INSERT INTO `discover_plan_table` VALUES (1, 'Belly fat burner HIIT', '14 min - Beginner', 'Beginner', 'assets/exerciseImage/discover/picksForYou/belly_fat_burner_hiit.webp', 'assets/exerciseImage/discover/subPlan/ic_belly_fat_burner_hiit.webp', 'DiscoverPicksForYou', 24, 14, 'High-intensity belly fat burning workouts with after burn effect. Keep burning calories even after training!', 'false', '53', 'Picks for you', 'Belly fat burning HIIT alternates intense exercises with less intense recovery periods.\r\n\r\nCombine abs workout with HIIT, you can melt away excess fat fast and make your six pack visible easily.\r\n\r\nYour body even keeps burning calories in the next 24 hours of your exercise(After-burn effect)!');
