INSERT INTO `discover_plan_table` VALUES (3, 'Get rid of man boobs HIIT', '13 min - Beginner', 'Beginner', 'assets/exerciseImage/discover/picksForYou/get_rid of man_boobs_hiit.webp', 'assets/exerciseImage/discover/subPlan/ic_get_rid_of_man_boobs.webp', 'DiscoverPicksForYou', 19, 13, 'Target your chest fat with high intensity workout. No embarrassing man boobs when taking T-shirt off!', 'false', '36,50', 'Picks for you', 'Pulling T-shirt again and again because of man boobs? This training targets chest fat, helping eliminate embarrassing man boobs. For beginners who are new to workout.\r\n\r\nWith cardio exercises and push-ups variations, it hits all areas of your chest and keeps your body burn calories in the next 24 hours.\r\n\r\nIf stick to a low-sugar and high-protein diet, eat more veggies and drink enough water, you can maximize workout results.');
INSERT INTO `discover_plan_table` VALUES (4, 'HIIT Killer core', '14 min - Beginner', 'Beginner', 'assets/exerciseImage/discover/picksForYou/hiit_killer_core.webp', 'assets/exerciseImage/discover/subPlan/ic_killer_core_hiit.webp', 'DiscoverPicksForYou', 23, 14, 'Want shredded abs? High intensity workout makes you feel the burn in your abs.', 'false', '53', 'Picks for you', 'Killer core HIIT alternates intense exercises with less intense recovery periods.\r\n\r\nThis super effective training helps burn more fat. It even keeps your body burning calories in the next 24 hours(After-burn effect)!\r\n\r\nIt targets all areas of the abs, you can get six pack abs faster and easier!');
INSERT INTO `discover_plan_table` VALUES (5, 'Last longer in bed	', '12 min - Intermediate', 'Intermediate', 'assets/exerciseImage/discover/picksForYou/last_longer_in_bed.webp', '', 'DiscoverPicksForYou', 12, 12, 'Strengthen pelvic floor muscles, improve sexual performance', 'false', '0', 'Picks for you', 'With longer exercise durations and higher difficulty levels, this training is for people with Kegel exercise experience.\r\n \r\nIt\'s more focused on strengthening your pelvic floor muscles. By stretching, muscle soreness can be relieved.\r\n \r\nPerseverance is important for Kegel exercises. To maximize results, we strongly suggest you live a healthy lifestyle - smoke less, drink less, follow a low cholesterol diet. ');
