INSERT INTO `discover_plan_table` VALUES (7, 'Build wider shoulders', '13 min - Intermediate', 'Intermediate', 'assets/exerciseImage/discover/picksForYou/build_wider_shoulder.webp', 'assets/exerciseImage/discover/subPlan/ic_build_wider_shoulder.webp', 'DiscoverPicksForYou', 20, 13, 'Target your front, middle, and rear deltoid, helping get your shoulders pumped!', 'false', '36,51', 'Picks for you', 'Fully exercising the deltoid muscles can effectively widen your shoulders. Focus on the middle deltoid; fully stimulate it with weights to increase the width of your shoulders. Exercise your front and rear deltoids in isolation to make your shoulders rounder and bigger.\r\n \r\nThis workout plan targets the three distinct parts of your deltoids. Combined with some compound shoulder exercises, it can build muscles and greatly pump up your shoulders! \r\n\r\nSuggestions far dumbbells: \r\n - 2.5-5kg for beginner\r\n - 5-10kg for intermediate \r\n -10-15kg for advanced');
