INSERT INTO `exercise_table` VALUES (1, 'BUTT KICKS', 's', 'Stand up on the floor, then run in place while kicking your heel up to touch your butt with each step.', 30, 'img_exercise/BUTTKICKS', 'https://www.youtube.com/watch?v=OQtrZe-6uns');
INSERT INTO `exercise_table` VALUES (2, 'QUICK FEET', 's', 'Start with your feet shoulder width apart. Bend your legs slightly and lean your upper body forward. \r\n\r\nPut your hands in front of you to keep balance, then run in place quickly. ', 30, 'img_exercise/QUICKFEET', 'https://www.youtube.com/watch?v=dC4ygsR_lUU');
INSERT INTO `exercise_table` VALUES (3, 'JUMPING JACKS', 's', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\n\r\nReturn to the start position then do the next rep. \r\n\r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups', 20, 'img_exercise/JUMPINGJACKS', 'https://www.youtube.com/watch?v=2W4ZNSwoW_4');
INSERT INTO `exercise_table` VALUES (4, 'BICYCLE CRUNCHES', 's', 'Lie on the floor with your hands behind your ears. Raise your knees and close your right elbow toward your left knee, then close your left elbow toward your right knee. Repeat the exercise.', 30, 'img_exercise/BICYCLECRUNCHES', 'https://www.youtube.com/watch?v=7JhZPRa-R80');
INSERT INTO `exercise_table` VALUES (5, 'MODIFIED BURPEES', 's', 'Stand with your feet shoulder width apart. Put your hands on the ground and kick your feet backward, then bring your feet back and jump up. Repeat the exercise.', 30, 'img_exercise/MODIFIEDBURPEES', 'https://www.youtube.com/watch?v=8o-7v3TU1Pc');
INSERT INTO `exercise_table` VALUES (6, 'ABDOMINAL CRUNCHES', 's', 'Lie on your back with your knees bent and your arena stretched forward.\r\n\r\nThen Oft your upper body off the floor. Hold for a few seconds and slowly return.\r\n \r\nIt primarily works the rectus abdominis muscle and the obliques. \r\n', 30, 'img_exercise/ABDOMINALCRUNCHES', 'https://www.youtube.com/watch?v=RUNrHkbP4Pc');
INSERT INTO `exercise_table` VALUES (7, 'JUMPING SQUATS', 's', 'Start in the squat position, then jump up using your abdominal muscles for strength. \r\n\r\nThis exercise works your abdomen.', 20, 'img_exercise/JUMPINGSQUATS', 'https://www.youtube.com/watch?v=xXLRbLdmwo8');
INSERT INTO `exercise_table` VALUES (8, 'HEEL TOUCH', 's', 'Lie on the ground with your legs here and your arms by your sides.', 30, 'img_exercise/HEELTOUCH', 'https://www.youtube.com/watch?v=HwLOdOmXcrI');
INSERT INTO `exercise_table` VALUES (9, 'HIGH STEPPING', 's', 'Run in place while pulling your knees as high as possible with each step. Keep your body upright during this exercise.', 20, 'img_exercise/HIGHSTEPPING', 'https://www.youtube.com/watch?v=u6oYV3aaKNc');
INSERT INTO `exercise_table` VALUES (10, 'RECLINED OBLIQUE TWIST', 's', 'Lie on your back with your legs extended and your elbows directly under your shoulders. \r\n\r\nLift your left leg up at a 45 degree angle while reaching your right arm over to your left side.\r\n \r\nThen slowly go back to the starting position. Repeat several times. and then switch to the other side. ', 30, 'img_exercise/RECLINEDOBLIQUETWIST', 'https://www.youtube.com/watch?v=F_S53B3cKoU');
INSERT INTO `exercise_table` VALUES (11, 'MOUNTAIN CLIMBER', 's', 'Start in the push-up position. Bend your right knee towards your chest and keep your left leg straight, then quickly switch from one leg to the other.\r\n \r\nThis exercise strengthens multiple muscle groups. ', 20, 'img_exercise/MOUNTAINCLIMBER', 'https://www.youtube.com/watch?v=wQq3ybaLZeA');
INSERT INTO `exercise_table` VALUES (12, 'LEG RAISES', 's', 'Lle down on your back, and put your hands beneath your hips for support.\r\n \r\nThen lift your legs up until they format angle with the floor.\r\n \r\nSlowly bring your legs back down and repeat the exercise. \r\n', 30, 'img_exercise/LEGRAISES', 'https://www.youtube.com/watch?v=dGKbTKLnym4');
INSERT INTO `exercise_table` VALUES (13, 'PUNCHES', 's', 'Stand with your legs shoulder width apart and your knees bent slightly. \r\n\r\nBend your elbows and clench your fists in front of your face.Extend one arm forward with the palm facing the floor. \r\n\r\nTake the arm back and repeat with the other arm.', 20, 'img_exercise/PUNCHES', 'https://www.youtube.com/watch?v=piogI3uC1r4');
INSERT INTO `exercise_table` VALUES (14, 'FLUTTER KICKS', 's', 'Lie on your hack with your arms at your sides. Lift your legs and keep them as straight as you can Then quickly raise your right leg up, and simultaneously lower your left leg. Switch legs and repeat.', 30, 'img_exercise/FLUTTERKICKS', 'https://www.youtube.com/watch?v=ay9j17QSn_s');
INSERT INTO `exercise_table` VALUES (15, 'COBRA STRETCH', 's', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n \r\nThen push your, chest up off the ground as far as possible. Hold this position for seconds.\r\n', 30, 'img_exercise/COBRASTRETCH', 'https://www.youtube.com/watch?v=9Z7IO95Np2g');
INSERT INTO `exercise_table` VALUES (16, 'CHILD\'S POSE', 's', 'Start with your knees and hands on the floor. \r\n\r\nPut your hands a little forward, widen your knees and put your toes together.\r\n \r\nTake a breath, then exhale and sit back. \r\n\r\nTry to make your butt touch your heels. \r\n\r\nRelax your elbows, make your forehead touch the floor and try to lower your chest close to the floor. Hold thid position. \r\n\r\nKeep your arms stretched forward as you sit back. \r\n\r\nMake sure there is enough space between your shoulders and ears during the exercise.', 30, 'img_exercise/CHILDSPOSE', 'https://www.youtube.com/watch?v=74oEGdu4_dI');
INSERT INTO `exercise_table` VALUES (17, 'LYING TWIST STRETCH LEFT', 's', 'Lie on your back with your legs straight and your arms stretched at your sides. Lift your knees and twist your legs to left. Hold this position.', 30, 'img_exercise/LYINGTWISTSTRETCHLEFT', 'https://www.youtube.com/watch?v=ZI-j_POtzlU');
INSERT INTO `exercise_table` VALUES (18, 'LYING TWIST STRETCH RIGHT', 's', 'Lie on your back with your legs straight and your arms stretched at your sides. Lift your knees and twist your legs to left. Hold this position.', 30, 'img_exercise/LYINGTWISTSTRETCHRIGHT', 'https://www.youtube.com/watch?v=ZI-j_POtzlU');
INSERT INTO `exercise_table` VALUES (19, 'TOY SOLDIERS', 's', 'Start with your feet shoulder width apart. Keep your legs and arms straight.\r\n \r\nKick your left leg up to touch your right hand to your toes. Repeat with the other side.', 30, 'img_exercise/TOYSOLDIERS', 'https://www.youtube.com/watch?v=J5R36QbhWf0');
INSERT INTO `exercise_table` VALUES (20, 'ALTERNATING HOOKS', 's', 'Stand with your feet shoulder-width apart, and place your dominant foot slightly forward. \r\n\r\nSlightly bend your knees, clench your fists and bend your elbows at 90 degrees.\r\n\r\nRaise you right arm to shoulder height and keep your forearm parallel to the ground. \r\n\r\nRotate your shoulders and hips and punch towards the left. \r\n\r\nSwitch sides and repeat.', 30, 'img_exercise/ALTERNATINGHOOKS', 'https://www.youtube.com/watch?v=RJJ7ksD1UJ4');
INSERT INTO `exercise_table` VALUES (21, 'UP AND DOWN PLANK', 's', 'Start in the straight arm position.\r\n\r\nThen bend your right arm and place your forearm on the ground with your elbow under your shoulder, then bend your left arm and come down in the traditional plank position.', 30, 'img_exercise/UPANDDOWNPLANK', 'https://www.youtube.com/watch?v=BZYnP1DXOdE');
INSERT INTO `exercise_table` VALUES (22, 'BUTT BRIDGE', 's', 'Lie on your back with knees bent and feet flat on the floor. \r\n\r\nPut your arms flat at your sides. \r\n\r\nThen lift your butt up and down.', 30, 'img_exercise/BUTTBRIDGE', 'https://www.youtube.com/watch?v=SfHqMoDVDk0');
INSERT INTO `exercise_table` VALUES (23, 'SPIDERMAN PLANK', 's', 'Lie on the floor with your toes and forearms on the ground. Keep your body straight.\r\n\r\nBend your left knee and bring it to the outside of your left arm. Return to the starting position and repeat with another leg.', 30, 'img_exercise/SPIDERMANPLANK', 'https://www.youtube.com/watch?v=Ie6ulItPjx4');
INSERT INTO `exercise_table` VALUES (24, 'FROG PRESS', 's', 'Lie on your back with your legs lifted, knees bent and heels squeezed together. Put your arms flat at your sides.\r\n\r\nStraighten your legs and bring them back to the starting position. Repeat the exercise.', 30, 'img_exercise/FROGPRESS', 'https://www.youtube.com/watch?v=ToTUkX3am4w');
INSERT INTO `exercise_table` VALUES (25, 'BACKWARD LUNGE', 's', 'Stand with your feet shoulder width apart and your hands on your hips.\r\n \r\nStep a big step backward with your right leg and lower your body until your left thigh is parallel to the floor Return and repeat with the other side \r\n', 30, 'img_exercise/BACKWARDLUNGE', 'https://www.youtube.com/watch?v=1LQCLqHUFUI');
INSERT INTO `exercise_table` VALUES (26, 'FROGGY GLUTE LIFTS', 's', 'Lie on your stomach with your knees bent and heels squeezed together.\r\n\r\nThen lift your feet up and down. The exercise is very effective at squeezing your butt.', 30, 'img_exercise/FROGGYGLUTELIFTS', 'https://www.youtube.com/watch?v=FLvOCG1a2a4');
INSERT INTO `exercise_table` VALUES (27, 'INCHWORMS', 's', 'Start with your feet shoulder width apart. Bend your body and walk your hands in front of you as far as you corn then walk your hands back. Repeat the exercise. ', 30, 'img_exercise/INCHWORMS', 'https://www.youtube.com/watch?v=gZOSJjZiLI4');
INSERT INTO `exercise_table` VALUES (28, 'PLANK', 's', 'Lie on the floor with your and forearms on the ground Keep your body straight and hold this position as long as you can.\r\n \r\nThis exercise strengthens the abdomen, back and shoulders.', 30, 'img_exercise/PLANK', 'https://www.youtube.com/watch?v=Fcbw82ykBvY');
INSERT INTO `exercise_table` VALUES (29, 'CROSS TOUCH AND REACH', 's', 'Stand on the floor with your arms extended to your right sides at the shoulder height.\r\n\r\nThen bend your body and use your left hand to touch your right foot or get as close as you can Switch sides and repeat.\r\n\r\nExhale when you bend your body and inhale when you come up.\r\n\r\nKeep your back and legs straight during the exercise.', 30, 'img_exercise/CROSSTOUCHANDREACH', 'https://www.youtube.com/watch?v=rQfQIAIliSY');
INSERT INTO `exercise_table` VALUES (30, 'LUNGE TWIST', 's', 'Stand with feet shoulder width apart and arms stretched forward. Take as big step forward and lower your body until your front knee is at a 90 degree angle.\r\n\r\nThen twist your body to the same side as your front leg and twist your upper body to the same side to the start position and switch to the other leg.\r\n\r\nYour upper body should always be kept straight. Keep your knees facing forward as you twist.', 30, 'img_exercise/LUNGETWIST', 'https://www.youtube.com/watch?v=JSRQ595yY2U');
INSERT INTO `exercise_table` VALUES (31, 'KNEE PUSHUPS', 'step', 'Start in the regular push-up position, then let your knees touch the floor and raise your feet up off the floor.\r\n\r\nNext push your body up and down.', 20, 'img_exercise/KNEEPUSHUPS', 'https://www.youtube.com/watch?v=KFxW5amBbsw');
INSERT INTO `exercise_table` VALUES (32, 'INCLINE PUSHUPS', 'step', 'Stand in the regular push-up position but with your hands elevated on a chair inherit. Then push your body up down using your arm strength. Remember to keep your body straight. \r\n', 16, 'img_exercise/INCLINEPUSHUPS', 'https://www.youtube.com/watch?v=UT03_KPhoR8');
INSERT INTO `exercise_table` VALUES (33, 'DUMBBELL CHEST FLY', 'step', 'Lie on your back with your knees bent and your feet flat on the floor.\r\n\r\nHold a dumbbell in each hand and raise your arms towards the ceiling with your palms facing each other and your elbows slightly bent.', 16, 'img_exercise/DUMBBELLCHESTFLY', 'https://www.youtube.com/watch?v=MZfp-nfKQ_E');
INSERT INTO `exercise_table` VALUES (34, 'SHOULDER STRETCH', 's', 'Sit on a chair with your arms bent at 90 degree angles. \r\n\r\nPut your palms up, clench your fists and keep your thumbs pointed outward. \r\n\r\nSit up straight, and squeeze your arms towards your upper body. \r\n\r\nRotate your forearms outward horizontally, then bring them back.\r\n\r\nRepeat the exercise.', 30, 'img_exercise/SHOULDERSTRETCH', 'https://www.youtube.com/watch?v=9k0EN2RCGgU');
INSERT INTO `exercise_table` VALUES (35, 'DOWNWARD FACING DOG ON THE WALL', 's', 'Stand in front of a wall with your hands against the wall. Slowly step back and slide your hands down until your upper body is parallel to the floor.\r\n\r\nPush your hands forward into the wall as you pull your hips away from the wall. Transfer your weight into your feet. Hold this position.', 30, 'img_exercise/DOWNWARDFACINGDOGONTHEWALL', 'https://www.youtube.com/watch?v=0rMcC-P79F4');
INSERT INTO `exercise_table` VALUES (36, 'LEFT QUAD STRETCH WITH WALL', 's', 'Stand with your right hand on the wall. \r\n\r\nBend your left leg and grasp your ankle or toes to bring your left calf close yo your left thigh. \r\n\r\nHold this position.', 30, 'img_exercise/LEFTQUADSTRETCHWITHWALL', 'https://www.youtube.com/watch?v=1qlN5EXFUNo');
INSERT INTO `exercise_table` VALUES (37, 'RIGHT QUAD STRETCH WITH WALL', 's', 'Stand with your left hand on the wall. \r\n\r\nBend your left leg and grasp your ankle or toes to bring your left calf close yo your right thigh. \r\n\r\nHold this position.', 30, 'img_exercise/RIGHTQUADSTRETCHWITHWALL', 'https://www.youtube.com/watch?v=1qlN5EXFUNo');
INSERT INTO `exercise_table` VALUES (38, 'SIDE HOP', 's', 'Stand on the floor, put your hands in front of you and hop from side to side.', 30, 'img_exercise/SIDEHOP', 'https://www.youtube.com/watch?v=wcQqb9hVS_Y');
INSERT INTO `exercise_table` VALUES (39, 'TRUNK ROTATION', 's', 'Stand with feet shoulder width apart and  your knees slightly bent.\r\n\r\nLift your arms in front of you with your elbows bent.\r\n\r\nTwist your upper body to the left and then the right.', 30, 'img_exercise/TRUNKROTATION', 'https://www.youtube.com/watch?v=BfACG9NsL0E');
INSERT INTO `exercise_table` VALUES (40, 'SUPERMAN', 's', 'Lie on your stomach with your arms extended straight overhead. Then raise both your arms and legs up off the floor.\r\n\r\nHold this position for two seconds. Return to the start position and repeat.', 30, 'img_exercise/SUPERMAN', 'https://www.youtube.com/watch?v=iMHTMPVR59c');
INSERT INTO `exercise_table` VALUES (41, 'PUSHUPS', 'step', 'Lay prone on the ground with arms supporting your body. \r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 16, 'img_exercise/PUSHUPS', 'https://www.youtube.com/watch?v=R08gYyypGto');
INSERT INTO `exercise_table` VALUES (42, 'RUSSIAN TWIST', 's', 'Sit on the floor with your knees bent, feet lifted a little bit and back tilted backwards.\r\n\r\nthen hold your hands together and twist from side to side.', 30, 'img_exercise/RUSSIANTWIST', 'https://www.youtube.com/watch?v=uYr7rhV0qpo');
INSERT INTO `exercise_table` VALUES (43, 'REVERSE CRUNCHES', 's', 'Lie on your back with your knee up at 90 degree angle and your hands behind your head.\r\n \r\nLift your upper body and thighs, and then stretch out.', 30, 'img_exercise/REVERSECRUNCHES', 'https://www.youtube.com/watch?v=5HyXYi1oqZE');
INSERT INTO `exercise_table` VALUES (44, 'SKIPPING WITHOUT ROPE', 's', 'Stand on the floor, bend your legs slightly and lean to your upper body forward.\r\n\r\nThen jump to the right. As you jump bring your left foot behind you and your left arm in front of you.\r\n\r\nThen jump to the other side. Repeat the exercise.', 20, 'img_exercise/SKIPPINGWITHOUTROPE', 'https://www.youtube.com/watch?v=XfFe0xjopos');
INSERT INTO `exercise_table` VALUES (45, 'SKATER JUMPS', 's', 'Stand on the floor, bend your legs slightly and lean to your upper body forward.\r\n\r\nThen jump to the right. As you jump bring your left foot behind you and your left arm in front of you.\r\n\r\nThen jump to the other side. Repeat the exercise.', 20, 'img_exercise/SKATERJUMP', 'https://www.youtube.com/watch?v=95Qxcy9xm0U');
INSERT INTO `exercise_table` VALUES (46, 'WALL SIT', 's', 'Start with your back against the wall, then slide down until your knees are at a 90 degree angle. \r\n\r\nKeep your back against the wall with your hands and arms away from your legs. \r\n\r\nHold the position. \r\n\r\nThe exercise is to strengthen the quadriceps muscles.', 40, 'img_exercise/WALLSIT', 'https://www.youtube.com/watch?v=zoBEgkd78Wg');
INSERT INTO `exercise_table` VALUES (47, 'TRICEPS STRETCH RIGHT', 's', 'Put your right hand on your back, use your left hand to grab your right elbow and gently pull it. \r\n\r\nHold this position for a few seconds.', 30, 'img_exercise/TRICEPSSTRETCHRIGHT', 'https://www.youtube.com/watch?v=8fN9H37Ts7w');
INSERT INTO `exercise_table` VALUES (48, 'TRICEPS STRETCH LEFT', 's', 'Put your left hand on your back, use your right hand to grab your left elbow and gently pull it. \r\n\r\nHold this position for a few seconds.', 30, 'img_exercise/TRICEPSSTRETCHLEFT', 'https://www.youtube.com/watch?v=8fN9H37Ts7w');
INSERT INTO `exercise_table` VALUES (49, 'LYING KNEE HUG', 'step', 'Lie on your back with your knees bent and feet flat on the ground.\r\n \r\nLift one knee up and pull it towards your chest as far as you can, while fully extending the other leg simultaneously, but don\'t touch the ground. Then switch sides, and repeat the exercise. ', 16, 'img_exercise/LYINGKNEEHUG', 'https://www.youtube.com/watch?v=cAhOrupicHU');
INSERT INTO `exercise_table` VALUES (50, 'PLIE SQUATS', 'step', 'Stand with your hands on your hips and feet a little wider than shoulder width apart.\r\n \r\nThen lower your body until your thighs are parallel to the floor.\r\n \r\nYour knees should be extended in the same.', 18, 'img_exercise/PLIESQUATS', 'https://www.youtube.com/watch?v=Y8Mk-oGDLAw');
INSERT INTO `exercise_table` VALUES (51, 'HIP BRIDGE & LEG LIFT LEFT', 'step', 'Lie on your back with your knees bent and feet flat on the floor. Then lift one leg up while raising your hips off the floor as high as you can.\r\n \r\nGo back to the start position and repeat the exercise. ', 18, 'img_exercise/HIPBRIDGE&LEGLIFTLEFT', 'https://www.youtube.com/watch?v=NQZfLEakvhw');
INSERT INTO `exercise_table` VALUES (52, 'HIP BRIDGE & LEG LIFT RIGHT', 'step', 'Lie on your back with your knees bent and feet flat on the floor. Then lift one leg up while raising your hips off the floor as high as you can.\r\n\r\nGo back to the start position and repeat with the other side.\r\n', 18, 'img_exercise/HIPBRIDGE&LEGLIFTRIGHT', 'https://www.youtube.com/watch?v=NQZfLEakvhw');
INSERT INTO `exercise_table` VALUES (53, 'CAT COW POSE', 's', 'Start on all fours with your knees under your butt and your hands directly under your shoulders.\r\n\r\nThen take a breath and make your belly fall down, shoulders roll back and head come up towards the ceiling. \r\n\r\nAs you exhale, curve your back upward and left your head come down. \r\n\r\nRepeat the exercise. \r\n\r\nDo it slowly with each step of this exercise.', 30, 'img_exercise/CATCOWPOSE', 'https://www.youtube.com/watch?v=L-T0HejuQdo');
INSERT INTO `exercise_table` VALUES (54, 'DOUBLE KNEES TO CHEST', 's', 'Lie down on your back with your legs extended.\r\n \r\nBend your knees and bring them up toward your chest; hug your knees with both hands. Hold for a few seconds. ', 30, 'img_exercise/DOUBLEKNEESTOCHEST', 'https://www.youtube.com/watch?v=Kt4gKheAXTE');
INSERT INTO `exercise_table` VALUES (55, 'STANDING BICYCLE CRUNCHES', 's', 'Stand with your feet shoulder width apart. Bring your knee to your opposite below.\r\n \r\nReturn to the start position and repeat with the other side. ', 30, 'img_exercise/STANDINGBICYCLECRUNCHES', 'https://www.youtube.com/watch?v=YmxHIHmMvvY');
INSERT INTO `exercise_table` VALUES (56, 'SEATED IN & OUTS', 'step', 'Sit on a bench, put your hands behind you and grab the bench, lean your body backward.\r\n\r\nLift your legs, bend your knees and bring your knees toward your chest. Fully extend your legs and repeat. ', 10, 'img_exercise/SEATEDIN&OUTS', 'https://www.youtube.com/watch?v=RNUs5NEeEiA');
INSERT INTO `exercise_table` VALUES (57, 'WINDSHIELD WIPERS', 'step', 'Lie on your back with your legs straight and lifted at a 90 degree angle. Extend your arms to the sides with palms down.\r\n\r\nTwist your legs to the left while keeping your upper body in place and your feet together. Then return and twist to the other side. Repeat the exercise. ', 10, 'img_exercise/WINDSHIELDWIPERS', 'https://www.youtube.com/watch?v=7_DUUwW5DIU');
INSERT INTO `exercise_table` VALUES (58, 'SHOULDER OUTWARD ROTATION', 'step', 'Sit on a chair with your arms bent at 90 degree angles.\r\n\r\nPut your palms up, clench your fists and keep your thumbs pointed outward. Sit up straight, and squeeze your arms towards your upper body.\r\n\r\nRotate your forearms outward horizontally, then bring them back. Repeat the exercise. ', 8, 'img_exercise/SHOULDEROUTWARDROTATION', 'https://www.youtube.com/watch?v=WxA6zPOl-Yw');
INSERT INTO `exercise_table` VALUES (59, 'REVERSE FLYS', 'step', 'Stand with your feet shoulder width apart and your legs slightly bent. Hold a dumbbell in each hand.\r\n\r\nLean your upper body forward into a bent over position. Let your arms hang straight down, then lift your arms to your sides until they are parallel to the floor. Return and repeat.', 14, 'img_exercise/REVERSEFLYS', 'https://www.youtube.com/watch?v=l3biDXAh3F4');
INSERT INTO `exercise_table` VALUES (60, 'DUMBBELL SIDE LATERAL RAISE', 'step', 'Stand with your feet shoulder width apart. Hold a dumbbell in each hand at your sides.\r\n\r\nRaise your arms to the sides at shoulder height, then put them down. Repeat the exercise.', 14, 'img_exercise/DUMBBELLSIDELATERALRAISE', 'https://www.youtube.com/watch?v=CVwh8H61c2k');
INSERT INTO `exercise_table` VALUES (61, 'DUMBBELL FRONT RAISE', 'step', 'Stand on the floor, and hold a dumbbell in each hand.\r\n\r\nRaise your arms straight forward at shoulder height, then lower them down. Repeat the exercise.', 12, 'img_exercise/DUMBBELLFRONTRAISE', 'https://www.youtube.com/watch?v=HiSauqBAlUg');
INSERT INTO `exercise_table` VALUES (62, 'MILITARY PRESS', 'step', 'Stand with your feet a little wider than your shoulders. Hold a dumbbell in each hand.\r\n\r\nRaise and bend your arms at 90 degree angles to your sides, keep your upper arms parallel to the floor and palms facing forward.', 12, 'img_exercise/MILITARYPRESS', 'https://www.youtube.com/watch?v=uKOYuEwsI4Q');
INSERT INTO `exercise_table` VALUES (63, 'ALTERNATING DUMBBELL SHOULDER PRESS', 'step', 'Hold a dumbbell M each hand. Raise and bend your arms at 90 degree angles to your sides, keep your upper arms parallel to the floor and palms facing forward.\r\n\r\nRaise your hands alternately above your head, then slowly lower them. Repeat the exercise.', 12, 'img_exercise/ALTERNATINGDUMBBELLSHOULDERPRESS', 'https://www.youtube.com/watch?v=XBbxm07FgpM');
INSERT INTO `exercise_table` VALUES (64, 'ANTERIOR SHOULDER STRETCH', 's', 'Sit with your knees bent and your feet flat on the floor.\r\n\r\nPut your hands behind you on the nook and keep your fingers pointed backward.\r\n \r\nSlightly bend your elbows to feel the stretch in the front of your shoulders.', 30, 'img_exercise/ANTERIORSHOULDERSTRETCH', 'https://www.youtube.com/watch?v=zkkdN01JC_o');
INSERT INTO `exercise_table` VALUES (65, 'SQUATS', 's', 'Stand with your feet shoulder width apart and your arms stretched forward, then lower your body until your thighs are parallel with the floor.\r\n\r\nYour knees should be extended in the same direction as your toes. \r\n\r\nReturn to the start position and do the next rep.\r\n\r\nThis works the thighs, hips buttocks, quads, hamstrings and lower body.', 30, 'img_exercise/SQUATS', 'https://www.youtube.com/watch?v=YD5OhmTxGAw');
INSERT INTO `exercise_table` VALUES (66, 'SINGLE LEG HIP ROTATION', 's', 'Stand on the floor with your hands rested on your hips and your feet shoulder width apart\r\n \r\nLift your left leg up at waist level and bend your knee at a right angle.\r\n \r\nThen rotate your body to the left side and rotate back. Change sides and repeat the exercise.\r\n  \r\nKeep the toes of your standing leg facing forward. Your knees should face the same direction as your toes.', 30, 'img_exercise/SINGLELEGHIPROTATION', 'https://www.youtube.com/watch?v=YyzS5Namezk');
INSERT INTO `exercise_table` VALUES (67, 'SQUAT REACH UPS', 's', 'Stand with your feet a little wider than shoulder width verb elbows bent, palms facing each other and fingers pointed toward the ceiling.\r\n \r\nLower your body until your thighs are parallel to the floor. When you come up, turn your body to the left, straighten your right leg, lift your right heel and stretch and reach your right arm to the left.\r\n \r\nReturn to the start position, and repeat the other side.', 30, 'img_exercise/SQUATREACHUPS', 'https://www.youtube.com/watch?v=7J41p15jF5A');
INSERT INTO `exercise_table` VALUES (68, 'PLANK HIP DIPS', 's', 'Start in a standard plank position.\r\n \r\nTwist your spine to your left side until your left leg touches the floor, then twist to the other side.\r\n \r\nRepeat the exercise.', 40, 'img_exercise/PLANKHIPDIPS', 'https://www.youtube.com/watch?v=fwM8O8wl448');
INSERT INTO `exercise_table` VALUES (69, 'FLUTTER KICKS SQUATS', 's', 'Start in the classic squat position.\r\n \r\nJump up, putting one foot forward and the other foot backward, then jump and switch legs.\r\n  \r\nJump again to come back to the squat position, and repeat the exercise.', 40, 'img_exercise/FLUTTERKICKSQUATS', 'https://www.youtube.com/watch?v=V6f4VFcF_wM');
INSERT INTO `exercise_table` VALUES (70, 'WALKING SQUATS', 's', 'Perform a squat position. Walk several steps to your left, then walk back. Repeat the exercise.', 40, 'img_exercise/WALKINSQUATS', 'https://www.youtube.com/watch?v=ul4v-YhWA7A');
INSERT INTO `exercise_table` VALUES (71, 'BACKWARD LUNGE WITH FRONT KICK LEFT', 's', 'Stand straight up. Then step back with your left leg and lower your body. When you come up, kick your left leg upward.\r\n \r\nGo back to the start position, and repeat the exercise.', 40, 'img_exercise/BACKWARDLUNGEWITHFRONTKICKLEFT', 'https://www.youtube.com/watch?v=6Y95oA0RpgU');
INSERT INTO `exercise_table` VALUES (72, 'BACKWARD LUNGE WITH FRONT KICK RIGHT', 's', 'Stand straight up. Then step back with your right leg and lower your body. When you come up, kick your right leg upward.\r\n \r\nGo back to the start position, and repeat the exercise.', 40, 'img_exercise/BACKWARDLUNGEWITHFRONTKICKRIGHT', 'https://www.youtube.com/watch?v=6Y95oA0RpgU');
INSERT INTO `exercise_table` VALUES (73, 'PLANK JACKS', 's', 'Start in the straight arm plank position with your hands under your shoulders and feet together.\r\n \r\nHop your feet apart and land on your toes, then hop back. Repeat the exercise.', 40, 'img_exercise/PLANKJACKS', 'https://www.youtube.com/watch?v=Y0J2Pwh21G0');
INSERT INTO `exercise_table` VALUES (74, 'ADDUCTOR STRETCH IN STANDING', 's', 'Stand with your feet wide distance apart and your hands rested on your hips.\r\n \r\nThen bend your left leg and lean your body to the left side.\r\n \r\nHold the position for a few seconds, then return and repeat with the other side.', 30, 'img_exercise/ADDUCTORSTRETCHINSTANDING', 'https://www.youtube.com/watch?v=9Hv2TztJwGI');
INSERT INTO `exercise_table` VALUES (75, 'DUMBBELL JUMPING SQUAT', 's', 'Stand with your feet a little wider than shoulder width apart and each of your hands holding a dumbbell at each side.\r\n \r\nSquat down until your thighs are parallel to the floor, then push on your heels to jump.\r\n \r\nReturn to the starting position and repeat the exercise. ', 30, 'img_exercise/DUMBBELLJUMPINGSQUAT', 'https://www.youtube.com/watch?v=y7M40xCnPK0');
INSERT INTO `exercise_table` VALUES (76, 'ARNOLD DUMBBELL PRESS', 'step', 'Hold a dumbbell in each hand. Bend your elbows in front of you and keep your palms towards your body.\r\n \r\nRaise your hands above your head while rotating your arms to make your palms face forward. Lower them and repeat.', 16, 'img_exercise/ARNOLDDUMBBELLPRESS', 'https://www.youtube.com/watch?v=8k8aH_M2uHY');
INSERT INTO `exercise_table` VALUES (77, 'DUMBBELL STEP UP ONTO CHAIR', 'step', 'Hold a dumbbell in each hand at your sides. Stand in front of a chair.\r\n \r\nThen step up on the chair and step back down.\r\n \r\nThe exercise works to strengthen the legs and buttocks.', 20, 'img_exercise/DUMBBELLSTEPUPONTOCHAIR', 'https://www.youtube.com/watch?v=5II5Stc5Qvs');
INSERT INTO `exercise_table` VALUES (78, 'LEG IN & OUTS', 'step', 'Sit down with your hands behind you on the ground, your legs extended and your upper body leaning backward.\r\n \r\nBend your knees, and bring them toward your chest; then fully extend your legs without touching the ground. Repeat the exercise.', 16, 'img_exercise/LEGIN&OUTS', 'https://www.youtube.com/watch?v=IWlAJ5tCMC0');
INSERT INTO `exercise_table` VALUES (79, 'DUMBBELL BENCH PRESS', 'step', 'Lie on a bench and hold a dumbbell in each hand.\r\n \r\nExtend your arms with your hands toward the ceiling and palms facing forward.\r\n \r\nBend and lower your elbows to your sides, then push the dumbbells straight up. Repeat the exercise.', 16, 'img_exercise/DUMBBELLBENCHPRESS', 'https://www.youtube.com/watch?v=GrmETJwvBgY');
INSERT INTO `exercise_table` VALUES (80, 'DUMBBELL BULGARIAN SPLIT SQUAT LEFT', 'step', 'Hold a dumbbell in each hand at your sides. Stand several feet away from a bench. Rest your left foot on the bench behind you.\r\n \r\nLower your body until your back knee nearly touches the floor and your front thigh is parallel to the floor. \r\n\r\nThen go back to the start position and repeat the exercise.\r\n \r\nThere should be enough space between your front foot and the bench so that your front knee does not go over your toes.Keep Your upper body straight.\r\n \r\nIt\'s a great exercise for the glutes and hamstrings.', 12, 'img_exercise/DUMBBELLBULGARIANSPLITSQUATLEFT', 'https://www.youtube.com/watch?v=ICfjgXUWeDA');
INSERT INTO `exercise_table` VALUES (81, 'DUMBBELL BULGARIAN SPLIT SQUAT RIGHT', 'step', 'Hold a dumbbell in each hand at your sides. Stand several feet away from a bench. Rest your right foot on the bench behind you.\r\n \r\nLower your body until your back knee nearly touches the floor and your front thigh is parallel to the floor.\r\n \r\nThen go back to the start position and repeat the exercise.\r\n \r\nThere should be enough space between your front foot and the bench so that your front knee does not go over your toes.Keep Your upper body straight.\r\n \r\nIt\'s a great exercise for the glutes and hamstrings.', 12, 'img_exercise/DUMBBELLBULGARIANSPLITSQUATRIGHT', 'https://www.youtube.com/watch?v=ICfjgXUWeDA');
INSERT INTO `exercise_table` VALUES (82, 'LEANING DUMBBELL ONE LEG CALF RAISE LEFT', 'step', 'Hold a dumbbell in your left hand and stand with the ball of your left foot on a stable bench or something similar.\r\n \r\nUse your right hand to hold onto something to maintain balance. Lift your left heel up and down.', 16, 'img_exercise/LEANINGDUMBBELLONELEGCALFRAISELEFT', 'https://www.youtube.com/watch?v=5Ot_DMIW2kI');
INSERT INTO `exercise_table` VALUES (83, 'LEANING DUMBBELL ONE LEG CALF RAISE RIGHT', 'step', 'Hold a dumbbell in your right hand and stand with the ball of your right foot on a stable bench or something similar.\r\n \r\nUse your left hand to hold onto something to maintain balance. Lift your right heel up and down.', 16, 'img_exercise/LEANINGDUMBBELLONELEGCALHRAISERIGHT', 'https://www.youtube.com/watch?v=5Ot_DMIW2kI');
INSERT INTO `exercise_table` VALUES (84, 'V CRUNCH', 'step', 'Sit on the floor, then lean back and lift your legs up off the floor. After finding a balance position, lift your upper body and bring your knees toward your chest. Then stretch out and repeat.\r\n \r\nExhale when you lift your body and inhale when you stretch out. \r\n\r\nIt\'s a great exercise for the lower abdominal muscle.', 16, 'img_exercise/VCRUNCH', 'https://www.youtube.com/watch?v=Hj4yrp6gOOg');
INSERT INTO `exercise_table` VALUES (85, 'BENT OVER ROW', 'step', 'Stand with your feet shoulder width apart. Lean forward, slightly bend your knees and sit your hips back. Hold a dumbbell in each hand.\r\n \r\nBend your elbows, and pull them backward. Lower your hands, and repeat the exercise.', 16, 'img_exercise/BENTOVERROW', 'https://www.youtube.com/watch?v=t2DUqP_13x8');
INSERT INTO `exercise_table` VALUES (86, 'SINGLE LEG DEADLIFT LEFT', 'step', 'Stand on your left leg with your back straight. \r\n\r\nThen hinge forward, reach your hands to the floor and stretch your right leg into the air.\r\n  \r\nGo back to the standing posture, and repeat the exercise.', 10, 'img_exercise/SINGLELEGDEADLIFTLEFT', 'https://www.youtube.com/watch?v=8pk5gFKZdbY');
INSERT INTO `exercise_table` VALUES (87, 'SINGLE LEG DEADLIFT RIGHT', 'step', 'Stand on your right leg with your back straight.\r\n \r\nThen hinge forward, reach your hands to the floor and stretch your left leg into the air.\r\n \r\nGo back to the standing posture, and repeat the exercise.', 10, 'img_exercise/SINGLELEGDEADLIFTRIGHT', 'https://www.youtube.com/watch?v=8pk5gFKZdbY');
INSERT INTO `exercise_table` VALUES (88, 'PLANK TAPS', 's', 'Start in the straight arm plank position. \n\n \r\nLift your right hand to tap your left shoulder.  \n\n \r\nReturn to the start position and repeat with the other hand. \n\n', 30, 'img_exercise/PLANKTAPS', 'https://www.youtube.com/watch?v=19lu4ch3M5U');
INSERT INTO `exercise_table` VALUES (89, 'KNEE TO CHEST STRETCH LEFT', 's', 'Lie on the floor with your legs extended. \r\n\r\nLift your left knee up and grab it with both hands.\r\n\r\nPull your left knee towards your chest as much as you can while keeping your right leg straight on the ground.\r\n\r\nHold this position for a few seconds.', 30, 'img_exercise/KNEETOCHESTSTRETCHLEFT', 'https://www.youtube.com/watch?v=xClg2Edare0');
INSERT INTO `exercise_table` VALUES (90, 'KNEE TO CHEST STRETCH RIGHT', 's', 'Lie on the floor with your legs extended. \r\n\r\nLift your right knee up and grab it with both hands.\r\n\r\nPull your right knee towards your chest as much as you can while keeping your left leg straight on the ground.\r\n\r\nHold this position for a few seconds.', 30, 'img_exercise/KNEETOCHESTSTRETCHRIGHT', 'https://www.youtube.com/watch?v=xClg2Edare0');
INSERT INTO `exercise_table` VALUES (91, 'SQUAT PULSES', 's', 'Stand with your feet shoulder width apart Pend your arms in front of you to keep balance. Lower your body until your thighs are parallel with the floor. Cocoa half way up instead of coming all the way up, then squat down again. Repeat. \r\n', 30, 'img_exercise/SQUATPULSES', 'https://www.youtube.com/watch?v=eTMyS0aqQlA');
INSERT INTO `exercise_table` VALUES (92, 'WALL PUSHUPS', 's', 'Stand in front of a wall one big step away from it. \r\n\r\nThen put your hands out straight towards the wall and lean against it.\r\n\r\nSlowly bend your elbows and press your upper body towards the wall. \r\n\r\nPush back and repeat the exercise.\r\n\r\nnRemember to keep your body straight.', 30, 'img_exercise/WALLPUSHUPS', 'https://www.youtube.com/watch?v=P7lSsHQZqBc');
INSERT INTO `exercise_table` VALUES (93, 'FIRE HYDRANT LEFT', 's', 'Start on all fours with your knees under your butt and your hands your shoulders. \r\n\r\nThen lift your left leg to the side at a 90 degree angle.', 30, 'img_exercise/FIREHYDRANTLEFT', 'https://www.youtube.com/watch?v=5u6klvw1oh0');
INSERT INTO `exercise_table` VALUES (94, 'FIRE HYDRANT RIGHT', 's', 'Start on all fours with your knees under your butt and your hands your shoulders. \r\n\r\nThen lift your left leg to the side at a 90 degree angle.', 30, 'img_exercise/FIREHYDRANTRIGHT', 'https://www.youtube.com/watch?v=5u6klvw1oh0');
INSERT INTO `exercise_table` VALUES (95, 'PUSH-UP & ROTATION', 's', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt`s a great exercise for the chest, shoulders, arms and core.', 30, 'img_exercise/PUSHUPROTATION', 'https://www.youtube.com/watch?v=NTwhw_HxxdA');
INSERT INTO `exercise_table` VALUES (96, 'REVERSE PUSHUPS', 's', 'Start in the regular push-up position.\r\n \r\nLower your body down, then bend your knees and move your hips backward with your arms straight. \r\n\r\nGo back to the push-up position and repeat.', 30, 'img_exercise/REVERSEPUSHUPS', 'https://www.youtube.com/watch?v=pok_Gj8TnAs');
INSERT INTO `exercise_table` VALUES (97, 'HYPER EXTENSION', 's', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 30, 'img_exercise/HYPEREXTENSION', 'https://www.youtube.com/watch?v=ldZk7JKRhJ4');
INSERT INTO `exercise_table` VALUES (98, 'SIDE PLANK KNEE CRUNCH LEFT', 's', 'Start in a side plank position with your right forearm on the floor and your left hand behind your ear.\r\n \r\nThen squeeze your abs, and bend your right knee. Bring your left elbow and left knee close to each other.\r\n \r\nGo back to the start position, and repeat the exercise.', 30, 'img_exercise/SIDEPLANKKNEECRUNCHLEFT', 'https://www.youtube.com/watch?v=gE0R8g3pcGQ');
INSERT INTO `exercise_table` VALUES (99, 'SIDE PLANK KNEE CRUNCH RIGHT', 's', 'Start in a side plank position with your left forearm on the floor and your right hand behind your ear. \r\n\r\nThen squeeze your abs, and bend your right knee. Bring your right elbow and right knee close to each other.\r\n \r\nGo back to the start position, and repeat the exercise.', 30, 'img_exercise/SIDEPLANKKNEECRUNCHRIGHT', 'https://www.youtube.com/watch?v=gE0R8g3pcGQ');
INSERT INTO `exercise_table` VALUES (100, 'LYING BUTTERFLY STRETCH', 's', 'Lie on the floor with your feet together. \r\n\r\nOpen your knees to the sides. \r\n\r\nHold this position.', 30, 'img_exercise/LYINGBUTTERFLYSTRETCH', 'https://www.youtube.com/watch?v=AWWF4nimzhk');
INSERT INTO `exercise_table` VALUES (101, 'BAND LATERAL RAISES', 'step', 'Hold one handle of the resistance band in each hand by your sides with your palms facing your thighs.\r\n \r\nStand on the middle of the resistance band with your feet shoulder-width apart.\r\n \r\nPull the handles straight up to the sides above shoulder level, and then slowly lower them. Repeat the exercise.', 16, 'img_exercise/BANDLATERALRAISES', 'https://www.youtube.com/watch?v=WOJIrYjS5c4');
INSERT INTO `exercise_table` VALUES (102, 'BAND SEATED ROWING WITH TWIST', 'step', 'Sit on the mat, with your knees slightly bent in front of you.\r\n \r\nLoop the resistance band around your soles with one handle in each hand.\r\n \r\nRotate your upper body to the left and pull the left handle backwards. Then return and repeat on the other side. Repeat the exercise.', 20, 'img_exercise/BANDSEATEDROWINGWITHTWIST', 'https://www.youtube.com/watch?v=_4xQ7wrSUeA');
INSERT INTO `exercise_table` VALUES (103, 'BAND HAMMER GRIP CURLS', 'step', 'Hold one handle of the resistance band in each hand by your sides with your palms facing forward.\r\n \r\nStand on the middle of the resistance band with both feet.\r\n \r\nBent your elbows, pull the handles towards your shoulders, and then slowly lower them down. Repeat the exercise.', 16, 'img_exercise/BANDHAMMERGRIPCURLS', 'https://www.youtube.com/watch?v=LZjpJ02uiyM');
INSERT INTO `exercise_table` VALUES (104, 'BAND TRICEPS KICKBACK', 'step', 'Hold one handle of the resistance band in each hand by your sides.\r\n \r\nStep on the middle of the resistance band with your feet hip-width apart, your knees slightly bent and your upper body leaned forward.\r\n \r\nPull the handles backward until your arms are straight, then slowly return. Repeat the exercise. ', 16, 'img_exercise/BANDTRICEPSKICKBACK', 'https://www.youtube.com/watch?v=8pyigjAPOw0');
INSERT INTO `exercise_table` VALUES (105, 'BAND SQUAT HIP ABDUCTION', 'step', 'Stand with your feet wider than shoulder width apart and your hands on your hips. Put a resistance band above your knees and the other one on your ankles.\r\n \r\nSquat down until your thighs are parallel to the floor. Stand up and lift your left leg to the side. Return and repeat on the other side.', 16, 'img_exercise/BANDSQUATHIPABDUCTION', 'https://www.youtube.com/watch?v=6GYTSTKb0vs');
INSERT INTO `exercise_table` VALUES (106, 'FIRE HYDRANT WITH BAND LEFT', 'step', 'Start with your knees under your butt and your hands under your shoulders. Put a resistance band above your knees.\r\n \r\nLift your left leg to the side at a 90 degree angle. Return and repeat.', 12, 'img_exercise/FIREHYDRANTWITHBANDLEFT', 'https://www.youtube.com/watch?v=gnzypKUFU6Y');
INSERT INTO `exercise_table` VALUES (107, 'FIRE HYDRANT WITH BAND RIGHT', 'step', 'Start with your knees under your butt and your hands under your shoulders. Put a resistance band above your knees.\r\n \r\nLift your right leg to the side at a 90 degree angle. Return and repeat.', 12, 'img_exercise/FIREHYRANTWITHBANDRIGHT', 'https://www.youtube.com/watch?v=gnzypKUFU6Y');
INSERT INTO `exercise_table` VALUES (108, 'BAND UPRIGHT ROW', 'step', 'Hold one handle of the resistance band in each hand with your body.\r\n\r\nStand on the middle of the resistance band with your feet shoulder - width apart.Swap the handles so that the resistanceband forms an \"X\" in front of you.\r\n\r\nPull the handles towards your shoulders with your elbows facing outwards; lower then and then repeat the exercise.', 16, 'img_exercise/BANDUPRIGHTROW', 'https://www.youtube.com/watch?v=bfzl23IIOi8');
INSERT INTO `exercise_table` VALUES (109, 'DUMBBELL PULLOVER', 'step', 'Lie on a bench with your head slightly hanging off the edge of the bench.\r\n \r\nExtend your arms over your chest and hold a dumbbell with your hands interlocked.\r\n \r\nKeep your elbows tight, lower the dumbbell backward as low as you can, then slowly return. Repeat the exercise.', 16, 'img_exercise/DUMBBELLPULLOVER', 'https://www.youtube.com/watch?v=FCogymf_XK0');
INSERT INTO `exercise_table` VALUES (110, 'DUMBBELL PLIE SQUATS', 'step', 'Stand with your feet a little wider than shoulder width apart and hold a dumbbell in your hands.\r\n \r\nLower your body until your thighs are parallel to the floor.\r\n  \r\nReturn to the starting position and repeat the exercise. ', 16, 'img_exercise/DUMBBELLPLIESQUATS', 'https://www.youtube.com/watch?v=SdLmwklGQVA');
INSERT INTO `exercise_table` VALUES (111, 'DUMBBELL PADDLE BOATS', 'step', 'Start from a sitting position with a dumbbell in your hands and your legs lifted off the ground.\r\n \r\nBring the dumbbell to your left side, and lean your upper body backward and stretch your legs at the same time. Then return to the starting position.\r\n \r\nRepeat the exercise for several times and then switch sides. ', 20, 'img_exercise/DUMBBELLPADDLEBOATS', 'https://www.youtube.com/watch?v=BHzui4J01AI');
INSERT INTO `exercise_table` VALUES (112, 'DUMBBELL LUNGES', 'step', 'Stand with your feet shoulder width apart and hold a dumbbell in each hand at each side.\r\n \r\nTake a big step forward with your right leg and lower your body until your right thigh is parallel to the floor.\r\n \r\nReturn to the starting position and switch to the other leg.', 20, 'img_exercise/DUMBBELLLUNGES', 'https://www.youtube.com/watch?v=SujYrLi5dng');
INSERT INTO `exercise_table` VALUES (113, 'STANDING DUMBBELL CALF RAISE', 'step', 'Hold a dumbbell in each hand at each side. Mace the ball of your feet on a wooden board or something similar and make sure your heels touch the floor.\r\n \r\nRaise your heels up off the floor, pause at the top and then slowly lower them back to the starting position.', 16, 'img_exercise/STANDINGDUMBBELLCALFRAISE', 'https://www.youtube.com/watch?v=-A-8LhO84H8');
INSERT INTO `exercise_table` VALUES (114, 'ALTERNATE DUMBBELL HAMMER CURL', 'step', 'Stand with your feet shoulder width apart. Hold a dumbbell M each hand.\r\n \r\nExtend your arms and place them at your sides with palms facing each other.\r\n \r\nBend your left arm and raise the dumbbell to your shoulder, then lower it down. Switch arm and repeat it.\r\n\r\nScreen reader support enabled.', 16, 'img_exercise/ALTERNATEDUMBBELLHAMMERCURL', 'https://www.youtube.com/watch?v=rvI9KlobD9E');
INSERT INTO `exercise_table` VALUES (115, 'DUMBBELL KICKBACKS', 'step', 'Stand upright, hold a dumbbell in each hand by your sides. Lean forward, and bend your knees slightly. Bend your elbows, and bring the dumbbells towards your chest.\r\n \r\nExtend your arms behind you, and squeeze your triceps. Bring the dumbbells back to your chest. Repeat the exercise.', 16, 'img_exercise/DUMBBELLKICKBACKS', 'https://www.youtube.com/watch?v=qOQZN2G4_3k');
INSERT INTO `exercise_table` VALUES (116, 'DUMBBELL HIP HINGE', 'step', 'Hold a dumbbell in each hand. Stand upright with your feet shoulder width apart.\r\n \r\nSit your hips back and bend your upper body while keeping your upper body straight, then slowly go back to the start position and repeat the exercise.', 12, 'img_exercise/DUMBBELLHIPHINGE', 'https://www.youtube.com/watch?v=8zI-lh7zdMg');
INSERT INTO `exercise_table` VALUES (117, 'COUNTERCLOCKWISE ARM SWINGS', 's', 'Stand on the floor with your arms extended straight to the side at shoulder height.\r\n \r\nMove your arms counterclockwise in big circles fast. Try to do it as fast as you can. It\'s a great exercise for the deltoid muscle.', 30, 'img_exercise/COUNTERCLOCKWISEARMSWINGS', 'https://www.youtube.com/watch?v=5QVIPA8rp7w');
INSERT INTO `exercise_table` VALUES (118, 'STANDING HIP CIRCLE', 's', 'Stand with your hands on your waist. Lift your left leg and move it clockwise in big circles, then move it counterclockwise. Switch legs and repeat the exercise.', 30, 'img_exercise/STANDINGHIPCIRCLE', 'https://www.youtube.com/watch?v=8vDGZlWPa4I');
INSERT INTO `exercise_table` VALUES (119, 'LEFT SIDE LYING FORWARD LEG LIFT', 's', 'Lie on your left side with your head resting on your left arm.\r\n \r\nBend your knees at a 90 degree angle in front of you.', 20, 'img_exercise/LEFTSIDELYINGFORWARDLEG', 'https://www.youtube.com/watch?v=3rZsQFnEspI');
INSERT INTO `exercise_table` VALUES (120, 'RIGHT SIDE LYING FORWARD LEG LIFT', 's', 'Lie on your right side with your head resting on your right arm.\r\n \r\nBend your knees at a 90 degree angle in front of you.', 20, 'img_exercise/RIGHTSIDELYINGFORWARDLEG', 'https://www.youtube.com/watch?v=3rZsQFnEspI');
INSERT INTO `exercise_table` VALUES (121, 'SIDE LYING LEG LIFT LEFT', 's', 'Lie down on your side with your head rested on your right arm. \r\n\r\nList your upper leg up and return to the start position.\r\n\r\nMake sure your left leg goes straight up and down during the exercise.\r\n\r\nIt`s a great exercise for the gluteus.', 20, 'img_exercise/SIDELYINGLEGLIFTLEFT', 'https://www.youtube.com/watch?v=4KZ04uVUXWM');
INSERT INTO `exercise_table` VALUES (122, 'SIDE LYING LEG LIFT RIGHT', 's', 'Lie down on your side with your head rested on your left arm. \r\n\r\nList your upper leg up and return to the start position.\r\n\r\nMake sure your right leg goes straight up and down during the exercise.\r\n\r\nIt`s a great exercise for the gluteus.', 20, 'img_exercise/SIDELYINGLEGLIFTRIGHT', 'https://www.youtube.com/watch?v=4KZ04uVUXWM');
INSERT INTO `exercise_table` VALUES (123, 'SIDE LYING KICKBACK LIFT LEFT', 's', 'Lie on your right side with your head resting on your right arm and legs extended.\r\n \r\nLift and bend your left knee in front of you, then kick your leg back. Repeat the exercise.', 20, 'img_exercise/SIDELYINGKICKBACKLEFT', 'https://www.youtube.com/watch?v=oXAYPmKW-QI');
INSERT INTO `exercise_table` VALUES (124, 'SIDE LYING KICKBACK LIFT RIGHT', 's', 'Lie on your left side with your head resting on your left arm and legs extended.\r\n \r\nLift and bend your right knee in front of you, then kick your leg back. Repeat the exercise. ', 20, 'img_exercise/SIDELYINGKICKBACKRIGHT', 'https://www.youtube.com/watch?v=oXAYPmKW-QI');
INSERT INTO `exercise_table` VALUES (125, 'SCISSORS', 's', 'Lie on your back with arms at sides, palms down and legs extended.\r\n \r\nLift your legs and cross the right thigh over the left then reverse the exercise. \r\n\r\nMake sure your back is always flat.\r\n\r\nIt\'s a great exercise for the obliques and rectus abdominis.', 30, 'img_exercise/SCISSORS', 'https://www.youtube.com/watch?v=LsYYC0Tvd14');
INSERT INTO `exercise_table` VALUES (126, 'LEGS UP THE WALL', 's', 'Put a pillow at the bottom of the wall. Lie on your back, lib and put your legs on the wall.\r\n \r\nMove your hips onto the pillow, as close to the wall as you can. Hold this position.', 120, 'img_exercise/LEGSUPTHEWALL', 'https://www.youtube.com/watch?v=vmQXO9OsDjE');
INSERT INTO `exercise_table` VALUES (127, 'ELBOWS BACK', 's', 'Stand up straight with your feet shoulder width apart. Place your hands on both sides of your waist,  facing downwards and elbows facing outwards.\r\n \r\nGently pull your elbows backward, then bring them back to the starting position. Repeat the exercise.', 30, 'img_exercise/ELBOWSBACK', 'https://www.youtube.com/watch?v=LDY2LiB8sxE');
INSERT INTO `exercise_table` VALUES (128, 'TRICEPS DIPS', 's', 'For the start position, sit on the chair. Then move your hip off the chair with your hands holding the edge of the chair.\r\n \r\nSlowly bend and stretch your arms to make your body go up and down. This is a great exercise for the triceps. ', 30, 'img_exercise/TRICEPSDIPS', 'https://www.youtube.com/watch?v=jF0UaL-I11U');
INSERT INTO `exercise_table` VALUES (129, 'CLOCKWISE ARM SWINGS', 's', 'Stand on the floor with your arms extended straight to the side at shoulder height.\r\n \r\nMove your arms clockwise in big circles fast. Try to do it as fast as you can. It\'s a great exercise for the deltoid muscle.', 30, 'img_exercise/CLOCKWISEARMSWINGS', 'https://www.youtube.com/watch?v=5QVIPA8rp7w');
INSERT INTO `exercise_table` VALUES (130, 'PLANK AND REACH', 's', 'Start in a traditional plank position, then alternately extend one arm forward. \r\n\r\nKeep your body straight during the exercise.\r\n\r\nIt\'s a great exercise for the abdominal muscle and deltoid muscle. ', 30, 'img_exercise/PLANKANDREACH', 'https://www.youtube.com/watch?v=d2EMrJCN50Q');
INSERT INTO `exercise_table` VALUES (131, 'CRAB WALK', 's', 'Sit down with your legs bent, place your hands shoulder-width apart on the ground behind you, and make sure your fingers are facing sideways.\r\n \r\nLift your hips until your upper body is parallel to the ground and walk forward with your hands and feet.', 30, 'img_exercise/CRABWALK', 'https://www.youtube.com/watch?v=IL4F1xGTZEY');
INSERT INTO `exercise_table` VALUES (132, 'STANDING BICEPS STRETCH LEFT', 's', 'Stand with your left arm close to a wall.\r\n\r\nExtend tour left arm and put your left hand on the wall, then gently turn gently turn body to the right.', 30, 'img_exercise/STANDINGBICEPSSTRETCHLEFT', 'https://www.youtube.com/watch?v=u8KplvVTrI8');
INSERT INTO `exercise_table` VALUES (133, 'STANDING BICEPS STRETCH RIGHT', 's', 'Stand with your right arm close to a wall.\r\n\r\nExtend tour right arm and put your left hand on the wall, then gently turn gently turn body to the left.', 30, 'img_exercise/STANDINGBICEPSSTRETCHRIGHT', 'https://www.youtube.com/watch?v=u8KplvVTrI8');
INSERT INTO `exercise_table` VALUES (134, 'PIKE PUSHUPS', 'step', 'Start with your hands and feet on the floor. \r\n\r\nPut your hands shoulder width apart. Bend your body, and lift your hips up in an upside down `V` shape. \r\n\r\nBend your elbows, and bring your head close to the floor. \r\n\r\nPush your body back, and repeat the exercise.', 8, 'img_exercise/PIKEPUSHUPS', 'https://www.youtube.com/watch?v=Ef89ur3lAbY');
INSERT INTO `exercise_table` VALUES (135, 'STRAIGHT ARM PLANK', 's', 'Start in the push-up position, but keep your arms straight. This exercise strengthens your abdomen and back muscles.', 30, 'img_exercise/STRAIGHTARMPLANK', 'https://www.youtube.com/watch?v=TMdPy8ak0mw');
INSERT INTO `exercise_table` VALUES (136, 'SIDE PLANK LEFT', 's', 'Lie on your left side with your forearm supporting your body. \r\n\r\nHold your body in a straight line. \r\n\r\nThis exercise targets the abdominal muscles and obliques.', 30, 'img_exercise/SIDEPLANKLEFT', 'https://www.youtube.com/watch?v=JN6vmeObPe8');
INSERT INTO `exercise_table` VALUES (137, 'SIDE PLANK RIGHT', 's', 'Lie on your right side with your forearm supporting your body. \r\n\r\nHold your body in a straight line. \r\n\r\nThis exercise targets the abdominal muscles and obliques.', 30, 'img_exercise/SIDEPLANKRIGHT', 'https://www.youtube.com/watch?v=JN6vmeObPe8');
INSERT INTO `exercise_table` VALUES (138, 'SHOULDER GATORS', 's', 'Stand upright with your hands beside your ears and elbows facing each side. \r\n\r\nRotate your elbows until both of them are facing the front.', 30, 'img_exercise/SHOULDERGATORS', 'https://www.youtube.com/watch?v=4c-wsl6BA-E');
INSERT INTO `exercise_table` VALUES (139, 'SIDE ARM RAISE', 'step', 'Stand with your feet shoulder width apart. \r\n\r\nRaise your arms to the sides at shoulder height, then put them down. \r\n\r\nRepeat the exercise. \r\n\r\nKeep your arms straight during the exercise.', 12, 'img_exercise/SIDEARMRAISE', 'https://www.youtube.com/watch?v=eEcUyYlf8UI');
INSERT INTO `exercise_table` VALUES (140, 'FLOOR Y RAISES', 'step', 'Lie face down on the floor with your arms fully extended and your thumbs pointing up, your body should be in the shape of the letter \"Y\". \r\n\r\nRaise your arms off the ground as far as you can and pause them at the top for 2 seconds. \r\n\r\nSlowly go back the start position, and repeat the exercise.', 12, 'img_exercise/FLOORYRAISES', 'https://www.youtube.com/watch?v=YKAqmu4ERLE');
INSERT INTO `exercise_table` VALUES (141, 'DYNAMIC CHEST', 's', 'Stand on the floor with your feet shoulder width apart. Extend your arms forward at shoulder height with your palms facing each other.\r\n \r\nExtend your arms as far out as possible, then move them back to the front. Repeat the exercise.', 30, 'img_exercise/DYNAMICCHEST', 'https://www.youtube.com/watch?v=YUdPw8FCb5Y');
INSERT INTO `exercise_table` VALUES (142, 'BOX PUSHUPS', 's', 'Start on all fours with your knees under your butt and your hands directly under your shoulders.\r\n\r\nBend your elbows and do a push-up. \r\n\r\nReturn to the start position and repeat.', 30, 'img_exercise/BOXPUSHUPS', 'https://www.youtube.com/watch?v=M8POM9zPmkg');
INSERT INTO `exercise_table` VALUES (143, 'CHEST STRETCH', 's', 'Find a doorway, take a lunge position in the doorway with your arms on the doorframe and your elbows a little lower than your shoulders, then slowly bring your chest forward', 30, 'img_exercise/CHESTSTRETCH', 'https://www.youtube.com/watch?v=DzYbKoktWao');
INSERT INTO `exercise_table` VALUES (144, 'ARM CIRCLES CLOCKWISE', 's', 'The slowly come out of it, bring your arms down and do a couple of shoulder rolls.', 30, 'img_exercise/ARMCIRCLESCLOCKWISE', 'https://www.youtube.com/watch?v=4TJv9YmECjc');
INSERT INTO `exercise_table` VALUES (145, 'KNEELING SIDE PLANK LEFT', 's', 'Lie on your left side with your forearm supporting your body and knees bent on the floor.\r\n \r\nKeep your spine straight. Hold this position.', 30, 'img_exercise/KNEELINGSIDEPLANKLEFT', 'https://www.youtube.com/watch?v=jr_-y1VEkW0');
INSERT INTO `exercise_table` VALUES (146, 'KNEELING SIDE PLANK RIGHT', 's', 'Lie on your right side with your forearm supporting your body and knees bent on the floor.\r\n \r\nKeep your spine straight. Hold this position. ', 30, 'img_exercise/BRIDGE', 'https://www.youtube.com/watch?v=jr_-y1VEkW0');
INSERT INTO `exercise_table` VALUES (147, 'BRIDGE', 's', 'Lie flat on the floor, and lift your hips off the Floor while keeping your back straight.\r\n \r\nHold this position as long as you can. The bridge exercise strengthens the whole abdomen, the lower back and the glutes.', 30, 'img_exercise/BRIDGE', 'https://www.youtube.com/watch?v=A9J-1LHgnSw');
INSERT INTO `exercise_table` VALUES (148, 'ARM SWINGS WITH LATERAL STEPS', 's', 'Stand with your feet shoulder width apart, and stretch your arms to the sides.\r\n \r\nThen step back with your left leg to the right side, and cross your arms in front of your chest. You can bend your right leg slightly.\r\n \r\nGo back to the start position, and repeat on the other side.', 30, 'img_exercise/ARMSWINGSWITHLATERALSTEPS', 'https://www.youtube.com/watch?v=tLEkdDgTDbM');
INSERT INTO `exercise_table` VALUES (149, 'BENT LEG TWIST', 's', 'Lie on your back with your knees up at a 90 degree angle.\r\n \r\nExtend your arms to the sides and put your palms down on the ground.\r\n \r\nTwist your legs to the left while keeping your upper body in place and your knees and feet together.\r\n \r\nHold it for one second, then return and twist to the other side. Repeat the exercise. ', 30, 'img_exercise/BENTLEGTWIST', 'https://www.youtube.com/watch?v=aVzdYvBP1Kg');
INSERT INTO `exercise_table` VALUES (150, 'PLANK LEG UP', 's', 'Start in the straight arm plank position. Then alternately lift and lower both legs up and down.', 46, 'img_exercise/PLANKLEGUP', 'https://www.youtube.com/watch?v=-9kCq0pB9LI');
INSERT INTO `exercise_table` VALUES (151, 'LUNGES', 's', 'Stand with your feet shoulder width apart and your hands on your hips. \r\n\r\nTake a step foraward with your right leg and lower your body until your right thigh is parallel with the floor. \r\n\r\nThen return and switch to the other leg. \r\n\r\nThis exercise strengthens the quadriceps, gluteus maximus and hamstrings.', 30, 'img_exercise/LUNGES', 'https://www.youtube.com/watch?v=SujYrLi5dng');
INSERT INTO `exercise_table` VALUES (152, 'STARFISH CRUNCH', 's', 'Lie on your back with your hands stretched out to your sides. Keep your legs apart with your feet wider than shoulder width apart.\r\n \r\nRaise your left leg up, slightly lift your shoulders off the floor, and reach your right hand to touch the left foot.\r\n\r\nReturn to the starting position, and repeat with the other side.', 46, 'img_exercise/STARFISHCRUNCH', 'https://www.youtube.com/watch?v=ZBeGvx_ixEI');
INSERT INTO `exercise_table` VALUES (153, 'DIAGONAL PLANK', 's', 'Start in the straight arm plank position. \r\n\r\nLift your arm and left leg until they are parallel with the ground. \r\n\r\nReturn to the start position and repeat with the other side.', 30, 'img_exercise/DIAGONALPLANK', 'https://www.youtube.com/watch?v=qXWu8sN3NOc');
INSERT INTO `exercise_table` VALUES (154, 'SIDE BRIDGES LEFT', 's', 'Lie on your right side. Put your right elbow directly under your shoulders and put your left hand on your waist. \r\n\r\nPlace your left leg on your right leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 20, 'img_exercise/SIDEBRIDGESLEFT', 'https://www.youtube.com/watch?v=alFy6jqzjL8');
INSERT INTO `exercise_table` VALUES (155, 'SIDE BRIDGES RIGHT', 's', 'Lie on your left side. Put your left elbow directly under your shoulders and put your right hand on your waist. \r\n\r\nPlace your right leg on your left leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 20, 'img_exercise/SIDEBRIDGESRIGHT', 'https://www.youtube.com/watch?v=alFy6jqzjL8');
INSERT INTO `exercise_table` VALUES (156, 'CROSS KNEE PLANK', 's', 'Start with the plank position. Bring one knee and the opposite elbow in to touch each other, then bring them back. Repeat with the other side.', 30, 'img_exercise/CROSSKNEEPLANK', 'https://www.youtube.com/watch?v=8fN356WKqPo');
INSERT INTO `exercise_table` VALUES (157, 'BODY SAW', 's', 'Start in the plank position. Shift your body back and forth. ', 30, 'img_exercise/BODYSAW', 'https://www.youtube.com/watch?v=CJHdCRhZCwY');
INSERT INTO `exercise_table` VALUES (158, 'SIDE LEG RAISE LEFT', 's', 'Lie on your right side with your forearm supporting your upper body and your left hand on the ground in front of you.\r\n\r\nKeep both legs together. Lift your legs lightly and hold for one second, then return to the start position. Repeat the exercise.', 20, 'img_exercise/SIDELEGRAISELEFT', 'https://www.youtube.com/watch?v=wJo8inKVKus');
INSERT INTO `exercise_table` VALUES (159, 'SIDE LEG RAISE RIGHT', 's', 'Lie on your left side with your forearm supporting your upper body and your right hand on the ground in front of you.\r\n\r\nKeep both legs together. Lift your legs lightly and hold for one second, then return to the start position. Repeat the exercise.', 20, 'img_exercise/SIDELEGRAISERIGHT', 'https://www.youtube.com/watch?v=wJo8inKVKus');
INSERT INTO `exercise_table` VALUES (160, 'CRUNCHES WITH LEGS RAISED', 's', 'Lie on your back with your legs straight up towards the ceiling and your hands behind your ears.\r\n\r\nLift your shoulders up off the floor, then slowly go back to the starting position. Repeat the exercise. ', 50, 'img_exercise/CRUNCHESWITHLEGSRAISED', 'https://www.youtube.com/watch?v=ZMYHvl7vNGA');
INSERT INTO `exercise_table` VALUES (161, 'X MAN CRUNCH', 's', 'Lie on your back with your hands stretched at your sides and legs apart.\r\n\r\nLift your legs and arms off the floor. Then raise your upper body and squeeze your arms and knees towards your abdominals.\r\n\r\nLower your arms and legs (but don\'t touch the floor) and repeat the exercise. ', 50, 'img_exercise/XMANCRUNCH', 'https://www.youtube.com/watch?v=Z7YbVvD7EOg');
INSERT INTO `exercise_table` VALUES (162, 'SIDE PLANK FRONT KICK RIGHT', 's', 'Start in a right side plank position, then lift your upper leg and kick it forward. Return to the start position and repeat.\r\n\r\nDon\'t sway your hips and keep your legs and upper body straight during the exercise.\r\n\r\nExhale when your leg kicks out and inhale when your leg comes back.\r\n\r\nIt\'s a great exercise for the glutes and quadriceps. ', 20, 'img_exercise/SIDEPLANKFRONTKICKRIGHT', 'https://www.youtube.com/watch?v=odZo04hgRzY');
INSERT INTO `exercise_table` VALUES (163, 'SIDE PLANK FRONT KICK LEFT', 's', 'Start in a left side plank position, then lift your upper leg and kick it forward. Return to the start position and repeat.\r\n\r\nDon\'t sway your hips and keep your legs and upper body straight during the exercise.\r\n\r\nExhale when your leg kicks out and inhale when your leg comes back.\r\n\r\nIt\'s a great exercise for the glutes and quadriceps. ', 20, 'img_exercise/SIDEPLANKFRONTKICKLEFT', 'https://www.youtube.com/watch?v=odZo04hgRzY');
INSERT INTO `exercise_table` VALUES (164, 'IN & OUTS', 's', 'Lay prone on the ground with arms supporting your body. Hop forward, bring your knees toward your chest, then hop back to the starting position. Repeat the exercise.', 30, 'img_exercise/IN&OUTS', 'https://www.youtube.com/watch?v=clsucWwp5Oc');
INSERT INTO `exercise_table` VALUES (165, 'CRAB KICK UP', 's', 'Sit on the floor with your legs bent, hips up and fingers pointing forward under your shoulders.\r\n\r\nKick your feet in the air alternating left and right. ', 30, 'img_exercise/CRABKICKUP', 'https://www.youtube.com/watch?v=5tQLkpJsLGA');
INSERT INTO `exercise_table` VALUES (166, 'DECLINE PUSHUPS', 's', 'Start on all fours with your knees under your butt and your hands under your sholders. \r\n\r\nThen elevate your feet on a chair or bench, and push your body up and down mainly using your arm strength. \r\n\r\nRemeember to keep your body straight.', 40, 'img_exercise/DECLINEPUSHUPS', 'https://www.youtube.com/watch?v=VCfB2oUZzAA');
INSERT INTO `exercise_table` VALUES (167, 'SHOULDER STRETCH WITH CHAIR', 's', 'Sit on a chair with your back straight and your feet flat on the ground.\r\n\r\nGrab the back of the chair, inhale deeply and open up your chest and shoulders. Hold for a few seconds.', 30, 'img_exercise/SHOULDERSTRETCHWITHCHAIR', 'https://www.youtube.com/watch?v=RAeNkKPQhgY');
INSERT INTO `exercise_table` VALUES (168, 'SQUATS KICKS', 's', 'Stand with feet shoulder width apart. Put your arms in front of your chest to keep your balance.\r\n\r\nThen do a squat, and when you come up, kick your left leg upward. Then switch. the right leg and repeat the exercise.\r\n\r\nInhale when you come down and exhale when you come up. Your knees should be extended in line with your toes.\r\n\r\nIt\'s a great exercise for the quadriceps a. gluteus maximus.', 30, 'img_exercise/SQUATSKICKS', 'https://www.youtube.com/watch?v=M_BXyytRTDU');
INSERT INTO `exercise_table` VALUES (169, 'SWIMMER AND SUPERMAN', 's', 'Lie on your stomach with your arms extended straight overhead. \r\n\r\nAlternately lift your opposite arm and leg.', 50, 'img_exercise/SWIMMERANDSUPERMAN', 'https://www.youtube.com/watch?v=xJS-arpsT5g');
INSERT INTO `exercise_table` VALUES (170, 'LYING DUMBBELL LATERAL RAISE LEFT', 'step', 'Lie on your right side with your forearm supporting your body.\r\n\r\nHold a dumbbell in your left hand and raise your left hand straight up and down.', 16, 'img_exercise/LYINGDUMBBELLLATERALRAISELEFT', 'https://www.youtube.com/watch?v=ciJl9ztrhGU');
INSERT INTO `exercise_table` VALUES (171, 'LYING DUMBBELL LATERAL RAISE RIGHT', 'step', 'Lie on your left side with your forearm supporting your body.\r\n\r\nHold a dumbbell in your right hand and raise your right hand straight up and down.', 16, 'img_exercise/LYINGDUMBBELLLATERALRAISERIGHT', 'https://www.youtube.com/watch?v=ciJl9ztrhGU');
INSERT INTO `exercise_table` VALUES (172, 'STRAIGHT LEG BOUNDS', 's', 'Stand with your feet shoulder width apart. Keep your legs straight.\r\n\r\nKick your left leg out, move your left arm backward and move your right arm forward. Then quickly switch sides and repeat. \r\n', 20, 'img_exercise/STRAIGHTLEGBOUNDS', 'https://www.youtube.com/watch?v=2jTOgea7Fgo');
INSERT INTO `exercise_table` VALUES (173, 'CALF STRETCH LEFT', 's', 'Stand one big step away in front of a wall. \r\n\r\nStep forward with your right foot and push the wall with your hands. \r\n\r\nPlease make sure your left leg is fully extended and you can feel your left calf stretching. \r\n\r\nHold this position for a few seconds.', 30, 'img_exercise/CALFSTRETCHLEFT', 'https://www.youtube.com/watch?v=6SIQN7Dh4Tg');
INSERT INTO `exercise_table` VALUES (174, 'CALF STRETCH RIGHT', 's', 'Stand one big step away in front of a wall. \r\n\r\nStep forward with your left foot and push the wall with your hands.\r\n \r\nPlease make sure your right leg is fully extended and you can feel your right calf stretching. \r\n\r\nHold this position for a few seconds.', 30, 'img_exercise/CALFSTRETCHRIGHT', 'https://www.youtube.com/watch?v=6SIQN7Dh4Tg');
INSERT INTO `exercise_table` VALUES (175, 'KNEE TO ELBOW CRUNCHES', 's', 'Stand with your feet shoulder width apart and your hands behind your ears.\r\n\r\nRaise your right knee, and use your left elbow to touch your right knee. Change sides and repeat.', 30, 'img_exercise/KNEETOELBOWCRUNCHES', 'https://www.youtube.com/watch?v=ZuQBnSK5ULk');
INSERT INTO `exercise_table` VALUES (176, 'CLOCKWISE SHOULDER ROLLS', 's', 'Stand or sit with your arms at your sides.\r\n\r\nRoll your shoulders up towards your ears, then roll them back and squeeze, then roll them down. \r\n\r\nRepeat the exercise.', 20, 'img_exercise/CLOCKWISESHOULDERROLLS', 'https://www.youtube.com/watch?v=Uf0MKHeT67c');
INSERT INTO `exercise_table` VALUES (177, 'COUNTERCLOCKWISE SHOULDER ROLLS', 's', 'Stand or sit with your arms at your sides.\r\n\r\nRoll your shoulders back and squeeze, then roll them up towards your ears, then roll them down. \r\n\r\nRepeat the exercise.', 20, 'img_exercise/COUNTERCLOCKWISESHOULDERROLLS', 'https://www.youtube.com/watch?v=Uf0MKHeT67c');
INSERT INTO `exercise_table` VALUES (178, 'ONE ARM DUMBBELL LATERAL RAISE LEFT', 'step', 'Hold a dumbbell in your left hand. Grab a doorway or something similar with your right hand.\r\n\r\nExtend your right arm and tilt your body slightly to the left. Raise your left arm to your left side at shoulder height, then lower it. Repeat the exercise.', 16, 'img_exercise/ONEARMDUMBBELLLATERALRAISELEFT', 'https://www.youtube.com/watch?v=mEuUMOokHqY');
INSERT INTO `exercise_table` VALUES (179, 'ONE ARM DUMBBELL LATERAL RAISE RIGHT', 'step', 'Hold a dumbbell in your right hand. Grab a doorway or something similar with your left hand.\r\n\r\nExtend your left arm and tilt your body slightly to the right. Raise your right arm to your right side at shoulder height, then lower it. Repeat the exercise.', 16, 'img_exercise/ONEARMDUMBBELLLATERALRAISERIGHT', 'https://www.youtube.com/watch?v=mEuUMOokHqY');
INSERT INTO `exercise_table` VALUES (180, 'STAR JUMPS', 's', 'Start in a squat position with your hands touching your feet.\r\n\r\nJump up, spread your legs apart and raise your arms overhead to your sides.\r\n\r\nReturn to the start position, and do the next rep.', 20, 'img_exercise/STARJUMPS', 'https://www.youtube.com/watch?v=4uaqCn1p1Xk');
INSERT INTO `exercise_table` VALUES (181, 'FAST SPIDER LUNGES', 's', 'Start with your hands under your shoulders, your left leg bent and next to the outside of your left arm and your right leg stretched behind you. Then jump and switch legs in the air. ', 30, 'img_exercise/FASTSPIDERLUNGES', 'https://www.youtube.com/watch?v=avU6nziSrjg');
INSERT INTO `exercise_table` VALUES (182, 'X BURPEES', 's', 'Stand with your feet together and your arms at your sides.\r\n\r\nJump up with your feet apart and your hands overhead in the shape of the letter \"X\".\r\n\r\nJump back, put your hands on the ground, kick your legs backward and spread them apart.\r\n \r\nCome back to the start position and repeat.', 20, 'img_exercise/XBURPEES', 'https://www.youtube.com/watch?v=uD5BUL79CvY');
INSERT INTO `exercise_table` VALUES (183, 'REVERSE CRUNCHES WITH LEGS RAISED', 's', 'Lie on your back with your legs stretched and your hands underneath your hips.\r\n\r\nLift your knees until your thighs are perpendicular to the floor. Straighten your legs and lift your hips up off the floor.\r\n\r\nReturn to the starting position and repeat the exercise. ', 30, 'img_exercise/REVERSECRUNCHESWITHLEGRAISED', 'https://www.youtube.com/watch?v=mRf73Zw7LzA');
INSERT INTO `exercise_table` VALUES (184, 'CRUNCH KICKS', 's', 'Lie on your back with your arms at your sides and shoulders slightly lifted.\r\n\r\nRaise your legs off the floor, bend your knees and pull them toward your chest.\r\n\r\nKick your feet forward and repeat it. ', 30, 'img_exercise/CRUNCHKICKS', 'https://www.youtube.com/watch?v=AG9K3GUIfls');
INSERT INTO `exercise_table` VALUES (185, 'HEELS TO THE HEAVEN', 's', 'Lie on your back with your hands at your sides and legs straight up towards the ceiling.\r\n\r\nRaise your hips straight up off the floor, then go back to the starting position. Repeat the exercise. ', 30, 'img_exercise/HEELSTOTHEHEAVEN', 'https://www.youtube.com/watch?v=ameO_UeSvA4');
INSERT INTO `exercise_table` VALUES (186, 'ALT V UP', 's', 'Start in the lying position with your legs extend and arms at your sides.\r\n\r\nSimultaneously lift your left leg and your upper body up off the ground, and use your right hand to touch your toes. Repeat with the other leg.', 30, 'img_exercise/ALTVUP', 'https://www.youtube.com/watch?v=X61wc2Ythgo');
INSERT INTO `exercise_table` VALUES (187, 'MOUNTAIN CLIMBER SQUAT THRUST', 's', 'Stand with your feet shoulder width apart.\r\n\r\nPut your hands on the ground and kick your feet backward. Bend your right knee towards your chest and keep your left leg straight, then quickly switch to your left leg.\r\n\r\nKick your left foot backward, then jump up. Repeat the exercise.', 20, 'img_exercise/MOUNTAINCLIMBERSQUATTHRUST', 'https://www.youtube.com/watch?v=snSqy2pPEa4');
INSERT INTO `exercise_table` VALUES (188, 'SIT UP TWIST', 's', 'Start in the lying position with your knees bent and feet slightly apart.\r\n\r\nPlace your hands behind your ears. Raise your upper body up and twist to one side.\r\n\r\nSlowly lower it back to the starting position. Repeat with the other side. ', 30, 'img_exercise/SITUPTWIST', 'https://www.youtube.com/watch?v=z942YS7nKQA');
INSERT INTO `exercise_table` VALUES (189, 'V HOLD', 's', 'Sit on the floor, lift your legs up at a 45 degree angle, and lean your upper body back at a 45 degree angle. Stretch your arms forward. Hold this position. ', 30, 'img_exercise/VHOLD', 'https://www.youtube.com/watch?v=WGwI629aTAY');
INSERT INTO `exercise_table` VALUES (190, 'ONE DOWN TWO UPS', 's', 'Lie on your back with your legs straight up towards the ceiling and your hands at your sides.\r\n\r\nLower one of your legs down. When you raise it up, lift your hips up off the floor.\r\n\r\nReturn to the starting position. Switch to the other leg and repeat the exercise.', 30, 'img_exercise/ONEDOWNTWOUPS', 'https://www.youtube.com/watch?v=I74qLIG0XWY');
INSERT INTO `exercise_table` VALUES (191, 'SEATED ABS CLOCKWISE CIRCLES', 's', 'Sit down with your palms behind your hips on the ground at your sides.\r\n\r\nExtend your legs and raise a up off the ground. Move your legs clockwise in circles.', 30, 'img_exercise/SEATEDABSCLOCKWISECIRCLES', 'https://www.youtube.com/watch?v=GkreGXxwFiQ');
INSERT INTO `exercise_table` VALUES (192, 'SEATED ABS COUNTERCLOCKWISE CIRCLES', 's', 'Lie on your back with knees bent and feet flat on the floor. Put your arms straight over the top of your head.\r\n\r\nLift your upper body off the floor, then slowly go back to the start position. The exercise increases abdominal endurance. ', 30, 'img_exercise/SEATEDABSCOUNTERCLOCKWISECIRCLES', 'https://www.youtube.com/watch?v=GkreGXxwFiQ');
INSERT INTO `exercise_table` VALUES (193, 'LONG ARM CRUNCHES', 's', 'Lie on your back with knees bent and feet flat on the floor. Put your arms straight over the top of your head.\r\n\r\nLift your upper body off the floor, then slowly go back to the start position. The exercise increases abdominal endurance. ', 30, 'img_exercise/LONGARMCRUNCHES', 'https://www.youtube.com/watch?v=wnArIdUfIM0');
INSERT INTO `exercise_table` VALUES (194, 'DEAD BUG', 's', 'Lie on your back with your knees up at a 90 degree angle and your arms lifted towards the ceiling.\r\n\r\nLower your right leg, and extend your left arm above your head.\r\n\r\nHold it for one second, then return to the start position and repeat with the other side.', 30, 'img_exercise/DEADBUG', 'https://www.youtube.com/watch?v=ng4aCi3fZ2c');
INSERT INTO `exercise_table` VALUES (195, 'WIDE ARM PUSHUPS', 's', 'Start in the regular push-up position but with your hands spread wider than your shoulders.\r\n\r\nThen push your body up and down Remember to keep your body straight.', 40, 'img_exercise/WIDEARMPUSHUPS', 'https://www.youtube.com/watch?v=kBREQ4OSds8');
INSERT INTO `exercise_table` VALUES (196, 'STANDING SIDE BEND', 's', 'Stand with your feet shoulder width apart.\r\n\r\nPut your left hand behind your head and your right hand at your side. Bend your body to your right side and lower your right hand towards the floor.\r\n\r\nPause for one second and return to the starting position. Switch sides and repeat the exercise. ', 20, 'img_exercise/STANDINGSIDEBEND', 'https://www.youtube.com/watch?v=fHyCshP7U1Y');
INSERT INTO `exercise_table` VALUES (197, 'SPINE LUMBAR TWIST STRETCH LEFT', 's', 'Lie on your back with your legs extended. \r\n\r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 20, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 'https://www.youtube.com/watch?v=ZgJtbiM_FMs');
INSERT INTO `exercise_table` VALUES (198, 'SPINE LUMBAR TWIST STRETCH RIGHT', 's', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 20, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 'https://www.youtube.com/watch?v=ZgJtbiM_FMs');
INSERT INTO `exercise_table` VALUES (199, 'KNEELING LUNGE STRETCH LEFT', 's', 'Start in a push-up position and bring your left knee forward and drop your right knee on the floor.\r\n\r\nRaise your upper body and put your hands on your waist. Then push your hips forward while keeping your upper body straight.\r\n\r\nPlease make sure your front knee won\'t go over your toes. Hold this position for a few seconds. ', 30, 'img_exercise/KNEELINGLUNGESTRETCHLEFT', 'https://www.youtube.com/watch?v=q3aPe7kCXq8');
INSERT INTO `exercise_table` VALUES (200, 'KNEELING LUNGE STRETCH RIGHT', 's', 'Start in a push-up position and bring your right knee forward and drop your left knee on the floor.\r\n\r\nRaise your upper body and put your hands on your waist. Then push your hips forward while keeping your upper body straight.\r\n\r\nPlease make sure your front knee won\'t go over your toes. Hold this position for a few seconds. ', 30, 'img_exercise/KNEELINGLUNGESTRETCHRIGHT', 'https://www.youtube.com/watch?v=q3aPe7kCXq8');
INSERT INTO `exercise_table` VALUES (201, 'SEATED BUTTERFLY STRETCH', 's', 'Sit on the floor with your feet together, and grab your toes.\r\n\r\nOpen your knees to the sides, and press your knees down as much as possible. ', 30, 'img_exercise/SEATEDBUTTERFLYSTRETCH', 'https://www.youtube.com/watch?v=N-xrg7jYVW0');
INSERT INTO `exercise_table` VALUES (202, 'OVERHEAD ARM CLOCKWISE', 's', 'Hold your hands together and lift them overhead. Then move your arms clockwise in big circles. ', 20, 'img_exercise/OVERHEADARMCLOCKWISE', 'https://www.youtube.com/watch?v=tDK3if-gjtQ');
INSERT INTO `exercise_table` VALUES (203, 'OVERHEAD ARM COUNTERCLOCKWISE', 's', 'Hold your hands together and lift them overhead. Then move your arms counterclockwise in big circles. ', 20, 'img_exercise/OVERHEADCOUNTERCLOCKWISE', 'https://www.youtube.com/watch?v=tDK3if-gjtQ');
INSERT INTO `exercise_table` VALUES (204, 'CLASP HANDS BEHIND THE BACK', 's', 'Stand with your feet shoulder-width apart.\r\n\r\nPut your hands behind you and interlock them. Then pull your elbows back and extend your arms. Hold it for a few seconds. ', 30, 'img_exercise/CLASPHANDSBEHINDBACK', 'https://www.youtube.com/watch?v=oOoscO1Uxv8');
INSERT INTO `exercise_table` VALUES (205, 'CLAPS OVER HEAD', 's', 'Stand with your feet shoulder width apart. Raise your arms and clap over your head. ', 30, 'img_exercise/CLAPSOVERHEAD', 'https://www.youtube.com/watch?v=-pmAAVV8c0c');
INSERT INTO `exercise_table` VALUES (206, 'FLOOR SLIDES', 's', 'Lie on your back with knees bent and feet flat on the floor.\r\n \r\nPut your arms straight over your head.\r\n\r\nSlide your forearms down at 90 degree angles, then slide them up. Repeat the exercise. ', 30, 'img_exercise/FLOORSLIDES', 'https://www.youtube.com/watch?v=m0Tk_6o3KEQ');
INSERT INTO `exercise_table` VALUES (207, 'BIRD DOG', 's', 'Start with your knees under your butt and your hands under your shoulders.\r\n\r\nThen stretch your right leg and left arm at the same time.\r\n\r\nHold for five seconds, then go back and repeat with the other side. ', 26, 'img_exercise/BIRDDOG', 'https://www.youtube.com/watch?v=-WUqsBbFddI');
INSERT INTO `exercise_table` VALUES (208, 'UP & DOWN NODS', 's', 'Bring your chin down to your chest, and hold it for a few seconds.\r\n\r\nThen look up towards the ceiling, and also hold it for a few seconds. Repeat the exercise.', 40, 'img_exercise/UP&DOWNNODS', 'https://www.youtube.com/watch?v=ueOtPco-h_I');
INSERT INTO `exercise_table` VALUES (209, 'SIDE TO SIDE TURNS', 's', 'Turn your head to the left, and hold it for a few seconds.\r\n\r\nThen turn your head to the right, and also hold it for a few seconds. Repeat the exercise. ', 40, 'img_exercise/SIDETOSIDETURNS', 'https://www.youtube.com/watch?v=IOre9odo0MQ');
INSERT INTO `exercise_table` VALUES (210, 'SIDE TO SIDE TILTS', 's', 'Tilt your head towards your left shoulder, and hold it for a few seconds.\r\n\r\nThen tilt your head towards your right shoulder, and also hold it for a few seconds. Repeat the exercise. ', 40, 'img_exercise/SIDETOSIDETILTS', 'https://www.youtube.com/watch?v=dnSR6569vYY');
INSERT INTO `exercise_table` VALUES (211, 'SIDE NECK STRETCH LEFT', 's', 'Put your left hand underneath your thigh with your palm up. Keep your left shoulder flat.\r\n\r\nPut your right hand on the left side of your head, then gently pull your head towards the right. Hold it for a few seconds. ', 30, 'img_exercise/SIDENECKSTRETCHLEFT', 'https://www.youtube.com/watch?v=vuXefIK-pgw');
INSERT INTO `exercise_table` VALUES (212, 'SIDE NECK STRETCH RIGHT', 's', 'Put your right hand underneath your thigh with your palm up. Keep your right shoulder flat.\r\n\r\nPut your left hand on the right side of your head, then gently pull your head towards the left. Hold it for a few seconds. ', 30, 'img_exercise/SIDENECKSTRETCHRIGHT', 'https://www.youtube.com/watch?v=vuXefIK-pgw');
INSERT INTO `exercise_table` VALUES (213, 'LEVATOR SCAPULAE STRETCH LEFT', 's', 'Sit on a chair, and use your left hand to hold the edge of the chair.\r\n\r\nTurn your head to the right front side, and put your right hand on the left side of your head.\r\n \r\nThen gently pull your head towards the right front side. Hold it for a few seconds. ', 30, 'img_exercise/LEVATORSCAPULAESTRETCHLEFT', 'https://www.youtube.com/watch?v=qmHPk-kjIpQ');
INSERT INTO `exercise_table` VALUES (214, 'LEVATOR SCAPULAE STRETCH RIGHT', 's', 'Sit on a chair, and use your right hand to hold the edge of the chair.\r\n\r\nTurn your head to the left front side, and put your left hand on the right side of your head.\r\n\r\nThen gently pull your head towards the left front side. Hold it for a few seconds. ', 30, 'img_exercise/LEVATORSCAPULAESTRETCHRIGHT', 'https://www.youtube.com/watch?v=qmHPk-kjIpQ');
INSERT INTO `exercise_table` VALUES (215, 'CROSS LEG SIDE BEND LEFT', 's', 'Stand up with your arms at your sides. Cross your right leg behind your left leg.\r\n\r\nExtend both arms over your head, grasp your right palm with your left hand and pull it to your left side. Bend your upper body to your left side. Hold for a few seconds. ', 30, 'img_exercise/CROSSLEGSIDEBENDLEFT', 'https://www.youtube.com/watch?v=iKMcxB_XVU0');
INSERT INTO `exercise_table` VALUES (216, 'CROSS LEG SIDE BEND RIGHT', 's', 'Stand up with your arms at your sides. Cross your left leg behind your right leg.\r\n\r\nExtend both arms over your head, grasp your left palm with your right hand and pull fits your right side. Bend your upper body to your right side. Hold for a few seconds.', 30, 'img_exercise/CROSSLEGSIDEBENDRIGHT', 'https://www.youtube.com/watch?v=iKMcxB_XVU0');
INSERT INTO `exercise_table` VALUES (217, 'QUARTER WALL SQUAT', 's', 'Stand in front of a wall with your feet apart a little wider than shoulder-width, and your hips against the well.\r\n\r\nBend your knees to make a 1/4 squat and then return to the starting position. Repeat the exercise. ', 60, 'img_exercise/QUARTERWALLSQUAT', 'https://www.youtube.com/watch?v=0Y8EmJQla3w');
INSERT INTO `exercise_table` VALUES (218, 'OPEN CHAIN KNEE EXTENSION LEFT', 's', 'Sit on a chair with your back straight. Slowly extend your left leg until it is straight and parallel to the ground, then slowly lower it down. Repeat the exercise.', 20, 'img_exercise/OPENCHAINKNEEEXTENSIONLEFT', 'https://www.youtube.com/watch?v=MpjeKMdiX08');
INSERT INTO `exercise_table` VALUES (219, 'OPEN CHAIN KNEE EXTENSION RIGHT', 's', 'Sit on a chair with your back straight. Slowly extend your right leg until it is straight and parallel to the ground, then slowly lower it down. Repeat the exercise.', 20, 'img_exercise/OPENCHAINKNEEEXTENSIONRIGHT', 'https://www.youtube.com/watch?v=MpjeKMdiX08');
INSERT INTO `exercise_table` VALUES (220, 'STRAIGHT LEG RAISE LEFT', 's', 'Lie flat down on your back with your left leg straight on the ground, and your right leg bent with your right foot flat on the ground.\r\n\r\nTighten your left leg and lift it straight up until your thighs are parallel, then slowly lower it down. ', 20, 'img_exercise/STRAIGHTLEGRAISELEFT', 'https://www.youtube.com/watch?v=ApCSBg_GNB0');
INSERT INTO `exercise_table` VALUES (221, 'STRAIGHT LEG RAISE RIGHT', 's', 'Lie flat down on your back with your right leg straight on the ground, and your left leg bent with your left foot flat on the ground.\r\n\r\nTighten your right leg and lift it straight up until your thighs are parallel, then slowly lower it down. ', 20, 'img_exercise/STRAIGHTLEGRAISERIGHT', 'https://www.youtube.com/watch?v=ApCSBg_GNB0');
INSERT INTO `exercise_table` VALUES (222, 'PILATES CLAMSHELL LEFT', 's', 'Lie on your right side with your head resting on your right arm and knees bent.\r\n\r\nLift your left knee upwards while keeping your heels touching, then go back to the starting position. Repeat the exercise. ', 20, 'img_exercise/PILATESCLAMSHELLLEFT', 'https://www.youtube.com/watch?v=Iu7KgVTLGIg');
INSERT INTO `exercise_table` VALUES (223, 'PILATES CLAMSHELL RIGHT', 's', 'Lie on your left side with your head resting on your left arm and knees bent.\r\n\r\nLift your right knee upwards while keeping your heels touching, then go back to the starting position. Repeat the exercise. ', 20, 'img_exercise/PILATESCLAMSHELLRIGHT', 'https://www.youtube.com/watch?v=Iu7KgVTLGIg');
INSERT INTO `exercise_table` VALUES (224, 'SITTING HAMSTRING STRETCH LEFT', 's', 'Sit with your legs extended in front of you. Bend your right leg with your right foot close to your left thigh.\r\n\r\nLean your upper body forward. Hold this position.', 20, 'img_exercise/SITTINGHAMSTRINGSTRETCHLEFT', 'https://www.youtube.com/watch?v=TfMyFKmTpvg');
INSERT INTO `exercise_table` VALUES (225, 'SITTING HAMSTRING STRETCH RIGHT', 's', 'Sit with your legs extended in front of you. Bend your left leg with your left foot close to your right thigh.\r\n \r\nLean your upper body forward. Hold this position. ', 20, 'img_exercise/SITTINGHAMSTRINGSTRETCHRIGHT', 'https://www.youtube.com/watch?v=TfMyFKmTpvg');
INSERT INTO `exercise_table` VALUES (226, 'OVERHEAD ARM CLOCKWISE CIRCLES', 's', 'Hold your hands together and lift them overhead. Then move your arms clockwise in big circles. ', 20, 'img_exercise/OVERHEADARMCLOCKWISECIRCLES', 'https://www.youtube.com/watch?v=tDK3if-gjtQ');
INSERT INTO `exercise_table` VALUES (227, 'OVERHEAD ARM COUNTERCLOCKWISE CIRCLES', 's', 'Hold your hands together and lift them overhead. Then move your arms counterclockwise in big circles. ', 20, 'img_exercise/OVERHEADCOUNTERCLOCKWISECICCLES', 'https://www.youtube.com/watch?v=tDK3if-gjtQ');
INSERT INTO `exercise_table` VALUES (228, 'SEATED SIDE BEND LEFT', 's', 'Sit and cross your legs on the mat. Lift your left arm overhead, and put your right hand on the floor for support.\r\n\r\nLook up at your left hand, and slowly bend your right arm; meanwhile, bend your upper body to the right. Hold it for a few seconds. ', 20, 'img_exercise/SEATEDSIDEBENDLEFT', 'https://www.youtube.com/watch?v=KS5j-mvDLh0');
INSERT INTO `exercise_table` VALUES (229, 'SEATED SIDE BEND RIGHT', 's', 'Sit and cross your legs on the mat. Lift your right arm overhead, and put your left hand on the floor for support.\r\n\r\nLook up at your right hand, and slowly bend your left arm; meanwhile, bend your upper body to the left. Hold it for a few seconds. ', 20, 'img_exercise/SEATEDSIDEBENDRIGHT', 'https://www.youtube.com/watch?v=KS5j-mvDLh0');
INSERT INTO `exercise_table` VALUES (230, 'SEATED SPINAL TWIST LEFT', 's', 'Sit and cross your legs on the mat.\r\n\r\nPut your left hand on your right knee and your right hand behind you on the floor.\r\n\r\nSlowly twist your upper body to the right. Hold it for a few seconds. ', 30, 'img_exercise/SEATEDSPINALTWISTLEFT', 'https://www.youtube.com/watch?v=T1ocAPNFJJY');
INSERT INTO `exercise_table` VALUES (231, 'SEATED SPINAL TWIST RIGHT', 's', 'Sit and cross your legs on the mat.\r\n\r\nPut your right hand on your left knee and your left hand behind you on the floor.\r\n\r\nSlowly twist your upper body to the left. Hold it for a few seconds. ', 30, 'img_exercise/SEATEDSPINALTWISTRIGHT', 'https://www.youtube.com/watch?v=T1ocAPNFJJY');
INSERT INTO `exercise_table` VALUES (232, 'GLUTE STRETCH LEFT', 's', 'Lie on your back with your feet flat on the floor. Put your left ankle on your right knee.\r\n\r\nLift your right knee, and grab the back of your right thigh with both hands. Gently pull it towards your body.', 20, 'img_exercise/GLUTEKICKBACKLEFT', 'https://www.youtube.com/watch?v=Gste7GKLBzw');
INSERT INTO `exercise_table` VALUES (233, 'GLUTE STRETCH RIGHT', 's', 'Lie on your back with your feet flat on the floor. Put your right ankle on your left knee.\r\n\r\nLift your left knee, and grab the back of your left thigh with both hands. Gently pull it towards your body. ', 20, 'img_exercise/GLUTEKICKBACKRIGHT', 'https://www.youtube.com/watch?v=Gste7GKLBzw');
INSERT INTO `exercise_table` VALUES (234, 'SUPINE HAMSTRING STRETCH LEFT', 's', 'Lie on your back with your legs straight and your hands at your sides.\r\n\r\nLift your left leg toward the ceiling. Hold the back of your thigh with your hands. Keep this position. ', 20, 'img_exercise/SUPINEHAMSTRINGSTRETCHLEFT', 'https://www.youtube.com/watch?v=9wK11AvPp1A');
INSERT INTO `exercise_table` VALUES (235, 'SUPINE HAMSTRING STRETCH RIGHT', 's', 'Lie on your back with your legs straight and your hands at your sides.\r\n\r\nLift your right leg toward the ceiling. Hold the back of your thigh with your hands. Keep this position.', 20, 'img_exercise/SUPINEHAMSTRINGSTRETCHRIGHT', 'https://www.youtube.com/watch?v=9wK11AvPp1A');
INSERT INTO `exercise_table` VALUES (236, 'FORWARD BEND', 's', 'Stand on the floor with your feet together.\r\n\r\nThen bend your body and bring your upper body as close to your legs as you can.\r\n\r\nHold this position for a few seconds and repeat.\r\n\r\nExhale when you bend your body and inhale when you come up. Keep your legs straight during the exercise.', 20, 'img_exercise/FORWARDBEND', 'https://www.youtube.com/watch?v=MKyJujOc2vo');
INSERT INTO `exercise_table` VALUES (237, 'TRIANGLE POSE LEFT', 's', 'Stand with your feet a little wider than shoulder-width apart. Raise your arms at your sides to shoulder height with your palms down.\r\n\r\nTurn your left foot to the left and your right foot 45 degrees to the left. Slightly shift your hips to the right, and bend your torso to the left until your left hand presses on the floor.\r\n\r\nExtend your right arm toward the ceiling, and turn your head to look at your right hand. Hold this position. ', 20, 'img_exercise/TRIANGLEPOSELEFT', 'https://www.youtube.com/watch?v=-dcRVM2sZH0');
INSERT INTO `exercise_table` VALUES (238, 'TRIANGLE POSE RIGHT', 's', 'Stand with your feet a little wider than shoulder-width apart. Raise your arms at your sides to shoulder height with your palms down.\r\n\r\nTurn your right foot to the left and your left foot 45 degrees to the right. Slightly shift your hips to the right, and bend your torso to the right until your right hand presses on the floor.\r\n\r\nExtend your left arm toward the ceiling, and turn your head to look at your left hand. Hold this position.', 20, 'img_exercise/TRIANGLEPOSERIGHT', 'https://www.youtube.com/watch?v=-dcRVM2sZH0');
INSERT INTO `exercise_table` VALUES (239, 'TORSO TWIST', 's', 'Stand on the floor with feet shoulder width apart, then rotate your body gently and slowly. This stretches your back and hips.\r\n\r\nRelax your shoulders. Your toes should always face forward.', 30, 'img_exercise/TORSOTWIST', 'https://www.youtube.com/watch?v=f4Qah0bQTIo');
INSERT INTO `exercise_table` VALUES (240, 'DOWNWARD FACING DOG', 's', 'Start on all fours with your knees under your butt and your hands directly under your shoulders.\r\n\r\nStraighten your legs, and lift your hips up in an upside down \'V\' shape. Spread your feet apart, and spread your fingers. Transfer your weight back to your legs. Hold this position.', 30, 'img_exercise/DOWNWARDFACINGDOG', 'https://www.youtube.com/watch?v=ahBd-oI76Zs');
INSERT INTO `exercise_table` VALUES (241, 'TRICEPS KICKBACKS', 's', 'Lean forward, bend your knees and your elbows.\r\n\r\nExtend your arms behind you and squeeze your triceps. Please make your arms parallel to the ground when extending them.\r\n\r\nGo back to the start position, and repeat this exercise.', 30, 'img_exercise/TRICEPSKICKBACKS', 'https://www.youtube.com/watch?v=lAt2UAxKvSk');
INSERT INTO `exercise_table` VALUES (242, 'CHEST PRESS PULSE', 's', 'Hold your forearms together at shoulder height and bend your elbows with your hands together to make an \'L shape.\r\n\r\nThen lift your forearms up and down. ', 30, 'img_exercise/CHESTPRESSPULSE', 'https://www.youtube.com/watch?v=jBDy37pM5jo');
INSERT INTO `exercise_table` VALUES (243, 'ROUNDHOUSE SQUAT KICKS', 's', 'Stand with feet shoulder width apart. Put your arms in front of your chest to keep your balance.\r\n\r\nThen do a squat, and when you come up, kick your left leg to the side. Repeat the exercise and then switch to the right leg.\r\n\r\nInhale when you go down, and exhale when you go up. Your knees should be extended in line with your toes.\r\n\r\nIt\'s a great exercise for the quadriceps and gluteus maximus. ', 30, 'img_exercise/ROUNDHOUSESQUATKICKS', 'https://www.youtube.com/watch?v=bx_QLD9sRLU');
INSERT INTO `exercise_table` VALUES (244, 'BOTTOM LEG LIFT LEFT', 's', 'Lie on your left side with your head resting on your left hand.\r\n\r\nThen put your right foot forward on the floor. Lift your left leg up and down. ', 30, 'img_exercise/BOTTOMLEGLIFTLEFT', 'https://www.youtube.com/watch?v=LknNaxKPOEQ');
INSERT INTO `exercise_table` VALUES (245, 'BOTTOM LEG LIFT RIGHT', 's', 'Lie on your left side with your head resting on your left hand.\r\n\r\nThen put your right foot forward on the floor. Lift your right leg up and down.', 30, 'img_exercise/BOTTOMLEGLIFTRIGHT', 'https://www.youtube.com/watch?v=LknNaxKPOEQ');
INSERT INTO `exercise_table` VALUES (246, 'QUAD STRETCH', 's', 'Stand on the floor, then bend your left leg and grasp your ankle or toes to bring your left calf close to your left thigh.\r\n\r\nHold this position for a few seconds, then change sides and repeat.\r\n\r\nYour lifted knee should always go straight down, and your upper body should keep straight during the exercise. ', 30, 'img_exercise/QUADSTRETCH', 'https://www.youtube.com/watch?v=UTA-6h17Zdo');
INSERT INTO `exercise_table` VALUES (247, 'SUMO SQUAT', 's', 'Stand with your feet 6-12 inches apart. Stretch your arms in front of you.\r\n\r\nLower your body until your thighs are parallel to the floor. Return to the starting position and repeat the exercise.', 30, 'img_exercise/SUMOSQUAT', 'https://www.youtube.com/watch?v=9rme1RyAJEE');
INSERT INTO `exercise_table` VALUES (248, 'DIAMOND PUSHUPS', 'step', 'Start in the push-up position. \r\n\r\nMake a diamond shape with your forefingers and thumbs together under your chest. \r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 20, 'img_exercise/DIAMONDPUSHUPS', 'https://www.youtube.com/watch?v=36HgbeFenxs');
INSERT INTO `exercise_table` VALUES (249, 'DONKEY KICKS LEFT', 's', 'Start on all fours with your knees under butt and and your hands under your shoulders.\r\n\r\nThen lift your left Ieg and squeeze your butt as much as you can. Go back to the start position and repeat the exercise. ', 20, 'img_exercise/DONKEYKICKSLEFT', 'https://www.youtube.com/watch?v=Sc8e7yCYvPQ		');
INSERT INTO `exercise_table` VALUES (250, 'DONKEY KICKS RIGHT', 's', 'Start on all fours with your knees under butt and and your hands under your shoulders.\r\n\r\nThen lift your right Ieg and squeeze your butt as much as you can. Go back to the start position and repeat the exercise.', 20, 'img_exercise/DONKEYKICKSRIGHT', 'https://www.youtube.com/watch?v=Sc8e7yCYvPQ');
INSERT INTO `exercise_table` VALUES (251, 'ARM SCISSORS', 's', 'Stand upright with your feet sholder width apart. \r\n\r\nStretch your arms in front of you at shoulder height with one arm overlap the other in the shape of the letter \"X\", and then spread them apart.\r\n\r\nSwitch arms, and repeat the exercise.', 30, 'img_exercise/ARMSCISSORS', 'https://www.youtube.com/watch?v=dPDsW7xvuVY');
INSERT INTO `exercise_table` VALUES (252, 'BURPEES', 's', 'Stand with your feet shoulder width apart, then put your hands on the ground and kick your feet backward. Do a quick push-up and then jump up. ', 20, 'img_exercise/BURPEES', 'https://www.youtube.com/watch?v=DyF2u0f-RP0');
INSERT INTO `exercise_table` VALUES (253, 'SIT UPS', 'step', 'Lie on your back with your hands behind our ears.\r\n\r\nThen lift your upper body off the floor and slowly up to the sitting position.\r\n\r\nDon\'t tug your neck when you get up.\r\n\r\nSlowly go back to the start position and repeat the exercise.\r\n\r\nIf your spine hurts, please change to another workout.', 30, 'img_exercise/SITUPS', 'https://www.youtube.com/watch?v=swOyWKk7Oko');
INSERT INTO `exercise_table` VALUES (254, 'BENCH GLUTE KICK BACK LEFT', 's', 'Start with your right knee and your hands on a bench, put your hands directly under your shoulders.\r\n\r\nThen kick your left leg back until it is parallel with the ground. Return to the starting position and repeat the exercise.', 20, 'img_exercise/BENCHGLUTEKICKBACKLEFT', 'https://www.youtube.com/watch?v=MI-jYzIv6JM');
INSERT INTO `exercise_table` VALUES (255, 'BENCH GLUTE KICK BACK RIGHT', 's', 'Start with your left knee and your hands on a bench, put your hands directly under your shoulders.\r\n\r\nThen kick your right leg back until it is parallel with the ground. Return to the starting position and repeat the exercise.', 20, 'img_exercise/BENCHGLUTEKICKBACKRIGHT', 'https://www.youtube.com/watch?v=MI-jYzIv6JM');
INSERT INTO `exercise_table` VALUES (256, 'SPIDERMAN PUSHUPS', 'step', 'Start in the regular push-up position. When lowering your torso downward. bend and lift one leg to the side.\r\n\r\nThen return to the start position and switch to the other leg. \r\n\r\nRemember to keep your body straight.', 20, 'img_exercise/SPIDERMANPUSHUPS', 'https://www.youtube.com/watch?v=yJq7NCTmiaI');
INSERT INTO `exercise_table` VALUES (257, 'LYING SWING LEGS LEFT', 's', 'Lie on your back with your toes towards the ceiling, legs flat on the floor and arms straight overhead.\r\n\r\nSwing your legs to your right and hold this position', 30, 'img_exercise/LYINGSWINGLEGSLEFT', 'https://www.youtube.com/watch?v=oWblsj1havg');
INSERT INTO `exercise_table` VALUES (258, 'LYING SWING LEGS RIGHT', 'step', 'Lie on your back with your toes towards the ceiling, legs flat on the floor and arms straight overhead.\r\n\r\nSwing your legs to your left and hold this position', 30, 'img_exercise/LYINGSWINGLEGSRIGHT', 'https://www.youtube.com/watch?v=oWblsj1havg');
INSERT INTO `exercise_table` VALUES (259, 'CRAB KICKS', 's', 'Sit on the floor with your legs bent together and your hands under your shoulders.to support your body.\r\n\r\nThen lift one leg up while lifting your hips off the floor as high as you can. Switch to the other leg and repeat.\r\n\r\nPush yourself up with your hips instead of your back. It\'s a great exercise for the gluteus.', 30, 'img_exercise/CRABKICKS', 'https://www.youtube.com/watch?v=KZO7RG0TR-0');
INSERT INTO `exercise_table` VALUES (260, 'SQUAT JACKS', 's', 'Start with your feet together and hands raised above your head.\r\n\r\nJump up, spread your feet aprt, lower your hands and squat down.\r\n\r\nJump back to the start position and repeat the exercise.', 30, 'img_exercise/SQUATJACKS', 'https://www.youtube.com/watch?v=YYoUh6ehSK8');
INSERT INTO `exercise_table` VALUES (261, 'OBLIQUE V UPS LEFT', 'step', 'Lie on your right side with your legs bent end slightly lifted. Keep your right arm stretched out in front of you.\r\n\r\nPut your left hand behind your ear. Lift your chest and legs up at the same time.\r\n\r\nReturn to the starting position and repeat the exercise.', 20, 'img_exercise/OBLIQUEVUPSLEFT', 'https://www.youtube.com/watch?v=dZGajX67rdQ');
INSERT INTO `exercise_table` VALUES (262, 'OBLIQUE V UPS RIGHT', 'step', 'Lie on your left side with your legs bent end slightly lifted. Keep your left arm stretched out in front of you.\r\n\r\nPut your right hand behind your ear. Lift your chest and legs up at the same time.\r\n\r\nReturn to the starting position and repeat the exercise.', 20, 'img_exercise/OBLIQUEVUPSRIGHT', 'https://www.youtube.com/watch?v=dZGajX67rdQ');
