INSERT INTO `tbl_abs_advanced` VALUES (1, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups', 30, 'time', 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_abs_advanced` VALUES (2, 'SITUPS', 'https://www.youtube.com/watch?v=1fbU_MkV7NE', 'Lie on your back with your hands behind your ears.\r\n\r\nThe  lift your upper body off the floor and slowly up to the sitting position.\r\n \r\nDon\'t tug your neck when you get up.\r\n\r\nSlowly go back to the start position and repeat the exercise.\r\n\r\nIf your spine hurts, please change another workout.', 20, 'step', 'img_exercise/SITUPS', 2, 2);
INSERT INTO `tbl_abs_advanced` VALUES (3, 'SIDE BRIDGES LEFT', 'https://www.youtube.com/watch?v=zyZaGLoEUC4', 'Lie on your right side. Put your right elbow directly under your shoulders and put your left leg on your right leg.\r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position.\r\n\r\nRepeat this exercise.', 20, 'step', 'img_exercise/SIDEBRIDGESLEFT', 3, 3);
INSERT INTO `tbl_abs_advanced` VALUES (4, 'SIDE BRIDGES RIGHT', 'https://www.youtube.com/watch?v=Ko9jId015qc', 'Lie on your left side. Put your left elbow directly under your shoulders and put your right hand on your waist.\r\n\r\nPlace your right leg on your left leg.\r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position.', 20, 'step', 'img_exercise/SIDEBRIDGESRIGHT', 4, 4);
INSERT INTO `tbl_abs_advanced` VALUES (5, 'ABDOMINAL CRUNCHES', 'https://www.youtube.com/watch?v=Xyd_fa5zoEU', 'Lie on your back with your knees bent and your arms stretched forward.\r\n\r\nThen lift your upper body off the floor. \r\n\r\nHold for a few seconds and slowly return.\r\n\r\nIt primarily works the rectus abdominis muscle and the obliques.', 30, 'step', 'img_exercise/ABDOMINALCRUNCHES', 5, 5);
INSERT INTO `tbl_abs_advanced` VALUES (6, 'BICYCLE CRUNCHES', 'https://www.youtube.com/watch?v=Iwyvozckjak', 'Lie on the floor with your hands behind your ears. \r\n\r\nRaise your knees and close your right elbow toward your left knee, then close your left elbow your right knee.\r\n\r\nRepeat the exercise.', 24, 'step', 'img_exercise/BICYCLECRUNCHES', 6, 6);
INSERT INTO `tbl_abs_advanced` VALUES (7, 'SIDE PLANK RIGHT', 'https://www.youtube.com/watch?v=4Azm8-c_k4Y', 'Lie on your right side with your forearm supporting your body.\r\n\r\nHold your body in straight line.\r\n\r\nThis exercise targets the abdominal muscles and obliques.', 20, 'time', 'img_exercise/SIDEPLANKRIGHT', 7, 7);
INSERT INTO `tbl_abs_advanced` VALUES (8, 'SIDE PLANK LEFT', 'https://www.youtube.com/watch?v=qHBTBRYmoV4', 'Lie on your left side with your forearm supporting your body. \r\n\r\nHold your body in a straight line.\r\n\r\nThis exercise targets the abdominal muscles and obliques.', 20, 'time', 'img_exercise/SIDEPLANKLEFT', 8, 8);
INSERT INTO `tbl_abs_advanced` VALUES (9, 'V UP', 'https://www.youtube.com/watch?v=riAutegDqdI', 'Lie on your back with your arms and legs extended and your legs squeezed together.\r\n\r\nRaise your upper body and legs, use your arms to touch your toes, then go back to the start position and repeat the exercise.', 18, 'step', 'img_exercise/VUP', 9, 9);
INSERT INTO `tbl_abs_advanced` VALUES (10, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards.\r\n\r\nRepeat the exercise with the other arm, it\'s a great exercise for the chest, shoulders, arms and core.', 24, 'step', 'img_exercise/PUSHUPROTATION', 10, 10);
INSERT INTO `tbl_abs_advanced` VALUES (11, 'RUSSIAN TWIST', 'https://www.youtube.com/watch?v=wkD8rjkodUI', 'Sit on the floor with your knees bent, feet lifted a little bit and back tilted backwards.\r\n\r\nthen hold your hands together and twist from side to side.', 48, 'step', 'img_exercise/RUSSIANTWIST', 11, 11);
INSERT INTO `tbl_abs_advanced` VALUES (12, 'ABDOMINAL CRUNCHES', 'https://www.youtube.com/watch?v=Xyd_fa5zoEU', 'Lie on your back with your knees bent and your arms stretched forward.\r\n\r\nThen lift your upper body off the floor. Hold for a few seconds and slowly return.\r\n\r\nIt primarily works the rectus abdominis muscle and the obliques.', 28, 'step', 'img_exercise/ABDOMINALCRUNCHES', 12, 12);
INSERT INTO `tbl_abs_advanced` VALUES (13, 'BUTT BRIDGE', 'https://www.youtube.com/watch?v=rWzV67w5-vU', 'Lie on your back with knees bent and feet flat on the floor. \r\n\r\nPut your arms flat at your sides.\r\n\r\nThen lift your butt up and down.', 30, 'step', 'img_exercise/BUTTBRIDGE', 13, 13);
INSERT INTO `tbl_abs_advanced` VALUES (14, 'HEEL TOUCH', 'https://www.youtube.com/watch?v=RW25fbkQxVQ', 'Lie on the ground with your legs bent and your arms by your sides.\r\n\r\nSlightly lift your upper body off the floor and make your hands alternately reach your heels.', 34, 'step', 'img_exercise/HEELTOUCH', 14, 14);
INSERT INTO `tbl_abs_advanced` VALUES (15, 'MOUNTAIN CLIMBER', 'https://www.youtube.com/watch?v=nmwgirgXLYM', 'Start in the push-up position. Bend your right knee towards your chest and keep your left leg straight, then quickly switch from one leg to the other.\r\n\r\nThis exercise strengthens multiple muscle groups.', 30, 'step', 'img_exercise/MOUNTAINCLIMBER', 15, 15);
INSERT INTO `tbl_abs_advanced` VALUES (16, 'CROSSOVER CRUNCH', 'https://www.youtube.com/watch?v=nCsgWiL-J90', 'Lie on your back with your knees bent and your hands behind your ears.\r\n\r\nRaise and twist your torso so your right elbow moves to meet your left knee. \r\n\r\nRepeat with the other side. ', 24, 'step', 'img_exercise/CROSSOVERCRUNCH', 16, 16);
INSERT INTO `tbl_abs_advanced` VALUES (17, 'V UP', 'https://www.youtube.com/watch?v=riAutegDqdI', 'Lie on your back with your arms and legs extended and your legs squeezed together.\r\n\r\nRaise your upper body and legs, use your arms to touch your toes, then go back to the start position and repeat the exercise.', 16, 'step', 'img_exercise/VUP', 17, 17);
INSERT INTO `tbl_abs_advanced` VALUES (18, 'PLANK', 'https://www.youtube.com/watch?v=pSHjTRCQxIw', 'Lie on the floor with your toes and forearms on the ground. \r\n\r\nKeep your body straight and hold this position as long as you can.\r\n\r\nThis exercise strengthens the abdomen, back and shoulders.', 60, 'time', 'img_exercise/PLANK', 18, 18);
INSERT INTO `tbl_abs_advanced` VALUES (19, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 30, 'time', 'img_exercise/COBRASTRETCH', 19, 19);
INSERT INTO `tbl_abs_advanced` VALUES (20, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=8auWNRJOKak', 'Lie on your back with your legs extended.\r\n\r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 20, 20);
INSERT INTO `tbl_abs_advanced` VALUES (21, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended.\r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 21, 21);
