INSERT INTO `tbl_abs_beginner` VALUES (6, 'LEG RAISES', 'https://www.youtube.com/watch?v=JB2oyawG9KI', 'Lie down on your back, and put your hands beneath your hips for support.\r\n\r\nthen lift your legs up until they form a right angle with the floor.\r\n\r\nSlowly bring your legs back down and repeat the exercise.', 16, 'step', 'img_exercise/LEGRAISES', 6, 6);
