INSERT INTO `tbl_arm_advanced` VALUES (1, 'ARM CIRCLES CLOCKWISE', 'https://www.youtube.com/watch?v=U0P4cr36Qss', 'Stand on the floor with your arms extended straight out to the sides at shoulder height.\r\n\r\nMove your arms clockwise in circles fast.\r\n\r\nTry to do it as fast as you can.\r\n\r\nIt\'s great exercise for the deltoid muscle.', 30, 'time', 'img_exercise/ARMCIRCLESCLOCKWISE', 1, 1);
INSERT INTO `tbl_arm_advanced` VALUES (2, 'ARM CIRCLES COUNTERCLOCKWISE ', 'https://www.youtube.com/watch?v=U0P4cr36Qss', 'Stand on the floor with your arms extends straight out to the sides at shoulder height.\r\n\r\nMove your arms counterclockwise in circles fast.\r\n\r\nTry to do it as fast as you can.\r\n\r\nIt\'s a great exercise for the deltoid muscle.', 30, 'time', 'img_exercise/ARMCIRCLESCOUNTERCLOCKWISE', 2, 2);
INSERT INTO `tbl_arm_advanced` VALUES (3, 'SKIPPING WITHOUT ROPE', 'https://www.youtube.com/watch?v=Mj6NezKTLmw', 'Place your arms at your sides and pretend to hold a skipping rope handle in each hand.\r\n\r\nJump and alternately land on the balls of your feet, rotating your wrists at the same time as if you were spinning a rose.', 30, 'time', 'img_exercise/SKIPPINGWITHOUTROPE', 3, 3);
INSERT INTO `tbl_arm_advanced` VALUES (4, 'LEG BARBEL CURL LEFT', 'https://www.youtube.com/watch?v=kwG2ipFRgfo', 'Stand against a wall. Lift your right leg up. lean forward and grab underneath your right ankle with your left hand.\r\n\r\nBring the ankle up towards the shoulder as much as you can, the lower it and repeat the exercise.', 16, 'step', 'img_exercise/LEGBARBELLCURLLEFT', 4, 4);
INSERT INTO `tbl_arm_advanced` VALUES (5, 'LEG BARBEL CURL RIGHT', 'https://www.youtube.com/watch?v=kzohU7hbN9I', 'Stand against a wall. Lift your left leg up. lean forward and grab underneath your left ankle with your right hand.\r\n\r\nBring the ankle up towards the shoulder as much as you can, the lower it and repeat the exercise.', 16, 'step', 'img_exercise/LEGBARBELLCURLRIGHT', 5, 5);
INSERT INTO `tbl_arm_advanced` VALUES (6, 'BURPEES', 'https://www.youtube.com/watch?v=wS4OsJ4yzx4', 'Stand with your feet shoulder width apart, then put your hands on the ground and kick your feet backward. \r\n\r\nDo quick push-up and then jump up.', 16, 'step', 'img_exercise/BURPEES', 6, 6);
INSERT INTO `tbl_arm_advanced` VALUES (7, 'ARM CURLS CRUNCH LEFT', 'https://www.youtube.com/watch?v=FrFyUbxs1uQ', 'Lie on your left side with your knees bent and lifted. \r\n\r\nGrasp your left thigh with your left hand and put your right hand behind your head.\r\n\r\nThen raise your upper body by pulling your left thigh. Repeat the exercise.', 14, 'step', 'img_exercise/ARMCURLSCRUNCHLEFT', 7, 7);
INSERT INTO `tbl_arm_advanced` VALUES (8, 'LEG BARBEL CURL RIGHT', 'https://www.youtube.com/watch?v=kzohU7hbN9I', 'Stand against a wall. lift your left leg up, lean forward and grab underneath your left ankle with your right hand.\r\n\r\nBring the ankle up towards the shoulder as much as you can, then lower it and repeat the exercise.', 8, 'step', 'img_exercise/LEGBARBELLCURLRIGHT', 8, 8);
INSERT INTO `tbl_arm_advanced` VALUES (9, 'FLOOR TRICEP DIPS', 'https://www.youtube.com/watch?v=Nl578wCij6E', 'Site on the floor with your knees bent and feet flat on the floor. \r\n\r\nPut your hands beneath your shoulders with your fingers pointing toward your hips.\r\n\r\nLift your hips off the floor. Then bend and extend your elbows to lower and lift your hips.\r\n\r\nRepeat the exercise to strengthen your upper arms.', 18, 'step', 'img_exercise/FLOORTRICEPDIPS', 9, 9);
INSERT INTO `tbl_arm_advanced` VALUES (10, 'ALTERNATING HOOKS', 'https://www.youtube.com/watch?v=uWubZ8WIejY', 'Stand with your feet shoulder-width apart, and place your dominant foot slightly forward. \r\n\r\nSlightly bend your knees, clench your fists and bend your elbows at 90 degrees.\r\n\r\nRaise you right arm to shoulder height and keep your forearm parallel to the ground. \r\n\r\nRotate your shoulders and hips and punch towards the left. \r\n\r\nSwitch sides and repeat.', 30, 'time', 'img_exercise/ALTERNATINGHOOKS', 10, 10);
INSERT INTO `tbl_arm_advanced` VALUES (11, 'MILITARY PUSHUPS', 'https://www.youtube.com/watch?v=ihvdd0rPTiU', 'Start in push-up position with your hands directly under your shoulders and feet no more than 12 inches apart.\r\n\r\nBend your elbows and lower your body until your upper arms are parallel to the floor.\r\n\r\nStay in this position for one second and then push your body back to the starting position and repeat the exercise. \r\n\r\nPlease remember that your elbows should be close to your body during this exercise.', 14, 'step', 'img_exercise/MILITARYPUSHUPS', 11, 11);
INSERT INTO `tbl_arm_advanced` VALUES (12, 'SHOULDER GATORS', 'https://www.youtube.com/watch?v=u6J2wkB2OHw', 'Stand upright with your hands beside your ears and elbows facing each side. \r\n\r\nRotate your elbows until both of them are facing the front.', 16, 'step', 'img_exercise/SHOULDERGATORS', 12, 12);
INSERT INTO `tbl_arm_advanced` VALUES (13, 'FLOOR TRICEP DIPS', 'https://www.youtube.com/watch?v=Nl578wCij6E', 'Site on the floor with your knees bent and feet flat on the floor. Put your hands beneath your shoulders with your fingers pointing toward your hips.\r\n\r\nLift your hips off the floor. Then bend and extend your elbows to lower and lift your hips.\r\n\r\nRepeat the exercise to strengthen your upper arms.', 16, 'step', 'img_exercise/FLOORTRICEPDIPS', 13, 13);
INSERT INTO `tbl_arm_advanced` VALUES (14, 'ALTERNATING HOOKS', 'https://www.youtube.com/watch?v=uWubZ8WIejY', 'Stand with your feet shoulder-width apart, and place your dominant foot slightly forward. \r\n\r\nSlightly bend your knees, clench your fists and bend your elbows at 90 degrees.\r\n\r\nRaise you right arm to shoulder height and keep your forearm parallel to the ground. \r\n\r\nRotate your shoulders and hips and punch towards the left. \r\n\r\nSwitch sides and repeat.', 30, 'time', 'img_exercise/ALTERNATINGHOOKS', 14, 14);
INSERT INTO `tbl_arm_advanced` VALUES (15, 'BURPEES', 'https://www.youtube.com/watch?v=wS4OsJ4yzx4', 'Stand with your feet shoulder width apart, then put your hands on the ground and kick your feet backward. \r\n\r\nDo quick push-up and then jump up.', 16, 'step', 'img_exercise/BURPEES', 15, 15);
INSERT INTO `tbl_arm_advanced` VALUES (16, 'ARM CURLS CRUNCH LEFT', 'https://www.youtube.com/watch?v=FrFyUbxs1uQ', 'Lie on your left side with your knees bent and lifted. \r\n\r\nGrasp your left thigh with your left hand and put your right hand behind your head.\r\n\r\nThen raise your upper body by pulling your left thigh. \r\n\r\nRepeat the exercise.', 12, 'step', 'img_exercise/ARMCURLSCRUNCHLEFT', 16, 16);
INSERT INTO `tbl_arm_advanced` VALUES (17, 'ARM CURLS CRUNCH RIGHT', 'https://www.youtube.com/watch?v=FrFyUbxs1uQ', 'Lie on your right side with your knees bent and lifted. \r\n\r\nGrasp your right thigh with your right hand and put your left hand behind your head.\r\n\r\nThen raise your upper body by pulling your right thigh.\r\n\r\nRepeat the exercise.', 12, 'step', 'img_exercise/ARMCURLSCRUNCHRIGHT', 17, 17);
INSERT INTO `tbl_arm_advanced` VALUES (18, 'MILITARY PUSHUPS', 'https://www.youtube.com/watch?v=ihvdd0rPTiU', 'Start in push-up position with your hands directly under your shoulders and feet no more than 12 inches apart.\r\n\r\nBend your elbows and lower your body until your upper arms are parallel to the floor.\r\n\r\nStay in this position for one second and then push your body back to the starting position and repeat the exercise.\r\n\r\nPlease remember that your elbows should be close to your body during this exercise.', 12, 'step', 'img_exercise/MILITARYPUSHUPS', 18, 18);
INSERT INTO `tbl_arm_advanced` VALUES (19, 'SHOULDER GATORS', 'https://www.youtube.com/watch?v=u6J2wkB2OHw', 'Stand upright with your hands beside your ears and elbows facing each side.\r\n\r\nRotate your elbows until both of them are facing the front.', 16, 'step', 'img_exercise/SHOULDERGATORS', 19, 19);
INSERT INTO `tbl_arm_advanced` VALUES (20, 'DOORWAY CURLS LEFT', 'https://www.youtube.com/watch?v=8TGU9byDMLg', 'Stand in doorway. Grasp the doorframe using your left hand, and put your feet close to the bottom of the door.\r\n\r\nExtend your left arm and lean back, then pull at the doorframe and lean pack, then pull at the doorframe and code back to the starting position.\r\n\r\nRepeat the exercise.', 8, 'step', 'img_exercise/DOORWAYCURLSLEFT', 20, 20);
INSERT INTO `tbl_arm_advanced` VALUES (21, 'DOORWAY CURLS RIGHT', 'https://www.youtube.com/watch?v=4N_5FYgiX5c', 'Stand in doorway. Grasp the doorframe using your right hand, and put your feet close to the bottom of the door.\r\n\r\nExtend your right arm and lean back, then pull at the doorframe and lean pack, then pull at the doorframe and code back to the starting position. \r\n\r\nRepeat the exercise.', 8, 'step', 'img_exercise/DOORWAYCURLSRIGHT', 21, 21);
INSERT INTO `tbl_arm_advanced` VALUES (22, 'SKIPPING WITHOUT ROPE', 'https://www.youtube.com/watch?v=Mj6NezKTLmw', 'Place your arms at your sides and pretend to hold a skipping rope handle in each hand.\r\n\r\nJump and alternately land on the balls of your feet, rotating your wrists at the same time as if you were spinning a rose.', 30, 'time', 'img_exercise/SKIPPINGWITHOUTROPE', 19, 19);
INSERT INTO `tbl_arm_advanced` VALUES (23, 'CHEST PRESS PULSE', 'https://www.youtube.com/watch?v=gNywcYw-YSM', 'Hold your forearms together at shoulder height and bend your elbows with your hands together to make an \'L\' shape.\r\n\r\nThen lift your forearms up and down.', 18, 'time', 'img_exercise/CHESTPRESSPULSE', 23, 23);
INSERT INTO `tbl_arm_advanced` VALUES (24, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards.\r\n\r\nRepeat the exercise with the other arm, it\'s a great exercise for the chest, shoulders, arms and core.', 12, 'step', 'img_exercise/PUSHUPROTATION', 24, 24);
INSERT INTO `tbl_arm_advanced` VALUES (25, 'TRICEPS STRETCH LEFT', 'https://www.youtube.com/watch?v=eG28Fku9JoU', 'Put your left hand on your back, use your right hand to grab your left elbow and gently pull it. \r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/TRICEPSSTRETCHLEFT', 25, 25);
INSERT INTO `tbl_arm_advanced` VALUES (26, 'TRICEPS STRETCH RIGHT', 'https://www.youtube.com/watch?v=L4kWEPx18hA', 'Put your right hand on your back, use your left hand to grab your right elbow and gently pull it. \r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/TRICEPSSTRETCHRIGHT', 26, 26);
INSERT INTO `tbl_arm_advanced` VALUES (27, 'STANDING BICEPS STRETCH LEFT', 'https://www.youtube.com/watch?v=uqO6GGebKXA', 'Stand with your left arm close to a wall. \r\n\r\nExtend tour left arm and put your left hand on the wall, then gently turn gently turn body to the right.', 30, 'time', 'img_exercise/STANDINGBICEPSSTRETCHLEFT', 27, 27);
INSERT INTO `tbl_arm_advanced` VALUES (28, 'STANDING BICEPS STRETCH RIGHT', 'https://www.youtube.com/watch?v=uqO6GGebKXA', 'Stand with your right arm close to a wall. \r\n\r\nExtend tour right arm and put your left hand on the wall, then gently turn gently turn body to the left.', 30, 'time', 'img_exercise/STANDINGBICEPSSTRETCHRIGHT', 28, 28);
INSERT INTO `tbl_arm_beginner` VALUES (1, 'ARM RAISES', 'https://www.youtube.com/watch?v=D-3JnFrFUOw', 'Stand on the floor with your arms extended straight forward at shoulder height.\r\n\r\nRaise your arms above tour head. Return to the start position and repeat.', 30, 'time', 'img_exercise/ARMRAISES', 1, 1);
INSERT INTO `tbl_arm_beginner` VALUES (2, 'SIDE ARM RAISE', 'https://www.youtube.com/watch?v=ww0r9xZunDM', 'Stand with your feet shoulder width apart.\r\n\r\nRaise your arms to the side at shoulder height, then put them down.\r\n\r\nRepeat the exercise.\r\n\r\nKeep your arms straight during the exercise.', 30, 'time', 'img_exercise/SIDEARMRAISE', 2, 2);
INSERT INTO `tbl_arm_beginner` VALUES (3, 'TRICEPS DIPS', 'https://www.youtube.com/watch?v=WmHXTlvI8Eo', 'for the start position, sit on the chair. \r\n\r\nThen move your hands holding the edge of the chair.\r\n\r\nSlowly bend and stretch your arms to make your body go up and down. \r\n\r\nThis is a great exercise for the triceps.', 10, 'step', 'img_exercise/TRICEPSDIPS', 3, 3);
INSERT INTO `tbl_arm_beginner` VALUES (4, 'ARM CIRCLES CLOCKWISE', 'https://www.youtube.com/watch?v=U0P4cr36Qss', 'Stand on the floor with your arms extended straight out to the sides at shoulder height.\r\n\r\nMove your arms clockwise in circles fast.\r\n\r\nTry to do it as fast as you can.\r\n\r\nIt\'s great exercise for the deltoid muscle.', 30, 'time', 'img_exercise/ARMCIRCLESCLOCKWISE', 4, 4);
INSERT INTO `tbl_arm_beginner` VALUES (5, 'ARM CIRCLES COUNTERCLOCKWISE ', 'https://www.youtube.com/watch?v=U0P4cr36Qss', 'Stand on the floor with your arms extends straight out to the sides at shoulder height.\r\n\r\nMove your arms counterclockwise in circles fast.\r\n\r\nTry to do it as fast as you can.\r\n\r\nIt a great exercise for the deltoid muscle.', 30, 'time', 'img_exercise/ARMCIRCLESCOUNTERCLOCKWISE', 5, 5);
INSERT INTO `tbl_arm_beginner` VALUES (6, 'DIAMOND PUSHUPS', 'https://www.youtube.com/watch?v=jaxbEHLC4qU', 'Start on all fours with your knees under your butt and your hands under your shoulders.\r\n\r\nMake a diamond shape with your forefingers and thumbs together directly under your face, then push your body up and down.\r\n\r\nRemember to keep your body straight. ', 6, 'step', 'img_exercise/DIAMONDPUSHUPS', 6, 6);
INSERT INTO `tbl_arm_beginner` VALUES (7, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start on all fours with your knees under your butt and your hands under your shoulders.\r\n\r\nMake a diamond shape with your forefingers and thumbs together directly under your face, then push your body up and down.\r\n\r\nRemember to keep your body straight. ', 30, 'time', 'img_exercise/JUMPINGJACKS', 7, 7);
INSERT INTO `tbl_arm_beginner` VALUES (8, 'CHEST PRESS PULSE', 'https://www.youtube.com/watch?v=gNywcYw-YSM', 'Hold your forearms together at shoulder height and bend your elbows with your hands together to make an \'L\' shape.\r\n\r\nThen lift your forearms up and down.', 16, 'time', 'img_exercise/CHESTPRESSPULSE', 8, 8);
INSERT INTO `tbl_arm_beginner` VALUES (9, 'LEG BARBELL CURL LEFT', 'https://www.youtube.com/watch?v=kwG2ipFRgfo', 'Stand against a wall. lift your right leg up, lean forward and grab underneath your right ankle with your left hand.\r\n\r\nBring the ankle up towards the shoulder as much as you can, then lower it and repeat the exercise.', 8, 'step', 'img_exercise/LEGBARBELLCURLLEFT', 9, 9);
INSERT INTO `tbl_arm_beginner` VALUES (10, 'LEG BARBEL CURL RIGHT', 'https://www.youtube.com/watch?v=kzohU7hbN9I', 'Stand against a wall. lift your left leg up, lean forward and grab underneath your left ankle with your right hand.\r\n\r\nBring the ankle up towards the shoulder as much as you can, then lower it and repeat the exercise.', 8, 'step', 'img_exercise/LEGBARBELLCURLRIGHT', 10, 10);
INSERT INTO `tbl_arm_beginner` VALUES (11, 'DIAGONAL PLANK', 'https://www.youtube.com/watch?v=CvykVqDRJjk', 'Start in the straight arm plank position. \r\n\r\nLift your arm and left leg until they are parallel with the ground. \r\n\r\nReturn to the start position and repeat with the other side.', 10, 'step', 'img_exercise/DIAGONALPLANK', 11, 11);
INSERT INTO `tbl_arm_beginner` VALUES (12, 'PUNCHES', 'https://www.youtube.com/watch?v=udo0RzY-9Cg', 'Stand with your legs shoulder width apart and your knees bent slightly. \r\n\r\nBend your elbows and clench your fists in front of your face.\r\n\r\nExtend one arm forward with the palm facing the floor. \r\n\r\nTake the arm back and repeat with the other arm.', 30, 'time', 'img_exercise/PUNCHES', 12, 12);
INSERT INTO `tbl_arm_beginner` VALUES (13, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 10, 'step', 'img_exercise/PUSHUPS', 13, 13);
INSERT INTO `tbl_arm_beginner` VALUES (14, 'INCHWORMS', 'https://www.youtube.com/watch?v=VSp0z7Mp5IU', 'Start with your feet shoulder width apart.\r\n\r\nBend your body and walk your hands in front of you as far as you can, then walk your hands back.\r\n\r\nRepeat the exercise.', 8, 'step', 'img_exercise/INCHWORMS', 14, 14);
INSERT INTO `tbl_arm_beginner` VALUES (15, 'WALL PUSHUPS', 'https://www.youtube.com/watch?v=EgU3CbtQTlw', 'Stand in front of a wall one big step away from it. \r\n\r\nThen put your hands out straight towards the wall and lean against it.\r\n\r\nSlowly bend your elbows and press your upper body towards the wall. \r\n\r\nPush back and repeat the exercise.\r\n\r\nRemember to keep your body straight.', 12, 'step', 'img_exercise/WALLPUSHUPS', 15, 15);
INSERT INTO `tbl_arm_beginner` VALUES (16, 'TRICEPS STRETCH LEFT', 'https://www.youtube.com/watch?v=eG28Fku9JoU', 'Put your left hand on your back, use your right hand to grab your left elbow and gently pull it.\r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/TRICEPSSTRETCHLEFT', 16, 16);
INSERT INTO `tbl_arm_beginner` VALUES (17, 'TRICEPS STRETCH RIGHT', 'https://www.youtube.com/watch?v=L4kWEPx18hA', 'Put your right hand on your back, use your left hand to grab your right elbow and gently pull it.\r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/TRICEPSSTRETCHRIGHT', 17, 17);
INSERT INTO `tbl_arm_beginner` VALUES (18, 'STANDING BICEPS STRETCH LEFT', 'https://www.youtube.com/watch?v=uqO6GGebKXA', 'Stand with your left arm close to a wall.\r\n\r\nExtend tour left arm and put your left hand on the wall, then gently turn gently turn body to the right.', 30, 'time', 'img_exercise/STANDINGBICEPSSTRETCHLEFT', 18, 18);
INSERT INTO `tbl_arm_beginner` VALUES (19, 'STANDING BICEPS STRETCH RIGHT', 'https://www.youtube.com/watch?v=uqO6GGebKXA', 'Stand with your right arm close to a wall.\r\n\r\nExtend tour right arm and put your left hand on the wall, then gently turn gently turn body to the left.', 30, 'time', 'img_exercise/STANDINGBICEPSSTRETCHRIGHT', 19, 19);
