INSERT INTO `tbl_arm_intermediate` VALUES (11, 'ALTERNATING HOOKS', 'https://www.youtube.com/watch?v=uWubZ8WIejY', 'Stand with your feet shoulder-width apart, and place your dominant foot slightly forward. \r\n\r\nSlightly bend your knees, clench your fists and bend your elbows at 90 degrees.\r\n\r\nRaise you right arm to shoulder height and keep your forearm parallel to the ground. \r\n\r\nRotate your shoulders and hips and punch towards the left.\r\n\r\nSwitch sides and repeat.', 30, 'time', 'img_exercise/ALTERNATINGHOOKS', 11, 11);
INSERT INTO `tbl_arm_intermediate` VALUES (12, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards.\r\n\r\nRepeat the exercise with the other arm, it\'s a great exercise for the chest, shoulders, arms and core.', 10, 'step', 'img_exercise/PUSHUPROTATION', 12, 12);
INSERT INTO `tbl_arm_intermediate` VALUES (13, 'LEG BARBEL CURL LEFT', 'https://www.youtube.com/watch?v=kwG2ipFRgfo', 'Stand against a wall.\r\n\r\nLift your right leg up.  Lean forward and grab underneath your right ankle with your left hand.\r\n\r\nBring the ankle up towards the shoulder as much as you can, the lower it and repeat the exercise.', 10, 'step', 'img_exercise/LEGBARBELLCURLLEFT', 13, 13);
INSERT INTO `tbl_arm_intermediate` VALUES (14, 'LEG BARBEL CURL RIGHT', 'https://www.youtube.com/watch?v=kzohU7hbN9I', 'Stand against a wall.\r\n\r\nLift your left leg up.\r\n\r\nlean forward and grab underneath your left ankle with your right hand.\r\n\r\nBring the ankle up towards the shoulder as much as you can, the lower it and repeat the exercise.', 10, 'step', 'img_exercise/LEGBARBELLCURLRIGHT', 14, 14);
INSERT INTO `tbl_arm_intermediate` VALUES (15, 'WALL PUSHUPS', 'https://www.youtube.com/watch?v=EgU3CbtQTlw', 'Stand in front of a wall one big step away from it.\r\n\r\nThen put your hands out straight towards the wall and lean against it.\r\n\r\nSlowly bend your elbows and press your upper body towards the wall.\r\n\r\nPush back and repeat the exercise. Remember to keep your body straight.', 12, 'step', 'img_exercise/WALLPUSHUPS', 15, 15);
INSERT INTO `tbl_arm_intermediate` VALUES (16, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 14, 'step', 'img_exercise/PUSHUPS', 16, 16);
INSERT INTO `tbl_arm_intermediate` VALUES (17, 'BURPEES', 'https://www.youtube.com/watch?v=wS4OsJ4yzx4', 'Stand with your feet shoulder width apart, then put your hands on the ground and kick your feet backward. \r\n\r\nDo quick push-up and then jump up.', 10, 'step', 'img_exercise/BURPEES', 17, 17);
INSERT INTO `tbl_arm_intermediate` VALUES (18, 'ARM SCISSORS', 'https://www.youtube.com/watch?v=Cilm0WNRdCo', 'Stand upright with your feet shoulder width apart.\r\n\r\nStretch your arms in front of you at shoulder height with one arm overlap the other in the shape of the letter\'x\', and then spread them apart.\r\n\r\nSwitch arms, and repeat the exercise.', 30, 'time', 'img_exercise/ARMSCISSORS', 18, 18);
INSERT INTO `tbl_arm_intermediate` VALUES (19, 'SKIPPING WITHOUT ROPE', 'https://www.youtube.com/watch?v=Mj6NezKTLmw', 'Place your arms at your sides and pretend to hold a skipping rope handle in each hand.\r\n\r\nJump and alternately land on the balls of your feet, rotating your wrists at the same time as if you were spinning a rose.', 30, 'time', 'img_exercise/SKIPPINGWITHOUTROPE', 19, 19);
INSERT INTO `tbl_arm_intermediate` VALUES (20, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 12, 'step', 'img_exercise/PUSHUPS', 20, 20);
INSERT INTO `tbl_arm_intermediate` VALUES (21, 'BURPEES', 'https://www.youtube.com/watch?v=wS4OsJ4yzx4', 'Stand with your feet shoulder width apart, then put your hands on the ground and kick your feet backward.\r\n\r\nDo quick push-up and then jump up.', 8, 'step', 'img_exercise/BURPEES', 21, 21);
INSERT INTO `tbl_arm_intermediate` VALUES (22, 'TRICEPS STRETCH LEFT', 'https://www.youtube.com/watch?v=eG28Fku9JoU', 'Put your left hand on your back, use your right hand to grab your left elbow and gently pull it.\r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/TRICEPSSTRETCHLEFT', 22, 22);
INSERT INTO `tbl_arm_intermediate` VALUES (23, 'TRICEPS STRETCH RIGHT', 'https://www.youtube.com/watch?v=L4kWEPx18hA', 'Put your right hand on your back, use your left hand to grab your right elbow and gently pull it.\r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/TRICEPSSTRETCHRIGHT', 23, 23);
INSERT INTO `tbl_arm_intermediate` VALUES (24, 'STANDING BICEPS STRETCH LEFT', 'https://www.youtube.com/watch?v=uqO6GGebKXA', 'Stand with your left arm close to a wall.\r\n\r\nExtend tour left arm and put your left hand on the wall, then gently turn gently turn body to the right.', 30, 'time', 'img_exercise/STANDINGBICEPSSTRETCHLEFT', 24, 24);
INSERT INTO `tbl_arm_intermediate` VALUES (25, 'STANDING BICEPS STRETCH RIGHT', 'https://www.youtube.com/watch?v=uqO6GGebKXA', 'Stand with your right arm close to a wall.\r\n\r\nExtend tour right arm and put your left hand on the wall, then gently turn gently turn body to the left.', 30, 'time', 'img_exercise/STANDINGBICEPSSTRETCHRIGHT', 25, 25);
INSERT INTO `tbl_chest_advanced` VALUES (1, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups', 30, 'time', 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_chest_advanced` VALUES (2, 'ARM CIRCLES', 'https://www.youtube.com/watch?v=140RTNMciH8', 'Stand on the floor with your arms extended straight out to the sides at shoulder height.\r\n\r\nMove your arms forward in circles, and then move backwards.', 20, 'step', 'img_exercise/ARMCIRCLESCLOCKWISE', 2, 2);
INSERT INTO `tbl_chest_advanced` VALUES (3, 'SHOULDER STRETCH', 'https://www.youtube.com/watch?v=K8sr1CGmKRw', 'place one arm across your body, parallel to the ground, then use the other arm to pull the parallel arm toward your chest.\r\n\r\nHold for a while, switch arms and repeat the exercise. \r\n\r\nKeep the inside arm straight during the exercise.', 30, 'time', 'img_exercise/SHOULDERSTRETCH', 3, 3);
INSERT INTO `tbl_chest_advanced` VALUES (4, 'BURPEES', 'https://www.youtube.com/watch?v=wS4OsJ4yzx4', 'Stand with your feet shoulder with apart, then put your hands on the ground and kick your feet backward.\r\n\r\nDo a quick push-up and then jump up.', 10, 'step', 'img_exercise/BURPEES', 4, 4);
INSERT INTO `tbl_chest_advanced` VALUES (5, 'STAGGERED PUSHUPS', 'https://www.youtube.com/watch?v=lg8Mo5dr2No', 'Start in the regular push-up position, but with one hand in front of the other.\r\n\r\nThe do a push-up and switch the other hand in front.\r\n\r\nRemember to keep your body straight.', 16, 'step', 'img_exercise/STAGGEREDPUSHUPS', 5, 5);
INSERT INTO `tbl_chest_advanced` VALUES (6, 'HINDU PUSHUPS', 'https://www.youtube.com/watch?v=nBLy1IGtSJ8', 'Start with your hands and feet touching the floor, body bent and butt up in an upside down \'V\' shape.\r\n\r\nThen bend your elbows to bring your body towards the floor.\r\n\r\nWhen your body is close to the floor, raise your upper body up as far as possible.\r\n\r\nThe return to the original position and repeat.', 16, 'step', 'img_exercise/HINDUPUSHUPS', 6, 6);
INSERT INTO `tbl_chest_advanced` VALUES (7, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards.\r\n\r\nRepeat the exercise with the other arm, it\'s a great exercise for the chest, shoulders, arms and core.', 12, 'step', 'img_exercise/PUSHUPROTATION', 7, 7);
INSERT INTO `tbl_chest_advanced` VALUES (8, 'DIAMOND PUSHUPS', 'https://www.youtube.com/watch?v=jaxbEHLC4qU', 'Start on all fours with your knees under your butt and your hands under your shoulders.\r\n\r\nMake a diamond shape with your forefingers and thumbs together directly under your face, then push your body up and down.\r\n\r\nRemember to keep your body straight. ', 16, 'step', 'img_exercise/DIAMONDPUSHUPS', 8, 8);
INSERT INTO `tbl_chest_advanced` VALUES (9, 'BOX PUSHUPS', 'https://www.youtube.com/watch?v=dmoHFWt-Mms', 'Start on all fours with your knees under your butt and your hands directly under your shoulders.\r\n\r\nBend your elbows and do a push-up. \r\n\r\nReturn to the start position and repeat.', 12, 'step', 'img_exercise/BOXPUSHUPS', 9, 9);
INSERT INTO `tbl_chest_advanced` VALUES (10, 'HINDU PUSHUPS', 'https://www.youtube.com/watch?v=nBLy1IGtSJ8', 'Start with your hands and feet touching the floor, body bent and butt up in an upside down \'V\' shape.\r\n\r\nThen bend your elbows to bring your body towards the floor.\r\n\r\nWhen your body is close to the floor, raise your upper body up as far as possible.\r\n\r\nThe return to the original position and repeat.', 12, 'step', 'img_exercise/HINDUPUSHUPS', 10, 10);
INSERT INTO `tbl_chest_advanced` VALUES (11, 'SPIDERMAN PUSHUPS', 'https://www.youtube.com/watch?v=DYONORexgpY', 'Start in the regular push-up position. When lowering your torso download, bend and lift one leg to the side.\r\n\r\nThe return to the start position and switch to the other leg.\r\n\r\nRemember to keep your body straight.', 20, 'step', 'img_exercise/SPIDERMANPUSHUPS', 11, 11);
INSERT INTO `tbl_chest_advanced` VALUES (12, 'DECLINE PUSHUPS', 'https://www.youtube.com/watch?v=PXIpw1JD4qw', 'Start on all fours with your knees under your butt and your hands under your shoulders.\r\n\r\nThen elevate your feet on a chair or bench, and push your body up and down mainly using your arm strength.\r\n\r\nRemember to keep your body straight.', 12, 'step', 'img_exercise/DECLINEPUSHUPS', 12, 12);
INSERT INTO `tbl_chest_advanced` VALUES (13, 'BURPEES', 'https://www.youtube.com/watch?v=wS4OsJ4yzx4', 'Stand with your feet shoulder with apart, then put your hands on the ground and kick your feet backward. \r\n\r\nDo a quick push-up and then jump up.', 10, 'step', 'img_exercise/BURPEES', 13, 13);
INSERT INTO `tbl_chest_advanced` VALUES (14, 'SHOULDER STRETCH', 'https://www.youtube.com/watch?v=K8sr1CGmKRw', 'Place one arm across your body, parallel to the ground, then use the other arm to pull the parallel arm toward your chest.\r\n\r\nHold for a while, switch arms and repeat the exercise. \r\n\r\nKeep the inside arm straight during the exercise.', 30, 'time', 'img_exercise/SHOULDERSTRETCH', 14, 14);
INSERT INTO `tbl_chest_advanced` VALUES (15, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 30, 'time', 'img_exercise/COBRASTRETCH', 15, 15);
INSERT INTO `tbl_chest_advanced` VALUES (16, 'CHEST STRETCH', 'https://www.youtube.com/watch?v=Kvo7054R3fQ', 'Find a doorway, take a lunge position in the doorway with your arms on the doorframe and your elbows a little lower than your shoulders, then slowly bring your chest forward.\r\n\r\nHold this position for 30-40 seconds. The slowly come out of it, bring your arms down and do a couple of shoulder rolls.\r\n\r\nDon\'t pull your head forward, and keep your neck relaxed.', 30, 'time', 'img_exercise/CHESTSTRETCH', 16, 16);
INSERT INTO `tbl_chest_beginner` VALUES (1, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups', 30, 'time', 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_chest_beginner` VALUES (2, 'INCLINE PUSHUPS', 'https://www.youtube.com/watch?v=3WGP7sn2_OI', 'Start in the regular push-up position but with your hands elevated on a chair or bench.\r\n\r\nThen push your body up down using your arm strength.\r\n\r\nRemeember to keep your body straight.', 16, 'step', 'img_exercise/INCLINEPUSHUPS', 2, 2);
INSERT INTO `tbl_chest_beginner` VALUES (3, 'KNEE PUSHUPS', 'https://www.youtube.com/watch?v=dmoHFWt-Mms', 'Start in the regular push-up position, then let your knees touch the floor and raise your feet up off the floor.\r\n\r\nNext push your body up and down', 12, 'step', 'img_exercise/KNEEPUSHUPS', 3, 3);
INSERT INTO `tbl_chest_beginner` VALUES (4, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 10, 'step', 'img_exercise/PUSHUPS', 4, 4);
