INSERT INTO `tbl_full_body_workouts_list` VALUES (8, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 'step', 4, '6', '8', 1, 1, 1, 0, 'img_exercise/PUSHUPS', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (9, 'WIDE ARM PUSHUPS', 'https://www.youtube.com/watch?v=dmoHFWt-Mms', 'start in the regular push-up position but with your hands spread wider than your shoulders.\r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 4, '6', '8', 1, 1, 1, 0, 'img_exercise/WIDEARMPUSHUPS', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (10, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 20, '00:20', '00:20', 1, 1, 1, 0, 'img_exercise/COBRASTRETCH', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (11, 'CHEST STRETCH', 'https://www.youtube.com/watch?v=Kvo7054R3fQ', 'Find a doorway, take a lunge position in the doorway with your arms on the doorframe and your elbows a little lower than your shoulders, then slowly bring your chest forward\r\n\r\nHold this position for 30-40 seconds. \r\n\r\nThe slowly come out of it, bring your arms down and do a couple of shoulder rolls.\r\n\r\nDon`t pull your head forward, and keep your neck relaxed.', 'time', 20, '00:20', '00:20', 1, 1, 1, 0, 'img_exercise/CHESTSTRETCH', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (12, 'ABDOMINAL CRUNCHES', 'https://www.youtube.com/watch?v=Xyd_fa5zoEU', 'Lie on your back with your knees bent and your arms stretched forward.\r\n\r\nThen lift your upper body off the floor. \r\n\r\nHold for a few seconds and slowly return.\r\n\r\nIt primarily works the rectus abdominis muscle and the obliques.', 'step', 10, '10', '10', 2, 1, 1, 0, 'img_exercise/ABDOMINALCRUNCHES', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (13, 'RUSSIAN TWIST', 'https://www.youtube.com/watch?v=wkD8rjkodUI', 'Sit on the floor with your knees bent, feet lifted a little bit and back tilted backwords. \r\n\r\nThen hold your hands together and twist from side to side.', 'step', 12, '12', '12', 2, 1, 1, 0, 'img_exercise/RUSSIANTWIST', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (14, 'HEEL TOUCH', 'https://www.youtube.com/watch?v=RW25fbkQxVQ', 'Lie on the ground with your legs bent and your arms by your sides.\r\n \r\nSlightly lift your body of the floor and make your hands alternately reach your heels.', 'step', 16, '16', '16', 2, 1, 1, 0, 'img_exercise/HEELTOUCH', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (15, 'MOUNTAIN CLIMBER', 'https://www.youtube.com/watch?v=nmwgirgXLYM', 'Start in the push-up position. \r\n\r\nBend your right knee towards your chest and keep your left leg straight, then quickly switch from one leg to the other. \r\n\r\nThis exercise strengthens multiple muscle groups.', 'step', 12, '12', '12', 2, 1, 1, 0, 'img_exercise/MOUNTAINCLIMBER', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (16, 'LEG RAISES', 'https://www.youtube.com/watch?v=JB2oyawG9KI', 'Lie down on your back, and put your hands beneath your hips for support. \r\n\r\nThen lift your legs up until they form a right angle with the floor. \r\n\r\nSlowly bring your legs back down and repeat the exercise.', 'step', 12, '12', '12', 2, 1, 1, 0, 'img_exercise/LEGRAISES', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (17, 'PLANK', 'https://www.youtube.com/watch?v=pSHjTRCQxIw', 'Lie on the floor with your toes and forearms on the ground.\r\n\r\nKeep your body straight and hold this position as long as you can. \r\n\r\nThis exercise strengthens the abdomen, back and shoulders.', 'time', 30, '00:30', '00:30', 2, 1, 1, 0, 'img_exercise/PLANK', 6, 6);
