INSERT INTO `tbl_full_body_workouts_list` VALUES (25, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=Im5nE3J558k', 'Lie on your back with your legs extended.\r\n \r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 'time', 30, '00:30', '00:30', 2, 1, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (26, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 2, 1, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (27, 'ARM RAISES', 'https://www.youtube.com/watch?v=D-3JnFrFUOw', 'Stand on the floor with your arms extended straight forward ar shoulder height. \r\n\r\nRaise your arms above your head. \r\n\r\nReturn to the start position and repeat.', 'step', 16, '16', '16', 3, 1, 1, 0, 'img_exercise/ARMRAISES', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (28, 'RHOMBOID PULLS', 'https://www.youtube.com/watch?v=XOs0waYd6hk', 'Stand with your feet shoulder width apart. \r\n\r\nRaise your arms parallel to the ground, and bend your elbows. Pull your elbows back and squeeze your shoulder blades. \r\n\r\nRepeat this exercise.', 'step', 14, '14', '14', 3, 1, 1, 0, 'img_exercise/RHOMBOIDPULLS', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (29, 'SIDE ARM RAISE', 'https://www.youtube.com/watch?v=ww0r9xZunDM', 'Stand with your feet shoulder width apart. \r\n\r\nRaise your arms to the sides at shoulder height, then put them down. \r\n\r\nRepeat the exercise. \r\n\r\nKeep your arms straight during the exercise.', 'step', 16, '16', '16', 3, 1, 1, 0, 'img_exercise/SIDEARMRAISE', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (30, 'KNEE PUSHUPS', 'https://www.youtube.com/watch?v=dmoHFWt-Mms', 'Start in the regular push-up position, then let your knees touch the floor and raise your feet up off the floor.\r\n\r\nNext push your body up and down.', 'step', 14, '14', '14', 3, 1, 1, 0, 'img_exercise/KNEEPUSHUPS', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (31, 'INCHWORMS', 'https://www.youtube.com/watch?v=VSp0z7Mp5IU', 'Start with your feet shoulder width apart.\r\n\r\nBend your body and walk your hands in front of you as far as you can, then walk your hands back. \r\n\r\nRepeat the exercise.', 'step', 10, '10', '10', 3, 1, 1, 0, 'img_exercise/INCHWORMS', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (32, 'SIDE LYING FLOOR STRETCH LEFT', 'https://www.youtube.com/watch?v=pdgohzanlco', 'Lie on your right side with your right knee slightly bent in front of you and your left leg stretched behind the right leg. \r\n\r\nStraighten your left arms over your head and gently pull on your left wrist to stretch the left side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 3, 1, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHLEFT', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (33, 'SIDE LYING FLOOR STRETCH RIGHT', 'https://www.youtube.com/watch?v=lBdM0Zurwyo', 'Lie on your left side with your left knee slightly bent in front of you and your right leg stretched behind the left leg. \r\n\r\nStraighten your right arms over your head and gently pull on your right wrist to stretch the right side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 3, 1, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHRIGHT', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (34, 'ARM SCISSORS', 'https://www.youtube.com/watch?v=Cilm0WNRdCo', 'Stand upright with your feet sholder width apart. \r\n\r\nStretch your arms in front of you at shoulder height with one arm overlap the other in the shape of the letter \"X\", and then spread them apart.\r\n\r\nSwitch arms, and repeat the exercise.', 'step', 30, '30', '30', 3, 1, 1, 0, 'img_exercise/ARMSCISSORS', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (35, 'RHOMBOID PULLS', 'https://www.youtube.com/watch?v=XOs0waYd6hk', 'Stand with your feet shoulder width apart. \r\n\r\nRaise your arms parallel to the ground, and bend your elbows. Pull your elbows back and squeeze your shoulder blades. \r\n\r\nRepeat this exercise.', 'step', 12, '12', '12', 3, 1, 1, 0, 'img_exercise/RHOMBOIDPULLS', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (36, 'SIDE ARM RAISE', 'https://www.youtube.com/watch?v=ww0r9xZunDM', 'Stand with your feet shoulder width apart. \r\n\r\nRaise your arms to the sides at shoulder height, then put them down. \r\n\r\nRepeat the exercise. \r\n\r\nKeep your arms straight during the exercise.', 'step', 14, '14', '14', 3, 1, 1, 0, 'img_exercise/SIDEARMRAISE', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (37, 'KNEE PUSHUPS', 'https://www.youtube.com/watch?v=dmoHFWt-Mms', 'Start in the regular push-up position, then let your knees touch the floor and raise your feet up off the floor.\r\n\r\nNext push your body up and down.', 'step', 12, '12', '12', 3, 1, 1, 0, 'img_exercise/KNEEPUSHUPS', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (38, 'CAT COW POSE', 'https://www.youtube.com/watch?v=y39PrKY_4JM&list=RDQMVCd2F3GXNEQ&start_radio=1', 'Start on all fours with your knees under your butt and your hands directly under your shoulders.\r\n\r\nThen take a breath and make your belly fall down, shoulders roll back and head come up towards the ceiling. \r\n\r\nAs you exhale, curve your back upward and left your head come down. \r\n\r\nRepeat the exercise. \r\n\r\nDo it slowly with each step of this exercise.', 'time', 30, '00:30', '00:30', 3, 1, 1, 0, 'img_exercise/CATCOWPOSE', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (39, 'PRONE TRICEPS PUSHUPS', 'https://www.youtube.com/watch?v=JjUBO22JaMI', 'Lie on your stomach with your hands underneath your shoulders and your elbows bent. \r\n\r\nSlightly raise your chest up, and then go back to the start position. \r\n\r\nRepeat this exersice.', 'step', 14, '14', '14', 3, 1, 1, 0, 'img_exercise/PRONETRICEPSPUSHUPS', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (40, 'RECLINED RHOMBOID SQUEEZES', 'https://www.youtube.com/watch?v=RqRwRE0CEoA', 'Sit with your knees bent. Slightly lean your upper body back. \r\n\r\nStretch your arms in front of you, then pull your elbows back to make your elbows at a 90 degree angle and squeeze your sholder blades.\r\n \r\nRepeat this exercise.', 'step', 12, '12', '12', 3, 1, 1, 0, 'img_exercise/RECLINEDRHOMBOIDSQUEEZES', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (41, 'PRONE TRICEPS PUSHUPS', 'https://www.youtube.com/watch?v=JjUBO22JaMI', 'Lie on your stomach with your hands underneath your shoulders and your elbows bent. \r\n\r\nSlightly raise your chest up, and then go back to the start position. \r\n\r\nRepeat this exersice.', 'step', 14, '14', '14', 3, 1, 1, 0, 'img_exercise/PRONETRICEPSPUSHUPS', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (42, 'RECLINED RHOMBOID SQUEEZES', 'https://www.youtube.com/watch?v=RqRwRE0CEoA', 'Sit with your knees bent. Slightly lean your upper body back. \r\n\r\nStretch your arms in front of you, then pull your elbows back to make your elbows at a 90 degree angle and squeeze your sholder blades.\r\n \r\nRepeat this exercise.', 'step', 12, '12', '12', 3, 1, 1, 0, 'img_exercise/RECLINEDRHOMBOIDSQUEEZES', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (43, 'CHILD\'S POSE', 'https://www.youtube.com/watch?v=2MJGg-dUKh0', 'Start with your knees and hands on the floor. \r\n\r\nPut your hands a little forward, widen your knees and put your toes together.\r\n \r\nTake a breath, then exhale and sit back. \r\n\r\nTry to make your butt touch your heels. \r\n\r\nRelax your elbows, make your forehead touch the floor and try to lower your chest close to the floor. Hold thid position. \r\n\r\nKeep your arms stretched forward as you sit back. \r\n\r\nMake sure there is enough space between your shoulders and ears during the exercise.', 'time', 30, '00:30', '00:30', 3, 1, 1, 0, 'img_exercise/CHILDSPOSE', 17, 17);
INSERT INTO `tbl_full_body_workouts_list` VALUES (44, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups.', 'time', 30, '00:30', '00:30', 4, 1, 1, 0, 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (45, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 'step', 4, '6', '10', 4, 1, 1, 0, 'img_exercise/PUSHUPS', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (46, 'WIDE ARM PUSHUPS', 'https://www.youtube.com/watch?v=dmoHFWt-Mms', 'start in the regular push-up position but with your hands spread wider than your shoulders.\r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 4, '6', '10', 4, 1, 1, 0, 'img_exercise/WIDEARMPUSHUPS', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (47, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt\'s a great exercise for the chest, shoulders, arms and core.', 'step', 4, '6', '6', 4, 1, 1, 0, 'img_exercise/PUSHUPROTATION', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (48, 'STAGGERED PUSHUPS', 'https://www.youtube.com/watch?v=lg8Mo5dr2No', 'Start in the regular push-up position, but with one hand in front of the other. \r\n\r\nThen do a push-up and switch the other hand in front. \r\n\r\nRemember to keep your body straight.', 'step', 4, '6', '6', 4, 1, 1, 0, 'img_exercise/STAGGEREDPUSHUPS', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (49, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 'step', 4, '6', '10', 4, 1, 1, 0, 'img_exercise/PUSHUPS', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (50, 'WIDE ARM PUSHUPS', 'https://www.youtube.com/watch?v=dmoHFWt-Mms', 'start in the regular push-up position but with your hands spread wider than your shoulders.\r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 4, '6', '10', 4, 1, 1, 0, 'img_exercise/WIDEARMPUSHUPS', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (51, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt`s a great exercise for the chest, shoulders, arms and core.', 'step', 4, '4', '4', 4, 1, 1, 0, 'img_exercise/PUSHUPROTATION', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (52, 'DECLINE PUSHUPS', 'https://www.youtube.com/watch?v=PXIpw1JD4qw', 'Start on all fours with your knees under your butt and your hands under your sholders. \r\n\r\nThen elevate your feet on a chair or bench, and push your body up and down mainly using your arm strength. \r\n\r\nRemeember to keep your body straight.', 'step', 4, '4', '6', 4, 1, 1, 0, 'img_exercise/DECLINEPUSHUPS', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (53, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 30, '00:30', '00:30', 4, 1, 1, 0, 'img_exercise/COBRASTRETCH', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (54, 'CHEST STRETCH', 'https://www.youtube.com/watch?v=Kvo7054R3fQ', 'Find a doorway, take a lunge position in the doorway with your arms on the doorframe and your elbows a little lower than your shoulders, then slowly bring your chest forward.\r\n\r\nHold this position for 30-40 seconds. \r\n\r\nThe slowly come out of it, bring your arms down and do a couple of shoulder rolls.\r\n\r\nDon\'t pull your head forward, and keep your neck relaxed.', 'time', 30, '00:30', '00:30', 4, 1, 1, 0, 'img_exercise/CHESTSTRETCH', 11, 11);
