INSERT INTO `tbl_full_body_workouts_list` VALUES (56, 'LEG RAISES', 'https://www.youtube.com/watch?v=JB2oyawG9KI', 'Lie down on your back, and put your hands beneath your hips for support. \r\n\r\nThen lift your legs up until they form a right angle with the floor. \r\n\r\nSlowly bring your legs back down and repeat the exercise.', 'step', 14, '14', '14', 5, 1, 1, 0, 'img_exercise/LEGRAISES', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (57, 'BUTT BRIDGE', 'https://www.youtube.com/watch?v=rWzV67w5-vU', 'Lie on your back with knees bent and feet flat on the floor. \r\n\r\nPut your arms flat at your sides. \r\n\r\nThen lift your butt up and down.', 'step', 10, '10', '10', 5, 1, 1, 0, 'img_exercise/BUTTBRIDGE', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (58, 'SIDE BRIDGES LEFT', 'https://www.youtube.com/watch?v=zyZaGLoEUC4', 'Lie on your right side. Put your right elbow directly under your shoulders and put your left hand on your waist. \r\n\r\nPlace your left leg on your right leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 'step', 10, '10', '10', 5, 1, 1, 0, 'img_exercise/SIDEBRIDGESLEFT', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (59, 'SIDE BRIDGES RIGHT', 'https://www.youtube.com/watch?v=Ko9jId015qc', 'Lie on your left side. Put your left elbow directly under your shoulders and put your right hand on your waist. \r\n\r\nPlace your right leg on your left leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 'step', 10, '10', '10', 5, 1, 1, 0, 'img_exercise/SIDEBRIDGESRIGHT', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (60, 'ABDOMINAL CRUNCHES', 'https://www.youtube.com/watch?v=Xyd_fa5zoEU', 'Lie on your back with your knees bent and your arms stretched forward.\r\n\r\nThen lift your upper body off the floor. \r\n\r\nHold for a few seconds and slowly return.\r\n\r\nIt primarily works the rectus abdominis muscle and the obliques.', 'step', 12, '12', '12', 5, 1, 1, 0, 'img_exercise/ABDOMINALCRUNCHES', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (61, 'RUSSIAN TWIST', 'https://www.youtube.com/watch?v=wkD8rjkodUI', 'Sit on the floor with your knees bent, feet lifted a little bit and back tilted backwords. \r\n\r\nThen hold your hands together and twist from side to side.', 'step', 14, '14', '14', 5, 1, 1, 0, 'img_exercise/RUSSIANTWIST', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (62, 'LEG RAISES', 'https://www.youtube.com/watch?v=JB2oyawG9KI', 'Lie down on your back, and put your hands beneath your hips for support. \r\n\r\nThen lift your legs up until they form a right angle with the floor. \r\n\r\nSlowly bring your legs back down and repeat the exercise.', 'step', 14, '14', '14', 5, 1, 1, 0, 'img_exercise/LEGRAISES', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (63, 'BUTT BRIDGE', 'https://www.youtube.com/watch?v=rWzV67w5-vU', 'Lie on your back with knees bent and feet flat on the floor. \r\n\r\nPut your arms flat at your sides. \r\n\r\nThen lift your butt up and down.', 'step', 10, '10', '10', 5, 1, 1, 0, 'img_exercise/BUTTBRIDGE', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (64, 'SIDE BRIDGES LEFT', 'https://www.youtube.com/watch?v=zyZaGLoEUC4', 'Lie on your right side. Put your right elbow directly under your shoulders and put your left hand on your waist. \r\n\r\nPlace your left leg on your right leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 'step', 8, '8', '8', 5, 1, 1, 0, 'img_exercise/SIDEBRIDGESLEFT', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (65, 'SIDE BRIDGES RIGHT', 'https://www.youtube.com/watch?v=Ko9jId015qc', 'Lie on your left side. Put your left elbow directly under your shoulders and put your right hand on your waist. \r\n\r\nPlace your right leg on your left leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 'step', 8, '8', '8', 5, 1, 1, 0, 'img_exercise/SIDEBRIDGESRIGHT', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (66, 'V UP', 'https://www.youtube.com/watch?v=riAutegDqdI', 'Lie on your back with your arms and legs extended and your legs squeezed together. \r\n\r\nRaise your upper body and legs, use your arms to touch your toes, then go back to the start position and repeat the exercise.', 'step', 10, '10', '10', 5, 1, 1, 0, 'img_exercise/VUP', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (67, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt`s a great exercise for the chest, shoulders, arms and core.', 'step', 10, '10', '10', 5, 1, 1, 0, 'img_exercise/PUSHUPROTATION', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (68, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 30, '00:30', '00:30', 5, 1, 1, 0, 'img_exercise/COBRASTRETCH', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (69, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=Im5nE3J558k', 'Lie on your back with your legs extended.\r\n \r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 'time', 30, '00:30', '00:30', 5, 1, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (70, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 5, 1, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (71, 'ARM SCISSORS', 'https://www.youtube.com/watch?v=Cilm0WNRdCo', 'Stand upright with your feet sholder width apart. \r\n\r\nStretch your arms in front of you at shoulder height with one arm overlap the other in the shape of the letter \"X\", and then spread them apart.\r\n\r\nSwitch arms, and repeat the exercise.', 'step', 30, '30', '30', 6, 1, 1, 0, 'img_exercise/ARMSCISSORS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (72, 'RHOMBOID PULLS', 'https://www.youtube.com/watch?v=XOs0waYd6hk', 'Stand with your feet shoulder width apart. \r\n\r\nRaise your arms parallel to the ground, and bend your elbows. Pull your elbows back and squeeze your shoulder blades. \r\n\r\nRepeat this exercise.', 'step', 14, '14', '14', 6, 1, 1, 0, 'img_exercise/RHOMBOIDPULLS', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (73, 'TRICEPS KICKBACKS', 'https://www.youtube.com/watch?v=ZO81bExngMI', 'Lean forward, bend your knees and your elbows.\r\n \r\nExtend your arms behind you and squeeze your triceps. \r\n\r\nPlease make your arms parallel to the ground when extending them. \r\n\r\nGo back to the start position, and repeat this exercise.', 'step', 6, '6', '6', 6, 1, 1, 0, 'img_exercise/TRICEPSKICKBACKS', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (74, 'INCLINE PUSHUPS', 'https://www.youtube.com/watch?v=3WGP7sn2_OI', 'Start in the regular push-up position but with your hands elevated on a chair or bench.\r\n\r\nThen push your body up down using your arm strength.\r\n\r\nRemeember to keep your body straight.', 'step', 6, '6', '6', 6, 1, 1, 0, 'img_exercise/INCLINEPUSHUPS', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (75, 'SIDE LYING FLOOR STRETCH LEFT', 'https://www.youtube.com/watch?v=pdgohzanlco', 'Lie on your right side with your right knee slightly bent in front of you and your left leg stretched behind the right leg. \r\n\r\nStraighten your left arms over your head and gently pull on your left wrist to stretch the left side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 6, 1, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHLEFT', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (76, 'SIDE LYING FLOOR STRETCH RIGHT', 'https://www.youtube.com/watch?v=lBdM0Zurwyo', 'Lie on your left side with your left knee slightly bent in front of you and your right leg stretched behind the left leg. \r\n\r\nStraighten your right arms over your head and gently pull on your right wrist to stretch the right side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 6, 1, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHRIGHT', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (77, 'ARM RAISES', 'https://www.youtube.com/watch?v=D-3JnFrFUOw', 'Stand on the floor with your arms extended straight forward ar shoulder height. \r\n\r\nRaise your arms above your head. \r\n\r\nReturn to the start position and repeat.', 'step', 16, '16', '16', 6, 1, 1, 0, 'img_exercise/ARMRAISES', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (78, 'RHOMBOID PULLS', 'https://www.youtube.com/watch?v=XOs0waYd6hk', 'Stand with your feet shoulder width apart. \r\n\r\nRaise your arms parallel to the ground, and bend your elbows. Pull your elbows back and squeeze your shoulder blades. \r\n\r\nRepeat this exercise.', 'step', 12, '12', '12', 6, 1, 1, 0, 'img_exercise/RHOMBOIDPULLS', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (79, 'INCHWORMS', 'https://www.youtube.com/watch?v=VSp0z7Mp5IU', 'Start with your feet shoulder width apart.\r\n\r\nBend your body and walk your hands in front of you as far as you can, then walk your hands back. \r\n\r\nRepeat the exercise.', 'step', 10, '10', '10', 6, 1, 1, 0, 'img_exercise/INCHWORMS', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (80, 'TRICEPS KICKBACKS', 'https://www.youtube.com/watch?v=ZO81bExngMI', 'Lean forward, bend your knees and your elbows.\r\n \r\nExtend your arms behind you and squeeze your triceps. \r\n\r\nPlease make your arms parallel to the ground when extending them. \r\n\r\nGo back to the start position, and repeat this exercise.', 'step', 6, '6', '6', 6, 1, 1, 0, 'img_exercise/TRICEPSKICKBACKS', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (81, 'INCLINE PUSHUPS', 'https://www.youtube.com/watch?v=3WGP7sn2_OI', 'Start in the regular push-up position but with your hands elevated on a chair or bench.\r\n\r\nThen push your body up down using your arm strength.\r\n\r\nRemeember to keep your body straight.', 'step', 6, '6', '6', 6, 1, 1, 0, 'img_exercise/INCLINEPUSHUPS', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (82, 'CAT COW POSE', 'https://www.youtube.com/watch?v=y39PrKY_4JM&list=RDQMVCd2F3GXNEQ&start_radio=1', 'Start on all fours with your knees under your butt and your hands directly under your shoulders.\r\n\r\nThen take a breath and make your belly fall down, shoulders roll back and head come up towards the ceiling. \r\n\r\nAs you exhale, curve your back upward and left your head come down. \r\n\r\nRepeat the exercise. \r\n\r\nDo it slowly with each step of this exercise.', 'time', 30, '00:30', '00:30', 6, 1, 1, 0, 'img_exercise/CATCOWPOSE', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (83, 'PRONE TRICEPS PUSHUPS', 'https://www.youtube.com/watch?v=JjUBO22JaMI', 'Lie on your stomach with your hands underneath your shoulders and your elbows bent. \r\n\r\nSlightly raise your chest up, and then go back to the start position. \r\n\r\nRepeat this exersice.', 'step', 14, '14', '14', 6, 1, 1, 0, 'img_exercise/PRONETRICEPSPUSHUPS', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (84, 'RECLINED RHOMBOID SQUEEZES', 'https://www.youtube.com/watch?v=RqRwRE0CEoA', 'Sit with your knees bent. Slightly lean your upper body back. \r\n\r\nStretch your arms in front of you, then pull your elbows back to make your elbows at a 90 degree angle and squeeze your sholder blades.\r\n \r\nRepeat this exercise.', 'step', 12, '12', '12', 6, 1, 1, 0, 'img_exercise/RECLINEDRHOMBOIDSQUEEZES', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (85, 'PRONE TRICEPS PUSHUPS', 'https://www.youtube.com/watch?v=JjUBO22JaMI', 'Lie on your stomach with your hands underneath your shoulders and your elbows bent. \r\n\r\nSlightly raise your chest up, and then go back to the start position. \r\n\r\nRepeat this exersice.', 'step', 14, '14', '14', 6, 1, 1, 0, 'img_exercise/PRONETRICEPSPUSHUPS', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (86, 'RECLINED RHOMBOID SQUEEZES', 'https://www.youtube.com/watch?v=RqRwRE0CEoA', 'Sit with your knees bent. Slightly lean your upper body back. \r\n\r\nStretch your arms in front of you, then pull your elbows back to make your elbows at a 90 degree angle and squeeze your sholder blades.\r\n \r\nRepeat this exercise.', 'step', 12, '12', '12', 6, 1, 1, 0, 'img_exercise/RECLINEDRHOMBOIDSQUEEZES', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (87, 'CHILD\'S POSE', 'https://www.youtube.com/watch?v=2MJGg-dUKh0', 'Start with your knees and hands on the floor. \r\n\r\nPut your hands a little forward, widen your knees and put your toes together.\r\n \r\nTake a breath, then exhale and sit back. \r\n\r\nTry to make your butt touch your heels. \r\n\r\nRelax your elbows, make your forehead touch the floor and try to lower your chest close to the floor. Hold thid position. \r\n\r\nKeep your arms stretched forward as you sit back. \r\n\r\nMake sure there is enough space between your shoulders and ears during the exercise.', 'time', 30, '00:30', '00:30', 6, 1, 1, 0, 'img_exercise/CHILDSPOSE', 17, 17);
INSERT INTO `tbl_full_body_workouts_list` VALUES (88, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups.', 'time', 30, '00:30', '00:30', 7, 1, 1, 0, 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (89, 'INCLINE PUSHUPS', 'https://www.youtube.com/watch?v=3WGP7sn2_OI', 'Start in the regular push-up position but with your hands elevated on a chair or bench.\r\n\r\nThen push your body up down using your arm strength.\r\n\r\nRemeember to keep your body straight.', 'step', 8, '12', '18', 7, 1, 1, 0, 'img_exercise/INCLINEPUSHUPS', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (90, 'WIDE ARM PUSHUPS', 'https://www.youtube.com/watch?v=dmoHFWt-Mms', 'start in the regular push-up position but with your hands spread wider than your shoulders.\r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 6, '8', '12', 7, 1, 1, 0, 'img_exercise/WIDEARMPUSHUPS', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (91, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt`s a great exercise for the chest, shoulders, arms and core.', 'step', 4, '6', '8', 7, 1, 1, 0, 'img_exercise/PUSHUPROTATION', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (92, 'STAGGERED PUSHUPS', 'https://www.youtube.com/watch?v=lg8Mo5dr2No', 'Start in the regular push-up position, but with one hand in front of the other. \r\n\r\nThen do a push-up and switch the other hand in front. \r\n\r\nRemember to keep your body straight.', 'step', 4, '6', '8', 7, 1, 1, 0, 'img_exercise/STAGGEREDPUSHUPS', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (93, 'DECLINE PUSHUPS', 'https://www.youtube.com/watch?v=PXIpw1JD4qw', 'Start on all fours with your knees under your butt and your hands under your sholders. \r\n\r\nThen elevate your feet on a chair or bench, and push your body up and down mainly using your arm strength. \r\n\r\nRemeember to keep your body straight.', 'step', 4, '6', '8', 7, 1, 1, 0, 'img_exercise/DECLINEPUSHUPS', 6, 6);
