INSERT INTO `tbl_full_body_workouts_list` VALUES (98, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 30, '00:30', '00:30', 7, 1, 1, 0, 'img_exercise/COBRASTRETCH', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (99, 'CHEST STRETCH', 'https://www.youtube.com/watch?v=Kvo7054R3fQ', 'Find a doorway, take a lunge position in the doorway with your arms on the doorframe and your elbows a little lower than your shoulders, then slowly bring your chest forward\r\n\r\nHold this position for 30-40 seconds. \r\n\r\nThe slowly come out of it, bring your arms down and do a couple of shoulder rolls.\r\n\r\nDon`t pull your head forward, and keep your neck relaxed.', 'time', 30, '00:30', '00:30', 7, 1, 1, 0, 'img_exercise/CHESTSTRETCH', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (100, 'ABDOMINAL CRUNCHES', 'https://www.youtube.com/watch?v=Xyd_fa5zoEU', 'Lie on your back with your knees bent and your arms stretched forward.\r\n\r\nThen lift your upper body off the floor. \r\n\r\nHold for a few seconds and slowly return.\r\n\r\nIt primarily works the rectus abdominis muscle and the obliques.', 'step', 12, '12', '12', 8, 2, 1, 0, 'img_exercise/ABDOMINALCRUNCHES', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (101, 'RUSSIAN TWIST', 'https://www.youtube.com/watch?v=wkD8rjkodUI', 'Sit on the floor with your knees bent, feet lifted a little bit and back tilted backwords. \r\n\r\nThen hold your hands together and twist from side to side.', 'step', 16, '16', '16', 8, 2, 1, 0, 'img_exercise/RUSSIANTWIST', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (102, 'PLANK', 'https://www.youtube.com/watch?v=pSHjTRCQxIw', 'Lie on the floor with your toes and forearms on the ground.\r\n\r\nKeep your body straight and hold this position as long as you can. \r\n\r\nThis exercise strengthens the abdomen, back and shoulders.', 'time', 30, '00:30', '00:30', 8, 2, 1, 0, 'img_exercise/PLANK', 3, 3);
