INSERT INTO `tbl_full_body_workouts_list` VALUES (104, 'CROSSOVER CRUNCH', 'https://www.youtube.com/watch?v=nCsgWiL-J90', 'Lie on your back with your knees bent and your hands behind your ears.\r\n \r\nRaise and twist your torso so your right elbow moves to meet your left knee. \r\n\r\nRepeat with the other side.', 'step', 14, '14', '14', 8, 2, 1, 0, 'img_exercise/CROSSOVERCRUNCH', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (105, 'SIDE BRIDGES LEFT', 'https://www.youtube.com/watch?v=zyZaGLoEUC4', 'Lie on your right side. Put your right elbow directly under your shoulders and put your left hand on your waist. \r\n\r\nPlace your left leg on your right leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 'step', 12, '12', '12', 8, 2, 1, 0, 'img_exercise/SIDEBRIDGESLEFT', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (106, 'SIDE BRIDGES RIGHT', 'https://www.youtube.com/watch?v=Ko9jId015qc', 'Lie on your left side. Put your left elbow directly under your shoulders and put your right hand on your waist. \r\n\r\nPlace your right leg on your left leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 'step', 12, '12', '12', 8, 2, 1, 0, 'img_exercise/SIDEBRIDGESRIGHT', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (107, 'BICYCLE CRUNCHES', 'https://www.youtube.com/watch?v=Iwyvozckjak', 'Lie on the floor with your hands behind your ears. \r\n\r\nRaise your knees and close your right elbows toward your left knee, then close your left elbow toward your right knee. \r\n\r\nRepear the exercise.', 'step', 14, '14', '14', 8, 2, 1, 0, 'img_exercise/BICYCLECRUNCHES', 8, 8);
