INSERT INTO `tbl_full_body_workouts_list` VALUES (109, 'RUSSIAN TWIST', 'https://www.youtube.com/watch?v=wkD8rjkodUI', 'Sit on the floor with your knees bent, feet lifted a little bit and back tilted backwords. \r\n\r\nThen hold your hands together and twist from side to side.', 'step', 16, '16', '16', 8, 2, 1, 0, 'img_exercise/RUSSIANTWIST', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (110, 'PLANK', 'https://www.youtube.com/watch?v=pSHjTRCQxIw', 'Lie on the floor with your toes and forearms on the ground.\r\n\r\nKeep your body straight and hold this position as long as you can. \r\n\r\nThis exercise strengthens the abdomen, back and shoulders.', 'time', 30, '00:30', '00:30', 8, 2, 1, 0, 'img_exercise/PLANK', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (111, 'SIDE BRIDGES LEFT', 'https://www.youtube.com/watch?v=zyZaGLoEUC4', 'Lie on your right side. Put your right elbow directly under your shoulders and put your left hand on your waist. \r\n\r\nPlace your left leg on your right leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 'step', 10, '10', '10', 8, 2, 1, 0, 'img_exercise/SIDEBRIDGESLEFT', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (112, 'SIDE BRIDGES RIGHT', 'https://www.youtube.com/watch?v=Ko9jId015qc', 'Lie on your left side. Put your left elbow directly under your shoulders and put your right hand on your waist. \r\n\r\nPlace your right leg on your left leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 'step', 10, '10', '10', 8, 2, 1, 0, 'img_exercise/SIDEBRIDGESRIGHT', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (113, 'BICYCLE CRUNCHES', 'https://www.youtube.com/watch?v=Iwyvozckjak', 'Lie on the floor with your hands behind your ears. \r\n\r\nRaise your knees and close your right elbows toward your left knee, then close your left elbow toward your right knee. \r\n\r\nRepear the exercise.', 'step', 14, '14', '14', 8, 2, 1, 0, 'img_exercise/BICYCLECRUNCHES', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (114, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt`s a great exercise for the chest, shoulders, arms and core.', 'step', 12, '12', '12', 8, 2, 1, 0, 'img_exercise/PUSHUPROTATION', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (115, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 30, '00:30', '00:30', 8, 2, 1, 0, 'img_exercise/COBRASTRETCH', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (116, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=Im5nE3J558k', 'Lie on your back with your legs extended.\r\n \r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 'time', 30, '00:30', '00:30', 8, 2, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 17, 17);
INSERT INTO `tbl_full_body_workouts_list` VALUES (117, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 8, 2, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 18, 18);
INSERT INTO `tbl_full_body_workouts_list` VALUES (118, 'SIDE ARM RAISE', 'https://www.youtube.com/watch?v=ww0r9xZunDM', 'Stand with your feet shoulder width apart. \r\n\r\nRaise your arms to the sides at shoulder height, then put them down. \r\n\r\nRepeat the exercise. \r\n\r\nKeep your arms straight during the exercise.', 'step', 16, '16', '16', 9, 2, 1, 0, 'img_exercise/SIDEARMRAISE', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (119, 'TRICEPS KICKBACKS', 'https://www.youtube.com/watch?v=ZO81bExngMI', 'Lean forward, bend your knees and your elbows.\r\n \r\nExtend your arms behind you and squeeze your triceps. \r\n\r\nPlease make your arms parallel to the ground when extending them. \r\n\r\nGo back to the start position, and repeat this exercise.', 'step', 10, '10', '10', 9, 2, 1, 0, 'img_exercise/TRICEPSKICKBACKS', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (120, 'INCLINE PUSHUPS', 'https://www.youtube.com/watch?v=3WGP7sn2_OI', 'Start in the regular push-up position but with your hands elevated on a chair or bench.\r\n\r\nThen push your body up down using your arm strength.\r\n\r\nRemember to keep your body straight.', 'step', 10, '10', '10', 9, 2, 1, 0, 'img_exercise/INCLINEPUSHUPS', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (121, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 'step', 6, '6', '6', 9, 2, 1, 0, 'img_exercise/HYPEREXTENSION', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (122, 'SIDE LYING FLOOR STRETCH LEFT', 'https://www.youtube.com/watch?v=pdgohzanlco', 'Lie on your right side with your right knee slightly bent in front of you and your left leg stretched behind the right leg. \r\n\r\nStraighten your left arms over your head and gently pull on your left wrist to stretch the left side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 9, 2, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHLEFT', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (123, 'SIDE LYING FLOOR STRETCH RIGHT', 'https://www.youtube.com/watch?v=lBdM0Zurwyo', 'Lie on your left side with your left knee slightly bent in front of you and your right leg stretched behind the left leg. \r\n\r\nStraighten your right arms over your head and gently pull on your right wrist to stretch the right side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 9, 2, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHRIGHT', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (124, 'SIDE ARM RAISE', 'https://www.youtube.com/watch?v=ww0r9xZunDM', 'Stand with your feet shoulder width apart. \r\n\r\nRaise your arms to the sides at shoulder height, then put them down. \r\n\r\nRepeat the exercise. \r\n\r\nKeep your arms straight during the exercise.', 'step', 14, '14', '14', 9, 2, 1, 0, 'img_exercise/SIDEARMRAISE', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (125, 'INCHWORMS', 'https://www.youtube.com/watch?v=VSp0z7Mp5IU', 'Start with your feet shoulder width apart.\r\n\r\nBend your body and walk your hands in front of you as far as you can, then walk your hands back. \r\n\r\nRepeat the exercise.', 'step', 12, '12', '12', 9, 2, 1, 0, 'img_exercise/INCHWORMS', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (126, 'TRICEPS KICKBACKS', 'https://www.youtube.com/watch?v=ZO81bExngMI', 'Lean forward, bend your knees and your elbows.\r\n \r\nExtend your arms behind you and squeeze your triceps. \r\n\r\nPlease make your arms parallel to the ground when extending them. \r\n\r\nGo back to the start position, and repeat this exercise.', 'step', 8, '8', '8', 9, 2, 1, 0, 'img_exercise/TRICEPSKICKBACKS', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (127, 'INCLINE PUSHUPS', 'https://www.youtube.com/watch?v=3WGP7sn2_OI', 'Start in the regular push-up position but with your hands elevated on a chair or bench.\r\n\r\nThen push your body up down using your arm strength.\r\n\r\nRemeember to keep your body straight.', 'step', 8, '8', '8', 9, 2, 1, 0, 'img_exercise/INCLINEPUSHUPS', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (128, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 'step', 6, '6', '6', 9, 2, 1, 0, 'img_exercise/HYPEREXTENSION', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (129, 'CAT COW POSE', 'https://www.youtube.com/watch?v=y39PrKY_4JM&list=RDQMVCd2F3GXNEQ&start_radio=1', 'Start on all fours with your knees under your butt and your hands directly under your shoulders.\r\n\r\nThen take a breath and make your belly fall down, shoulders roll back and head come up towards the ceiling. \r\n\r\nAs you exhale, curve your back upward and left your head come down. \r\n\r\nRepeat the exercise. \r\n\r\nDo it slowly with each step of this exercise.', 'time', 30, '00:30', '00:30', 9, 2, 1, 0, 'img_exercise/CATCOWPOSE', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (130, 'RECLINED RHOMBOID SQUEEZES', 'https://www.youtube.com/watch?v=RqRwRE0CEoA', 'Sit with your knees bent. Slightly lean your upper body back. \r\n\r\nStretch your arms in front of you, then pull your elbows back to make your elbows at a 90 degree angle and squeeze your sholder blades.\r\n \r\nRepeat this exercise.', 'step', 14, '14', '14', 9, 2, 1, 0, 'img_exercise/RECLINEDRHOMBOIDSQUEEZES', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (131, 'SUPINE PUSHUPS', 'https://www.youtube.com/watch?v=8H-TSjVRCUA', 'Lie on your back with your feet flat on the floor and your arms bent on two sides. \r\n\r\nPush your chest up as far as you can, and then slowly go back  to the start position. \r\n\r\nRepeat the exercise.', 'step', 10, '10', '10', 9, 2, 1, 0, 'img_exercise/SUPINEPUSHUP', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (132, 'RECLINED RHOMBOID SQUEEZES', 'https://www.youtube.com/watch?v=RqRwRE0CEoA', 'Sit with your knees bent. Slightly lean your upper body back. \r\n\r\nStretch your arms in front of you, then pull your elbows back to make your elbows at a 90 degree angle and squeeze your sholder blades.\r\n \r\nRepeat this exercise.', 'step', 14, '14', '14', 9, 2, 1, 0, 'img_exercise/RECLINEDRHOMBOIDSQUEEZES', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (133, 'SUPINE PUSHUPS', 'https://www.youtube.com/watch?v=8H-TSjVRCUA', 'Lie on your back with your feet flat on the floor and your arms bent on two sides. \r\n\r\nPush your chest up as far as you can, and then slowly go back  to the start position. \r\n\r\nRepeat the exercise.', 'step', 10, '10', '10', 9, 2, 1, 0, 'img_exercise/SUPINEPUSHUP', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (134, 'CHILD\'S POSE', 'https://www.youtube.com/watch?v=2MJGg-dUKh0', 'Start with your knees and hands on the floor. \r\n\r\nPut your hands a little forward, widen your knees and put your toes together.\r\n \r\nTake a breath, then exhale and sit back. \r\n\r\nTry to make your butt touch your heels. \r\n\r\nRelax your elbows, make your forehead touch the floor and try to lower your chest close to the floor. Hold thid position. \r\n\r\nKeep your arms stretched forward as you sit back. \r\n\r\nMake sure there is enough space between your shoulders and ears during the exercise.', 'time', 30, '00:30', '00:30', 9, 2, 1, 0, 'img_exercise/CHILDSPOSE', 17, 17);
INSERT INTO `tbl_full_body_workouts_list` VALUES (135, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups.', 'time', 30, '00:30', '00:30', 10, 2, 1, 0, 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (136, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 'step', 6, '-', '12', 10, 2, 1, 0, 'img_exercise/PUSHUPS', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (137, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt\'s a great exercise for the chest, shoulders, arms and core.', 'step', 4, '6', '8', 10, 2, 1, 0, 'img_exercise/PUSHUPROTATION', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (138, 'STAGGERED PUSHUPS', 'https://www.youtube.com/watch?v=lg8Mo5dr2No', 'Start in the regular push-up position, but with one hand in front of the other. \r\n\r\nThen do a push-up and switch the other hand in front. \r\n\r\nRemember to keep your body straight.', 'step', 4, '6', '10', 10, 2, 1, 0, 'img_exercise/STAGGEREDPUSHUPS', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (139, 'DECLINE PUSHUPS', 'https://www.youtube.com/watch?v=PXIpw1JD4qw', 'Start on all fours with your knees under your butt and your hands under your sholders. \r\n\r\nThen elevate your feet on a chair or bench, and push your body up and down mainly using your arm strength. \r\n\r\nRemeember to keep your body straight.', 'step', 6, '6', '10', 10, 2, 1, 0, 'img_exercise/DECLINEPUSHUPS', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (140, 'DIAMOND PUSHUPS', 'https://www.youtube.com/watch?v=jaxbEHLC4qU', 'Start in the push-up position. \r\n\r\nMake a diamond shape with your forefingers and thumbs together under your chest. \r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 4, '-', '6', 10, 2, 1, 0, 'img_exercise/DIAMONDPUSHUPS', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (141, 'INCLINE PUSHUPS', 'https://www.youtube.com/watch?v=3WGP7sn2_OI', 'Start in the regular push-up position but with your hands elevated on a chair or bench.\r\n\r\nThen push your body up down using your arm strength.\r\n\r\nRemeember to keep your body straight.', 'step', 6, '12', '16', 10, 2, 1, 0, 'img_exercise/INCLINEPUSHUPS', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (142, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 'step', 6, '-', '12', 10, 2, 1, 0, 'img_exercise/PUSHUPS', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (143, 'WIDE ARM PUSHUPS', 'https://www.youtube.com/watch?v=dmoHFWt-Mms', 'start in the regular push-up position but with your hands spread wider than your shoulders.\r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 6, '8', '14', 10, 2, 1, 0, 'img_exercise/WIDEARMPUSHUPS', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (144, 'STAGGERED PUSHUPS', 'https://www.youtube.com/watch?v=lg8Mo5dr2No', 'Start in the regular push-up position, but with one hand in front of the other. \r\n\r\nThen do a push-up and switch the other hand in front. \r\n\r\nRemember to keep your body straight.', 'step', 4, '6', '8', 10, 2, 1, 0, 'img_exercise/STAGGEREDPUSHUPS', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (145, 'DECLINE PUSHUPS', 'https://www.youtube.com/watch?v=PXIpw1JD4qw', 'Start on all fours with your knees under your butt and your hands under your sholders. \r\n\r\nThen elevate your feet on a chair or bench, and push your body up and down mainly using your arm strength. \r\n\r\nRemeember to keep your body straight.', 'step', 6, '6', '8', 10, 2, 1, 0, 'img_exercise/DECLINEPUSHUPS', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (146, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 30, '00:30', '00:30', 10, 2, 1, 0, 'img_exercise/COBRASTRETCH', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (147, 'CHEST STRETCH', 'https://www.youtube.com/watch?v=Kvo7054R3fQ', 'Find a doorway, take a lunge position in the doorway with your arms on the doorframe and your elbows a little lower than your shoulders, then slowly bring your chest forward\r\n\r\nHold this position for 30-40 seconds. \r\n\r\nThe slowly come out of it, bring your arms down and do a couple of shoulder rolls.\r\n\r\nDon`t pull your head forward, and keep your neck relaxed.', 'time', 30, '00:30', '00:30', 10, 2, 1, 0, 'img_exercise/CHESTSTRETCH', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (148, 'SIT UPS', 'https://www.youtube.com/watch?v=1fbU_MkV7NE', 'Lie on your back with your hands behind your ears. \r\n\r\nThen lift your upper body off the floor and slowly up to the sitting position. \r\n\r\nDon\'t tug your neck when you get up. \r\n\r\nSlowly go back to the start position and repeat the exercise. \r\n\r\nIf you spine hurts, please change to another workout.', 'step', 14, '14', '14', 11, 2, 1, 0, 'img_exercise/SITUPS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (149, 'ABDOMINAL CRUNCHES', 'https://www.youtube.com/watch?v=Xyd_fa5zoEU', 'Lie on your back with your knees bent and your arms stretched forward.\r\n\r\nThen lift your upper body off the floor. \r\n\r\nHold for a few seconds and slowly return.\r\n\r\nIt primarily works the rectus abdominis muscle and the obliques.', 'step', 14, '14', '14', 11, 2, 1, 0, 'img_exercise/ABDOMINALCRUNCHES', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (150, 'RUSSIAN TWIST', 'https://www.youtube.com/watch?v=wkD8rjkodUI', 'Sit on the floor with your knees bent, feet lifted a little bit and back tilted backwords. \r\n\r\nThen hold your hands together and twist from side to side.', 'step', 18, '18', '18', 11, 2, 1, 0, 'img_exercise/RUSSIANTWIST', 3, 3);
