INSERT INTO `tbl_full_body_workouts_list` VALUES (160, 'SIDE BRIDGES LEFT', 'https://www.youtube.com/watch?v=zyZaGLoEUC4', 'Lie on your right side. Put your right elbow directly under your shoulders and put your left hand on your waist. \r\n\r\nPlace your left leg on your right leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 'step', 10, '10', '10', 11, 2, 1, 0, 'img_exercise/SIDEBRIDGESLEFT', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (161, 'SIDE BRIDGES RIGHT', 'https://www.youtube.com/watch?v=Ko9jId015qc', 'Lie on your left side. Put your left elbow directly under your shoulders and put your right hand on your waist. \r\n\r\nPlace your right leg on your left leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 'step', 10, '10', '10', 11, 2, 1, 0, 'img_exercise/SIDEBRIDGESRIGHT', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (162, 'BICYCLE CRUNCHES', 'https://www.youtube.com/watch?v=Iwyvozckjak', 'Lie on the floor with your hands behind your ears. \r\n\r\nRaise your knees and close your right elbows toward your left knee, then close your left elbow toward your right knee. \r\n\r\nRepear the exercise.', 'step', 18, '18', '18', 11, 2, 1, 0, 'img_exercise/BICYCLECRUNCHES', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (163, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt`s a great exercise for the chest, shoulders, arms and core.', 'step', 14, '14', '14', 11, 2, 1, 0, 'img_exercise/PUSHUPROTATION', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (164, 'CHEST STRETCH', 'https://www.youtube.com/watch?v=Kvo7054R3fQ', 'Find a doorway, take a lunge position in the doorway with your arms on the doorframe and your elbows a little lower than your shoulders, then slowly bring your chest forward\r\n\r\nHold this position for 30-40 seconds. \r\n\r\nThe slowly come out of it, bring your arms down and do a couple of shoulder rolls.\r\n\r\nDon\'t pull your head forward, and keep your neck relaxed.', 'time', 30, '00:30', '00:30', 11, 2, 1, 0, 'img_exercise/CHESTSTRETCH', 17, 17);
INSERT INTO `tbl_full_body_workouts_list` VALUES (165, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=Im5nE3J558k', 'Lie on your back with your legs extended.\r\n \r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 'time', 30, '00:30', '00:30', 11, 2, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 18, 18);
INSERT INTO `tbl_full_body_workouts_list` VALUES (166, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 11, 2, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 19, 19);
INSERT INTO `tbl_full_body_workouts_list` VALUES (167, 'TRICEPS KICKBACKS', 'https://www.youtube.com/watch?v=ZO81bExngMI', 'Lean forward, bend your knees and your elbows.\r\n \r\nExtend your arms behind you and squeeze your triceps. \r\n\r\nPlease make your arms parallel to the ground when extending them. \r\n\r\nGo back to the start position, and repeat this exercise.', 'step', 12, '12', '12', 12, 2, 1, 0, 'img_exercise/TRICEPSKICKBACKS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (168, 'INCLINE PUSHUPS', 'https://www.youtube.com/watch?v=3WGP7sn2_OI', 'Start in the regular push-up position but with your hands elevated on a chair or bench.\r\n\r\nThen push your body up down using your arm strength.\r\n\r\nRemember to keep your body straight.', 'step', 12, '12', '12', 12, 2, 1, 0, 'img_exercise/INCLINEPUSHUPS', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (169, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 'step', 10, '10', '10', 12, 2, 1, 0, 'img_exercise/HYPEREXTENSION', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (170, 'TRICEPS DIPS', 'https://www.youtube.com/watch?v=WmHXTlvI8Eo', 'For the start position, sit on the chair. \r\n\r\nThen move your hip off the chair with your hands holding the edge of the chair. \r\n\r\nSlowly bend and stretch your arms to make your body go up and down. \r\n\r\nThis is a great exercise for the triceps.', 'step', 10, '10', '10', 12, 2, 1, 0, 'img_exercise/TRICEPSDIPS', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (171, 'SIDE LYING FLOOR STRETCH LEFT', 'https://www.youtube.com/watch?v=pdgohzanlco', 'Lie on your right side with your right knee slightly bent in front of you and your left leg stretched behind the right leg. \r\n\r\nStraighten your left arms over your head and gently pull on your left wrist to stretch the left side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 12, 2, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHLEFT', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (172, 'SIDE LYING FLOOR STRETCH RIGHT', 'https://www.youtube.com/watch?v=lBdM0Zurwyo', 'Lie on your left side with your left knee slightly bent in front of you and your right leg stretched behind the left leg. \r\n\r\nStraighten your right arms over your head and gently pull on your right wrist to stretch the right side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 12, 2, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHRIGHT', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (173, 'TRICEPS KICKBACKS', 'https://www.youtube.com/watch?v=ZO81bExngMI', 'Lean forward, bend your knees and your elbows.\r\n \r\nExtend your arms behind you and squeeze your triceps. \r\n\r\nPlease make your arms parallel to the ground when extending them. \r\n\r\nGo back to the start position, and repeat this exercise.', 'step', 12, '12', '12', 12, 2, 1, 0, 'img_exercise/TRICEPSKICKBACKS', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (174, 'INCLINE PUSHUPS', 'https://www.youtube.com/watch?v=3WGP7sn2_OI', 'Start in the regular push-up position but with your hands elevated on a chair or bench.\r\n\r\nThen push your body up down using your arm strength.\r\n\r\nRemeember to keep your body straight.', 'step', 12, '12', '12', 12, 2, 1, 0, 'img_exercise/INCLINEPUSHUPS', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (175, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 'step', 10, '10', '10', 12, 2, 1, 0, 'img_exercise/HYPEREXTENSION', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (176, 'TRICEPS DIPS', 'https://www.youtube.com/watch?v=WmHXTlvI8Eo', 'For the start position, sit on the chair. \r\n\r\nThen move your hip off the chair with your hands holding the edge of the chair. \r\n\r\nSlowly bend and stretch your arms to make your body go up and down. \r\n\r\nThis is a great exercise for the triceps.', 'step', 10, '10', '10', 12, 2, 1, 0, 'img_exercise/TRICEPSDIPS', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (177, 'CAT COW POSE', 'https://www.youtube.com/watch?v=y39PrKY_4JM&list=RDQMVCd2F3GXNEQ&start_radio=1', 'Start on all fours with your knees under your butt and your hands directly under your shoulders.\r\n\r\nThen take a breath and make your belly fall down, shoulders roll back and head come up towards the ceiling. \r\n\r\nAs you exhale, curve your back upward and left your head come down. \r\n\r\nRepeat the exercise. \r\n\r\nDo it slowly with each step of this exercise.', 'time', 30, '00:30', '00:30', 12, 2, 1, 0, 'img_exercise/CATCOWPOSE', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (178, 'SWIMMER AND SUPERMAN', 'https://www.youtube.com/watch?v=5soxSMFTyBw', 'Lie on your stomach with your arms extended straight overhead. \r\n\r\nAlternately lift your opposite arm and leg.', 'step', 12, '12', '12', 12, 2, 1, 0, 'img_exercise/SWIMMERANDSUPERMAN', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (179, 'SUPINE PUSHUPS', 'https://www.youtube.com/watch?v=8H-TSjVRCUA', 'Lie on your back with your feet flat on the floor and your arms bent on two sides. \r\n\r\nPush your chest up as far as you can, and then slowly go back  to the start position. \r\n\r\nRepeat the exercise.', 'step', 12, '12', '12', 12, 2, 1, 0, 'img_exercise/SUPINEPUSHUP', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (180, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 'step', 10, '10', '10', 12, 2, 1, 0, 'img_exercise/HYPEREXTENSION', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (181, 'SWIMMER AND SUPERMAN', 'https://www.youtube.com/watch?v=5soxSMFTyBw', 'Lie on your stomach with your arms extended straight overhead. \r\n\r\nAlternately lift your opposite arm and leg.', 'step', 12, '12', '12', 12, 2, 1, 0, 'img_exercise/SWIMMERANDSUPERMAN', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (182, 'SUPINE PUSHUPS', 'https://www.youtube.com/watch?v=8H-TSjVRCUA', 'Lie on your back with your feet flat on the floor and your arms bent on two sides. \r\n\r\nPush your chest up as far as you can, and then slowly go back  to the start position. \r\n\r\nRepeat the exercise.', 'step', 12, '12', '12', 12, 2, 1, 0, 'img_exercise/SUPINEPUSHUP', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (183, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 'step', 10, '10', '10', 12, 2, 1, 0, 'img_exercise/HYPEREXTENSION', 17, 17);
INSERT INTO `tbl_full_body_workouts_list` VALUES (184, 'CHILD\'S POSE', 'https://www.youtube.com/watch?v=2MJGg-dUKh0', 'Start with your knees and hands on the floor. \r\n\r\nPut your hands a little forward, widen your knees and put your toes together.\r\n \r\nTake a breath, then exhale and sit back. \r\n\r\nTry to make your butt touch your heels. \r\n\r\nRelax your elbows, make your forehead touch the floor and try to lower your chest close to the floor. Hold thid position. \r\n\r\nKeep your arms stretched forward as you sit back. \r\n\r\nMake sure there is enough space between your shoulders and ears during the exercise.', 'time', 30, '00:30', '00:30', 12, 2, 1, 0, 'img_exercise/CHILDSPOSE', 18, 18);
INSERT INTO `tbl_full_body_workouts_list` VALUES (185, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups.', 'time', 30, '00:30', '00:30', 13, 2, 1, 0, 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (186, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nthis exercise works the chest, shoulders, triceps, back and legs.', 'step', 6, '10', '14', 13, 2, 1, 0, 'img_exercise/PUSHUPS', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (187, 'WIDE ARM PUSHUPS', 'https://www.youtube.com/watch?v=dmoHFWt-Mms', 'start in the regular push-up position but with your hands spread wider than your shoulders.\r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 6, '10', '14', 13, 2, 1, 0, 'img_exercise/WIDEARMPUSHUPS', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (188, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt`s a great exercise for the chest, shoulders, arms and core.', 'step', 6, '8', '10', 13, 2, 1, 0, 'img_exercise/PUSHUPROTATION', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (189, 'STAGGERED PUSHUPS', 'https://www.youtube.com/watch?v=lg8Mo5dr2No', 'Start in the regular push-up position, but with one hand in front of the other. \r\n\r\nThen do a push-up and switch the other hand in front. \r\n\r\nRemember to keep your body straight.', 'step', 6, '8', '12', 13, 2, 1, 0, 'img_exercise/STAGGEREDPUSHUPS', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (190, 'HINDU PUSHUPS', 'https://www.youtube.com/watch?v=nBLy1IGtSJ8', 'Start with your hands and feet touching the floor, body bent and butt up in an upside down `V` shape. \r\n\r\nThen bend your elbows to bring your body towardds the floor. \r\n\r\nWhen your body is close to the floor, raise your upper body up as far as possible. \r\n\r\nThen return to the original position and repeat.', 'step', 4, '6', '8', 13, 2, 1, 0, 'img_exercise/HINDUPUSHUPS', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (191, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nthis exercise works the chest, shoulders, triceps, back and legs.', 'step', 6, '10', '14', 13, 2, 1, 0, 'img_exercise/PUSHUPS', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (192, 'WIDE ARM PUSHUPS', 'https://www.youtube.com/watch?v=dmoHFWt-Mms', 'start in the regular push-up position but with your hands spread wider than your shoulders.\r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 8, '12', '16', 13, 2, 1, 0, 'img_exercise/WIDEARMPUSHUPS', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (193, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt\'s a great exercise for the chest, shoulders, arms and core.', 'step', 6, '8', '10', 13, 2, 1, 0, 'img_exercise/PUSHUPROTATION', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (194, 'STAGGERED PUSHUPS', 'https://www.youtube.com/watch?v=lg8Mo5dr2No', 'Start in the regular push-up position, but with one hand in front of the other. \r\n\r\nThen do a push-up and switch the other hand in front. \r\n\r\nRemember to keep your body straight.', 'step', 6, '8', '10', 13, 2, 1, 0, 'img_exercise/STAGGEREDPUSHUPS', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (195, 'DECLINE PUSHUPS', 'https://www.youtube.com/watch?v=PXIpw1JD4qw', 'Start on all fours with your knees under your butt and your hands under your sholders. \r\n\r\nThen elevate your feet on a chair or bench, and push your body up and down mainly using your arm strength. \r\n\r\nRemember to keep your body straight.', 'step', 6, '8', '10', 13, 2, 1, 0, 'img_exercise/DECLINEPUSHUPS', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (196, 'SHOULDER STRETCH', 'https://www.youtube.com/watch?v=K8sr1CGmKRw', 'Place one arm across your body, parallel to the ground, then use the other arm to pull the parallel arm toward your chest. \r\n\r\nHold for a while, switch arms and repeat the exercise. \r\n\r\nKeep the inside arm straight during the exercise.', 'time', 30, '00:30', '00:30', 13, 2, 1, 0, 'img_exercise/SHOULDERSTRETCH', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (197, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 30, '00:30', '00:30', 13, 2, 1, 0, 'img_exercise/COBRASTRETCH', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (198, 'CHEST STRETCH', 'https://www.youtube.com/watch?v=Kvo7054R3fQ', 'Find a doorway, take a lunge position in the doorway with your arms on the doorframe and your elbows a little lower than your shoulders, then slowly bring your chest forward\r\n\r\nHold this position for 30-40 seconds. \r\n\r\nThe slowly come out of it, bring your arms down and do a couple of shoulder rolls.\r\n\r\nDon`t pull your head forward, and keep your neck relaxed.', 'time', 30, '00:30', '00:30', 13, 2, 1, 0, 'img_exercise/CHESTSTRETCH', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (199, 'HEEL TOUCH', 'https://www.youtube.com/watch?v=RW25fbkQxVQ', 'Lie on the ground with your legs bent and your arms by your sides.\r\n \r\nSlightly lift your body of the floor and make your hands alternately reach your heels.', 'step', 20, '20', '20', 14, 2, 1, 0, 'img_exercise/HEELTOUCH', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (200, 'CROSSOVER CRUNCH', 'https://www.youtube.com/watch?v=nCsgWiL-J90', 'Lie on your back with your knees bent and your hands behind your ears.\r\n \r\nRaise and twist your torso so your right elbow moves to meet your left knee. \r\n\r\nRepeat with the other side.', 'step', 16, '16', '16', 14, 2, 1, 0, 'img_exercise/CROSSOVERCRUNCH', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (201, 'LEG RAISES', 'https://www.youtube.com/watch?v=JB2oyawG9KI', 'Lie down on your back, and put your hands beneath your hips for support. \r\n\r\nThen lift your legs up until they form a right angle with the floor. \r\n\r\nSlowly bring your legs back down and repeat the exercise.', 'step', 16, '16', '16', 14, 2, 1, 0, 'img_exercise/LEGRAISES', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (202, 'SIDE BRIDGES LEFT', 'https://www.youtube.com/watch?v=zyZaGLoEUC4', 'Lie on your right side. Put your right elbow directly under your shoulders and put your left hand on your waist. \r\n\r\nPlace your left leg on your right leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 'step', 16, '16', '16', 14, 2, 1, 0, 'img_exercise/SIDEBRIDGESLEFT', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (203, 'SIDE BRIDGES RIGHT', 'https://www.youtube.com/watch?v=Ko9jId015qc', 'Lie on your left side. Put your left elbow directly under your shoulders and put your right hand on your waist. \r\n\r\nPlace your right leg on your left leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 'step', 16, '16', '16', 14, 2, 1, 0, 'img_exercise/SIDEBRIDGESRIGHT', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (204, 'BICYCLE CRUNCHES', 'https://www.youtube.com/watch?v=Iwyvozckjak', 'Lie on the floor with your hands behind your ears. \r\n\r\nRaise your knees and close your right elbows toward your left knee, then close your left elbow toward your right knee. \r\n\r\nRepear the exercise.', 'step', 20, '20', '20', 14, 2, 1, 0, 'img_exercise/BICYCLECRUNCHES', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (205, 'V UP', 'https://www.youtube.com/watch?v=riAutegDqdI', 'Lie on your back with your arms and legs extended and your legs squeezed together. \r\n\r\nRaise your upper body and legs, use your arms to touch your toes, then go back to the start position and repeat the exercise.', 'step', 10, '10', '10', 14, 2, 1, 0, 'img_exercise/VUP', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (206, 'ABDOMINAL CRUNCHES', 'https://www.youtube.com/watch?v=Xyd_fa5zoEU', 'Lie on your back with your knees bent and your arms stretched forward.\r\n\r\nThen lift your upper body off the floor. \r\n\r\nHold for a few seconds and slowly return.\r\n\r\nIt primarily works the rectus abdominis muscle and the obliques.', 'step', 16, '16', '16', 14, 2, 1, 0, 'img_exercise/ABDOMINALCRUNCHES', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (207, 'RUSSIAN TWIST', 'https://www.youtube.com/watch?v=wkD8rjkodUI', 'Sit on the floor with your knees bent, feet lifted a little bit and back tilted backwords. \r\n\r\nThen hold your hands together and twist from side to side.', 'step', 20, '20', '20', 14, 2, 1, 0, 'img_exercise/RUSSIANTWIST', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (208, 'LEG RAISES', 'https://www.youtube.com/watch?v=JB2oyawG9KI', 'Lie down on your back, and put your hands beneath your hips for support. \r\n\r\nThen lift your legs up until they form a right angle with the floor. \r\n\r\nSlowly bring your legs back down and repeat the exercise.', 'step', 16, '16', '16', 14, 2, 1, 0, 'img_exercise/LEGRAISES', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (209, 'BICYCLE CRUNCHES', 'https://www.youtube.com/watch?v=Iwyvozckjak', 'Lie on the floor with your hands behind your ears. \r\n\r\nRaise your knees and close your right elbows toward your left knee, then close your left elbow toward your right knee. \r\n\r\nRepear the exercise.', 'step', 20, '20', '20', 14, 2, 1, 0, 'img_exercise/BICYCLECRUNCHES', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (210, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt\'s a great exercise for the chest, shoulders, arms and core.', 'step', 16, '16', '16', 14, 2, 1, 0, 'img_exercise/PUSHUPROTATION', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (211, 'SIDE PLANK RIGHT', 'https://www.youtube.com/watch?v=4Azm8-c_k4Y', 'Lie on your right side with your forearm supporting your body. \r\n\r\nHold your body in a straight line. \r\n\r\nThis exercise targets the abdominal muscles and obliques.', 'time', 20, '00:20', '00:20', 14, 2, 1, 0, 'img_exercise/PLANK', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (212, 'SIDE PLANK LEFT', 'https://www.youtube.com/watch?v=qHBTBRYmoV4', 'Lie on your left side with your forearm supporting your body. \r\n\r\nHold your body in a straight line. \r\n\r\nThis exercise targets the abdominal muscles and obliques.', 'time', 20, '00:20', '00:20', 14, 2, 1, 0, 'img_exercise/PLANK', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (213, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 30, '00:30', '00:30', 14, 2, 1, 0, 'img_exercise/COBRASTRETCH', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (214, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=Im5nE3J558k', 'Lie on your back with your legs extended.\r\n \r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 'time', 30, '00:30', '00:30', 14, 2, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (215, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 14, 2, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 17, 17);
INSERT INTO `tbl_full_body_workouts_list` VALUES (216, 'TRICEPS KICKBACKS', 'https://www.youtube.com/watch?v=ZO81bExngMI', 'Lean forward, bend your knees and your elbows.\r\n \r\nExtend your arms behind you and squeeze your triceps. \r\n\r\nPlease make your arms parallel to the ground when extending them. \r\n\r\nGo back to the start position, and repeat this exercise.', 'step', 14, '14', '14', 15, 3, 1, 0, 'img_exercise/TRICEPSKICKBACKS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (217, 'INCLINE PUSHUPS', 'https://www.youtube.com/watch?v=3WGP7sn2_OI', 'Start in the regular push-up position but with your hands elevated on a chair or bench.\r\n\r\nThen push your body up down using your arm strength.\r\n\r\nRemeember to keep your body straight.', 'step', 14, '14', '14', 15, 3, 1, 0, 'img_exercise/INCLINEPUSHUPS', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (218, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 'step', 12, '12', '12', 15, 3, 1, 0, 'img_exercise/HYPEREXTENSION', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (219, 'TRICEPS DIPS', 'https://www.youtube.com/watch?v=WmHXTlvI8Eo', 'For the start position, sit on the chair. \r\n\r\nThen move your hip off the chair with your hands holding the edge of the chair. \r\n\r\nSlowly bend and stretch your arms to make your body go up and down. \r\n\r\nThis is a great exercise for the triceps.', 'step', 16, '16', '16', 15, 3, 1, 0, 'img_exercise/TRICEPSDIPS', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (220, 'SIDE LYING FLOOR STRETCH LEFT', 'https://www.youtube.com/watch?v=pdgohzanlco', 'Lie on your right side with your right knee slightly bent in front of you and your left leg stretched behind the right leg. \r\n\r\nStraighten your left arms over your head and gently pull on your left wrist to stretch the left side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 15, 3, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHLEFT', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (221, 'SIDE LYING FLOOR STRETCH RIGHT', 'https://www.youtube.com/watch?v=lBdM0Zurwyo', 'Lie on your left side with your left knee slightly bent in front of you and your right leg stretched behind the left leg. \r\n\r\nStraighten your right arms over your head and gently pull on your right wrist to stretch the right side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 15, 3, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHRIGHT', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (222, 'TRICEPS KICKBACKS', 'https://www.youtube.com/watch?v=ZO81bExngMI', 'Lean forward, bend your knees and your elbows.\r\n \r\nExtend your arms behind you and squeeze your triceps. \r\n\r\nPlease make your arms parallel to the ground when extending them. \r\n\r\nGo back to the start position, and repeat this exercise.', 'step', 12, '12', '12', 15, 3, 1, 0, 'img_exercise/TRICEPSKICKBACKS', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (223, 'INCLINE PUSHUPS', 'https://www.youtube.com/watch?v=3WGP7sn2_OI', 'Start in the regular push-up position but with your hands elevated on a chair or bench.\r\n\r\nThen push your body up down using your arm strength.\r\n\r\nRemeember to keep your body straight.', 'step', 12, '12', '12', 15, 3, 1, 0, 'img_exercise/INCLINEPUSHUPS', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (224, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 'step', 10, '10', '10', 15, 3, 1, 0, 'img_exercise/HYPEREXTENSION', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (225, 'TRICEPS DIPS', 'https://www.youtube.com/watch?v=WmHXTlvI8Eo', 'For the start position, sit on the chair. \r\n\r\nThen move your hip off the chair with your hands holding the edge of the chair. \r\n\r\nSlowly bend and stretch your arms to make your body go up and down. \r\n\r\nThis is a great exercise for the triceps.', 'step', 14, '14', '14', 15, 3, 1, 0, 'img_exercise/TRICEPSDIPS', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (226, 'CAT COW POSE', 'https://www.youtube.com/watch?v=y39PrKY_4JM&list=RDQMVCd2F3GXNEQ&start_radio=1', 'Start on all fours with your knees under your butt and your hands directly under your shoulders.\r\n\r\nThen take a breath and make your belly fall down, shoulders roll back and head come up towards the ceiling. \r\n\r\nAs you exhale, curve your back upward and left your head come down. \r\n\r\nRepeat the exercise. \r\n\r\nDo it slowly with each step of this exercise.', 'time', 30, '00:30', '00:30', 15, 3, 1, 0, 'img_exercise/CATCOWPOSE', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (227, 'SWIMMER AND SUPERMAN', 'https://www.youtube.com/watch?v=5soxSMFTyBw', 'Lie on your stomach with your arms extended straight overhead. \r\n\r\nAlternately lift your opposite arm and leg.', 'step', 14, '14', '14', 15, 3, 1, 0, 'img_exercise/SWIMMERANDSUPERMAN', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (228, 'SUPINE PUSHUPS', 'https://www.youtube.com/watch?v=8H-TSjVRCUA', 'Lie on your back with your feet flat on the floor and your arms bent on two sides. \r\n\r\nPush your chest up as far as you can, and then slowly go back  to the start position. \r\n\r\nRepeat the exercise.', 'step', 12, '12', '12', 15, 3, 1, 0, 'img_exercise/SUPINEPUSHUP', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (229, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 'step', 10, '10', '10', 15, 3, 1, 0, 'img_exercise/HYPEREXTENSION', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (230, 'SWIMMER AND SUPERMAN', 'https://www.youtube.com/watch?v=5soxSMFTyBw', 'Lie on your stomach with your arms extended straight overhead. \r\n\r\nAlternately lift your opposite arm and leg.', 'step', 14, '14', '14', 15, 3, 1, 0, 'img_exercise/SWIMMERANDSUPERMAN', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (231, 'SUPINE PUSHUPS', 'https://www.youtube.com/watch?v=8H-TSjVRCUA', 'Lie on your back with your feet flat on the floor and your arms bent on two sides. \r\n\r\nPush your chest up as far as you can, and then slowly go back  to the start position. \r\n\r\nRepeat the exercise.', 'step', 12, '12', '12', 15, 3, 1, 0, 'img_exercise/SUPINEPUSHUP', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (232, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 'step', 10, '10', '10', 15, 3, 1, 0, 'img_exercise/HYPEREXTENSION', 17, 17);
INSERT INTO `tbl_full_body_workouts_list` VALUES (233, 'CHILD\'S POSE', 'https://www.youtube.com/watch?v=2MJGg-dUKh0', 'Start with your knees and hands on the floor. \r\n\r\nPut your hands a little forward, widen your knees and put your toes together.\r\n \r\nTake a breath, then exhale and sit back. \r\n\r\nTry to make your butt touch your heels. \r\n\r\nRelax your elbows, make your forehead touch the floor and try to lower your chest close to the floor. Hold thid position. \r\n\r\nKeep your arms stretched forward as you sit back. \r\n\r\nMake sure there is enough space between your shoulders and ears during the exercise.', 'time', 30, '00:30', '00:30', 15, 3, 1, 0, 'img_exercise/CHILDSPOSE', 18, 18);
INSERT INTO `tbl_full_body_workouts_list` VALUES (234, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups.', 'time', 30, '00:30', '00:30', 16, 3, 1, 0, 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (235, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 'step', 8, '12', '16', 16, 3, 1, 0, 'img_exercise/PUSHUPS', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (236, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt\'s a great exercise for the chest, shoulders, arms and core.', 'step', 6, '8', '10', 16, 3, 1, 0, 'img_exercise/PUSHUPROTATION', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (237, 'STAGGERED PUSHUPS', 'https://www.youtube.com/watch?v=lg8Mo5dr2No', 'Start in the regular push-up position, but with one hand in front of the other. \r\n\r\nThen do a push-up and switch the other hand in front. \r\n\r\nRemember to keep your body straight.', 'step', 6, '8', '12', 16, 3, 1, 0, 'img_exercise/STAGGEREDPUSHUPS', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (238, 'HINDU PUSHUPS', 'https://www.youtube.com/watch?v=nBLy1IGtSJ8', 'Start with your hands and feet touching the floor, body bent and butt up in an upside down `V` shape. \r\n\r\nThen bend your elbows to bring your body towardds the floor. \r\n\r\nWhen your body is close to the floor, raise your upper body up as far as possible. \r\n\r\nThen return to the original position and repeat.', 'step', 6, '6', '10', 16, 3, 1, 0, 'img_exercise/HINDUPUSHUPS', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (239, 'DIAMOND PUSHUPS', 'https://www.youtube.com/watch?v=jaxbEHLC4qU', 'Start in the push-up position. \r\n\r\nMake a diamond shape with your forefingers and thumbs together under your chest. \r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 6, '6', '8', 16, 3, 1, 0, 'img_exercise/DIAMONDPUSHUPS', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (240, 'SPIDERMAN PUSHUPS', 'https://www.youtube.com/watch?v=DYONORexgpY', 'Start in the regular push-up position. \r\n\r\nWhen lowering your torso downward, bend and lift one leg to the side. \r\n\r\nThen return to the start position and switch to the other leg. \r\n\r\nRemember to keep your body straight.', 'step', 4, '6', '8', 16, 3, 1, 0, 'img_exercise/SPIDERMANPUSHUPS', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (241, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 'step', 8, '12', '16', 16, 3, 1, 0, 'img_exercise/PUSHUPS', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (242, 'WIDE ARM PUSHUPS', 'https://www.youtube.com/watch?v=dmoHFWt-Mms', 'start in the regular push-up position but with your hands spread wider than your shoulders.\r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 10, '12', '16', 16, 3, 1, 0, 'img_exercise/WIDEARMPUSHUPS', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (243, 'STAGGERED PUSHUPS', 'https://www.youtube.com/watch?v=lg8Mo5dr2No', 'Start in the regular push-up position, but with one hand in front of the other. \r\n\r\nThen do a push-up and switch the other hand in front. \r\n\r\nRemember to keep your body straight.', 'step', 6, '8', '10', 16, 3, 1, 0, 'img_exercise/STAGGEREDPUSHUPS', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (244, 'DECLINE PUSHUPS', 'https://www.youtube.com/watch?v=PXIpw1JD4qw', 'Start on all fours with your knees under your butt and your hands under your sholders. \r\n\r\nThen elevate your feet on a chair or bench, and push your body up and down mainly using your arm strength. \r\n\r\nRemember to keep your body straight.', 'step', 8, '10', '12', 16, 3, 1, 0, 'img_exercise/DECLINEPUSHUPS', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (245, 'SHOULDER STRETCH', 'https://www.youtube.com/watch?v=K8sr1CGmKRw', 'Place one arm across your body, parallel to the ground, then use the other arm to pull the parallel arm toward your chest. \r\n\r\nHold for a while, switch arms and repeat the exercise. \r\n\r\nKeep the inside arm straight during the exercise.', 'time', 30, '00:30', '00:30', 16, 3, 1, 0, 'img_exercise/SHOULDERSTRETCH', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (246, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 30, '00:30', '00:30', 16, 3, 1, 0, 'img_exercise/COBRASTRETCH', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (247, 'CHEST STRETCH', 'https://www.youtube.com/watch?v=Kvo7054R3fQ', 'Find a doorway, take a lunge position in the doorway with your arms on the doorframe and your elbows a little lower than your shoulders, then slowly bring your chest forward\r\n\r\nHold this position for 30-40 seconds. \r\n\r\nThe slowly come out of it, bring your arms down and do a couple of shoulder rolls.\r\n\r\nDon\'t pull your head forward, and keep your neck relaxed.', 'time', 30, '00:30', '00:30', 16, 3, 1, 0, 'img_exercise/CHESTSTRETCH', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (248, 'SIT UPS', 'https://www.youtube.com/watch?v=1fbU_MkV7NE', 'Lie on your back with your hands behind your ears. \r\n\r\nThen lift your upper body off the floor and slowly up to the sitting position. \r\n\r\nDon\'t tug your neck when you get up. \r\n\r\nSlowly go back to the start position and repeat the exercise. \r\n\r\nIf you spine hurts, please change to another workout.', 'step', 16, '16', '16', 17, 3, 1, 0, 'img_exercise/SITUPS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (249, 'ABDOMINAL CRUNCHES', 'https://www.youtube.com/watch?v=Xyd_fa5zoEU', 'Lie on your back with your knees bent and your arms stretched forward.\r\n\r\nThen lift your upper body off the floor. \r\n\r\nHold for a few seconds and slowly return.\r\n\r\nIt primarily works the rectus abdominis muscle and the obliques.', 'step', 16, '16', '16', 17, 3, 1, 0, 'img_exercise/ABDOMINALCRUNCHES', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (250, 'MOUNTAIN CLIMBER', 'https://www.youtube.com/watch?v=nmwgirgXLYM', 'Start in the push-up position. \r\n\r\nBend your right knee towards your chest and keep your left leg straight, then quickly switch from one leg to the other. \r\n\r\nThis exercise strengthens multiple muscle groups.', 'step', 14, '14', '14', 17, 3, 1, 0, 'img_exercise/MOUNTAINCLIMBER', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (251, 'HEEL TOUCH', 'https://www.youtube.com/watch?v=RW25fbkQxVQ', 'Lie on the ground with your legs bent and your arms by your sides.\r\n \r\nSlightly lift your body of the floor and make your hands alternately reach your heels.', 'step', 24, '24', '24', 17, 3, 1, 0, 'img_exercise/HEELTOUCH', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (252, 'LEG RAISES', 'https://www.youtube.com/watch?v=JB2oyawG9KI', 'Lie down on your back, and put your hands beneath your hips for support. \r\n\r\nThen lift your legs up until they form a right angle with the floor. \r\n\r\nSlowly bring your legs back down and repeat the exercise.', 'step', 18, '18', '18', 17, 3, 1, 0, 'img_exercise/LEGRAISES', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (253, 'PLANK', 'https://www.youtube.com/watch?v=pSHjTRCQxIw', 'Lie on the floor with your toes and forearms on the ground.\r\n\r\nKeep your body straight and hold this position as long as you can. \r\n\r\nThis exercise strengthens the abdomen, back and shoulders.', 'time', 40, '00:40', '00:40', 17, 3, 1, 0, 'img_exercise/PLANK', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (254, 'BUTT BRIDGE', 'https://www.youtube.com/watch?v=rWzV67w5-vU', 'Lie on your back with knees bent and feet flat on the floor. \r\n\r\nPut your arms flat at your sides. \r\n\r\nThen lift your butt up and down.', 'step', 20, '20', '20', 17, 3, 1, 0, 'img_exercise/BUTTBRIDGE', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (255, 'SIDE BRIDGES LEFT', 'https://www.youtube.com/watch?v=zyZaGLoEUC4', 'Lie on your right side. Put your right elbow directly under your shoulders and put your left hand on your waist. \r\n\r\nPlace your left leg on your right leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 'step', 16, '16', '16', 17, 3, 1, 0, 'img_exercise/SIDEBRIDGESLEFT', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (256, 'SIDE BRIDGES RIGHT', 'https://www.youtube.com/watch?v=Ko9jId015qc', 'Lie on your left side. Put your left elbow directly under your shoulders and put your right hand on your waist. \r\n\r\nPlace your right leg on your left leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 'step', 16, '16', '16', 17, 3, 1, 0, 'img_exercise/SIDEBRIDGESRIGHT', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (257, 'V UP', 'https://www.youtube.com/watch?v=riAutegDqdI', 'Lie on your back with your arms and legs extended and your legs squeezed together. \r\n\r\nRaise your upper body and legs, use your arms to touch your toes, then go back to the start position and repeat the exercise.', 'step', 12, '12', '12', 17, 3, 1, 0, 'img_exercise/VUP', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (258, 'ABDOMINAL CRUNCHES', 'https://www.youtube.com/watch?v=Xyd_fa5zoEU', 'Lie on your back with your knees bent and your arms stretched forward.\r\n\r\nThen lift your upper body off the floor. \r\n\r\nHold for a few seconds and slowly return.\r\n\r\nIt primarily works the rectus abdominis muscle and the obliques.', 'step', 16, '16', '16', 17, 3, 1, 0, 'img_exercise/ABDOMINALCRUNCHES', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (259, 'MOUNTAIN CLIMBER', 'https://www.youtube.com/watch?v=nmwgirgXLYM', 'Start in the push-up position. \r\n\r\nBend your right knee towards your chest and keep your left leg straight, then quickly switch from one leg to the other. \r\n\r\nThis exercise strengthens multiple muscle groups.', 'step', 14, '14', '14', 17, 3, 1, 0, 'img_exercise/MOUNTAINCLIMBER', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (260, 'HEEL TOUCH', 'https://www.youtube.com/watch?v=RW25fbkQxVQ', 'Lie on the ground with your legs bent and your arms by your sides.\r\n \r\nSlightly lift your body of the floor and make your hands alternately reach your heels.', 'step', 20, '20', '20', 17, 3, 1, 0, 'img_exercise/HEELTOUCH', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (261, 'LEG RAISES', 'https://www.youtube.com/watch?v=JB2oyawG9KI', 'Lie down on your back, and put your hands beneath your hips for support. \r\n\r\nThen lift your legs up until they form a right angle with the floor. \r\n\r\nSlowly bring your legs back down and repeat the exercise.', 'step', 18, '18', '18', 17, 3, 1, 0, 'img_exercise/LEGRAISES', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (262, 'PLANK', 'https://www.youtube.com/watch?v=pSHjTRCQxIw', 'Lie on the floor with your toes and forearms on the ground.\r\n\r\nKeep your body straight and hold this position as long as you can. \r\n\r\nThis exercise strengthens the abdomen, back and shoulders.', 'time', 40, '00:40', '00:40', 17, 3, 1, 0, 'img_exercise/PLANK', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (263, 'BUTT BRIDGE', 'https://www.youtube.com/watch?v=rWzV67w5-vU', 'Lie on your back with knees bent and feet flat on the floor. \r\n\r\nPut your arms flat at your sides. \r\n\r\nThen lift your butt up and down.', 'step', 16, '16', '16', 17, 3, 1, 0, 'img_exercise/BUTTBRIDGE', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (264, 'V UP', 'https://www.youtube.com/watch?v=riAutegDqdI', 'Lie on your back with your arms and legs extended and your legs squeezed together. \r\n\r\nRaise your upper body and legs, use your arms to touch your toes, then go back to the start position and repeat the exercise.', 'step', 14, '14', '14', 17, 3, 1, 0, 'img_exercise/VUP', 17, 17);
INSERT INTO `tbl_full_body_workouts_list` VALUES (265, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 30, '00:30', '00:30', 17, 3, 1, 0, 'img_exercise/COBRASTRETCH', 18, 18);
INSERT INTO `tbl_full_body_workouts_list` VALUES (266, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=Im5nE3J558k', 'Lie on your back with your legs extended.\r\n \r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 'time', 30, '00:30', '00:30', 17, 3, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 19, 19);
INSERT INTO `tbl_full_body_workouts_list` VALUES (267, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 17, 3, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 20, 20);
INSERT INTO `tbl_full_body_workouts_list` VALUES (268, 'TRICEPS KICKBACKS', 'https://www.youtube.com/watch?v=ZO81bExngMI', 'Lean forward, bend your knees and your elbows.\r\n \r\nExtend your arms behind you and squeeze your triceps. \r\n\r\nPlease make your arms parallel to the ground when extending them. \r\n\r\nGo back to the start position, and repeat this exercise.', 'step', 14, '14', '14', 18, 3, 1, 0, 'img_exercise/TRICEPSKICKBACKS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (269, 'FLOOR TRICEP DIPS', 'https://www.youtube.com/watch?v=Nl578wCij6E', 'Sit on the floor with your knees bent and feet flat on the floor. \r\n\r\nPut your hands beneath your shoulders with your fingers pointing toward your hips. \r\n\r\nLift your hips off the floor. \r\n\r\nThen bens and extend your elbows to lower and lift your hips. \r\n\r\nRepeat the exercise to strengthen your upper arms.', 'step', 10, '10', '10', 18, 3, 1, 0, 'img_exercise/FLOORTRICEPDIPS', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (270, 'PIKE PUSHUPS', 'https://www.youtube.com/watch?v=x7_I5SUAd00', 'Start with your hands and feet on the floor. \r\n\r\nPut your hands shoulder width apart. Bend your body, and lift your hips up in an upside down \'V\' shape. \r\n\r\nBend your elbows, and bring your head close to the floor. \r\n\r\nPush your body back, and repeat the exercise.', 'step', 10, '10', '10', 18, 3, 1, 0, 'img_exercise/PIKEPUSHUPS', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (271, 'SIDE LYING FLOOR STRETCH LEFT', 'https://www.youtube.com/watch?v=pdgohzanlco', 'Lie on your right side with your right knee slightly bent in front of you and your left leg stretched behind the right leg. \r\n\r\nStraighten your left arms over your head and gently pull on your left wrist to stretch the left side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 18, 3, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHLEFT', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (272, 'SIDE LYING FLOOR STRETCH RIGHT', 'https://www.youtube.com/watch?v=lBdM0Zurwyo', 'Lie on your left side with your left knee slightly bent in front of you and your right leg stretched behind the left leg. \r\n\r\nStraighten your right arms over your head and gently pull on your right wrist to stretch the right side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 18, 3, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHRIGHT', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (273, 'REVERSE PUSHUPS', 'https://www.youtube.com/watch?v=a00N2M7I1_o', 'Start in the regular push-up position.\r\n \r\nLower your body down, then bend your knees and move your hips backward with your arms straight. \r\n\r\nGo back to the push-up position and repeat.', 'step', 6, '6', '6', 18, 3, 1, 0, 'img_exercise/REVERSEPUSHUPS', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (274, 'FLOOR TRICEP DIPS', 'https://www.youtube.com/watch?v=Nl578wCij6E', 'Sit on the floor with your knees bent and feet flat on the floor. \r\n\r\nPut your hands beneath your shoulders with your fingers pointing toward your hips. \r\n\r\nLift your hips off the floor. \r\n\r\nThen bens and extend your elbows to lower and lift your hips. \r\n\r\nRepeat the exercise to strengthen your upper arms.', 'step', 8, '8', '8', 18, 3, 1, 0, 'img_exercise/FLOORTRICEPDIPS', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (275, 'PIKE PUSHUPS', 'https://www.youtube.com/watch?v=x7_I5SUAd00', 'Start with your hands and feet on the floor. \r\n\r\nPut your hands shoulder width apart. Bend your body, and lift your hips up in an upside down `V` shape. \r\n\r\nBend your elbows, and bring your head close to the floor. \r\n\r\nPush your body back, and repeat the exercise.', 'step', 8, '8', '8', 18, 3, 1, 0, 'img_exercise/PIKEPUSHUPS', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (276, 'REVERSE PUSHUPS', 'https://www.youtube.com/watch?v=a00N2M7I1_o', 'Start in the regular push-up position.\r\n \r\nLower your body down, then bend your knees and move your hips backward with your arms straight. \r\n\r\nGo back to the push-up position and repeat.', 'step', 6, '6', '6', 18, 3, 1, 0, 'img_exercise/REVERSEPUSHUPS', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (277, 'CAT COW POSE', 'https://www.youtube.com/watch?v=y39PrKY_4JM&list=RDQMVCd2F3GXNEQ&start_radio=1', 'Start on all fours with your knees under your butt and your hands directly under your shoulders.\r\n\r\nThen take a breath and make your belly fall down, shoulders roll back and head come up towards the ceiling. \r\n\r\nAs you exhale, curve your back upward and left your head come down. \r\n\r\nRepeat the exercise. \r\n\r\nDo it slowly with each step of this exercise.', 'time', 30, '00:30', '00:30', 18, 3, 1, 0, 'img_exercise/CATCOWPOSE', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (278, 'SUPINE PUSHUPS', 'https://www.youtube.com/watch?v=8H-TSjVRCUA', 'Lie on your back with your feet flat on the floor and your arms bent on two sides. \r\n\r\nPush your chest up as far as you can, and then slowly go back  to the start position. \r\n\r\nRepeat the exercise.', 'step', 14, '14', '14', 18, 3, 1, 0, 'img_exercise/SUPINEPUSHUP', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (279, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 'step', 12, '12', '12', 18, 3, 1, 0, 'img_exercise/HYPEREXTENSION', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (280, 'HOVER PUSHUPS', 'https://www.youtube.com/watch?v=9f6tdzkA7Tg', 'Start in a push-up position. Lower yourself; shift your body to the left and then to the right. \r\n\r\nPush your body up and repeat the exercise.', 'step', 14, '14', '14', 18, 3, 1, 0, 'img_exercise/HOVERPUSHUP', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (281, 'REVERSE SNOW ANGELS', 'https://www.youtube.com/watch?v=ijr9vR9QLIM', 'Lie on your stomach with your arms to your sides. \r\n\r\nLift your arms up and extend them over your head to touch your thumbs. \r\n\r\nThen slowly bring them back. \r\n\r\nRepeat the exercise.', 'step', 8, '8', '8', 18, 3, 1, 0, 'img_exercise/REVERSESNOWANGELS', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (282, 'SUPINE PUSHUPS', 'https://www.youtube.com/watch?v=8H-TSjVRCUA', 'Lie on your back with your feet flat on the floor and your arms bent on two sides. \r\n\r\nPush your chest up as far as you can, and then slowly go back  to the start position. \r\n\r\nRepeat the exercise.', 'step', 14, '14', '14', 18, 3, 1, 0, 'img_exercise/SUPINEPUSHUP', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (283, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 'step', 12, '12', '12', 18, 3, 1, 0, 'img_exercise/HYPEREXTENSION', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (284, 'HOVER PUSHUPS', 'https://www.youtube.com/watch?v=9f6tdzkA7Tg', 'Start in a push-up position. Lower yourself, shift your body to the left and then to the right. \r\n\r\nPush your body up and repeat the exercise.', 'step', 14, '14', '14', 18, 3, 1, 0, 'img_exercise/HOVERPUSHUP', 17, 17);
INSERT INTO `tbl_full_body_workouts_list` VALUES (285, 'REVERSE SNOW ANGELS', 'https://www.youtube.com/watch?v=ijr9vR9QLIM', 'Lie on your stomach with your arms to your sides. \r\n\r\nLift your arms up and extend them over your head to touch your thumbs. \r\n\r\nThen slowly bring them back. \r\n\r\nRepeat the exercise.', 'step', 8, '8', '8', 18, 3, 1, 0, 'img_exercise/REVERSESNOWANGELS', 18, 18);
INSERT INTO `tbl_full_body_workouts_list` VALUES (286, 'CHILD\'S POSE', 'https://www.youtube.com/watch?v=2MJGg-dUKh0', 'Start with your knees and hands on the floor. \r\n\r\nPut your hands a little forward, widen your knees and put your toes together.\r\n \r\nTake a breath, then exhale and sit back. \r\n\r\nTry to make your butt touch your heels. \r\n\r\nRelax your elbows, make your forehead touch the floor and try to lower your chest close to the floor. Hold this position. \r\n\r\nKeep your arms stretched forward as you sit back. \r\n\r\nMake sure there is enough space between your shoulders and ears during the exercise.', 'time', 30, '00:30', '00:30', 18, 3, 1, 0, 'img_exercise/CHILDSPOSE', 19, 19);
INSERT INTO `tbl_full_body_workouts_list` VALUES (287, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups.', 'time', 30, '00:30', '00:30', 19, 3, 1, 0, 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (288, 'WIDE ARM PUSHUPS', 'https://www.youtube.com/watch?v=dmoHFWt-Mms', 'start in the regular push-up position but with your hands spread wider than your shoulders.\r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 8, '12', '16', 19, 3, 1, 0, 'img_exercise/WIDEARMPUSHUPS', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (289, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 'step', 10, '14', '18', 19, 3, 1, 0, 'img_exercise/PUSHUPS', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (290, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt\'s a great exercise for the chest, shoulders, arms and core.', 'step', 8, '10', '12', 19, 3, 1, 0, 'img_exercise/PUSHUPROTATION', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (291, 'DIAMOND PUSHUPS', 'https://www.youtube.com/watch?v=jaxbEHLC4qU', 'Start in the push-up position. \r\n\r\nMake a diamond shape with your forefingers and thumbs together under your chest. \r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 6, '8', '10', 19, 3, 1, 0, 'img_exercise/DIAMONDPUSHUPS', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (292, 'SPIDERMAN PUSHUPS', 'https://www.youtube.com/watch?v=DYONORexgpY', 'Start in the regular push-up position. \r\n\r\nWhen lowering your torso downward, bend and lift one leg to the side. \r\n\r\nThen return to the start position and switch to the other leg. \r\n\r\nRemember to keep your body straight.', 'step', 6, '8', '10', 19, 3, 1, 0, 'img_exercise/SPIDERMANPUSHUPS', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (293, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 'step', 8, '14', '18', 19, 3, 1, 0, 'img_exercise/PUSHUPS', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (294, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt\'s a great exercise for the chest, shoulders, arms and core.', 'step', 8, '10', '12', 19, 3, 1, 0, 'img_exercise/PUSHUPROTATION', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (295, 'DECLINE PUSHUPS', 'https://www.youtube.com/watch?v=PXIpw1JD4qw', 'Start on all fours with your knees under your butt and your hands under your sholders. \r\n\r\nThen elevate your feet on a chair or bench, and push your body up and down mainly using your arm strength. \r\n\r\nRemember to keep your body straight.', 'step', 8, '10', '14', 19, 3, 1, 0, 'img_exercise/DECLINEPUSHUPS', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (296, 'HINDU PUSHUPS', 'https://www.youtube.com/watch?v=nBLy1IGtSJ8', 'Start with your hands and feet touching the floor, body bent and butt up in an upside down `V` shape. \r\n\r\nThen bend your elbows to bring your body towardds the floor. \r\n\r\nWhen your body is close to the floor, raise your upper body up as far as possible. \r\n\r\nThen return to the original position and repeat.', 'step', 6, '8', '10', 19, 3, 1, 0, 'img_exercise/HINDUPUSHUPS', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (297, 'DIAMOND PUSHUPS', 'https://www.youtube.com/watch?v=jaxbEHLC4qU', 'Start in the push-up position. \r\n\r\nMake a diamond shape with your forefingers and thumbs together under your chest. \r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 4, '6', '6', 19, 3, 1, 0, 'img_exercise/DIAMONDPUSHUPS', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (298, 'SPIDERMAN PUSHUPS', 'https://www.youtube.com/watch?v=DYONORexgpY', 'Start in the regular push-up position. \r\n\r\nWhen lowering your torso downward, bend and lift one leg to the side. \r\n\r\nThen return to the start position and switch to the other leg. \r\n\r\nRemember to keep your body straight.', 'step', 4, '6', '6', 19, 3, 1, 0, 'img_exercise/SPIDERMANPUSHUPS', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (299, 'SHOULDER STRETCH', 'https://www.youtube.com/watch?v=K8sr1CGmKRw', 'Place one arm across your body, parallel to the ground, then use the other arm to pull the parallel arm toward your chest. \r\n\r\nHold for a while, switch arms and repeat the exercise. \r\n\r\nKeep the inside arm straight during the exercise.', 'time', 30, '00:30', '00:30', 19, 3, 1, 0, 'img_exercise/SHOULDERSTRETCH', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (300, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 30, '00:30', '00:30', 19, 3, 1, 0, 'img_exercise/COBRASTRETCH', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (301, 'CHEST STRETCH', 'https://www.youtube.com/watch?v=Kvo7054R3fQ', 'Find a doorway, take a lunge position in the doorway with your arms on the doorframe and your elbows a little lower than your shoulders, then slowly bring your chest forward.\r\n\r\nHold this position for 30-40 seconds. \r\n\r\nThe slowly come out of it, bring your arms down and do a couple of shoulder rolls.\r\n\r\nDon\'t pull your head forward, and keep your neck relaxed.', 'time', 30, '00:30', '00:30', 19, 3, 1, 0, 'img_exercise/CHESTSTRETCH', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (302, 'ABDOMINAL CRUNCHES', 'https://www.youtube.com/watch?v=Xyd_fa5zoEU', 'Lie on your back with your knees bent and your arms stretched forward.\r\n\r\nThen lift your upper body off the floor. \r\n\r\nHold for a few seconds and slowly return.\r\n\r\nIt primarily works the rectus abdominis muscle and the obliques.', 'step', 18, '18', '18', 20, 3, 1, 0, 'img_exercise/ABDOMINALCRUNCHES', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (303, 'RUSSIAN TWIST', 'https://www.youtube.com/watch?v=wkD8rjkodUI', 'Sit on the floor with your knees bent, feet lifted a little bit and back tilted backwords. \r\n\r\nThen hold your hands together and twist from side to side.', 'step', 20, '20', '20', 20, 3, 1, 0, 'img_exercise/RUSSIANTWIST', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (304, 'MOUNTAIN CLIMBER', 'https://www.youtube.com/watch?v=nmwgirgXLYM', 'Start in the push-up position. \r\n\r\nBend your right knee towards your chest and keep your left leg straight, then quickly switch from one leg to the other. \r\n\r\nThis exercise strengthens multiple muscle groups.', 'step', 16, '16', '16', 20, 3, 1, 0, 'img_exercise/MOUNTAINCLIMBER', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (305, 'LEG RAISES', 'https://www.youtube.com/watch?v=JB2oyawG9KI', 'Lie down on your back, and put your hands beneath your hips for support. \r\n\r\nThen lift your legs up until they form a right angle with the floor. \r\n\r\nSlowly bring your legs back down and repeat the exercise.', 'step', 20, '20', '20', 20, 3, 1, 0, 'img_exercise/LEGRAISES', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (306, 'CROSSOVER CRUNCH', 'https://www.youtube.com/watch?v=nCsgWiL-J90', 'Lie on your back with your knees bent and your hands behind your ears.\r\n \r\nRaise and twist your torso so your right elbow moves to meet your left knee. \r\n\r\nRepeat with the other side.', 'step', 18, '18', '18', 20, 3, 1, 0, 'img_exercise/CROSSOVERCRUNCH', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (307, 'BICYCLE CRUNCHES', 'https://www.youtube.com/watch?v=Iwyvozckjak', 'Lie on the floor with your hands behind your ears. \r\n\r\nRaise your knees and close your right elbows toward your left knee, then close your left elbow toward your right knee. \r\n\r\nRepear the exercise.', 'step', 20, '20', '20', 20, 3, 1, 0, 'img_exercise/BICYCLECRUNCHES', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (308, 'ABDOMINAL CRUNCHES', 'https://www.youtube.com/watch?v=Xyd_fa5zoEU', 'Lie on your back with your knees bent and your arms stretched forward.\r\n\r\nThen lift your upper body off the floor. \r\n\r\nHold for a few seconds and slowly return.\r\n\r\nIt primarily works the rectus abdominis muscle and the obliques.', 'step', 18, '18', '18', 20, 3, 1, 0, 'img_exercise/ABDOMINALCRUNCHES', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (309, 'RUSSIAN TWIST', 'https://www.youtube.com/watch?v=wkD8rjkodUI', 'Sit on the floor with your knees bent, feet lifted a little bit and back tilted backwords. \r\n\r\nThen hold your hands together and twist from side to side.', 'step', 22, '22', '22', 20, 3, 1, 0, 'img_exercise/RUSSIANTWIST', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (310, 'MOUNTAIN CLIMBER', 'https://www.youtube.com/watch?v=nmwgirgXLYM', 'Start in the push-up position. \r\n\r\nBend your right knee towards your chest and keep your left leg straight, then quickly switch from one leg to the other. \r\n\r\nThis exercise strengthens multiple muscle groups.', 'step', 16, '16', '16', 20, 3, 1, 0, 'img_exercise/MOUNTAINCLIMBER', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (311, 'LEG RAISES', 'https://www.youtube.com/watch?v=JB2oyawG9KI', 'Lie down on your back, and put your hands beneath your hips for support. \r\n\r\nThen lift your legs up until they form a right angle with the floor. \r\n\r\nSlowly bring your legs back down and repeat the exercise.', 'step', 20, '20', '20', 20, 3, 1, 0, 'img_exercise/LEGRAISES', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (312, 'CROSSOVER CRUNCH', 'https://www.youtube.com/watch?v=nCsgWiL-J90', 'Lie on your back with your knees bent and your hands behind your ears.\r\n \r\nRaise and twist your torso so your right elbow moves to meet your left knee. \r\n\r\nRepeat with the other side.', 'step', 20, '20', '20', 20, 3, 1, 0, 'img_exercise/CROSSOVERCRUNCH', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (313, 'BICYCLE CRUNCHES', 'https://www.youtube.com/watch?v=Iwyvozckjak', 'Lie on the floor with your hands behind your ears. \r\n\r\nRaise your knees and close your right elbows toward your left knee, then close your left elbow toward your right knee. \r\n\r\nRepear the exercise.', 'step', 20, '20', '20', 20, 3, 1, 0, 'img_exercise/BICYCLECRUNCHES', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (314, 'V UP', 'https://www.youtube.com/watch?v=riAutegDqdI', 'Lie on your back with your arms and legs extended and your legs squeezed together. \r\n\r\nRaise your upper body and legs, use your arms to touch your toes, then go back to the start position and repeat the exercise.', 'step', 14, '14', '14', 20, 3, 1, 0, 'img_exercise/VUP', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (315, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt\'s a great exercise for the chest, shoulders, arms and core.', 'step', 16, '16', '16', 20, 3, 1, 0, 'img_exercise/PUSHUPROTATION', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (316, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 30, '00:30', '00:30', 20, 3, 1, 0, 'img_exercise/COBRASTRETCH', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (317, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=Im5nE3J558k', 'Lie on your back with your legs extended.\r\n \r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 'time', 30, '00:30', '00:30', 20, 3, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (318, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 20, 3, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 17, 17);
INSERT INTO `tbl_full_body_workouts_list` VALUES (319, 'FLOOR TRICEP DIPS', 'https://www.youtube.com/watch?v=Nl578wCij6E', 'Sit on the floor with your knees bent and feet flat on the floor. \r\n\r\nPut your hands beneath your shoulders with your fingers pointing toward your hips. \r\n\r\nLift your hips off the floor. \r\n\r\nThen bens and extend your elbows to lower and lift your hips. \r\n\r\nRepeat the exercise to strengthen your upper arms.', 'step', 10, '10', '10', 21, 3, 1, 0, 'img_exercise/FLOORTRICEPDIPS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (320, 'PIKE PUSHUPS', 'https://www.youtube.com/watch?v=x7_I5SUAd00', 'Start with your hands and feet on the floor. \r\n\r\nPut your hands shoulder width apart. Bend your body, and lift your hips up in an upside down `V` shape. \r\n\r\nBend your elbows, and bring your head close to the floor. \r\n\r\nPush your body back, and repeat the exercise.', 'step', 10, '10', '10', 21, 3, 1, 0, 'img_exercise/PIKEPUSHUPS', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (321, 'REVERSE PUSHUPS', 'https://www.youtube.com/watch?v=a00N2M7I1_o', 'Start in the regular push-up position.\r\n \r\nLower your body down, then bend your knees and move your hips backward with your arms straight. \r\n\r\nGo back to the push-up position and repeat.', 'step', 8, '8', '8', 21, 3, 1, 0, 'img_exercise/REVERSEPUSHUPS', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (322, 'SIDE LYING FLOOR STRETCH LEFT', 'https://www.youtube.com/watch?v=pdgohzanlco', 'Lie on your right side with your right knee slightly bent in front of you and your left leg stretched behind the right leg. \r\n\r\nStraighten your left arms over your head and gently pull on your left wrist to stretch the left side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 21, 3, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHLEFT', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (323, 'SIDE LYING FLOOR STRETCH RIGHT', 'https://www.youtube.com/watch?v=lBdM0Zurwyo', 'Lie on your left side with your left knee slightly bent in front of you and your right leg stretched behind the left leg. \r\n\r\nStraighten your right arms over your head and gently pull on your right wrist to stretch the right side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 21, 3, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHRIGHT', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (324, 'FLOOR TRICEP DIPS', 'https://www.youtube.com/watch?v=Nl578wCij6E', 'Sit on the floor with your knees bent and feet flat on the floor. \r\n\r\nPut your hands beneath your shoulders with your fingers pointing toward your hips. \r\n\r\nLift your hips off the floor. \r\n\r\nThen bens and extend your elbows to lower and lift your hips. \r\n\r\nRepeat the exercise to strengthen your upper arms.', 'step', 8, '8', '8', 21, 3, 1, 0, 'img_exercise/FLOORTRICEPDIPS', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (325, 'PIKE PUSHUPS', 'https://www.youtube.com/watch?v=x7_I5SUAd00', 'Start with your hands and feet on the floor. \r\n\r\nPut your hands shoulder width apart. Bend your body, and lift your hips up in an upside down `V` shape. \r\n\r\nBend your elbows, and bring your head close to the floor. \r\n\r\nPush your body back, and repeat the exercise.', 'step', 8, '8', '8', 21, 3, 1, 0, 'img_exercise/PIKEPUSHUPS', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (326, 'REVERSE PUSHUPS', 'https://www.youtube.com/watch?v=a00N2M7I1_o', 'Start in the regular push-up position.\r\n \r\nLower your body down, then bend your knees and move your hips backward with your arms straight. \r\n\r\nGo back to the push-up position and repeat.', 'step', 6, '6', '6', 21, 3, 1, 0, 'img_exercise/REVERSEPUSHUPS', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (327, 'CAT COW POSE', 'https://www.youtube.com/watch?v=y39PrKY_4JM&list=RDQMVCd2F3GXNEQ&start_radio=1', 'Start on all fours with your knees under your butt and your hands directly under your shoulders.\r\n\r\nThen take a breath and make your belly fall down, shoulders roll back and head come up towards the ceiling. \r\n\r\nAs you exhale, curve your back upward and left your head come down. \r\n\r\nRepeat the exercise. \r\n\r\nDo it slowly with each step of this exercise.', 'time', 30, '00:30', '00:30', 21, 3, 1, 0, 'img_exercise/CATCOWPOSE', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (328, 'FLOOR Y RAISES', 'https://www.youtube.com/watch?v=rSV-cyaqdFg', 'Lie face down on the floor with your arms fully extended and your thumbs pointing up, your body should be in the shape of the letter \"Y\". \r\n\r\nRaise your arms off the ground as far as you can and pause them at the top for 2 seconds. \r\n\r\nSlowly go back the start position, and repeat the exercise.', 'step', 14, '14', '14', 21, 3, 1, 0, 'img_exercise/FLOORYRAISES', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (329, 'SUPINE PUSHUPS', 'https://www.youtube.com/watch?v=8H-TSjVRCUA', 'Lie on your back with your feet flat on the floor and your arms bent on two sides. \r\n\r\nPush your chest up as far as you can, and then slowly go back  to the start position. \r\n\r\nRepeat the exercise.', 'step', 14, '14', '14', 21, 3, 1, 0, 'img_exercise/SUPINEPUSHUP', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (330, 'HOVER PUSHUPS', 'https://www.youtube.com/watch?v=9f6tdzkA7Tg', 'Start in a push-up position. Lower yourself; shift your body to the left and then to the right. \r\n\r\nPush your body up and repeat the exercise.', 'step', 16, '16', '16', 21, 3, 1, 0, 'img_exercise/HOVERPUSHUP', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (331, 'REVERSE SNOW ANGELS', 'https://www.youtube.com/watch?v=ijr9vR9QLIM', 'Lie on your stomach with your arms to your sides. \r\n\r\nLift your arms up and extend them over your head to touch your thumbs. \r\n\r\nThen slowly bring them back. \r\n\r\nRepeat the exercise.', 'step', 10, '10', '10', 21, 3, 1, 0, 'img_exercise/REVERSESNOWANGELS', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (332, 'FLOOR Y RAISES', 'https://www.youtube.com/watch?v=rSV-cyaqdFg', 'Lie face down on the floor with your arms fully extended and your thumbs pointing up, your body should be in the shape of the letter \"Y\". \r\n\r\nRaise your arms off the ground as far as you can and pause them at the top for 2 seconds. \r\n\r\nSlowly go back the start position, and repeat the exercise.', 'step', 14, '14', '14', 21, 3, 1, 0, 'img_exercise/FLOORYRAISES', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (333, 'SUPINE PUSHUPS', 'https://www.youtube.com/watch?v=8H-TSjVRCUA', 'Lie on your back with your feet flat on the floor and your arms bent on two sides. \r\n\r\nPush your chest up as far as you can, and then slowly go back  to the start position. \r\n\r\nRepeat the exercise.', 'step', 14, '14', '14', 21, 3, 1, 0, 'img_exercise/SUPINEPUSHUP', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (334, 'HOVER PUSHUPS', 'https://www.youtube.com/watch?v=9f6tdzkA7Tg', 'Start in a push-up position. Lower yourself; shift your body to the left and then to the right. \r\n\r\nPush your body up and repeat the exercise.', 'step', 16, '16', '16', 21, 3, 1, 0, 'img_exercise/HOVERPUSHUP', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (335, 'REVERSE SNOW ANGELS', 'https://www.youtube.com/watch?v=ijr9vR9QLIM', 'Lie on your stomach with your arms to your sides. \r\n\r\nLift your arms up and extend them over your head to touch your thumbs. \r\n\r\nThen slowly bring them back. \r\n\r\nRepeat the exercise.', 'step', 10, '10', '10', 21, 3, 1, 0, 'img_exercise/REVERSESNOWANGELS', 17, 17);
INSERT INTO `tbl_full_body_workouts_list` VALUES (336, 'CHILD\'S POSE', 'https://www.youtube.com/watch?v=2MJGg-dUKh0', 'Start with your knees and hands on the floor. \r\n\r\nPut your hands a little forward, widen your knees and put your toes together.\r\n \r\nTake a breath, then exhale and sit back. \r\n\r\nTry to make your butt touch your heels. \r\n\r\nRelax your elbows, make your forehead touch the floor and try to lower your chest close to the floor. Hold thid position. \r\n\r\nKeep your arms stretched forward as you sit back. \r\n\r\nMake sure there is enough space between your shoulders and ears during the exercise.', 'time', 30, '00:30', '00:30', 21, 3, 1, 0, 'img_exercise/CHILDSPOSE', 18, 18);
INSERT INTO `tbl_full_body_workouts_list` VALUES (337, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups.', 'time', 30, '00:30', '00:30', 22, 4, 1, 0, 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (338, 'ARM CIRCLES', 'https://www.youtube.com/watch?v=140RTNMciH8', 'Stand on the floor with your arms extended straight out to the sides at shoulder height. \r\n\r\nMove your arms forward in circles, and then move backwards.', 'step', 20, '20', '20', 22, 4, 1, 0, 'img_exercise/ARMCIRCLESCLOCKWISE', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (339, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt`s a great exercise for the chest, shoulders, arms and core.', 'step', 8, '10', '12', 22, 4, 1, 0, 'img_exercise/PUSHUPROTATION', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (340, 'STAGGERED PUSHUPS', 'https://www.youtube.com/watch?v=lg8Mo5dr2No', 'Start in the regular push-up position, but with one hand in front of the other. \r\n\r\nThen do a push-up and switch the other hand in front. \r\n\r\nRemember to keep your body straight.', 'step', 8, '10', '16', 22, 4, 1, 0, 'img_exercise/STAGGEREDPUSHUPS', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (341, 'HINDU PUSHUPS', 'https://www.youtube.com/watch?v=nBLy1IGtSJ8', 'Start with your hands and feet touching the floor, body bent and butt up in an upside down `V` shape. \r\n\r\nThen bend your elbows to bring your body towardds the floor. \r\n\r\nWhen your body is close to the floor, raise your upper body up as far as possible. \r\n\r\nThen return to the original position and repeat.', 'step', 6, '8', '12', 22, 4, 1, 0, 'img_exercise/HINDUPUSHUPS', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (342, 'DIAMOND PUSHUPS', 'https://www.youtube.com/watch?v=jaxbEHLC4qU', 'Start in the push-up position. \r\n\r\nMake a diamond shape with your forefingers and thumbs together under your chest. \r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 8, '10', '12', 22, 4, 1, 0, 'img_exercise/DIAMONDPUSHUPS', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (343, 'SPIDERMAN PUSHUPS', 'https://www.youtube.com/watch?v=DYONORexgpY', 'Start in the regular push-up position. \r\n\r\nWhen lowering your torso downward, bend and lift one leg to the side. \r\n\r\nThen return to the start position and switch to the other leg. \r\n\r\nRemember to keep your body straight.', 'step', 8, '10', '14', 22, 4, 1, 0, 'img_exercise/SPIDERMANPUSHUPS', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (344, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 'step', 10, '16', '20', 22, 4, 1, 0, 'img_exercise/PUSHUPS', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (345, 'STAGGERED PUSHUPS', 'https://www.youtube.com/watch?v=lg8Mo5dr2No', 'Start in the regular push-up position, but with one hand in front of the other. \r\n\r\nThen do a push-up and switch the other hand in front. \r\n\r\nRemember to keep your body straight.', 'step', 8, '10', '14', 22, 4, 1, 0, 'img_exercise/STAGGEREDPUSHUPS', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (346, 'DECLINE PUSHUPS', 'https://www.youtube.com/watch?v=PXIpw1JD4qw', 'Start on all fours with your knees under your butt and your hands under your sholders. \r\n\r\nThen elevate your feet on a chair or bench, and push your body up and down mainly using your arm strength. \r\n\r\nRemember to keep your body straight.', 'step', 8, '10', '14', 22, 4, 1, 0, 'img_exercise/DECLINEPUSHUPS', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (347, 'HINDU PUSHUPS', 'https://www.youtube.com/watch?v=nBLy1IGtSJ8', 'Start with your hands and feet touching the floor, body bent and butt up in an upside down `V` shape. \r\n\r\nThen bend your elbows to bring your body towardds the floor. \r\n\r\nWhen your body is close to the floor, raise your upper body up as far as possible. \r\n\r\nThen return to the original position and repeat.', 'step', 6, '8', '10', 22, 4, 1, 0, 'img_exercise/HINDUPUSHUPS', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (348, 'SPIDERMAN PUSHUPS', 'https://www.youtube.com/watch?v=DYONORexgpY', 'Start in the regular push-up position. \r\n\r\nWhen lowering your torso downward, bend and lift one leg to the side. \r\n\r\nThen return to the start position and switch to the other leg. \r\n\r\nRemember to keep your body straight.', 'step', 6, '8', '10', 22, 4, 1, 0, 'img_exercise/SPIDERMANPUSHUPS', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (349, 'SHOULDER STRETCH', 'https://www.youtube.com/watch?v=K8sr1CGmKRw', 'Place one arm across your body, parallel to the ground, then use the other arm to pull the parallel arm toward your chest. \r\n\r\nHold for a while, switch arms and repeat the exercise. \r\n\r\nKeep the inside arm straight during the exercise.', 'time', 30, '00:30', '00:30', 22, 4, 1, 0, 'img_exercise/SHOULDERSTRETCH', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (350, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 30, '00:30', '00:30', 22, 4, 1, 0, 'img_exercise/COBRASTRETCH', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (351, 'CHEST STRETCH', 'https://www.youtube.com/watch?v=Kvo7054R3fQ', 'Find a doorway, take a lunge position in the doorway with your arms on the doorframe and your elbows a little lower than your shoulders, then slowly bring your chest forward\r\n\r\nHold this position for 30-40 seconds. \r\n\r\nThe slowly come out of it, bring your arms down and do a couple of shoulder rolls.\r\n\r\nDon\'t pull your head forward, and keep your neck relaxed.', 'time', 30, '00:30', '00:30', 22, 4, 1, 0, 'img_exercise/CHESTSTRETCH', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (352, 'SIT UPS', 'https://www.youtube.com/watch?v=1fbU_MkV7NE', 'Lie on your back with your hands behind your ears. \r\n\r\nThen lift your upper body off the floor and slowly up to the sitting position. \r\n\r\nDon\'t tug your neck when you get up. \r\n\r\nSlowly go back to the start position and repeat the exercise. \r\n\r\nIf you spine hurts, please change to another workout.', 'step', 18, '18', '18', 23, 4, 1, 0, 'img_exercise/SITUPS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (353, 'ABDOMINAL CRUNCHES', 'https://www.youtube.com/watch?v=Xyd_fa5zoEU', 'Lie on your back with your knees bent and your arms stretched forward.\r\n\r\nThen lift your upper body off the floor. \r\n\r\nHold for a few seconds and slowly return.\r\n\r\nIt primarily works the rectus abdominis muscle and the obliques.', 'step', 20, '20', '20', 23, 4, 1, 0, 'img_exercise/ABDOMINALCRUNCHES', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (354, 'MOUNTAIN CLIMBER', 'https://www.youtube.com/watch?v=nmwgirgXLYM', 'Start in the push-up position. \r\n\r\nBend your right knee towards your chest and keep your left leg straight, then quickly switch from one leg to the other. \r\n\r\nThis exercise strengthens multiple muscle groups.', 'step', 18, '18', '18', 23, 4, 1, 0, 'img_exercise/MOUNTAINCLIMBER', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (355, 'HEEL TOUCH', 'https://www.youtube.com/watch?v=RW25fbkQxVQ', 'Lie on the ground with your legs bent and your arms by your sides.\r\n \r\nSlightly lift your body of the floor and make your hands alternately reach your heels.', 'step', 24, '24', '24', 23, 4, 1, 0, 'img_exercise/HEELTOUCH', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (356, 'PLANK', 'https://www.youtube.com/watch?v=pSHjTRCQxIw', 'Lie on the floor with your toes and forearms on the ground.\r\n\r\nKeep your body straight and hold this position as long as you can. \r\n\r\nThis exercise strengthens the abdomen, back and shoulders.', 'time', 50, '00:50', '00:50', 23, 4, 1, 0, 'img_exercise/PLANK', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (357, 'BUTT BRIDGE', 'https://www.youtube.com/watch?v=rWzV67w5-vU', 'Lie on your back with knees bent and feet flat on the floor. \r\n\r\nPut your arms flat at your sides. \r\n\r\nThen lift your butt up and down.', 'step', 20, '20', '20', 23, 4, 1, 0, 'img_exercise/BUTTBRIDGE', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (358, 'SIDE BRIDGES LEFT', 'https://www.youtube.com/watch?v=zyZaGLoEUC4', 'Lie on your right side. Put your right elbow directly under your shoulders and put your left hand on your waist. \r\n\r\nPlace your left leg on your right leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 'step', 18, '18', '18', 23, 4, 1, 0, 'img_exercise/SIDEBRIDGESLEFT', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (359, 'SIDE BRIDGES RIGHT', 'https://www.youtube.com/watch?v=Ko9jId015qc', 'Lie on your left side. Put your left elbow directly under your shoulders and put your right hand on your waist. \r\n\r\nPlace your right leg on your left leg. \r\n\r\nRaise your hips upward, hold for 2-4 seconds, then go back to the start position. \r\n\r\nRepeat this exercise.', 'step', 18, '18', '18', 23, 4, 1, 0, 'img_exercise/SIDEBRIDGESRIGHT', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (360, 'V UP', 'https://www.youtube.com/watch?v=riAutegDqdI', 'Lie on your back with your arms and legs extended and your legs squeezed together. \r\n\r\nRaise your upper body and legs, use your arms to touch your toes, then go back to the start position and repeat the exercise.', 'step', 16, '16', '16', 23, 4, 1, 0, 'img_exercise/VUP', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (361, 'ABDOMINAL CRUNCHES', 'https://www.youtube.com/watch?v=Xyd_fa5zoEU', 'Lie on your back with your knees bent and your arms stretched forward.\r\n\r\nThen lift your upper body off the floor. \r\n\r\nHold for a few seconds and slowly return.\r\n\r\nIt primarily works the rectus abdominis muscle and the obliques.', 'step', 20, '20', '20', 23, 4, 1, 0, 'img_exercise/ABDOMINALCRUNCHES', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (362, 'MOUNTAIN CLIMBER', 'https://www.youtube.com/watch?v=nmwgirgXLYM', 'Start in the push-up position. \r\n\r\nBend your right knee towards your chest and keep your left leg straight, then quickly switch from one leg to the other. \r\n\r\nThis exercise strengthens multiple muscle groups.', 'step', 18, '18', '18', 23, 4, 1, 0, 'img_exercise/MOUNTAINCLIMBER', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (363, 'HEEL TOUCH', 'https://www.youtube.com/watch?v=RW25fbkQxVQ', 'Lie on the ground with your legs bent and your arms by your sides.\r\n \r\nSlightly lift your body of the floor and make your hands alternately reach your heels.', 'step', 24, '24', '24', 23, 4, 1, 0, 'img_exercise/HEELTOUCH', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (364, 'LEG RAISES', 'https://www.youtube.com/watch?v=JB2oyawG9KI', 'Lie down on your back, and put your hands beneath your hips for support. \r\n\r\nThen lift your legs up until they form a right angle with the floor. \r\n\r\nSlowly bring your legs back down and repeat the exercise.', 'step', 22, '22', '22', 23, 4, 1, 0, 'img_exercise/LEGRAISES', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (365, 'BUTT BRIDGE', 'https://www.youtube.com/watch?v=rWzV67w5-vU', 'Lie on your back with knees bent and feet flat on the floor. \r\n\r\nPut your arms flat at your sides. \r\n\r\nThen lift your butt up and down.', 'step', 20, '20', '20', 23, 4, 1, 0, 'img_exercise/BUTTBRIDGE', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (366, 'V UP', 'https://www.youtube.com/watch?v=riAutegDqdI', 'Lie on your back with your arms and legs extended and your legs squeezed together. \r\n\r\nRaise your upper body and legs, use your arms to touch your toes, then go back to the start position and repeat the exercise.', 'step', 16, '16', '16', 23, 4, 1, 0, 'img_exercise/VUP', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (367, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt\'s a great exercise for the chest, shoulders, arms and core.', 'step', 18, '18', '18', 23, 4, 1, 0, 'img_exercise/PUSHUPROTATION', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (368, 'SIDE PLANK RIGHT', 'https://www.youtube.com/watch?v=4Azm8-c_k4Y', 'Lie on your right side with your forearm supporting your body. \r\n\r\nHold your body in a straight line. \r\n\r\nThis exercise targets the abdominal muscles and obliques.', 'time', 20, '00:20', '00:20', 23, 4, 1, 0, 'img_exercise/PLANK', 17, 17);
INSERT INTO `tbl_full_body_workouts_list` VALUES (369, 'SIDE PLANK LEFT', 'https://www.youtube.com/watch?v=qHBTBRYmoV4', 'Lie on your left side with your forearm supporting your body. \r\n\r\nHold your body in a straight line. \r\n\r\nThis exercise targets the abdominal muscles and obliques.', 'time', 20, '00:20', '00:20', 23, 4, 1, 0, 'img_exercise/PLANK', 18, 18);
INSERT INTO `tbl_full_body_workouts_list` VALUES (370, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 30, '00:30', '00:30', 23, 4, 1, 0, 'img_exercise/COBRASTRETCH', 19, 19);
INSERT INTO `tbl_full_body_workouts_list` VALUES (371, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=Im5nE3J558k', 'Lie on your back with your legs extended.\r\n \r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 'time', 30, '00:30', '00:30', 23, 4, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 20, 20);
INSERT INTO `tbl_full_body_workouts_list` VALUES (372, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 23, 4, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 21, 21);
INSERT INTO `tbl_full_body_workouts_list` VALUES (373, 'FLOOR TRICEP DIPS', 'https://www.youtube.com/watch?v=Nl578wCij6E', 'Sit on the floor with your knees bent and feet flat on the floor. \r\n\r\nPut your hands beneath your shoulders with your fingers pointing toward your hips. \r\n\r\nLift your hips off the floor. \r\n\r\nThen bens and extend your elbows to lower and lift your hips. \r\n\r\nRepeat the exercise to strengthen your upper arms.', 'step', 12, '12', '12', 24, 4, 1, 0, 'img_exercise/FLOORTRICEPDIPS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (374, 'PIKE PUSHUPS', 'https://www.youtube.com/watch?v=x7_I5SUAd00', 'Start with your hands and feet on the floor. \r\n\r\nPut your hands shoulder width apart. Bend your body, and lift your hips up in an upside down \'V\' shape. \r\n\r\nBend your elbows, and bring your head close to the floor. \r\n\r\nPush your body back, and repeat the exercise.', 'step', 12, '12', '12', 24, 4, 1, 0, 'img_exercise/PIKEPUSHUPS', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (375, 'REVERSE PUSHUPS', 'https://www.youtube.com/watch?v=a00N2M7I1_o', 'Start in the regular push-up position.\r\n \r\nLower your body down, then bend your knees and move your hips backward with your arms straight. \r\n\r\nGo back to the push-up position and repeat.', 'step', 10, '10', '10', 24, 4, 1, 0, 'img_exercise/REVERSEPUSHUPS', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (376, 'SIDE LYING FLOOR STRETCH LEFT', 'https://www.youtube.com/watch?v=pdgohzanlco', 'Lie on your right side with your right knee slightly bent in front of you and your left leg stretched behind the right leg. \r\n\r\nStraighten your left arms over your head and gently pull on your left wrist to stretch the left side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 24, 4, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHLEFT', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (377, 'SIDE LYING FLOOR STRETCH RIGHT', 'https://www.youtube.com/watch?v=lBdM0Zurwyo', 'Lie on your left side with your left knee slightly bent in front of you and your right leg stretched behind the left leg. \r\n\r\nStraighten your right arms over your head and gently pull on your right wrist to stretch the right side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 24, 4, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHRIGHT', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (378, 'FLOOR TRICEP DIPS', 'https://www.youtube.com/watch?v=Nl578wCij6E', 'Sit on the floor with your knees bent and feet flat on the floor. \r\n\r\nPut your hands beneath your shoulders with your fingers pointing toward your hips. \r\n\r\nLift your hips off the floor. \r\n\r\nThen bens and extend your elbows to lower and lift your hips. \r\n\r\nRepeat the exercise to strengthen your upper arms.', 'step', 10, '10', '10', 24, 4, 1, 0, 'img_exercise/FLOORTRICEPDIPS', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (379, 'PIKE PUSHUPS', 'https://www.youtube.com/watch?v=x7_I5SUAd00', 'Start with your hands and feet on the floor. \r\n\r\nPut your hands shoulder width apart. Bend your body, and lift your hips up in an upside down `V` shape. \r\n\r\nBend your elbows, and bring your head close to the floor. \r\n\r\nPush your body back, and repeat the exercise.', 'step', 10, '10', '10', 24, 4, 1, 0, 'img_exercise/PIKEPUSHUPS', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (380, 'REVERSE PUSHUPS', 'https://www.youtube.com/watch?v=a00N2M7I1_o', 'Start in the regular push-up position.\r\n \r\nLower your body down, then bend your knees and move your hips backward with your arms straight. \r\n\r\nGo back to the push-up position and repeat.', 'step', 8, '8', '8', 24, 4, 1, 0, 'img_exercise/REVERSEPUSHUPS', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (381, 'CAT COW POSE', 'https://www.youtube.com/watch?v=y39PrKY_4JM&list=RDQMVCd2F3GXNEQ&start_radio=1', 'Start on all fours with your knees under your butt and your hands directly under your shoulders.\r\n\r\nThen take a breath and make your belly fall down, shoulders roll back and head come up towards the ceiling. \r\n\r\nAs you exhale, curve your back upward and left your head come down. \r\n\r\nRepeat the exercise. \r\n\r\nDo it slowly with each step of this exercise.', 'time', 30, '00:30', '00:30', 24, 4, 1, 0, 'img_exercise/CATCOWPOSE', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (382, 'SUPINE PUSHUPS', 'https://www.youtube.com/watch?v=8H-TSjVRCUA', 'Lie on your back with your feet flat on the floor and your arms bent on two sides. \r\n\r\nPush your chest up as far as you can, and then slowly go back  to the start position. \r\n\r\nRepeat the exercise.', 'step', 16, '16', '16', 24, 4, 1, 0, 'img_exercise/SUPINEPUSHUP', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (383, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 'step', 14, '14', '14', 24, 4, 1, 0, 'img_exercise/HYPEREXTENSION', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (384, 'HOVER PUSHUPS', 'https://www.youtube.com/watch?v=9f6tdzkA7Tg', 'Start in a push-up position. Lower yourself; shift your body to the left and then to the right. \r\n\r\nPush your body up and repeat the exercise.', 'step', 16, '16', '16', 24, 4, 1, 0, 'img_exercise/HOVERPUSHUP', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (385, 'REVERSE SNOW ANGELS', 'https://www.youtube.com/watch?v=ijr9vR9QLIM', 'Lie on your stomach with your arms to your sides. \r\n\r\nLift your arms up and extend them over your head to touch your thumbs. \r\n\r\nThen slowly bring them back. \r\n\r\nRepeat the exercise.', 'step', 12, '12', '12', 24, 4, 1, 0, 'img_exercise/REVERSESNOWANGELS', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (386, 'SUPINE PUSHUPS', 'https://www.youtube.com/watch?v=8H-TSjVRCUA', 'Lie on your back with your feet flat on the floor and your arms bent on two sides. \r\n\r\nPush your chest up as far as you can, and then slowly go back  to the start position. \r\n\r\nRepeat the exercise.', 'step', 16, '16', '16', 24, 4, 1, 0, 'img_exercise/SUPINEPUSHUP', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (387, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 'step', 14, '14', '14', 24, 4, 1, 0, 'img_exercise/HYPEREXTENSION', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (388, 'HOVER PUSHUPS', 'https://www.youtube.com/watch?v=9f6tdzkA7Tg', 'Start in a push-up position. Lower yourself; shift your body to the left and then to the right. \r\n\r\nPush your body up and repeat the exercise.', 'step', 16, '16', '16', 24, 4, 1, 0, 'img_exercise/HOVERPUSHUP', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (389, 'REVERSE SNOW ANGELS', 'https://www.youtube.com/watch?v=ijr9vR9QLIM', 'Lie on your stomach with your arms to your sides. \r\n\r\nLift your arms up and extend them over your head to touch your thumbs. \r\n\r\nThen slowly bring them back. \r\n\r\nRepeat the exercise.', 'step', 12, '12', '12', 24, 4, 1, 0, 'img_exercise/REVERSESNOWANGELS', 17, 17);
INSERT INTO `tbl_full_body_workouts_list` VALUES (390, 'CHILD\'S POSE', 'https://www.youtube.com/watch?v=2MJGg-dUKh0', 'Start with your knees and hands on the floor. \r\n\r\nPut your hands a little forward, widen your knees and put your toes together.\r\n \r\nTake a breath, then exhale and sit back. \r\n\r\nTry to make your butt touch your heels. \r\n\r\nRelax your elbows, make your forehead touch the floor and try to lower your chest close to the floor. Hold thid position. \r\n\r\nKeep your arms stretched forward as you sit back. \r\n\r\nMake sure there is enough space between your shoulders and ears during the exercise.', 'time', 30, '00:30', '00:30', 24, 4, 1, 0, 'img_exercise/CHILDSPOSE', 18, 18);
INSERT INTO `tbl_full_body_workouts_list` VALUES (391, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups.', 'time', 30, '00:30', '00:30', 25, 4, 1, 0, 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (392, 'ARM CIRCLES', 'https://www.youtube.com/watch?v=140RTNMciH8', 'Stand on the floor with your arms extended straight out to the sides at shoulder height. \r\n\r\nMove your arms forward in circles, and then move backwards.', 'step', 20, '20', '20', 25, 4, 1, 0, 'img_exercise/ARMCIRCLESCLOCKWISE', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (393, 'BURPEES', 'https://www.youtube.com/watch?v=wS4OsJ4yzx4', 'Stand with your feet shoulder width apart, then put your hands on the ground and kick your feet backwards. \r\n\r\nDo a quick push-up and then jump up.', 'step', 4, '4', '6', 25, 4, 1, 0, 'img_exercise/BURPEES', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (394, 'WIDE ARM PUSHUPS', 'https://www.youtube.com/watch?v=dmoHFWt-Mms', 'start in the regular push-up position but with your hands spread wider than your shoulders.\r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 10, '14', '18', 25, 4, 1, 0, 'img_exercise/WIDEARMPUSHUPS', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (395, 'STAGGERED PUSHUPS', 'https://www.youtube.com/watch?v=lg8Mo5dr2No', 'Start in the regular push-up position, but with one hand in front of the other. \r\n\r\nThen do a push-up and switch the other hand in front. \r\n\r\nRemember to keep your body straight.', 'step', 8, '10', '16', 25, 4, 1, 0, 'img_exercise/STAGGEREDPUSHUPS', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (396, 'DECLINE PUSHUPS', 'https://www.youtube.com/watch?v=PXIpw1JD4qw', 'Start on all fours with your knees under your butt and your hands under your sholders. \r\n\r\nThen elevate your feet on a chair or bench, and push your body up and down mainly using your arm strength. \r\n\r\nRemeember to keep your body straight.', 'step', 6, '8', '16', 25, 4, 1, 0, 'img_exercise/DECLINEPUSHUPS', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (397, 'HINDU PUSHUPS', 'https://www.youtube.com/watch?v=nBLy1IGtSJ8', 'Start with your hands and feet touching the floor, body bent and butt up in an upside down `V` shape. \r\n\r\nThen bend your elbows to bring your body towardds the floor. \r\n\r\nWhen your body is close to the floor, raise your upper body up as far as possible. \r\n\r\nThen return to the original position and repeat.', 'step', 8, '10', '14', 25, 4, 1, 0, 'img_exercise/HINDUPUSHUPS', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (398, 'DIAMOND PUSHUPS', 'https://www.youtube.com/watch?v=jaxbEHLC4qU', 'Start in the push-up position. \r\n\r\nMake a diamond shape with your forefingers and thumbs together under your chest. \r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 10, '12', '16', 25, 4, 1, 0, 'img_exercise/DIAMONDPUSHUPS', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (399, 'SPIDERMAN PUSHUPS', 'https://www.youtube.com/watch?v=DYONORexgpY', 'Start in the regular push-up position. \r\n\r\nWhen lowering your torso downward, bend and lift one leg to the side. \r\n\r\nThen return to the start position and switch to the other leg. \r\n\r\nRemember to keep your body straight.', 'step', 10, '12', '16', 25, 4, 1, 0, 'img_exercise/SPIDERMANPUSHUPS', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (400, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 'step', 10, '16', '20', 25, 4, 1, 0, 'img_exercise/PUSHUPS', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (401, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt\'s a great exercise for the chest, shoulders, arms and core.', 'step', 8, '10', '12', 25, 4, 1, 0, 'img_exercise/PUSHUPROTATION', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (402, 'DIAMOND PUSHUPS', 'https://www.youtube.com/watch?v=jaxbEHLC4qU', 'Start in the push-up position. \r\n\r\nMake a diamond shape with your forefingers and thumbs together under your chest. \r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 8, '10', '12', 25, 4, 1, 0, 'img_exercise/DIAMONDPUSHUPS', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (403, 'SPIDERMAN PUSHUPS', 'https://www.youtube.com/watch?v=DYONORexgpY', 'Start in the regular push-up position. \r\n\r\nWhen lowering your torso downward, bend and lift one leg to the side. \r\n\r\nThen return to the start position and switch to the other leg. \r\n\r\nRemember to keep your body straight.', 'step', 8, '10', '12', 25, 4, 1, 0, 'img_exercise/SPIDERMANPUSHUPS', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (404, 'SHOULDER STRETCH', 'https://www.youtube.com/watch?v=K8sr1CGmKRw', 'Place one arm across your body, parallel to the ground, then use the other arm to pull the parallel arm toward your chest. \r\n\r\nHold for a while, switch arms and repeat the exercise. \r\n\r\nKeep the inside arm straight during the exercise.', 'time', 30, '00:30', '00:30', 25, 4, 1, 0, 'img_exercise/SHOULDERSTRETCH', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (405, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 30, '00:30', '00:30', 25, 4, 1, 0, 'img_exercise/COBRASTRETCH', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (406, 'CHEST STRETCH', 'https://www.youtube.com/watch?v=Kvo7054R3fQ', 'Find a doorway, take a lunge position in the doorway with your arms on the doorframe and your elbows a little lower than your shoulders, then slowly bring your chest forward\r\n\r\nHold this position for 30-40 seconds. \r\n\r\nThe slowly come out of it, bring your arms down and do a couple of shoulder rolls.\r\n\r\nDon\'t pull your head forward, and keep your neck relaxed.', 'time', 30, '00:30', '00:30', 25, 4, 1, 0, 'img_exercise/CHESTSTRETCH', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (407, 'ABDOMINAL CRUNCHES', 'https://www.youtube.com/watch?v=Xyd_fa5zoEU', 'Lie on your back with your knees bent and your arms stretched forward.\r\n\r\nThen lift your upper body off the floor. \r\n\r\nHold for a few seconds and slowly return.\r\n\r\nIt primarily works the rectus abdominis muscle and the obliques.', 'step', 22, '22', '22', 26, 4, 1, 0, 'img_exercise/ABDOMINALCRUNCHES', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (408, 'RUSSIAN TWIST', 'https://www.youtube.com/watch?v=wkD8rjkodUI', 'Sit on the floor with your knees bent, feet lifted a little bit and back tilted backwords. \r\n\r\nThen hold your hands together and twist from side to side.', 'step', 22, '22', '22', 26, 4, 1, 0, 'img_exercise/RUSSIANTWIST', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (409, 'MOUNTAIN CLIMBER', 'https://www.youtube.com/watch?v=nmwgirgXLYM', 'Start in the push-up position. \r\n\r\nBend your right knee towards your chest and keep your left leg straight, then quickly switch from one leg to the other. \r\n\r\nThis exercise strengthens multiple muscle groups.', 'step', 20, '20', '20', 26, 4, 1, 0, 'img_exercise/MOUNTAINCLIMBER', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (410, 'LEG RAISES', 'https://www.youtube.com/watch?v=JB2oyawG9KI', 'Lie down on your back, and put your hands beneath your hips for support. \r\n\r\nThen lift your legs up until they form a right angle with the floor. \r\n\r\nSlowly bring your legs back down and repeat the exercise.', 'step', 22, '22', '22', 26, 4, 1, 0, 'img_exercise/LEGRAISES', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (411, 'CROSSOVER CRUNCH', 'https://www.youtube.com/watch?v=nCsgWiL-J90', 'Lie on your back with your knees bent and your hands behind your ears.\r\n \r\nRaise and twist your torso so your right elbow moves to meet your left knee. \r\n\r\nRepeat with the other side.', 'step', 20, '20', '20', 26, 4, 1, 0, 'img_exercise/CROSSOVERCRUNCH', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (412, 'BICYCLE CRUNCHES', 'https://www.youtube.com/watch?v=Iwyvozckjak', 'Lie on the floor with your hands behind your ears. \r\n\r\nRaise your knees and close your right elbows toward your left knee, then close your left elbow toward your right knee. \r\n\r\nRepear the exercise.', 'step', 20, '20', '20', 26, 4, 1, 0, 'img_exercise/BICYCLECRUNCHES', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (413, 'ABDOMINAL CRUNCHES', 'https://www.youtube.com/watch?v=Xyd_fa5zoEU', 'Lie on your back with your knees bent and your arms stretched forward.\r\n\r\nThen lift your upper body off the floor. \r\n\r\nHold for a few seconds and slowly return.\r\n\r\nIt primarily works the rectus abdominis muscle and the obliques.', 'step', 22, '22', '22', 26, 4, 1, 0, 'img_exercise/ABDOMINALCRUNCHES', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (414, 'RUSSIAN TWIST', 'https://www.youtube.com/watch?v=wkD8rjkodUI', 'Sit on the floor with your knees bent, feet lifted a little bit and back tilted backwords. \r\n\r\nThen hold your hands together and twist from side to side.', 'step', 26, '26', '26', 26, 4, 1, 0, 'img_exercise/RUSSIANTWIST', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (415, 'MOUNTAIN CLIMBER', 'https://www.youtube.com/watch?v=nmwgirgXLYM', 'Start in the push-up position. \r\n\r\nBend your right knee towards your chest and keep your left leg straight, then quickly switch from one leg to the other. \r\n\r\nThis exercise strengthens multiple muscle groups.', 'step', 20, '20', '20', 26, 4, 1, 0, 'img_exercise/MOUNTAINCLIMBER', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (416, 'LEG RAISES', 'https://www.youtube.com/watch?v=JB2oyawG9KI', 'Lie down on your back, and put your hands beneath your hips for support. \r\n\r\nThen lift your legs up until they form a right angle with the floor. \r\n\r\nSlowly bring your legs back down and repeat the exercise.', 'step', 24, '24', '24', 26, 4, 1, 0, 'img_exercise/LEGRAISES', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (417, 'CROSSOVER CRUNCH', 'https://www.youtube.com/watch?v=nCsgWiL-J90', 'Lie on your back with your knees bent and your hands behind your ears.\r\n \r\nRaise and twist your torso so your right elbow moves to meet your left knee. \r\n\r\nRepeat with the other side.', 'step', 22, '22', '22', 26, 4, 1, 0, 'img_exercise/CROSSOVERCRUNCH', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (418, 'BICYCLE CRUNCHES', 'https://www.youtube.com/watch?v=Iwyvozckjak', 'Lie on the floor with your hands behind your ears. \r\n\r\nRaise your knees and close your right elbows toward your left knee, then close your left elbow toward your right knee. \r\n\r\nRepear the exercise.', 'step', 24, '24', '24', 26, 4, 1, 0, 'img_exercise/BICYCLECRUNCHES', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (419, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt\'s a great exercise for the chest, shoulders, arms and core.', 'step', 20, '20', '20', 26, 4, 1, 0, 'img_exercise/PUSHUPROTATION', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (420, 'SIDE PLANK RIGHT', 'https://www.youtube.com/watch?v=4Azm8-c_k4Y', 'Lie on your right side with your forearm supporting your body. \r\n\r\nHold your body in a straight line. \r\n\r\nThis exercise targets the abdominal muscles and obliques.', 'time', 20, '00:20', '00:20', 26, 4, 1, 0, 'img_exercise/PLANK', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (421, 'SIDE PLANK LEFT', 'https://www.youtube.com/watch?v=qHBTBRYmoV4', 'Lie on your left side with your forearm supporting your body. \r\n\r\nHold your body in a straight line. \r\n\r\nThis exercise targets the abdominal muscles and obliques.', 'time', 20, '00:20', '00:20', 26, 4, 1, 0, 'img_exercise/PLANK', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (422, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 30, '00:30', '00:30', 26, 4, 1, 0, 'img_exercise/COBRASTRETCH', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (423, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=Im5nE3J558k', 'Lie on your back with your legs extended.\r\n \r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 'time', 30, '00:30', '00:30', 26, 4, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 17, 17);
INSERT INTO `tbl_full_body_workouts_list` VALUES (424, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 26, 4, 1, 0, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 18, 18);
INSERT INTO `tbl_full_body_workouts_list` VALUES (425, 'FLOOR TRICEP DIPS', 'https://www.youtube.com/watch?v=Nl578wCij6E', 'Sit on the floor with your knees bent and feet flat on the floor. \r\n\r\nPut your hands beneath your shoulders with your fingers pointing toward your hips. \r\n\r\nLift your hips off the floor. \r\n\r\nThen bens and extend your elbows to lower and lift your hips. \r\n\r\nRepeat the exercise to strengthen your upper arms.', 'step', 14, '14', '14', 27, 4, 1, 0, 'img_exercise/FLOORTRICEPDIPS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (426, 'PIKE PUSHUPS', 'https://www.youtube.com/watch?v=x7_I5SUAd00', 'Start with your hands and feet on the floor. \r\n\r\nPut your hands shoulder width apart. Bend your body, and lift your hips up in an upside down `V` shape. \r\n\r\nBend your elbows, and bring your head close to the floor. \r\n\r\nPush your body back, and repeat the exercise.', 'step', 14, '14', '14', 27, 4, 1, 0, 'img_exercise/PIKEPUSHUPS', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (427, 'REVERSE PUSHUPS', 'https://www.youtube.com/watch?v=a00N2M7I1_o', 'Start in the regular push-up position.\r\n \r\nLower your body down, then bend your knees and move your hips backward with your arms straight. \r\n\r\nGo back to the push-up position and repeat.', 'step', 12, '12', '12', 27, 4, 1, 0, 'img_exercise/REVERSEPUSHUPS', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (428, 'SIDE LYING FLOOR STRETCH LEFT', 'https://www.youtube.com/watch?v=pdgohzanlco', 'Lie on your right side with your right knee slightly bent in front of you and your left leg stretched behind the right leg. \r\n\r\nStraighten your left arms over your head and gently pull on your left wrist to stretch the left side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 27, 4, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHLEFT', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (429, 'SIDE LYING FLOOR STRETCH RIGHT', 'https://www.youtube.com/watch?v=lBdM0Zurwyo', 'Lie on your left side with your left knee slightly bent in front of you and your right leg stretched behind the left leg. \r\n\r\nStraighten your right arms over your head and gently pull on your right wrist to stretch the right side of your body. \r\n\r\nHold this position for a few seconds.', 'time', 30, '00:30', '00:30', 27, 4, 1, 0, 'img_exercise/SIDELYINGFLOORSTRETCHRIGHT', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (430, 'FLOOR TRICEP DIPS', 'https://www.youtube.com/watch?v=Nl578wCij6E', 'Sit on the floor with your knees bent and feet flat on the floor. \r\n\r\nPut your hands beneath your shoulders with your fingers pointing toward your hips. \r\n\r\nLift your hips off the floor. \r\n\r\nThen bens and extend your elbows to lower and lift your hips. \r\n\r\nRepeat the exercise to strengthen your upper arms.', 'step', 12, '12', '12', 27, 4, 1, 0, 'img_exercise/FLOORTRICEPDIPS', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (431, 'PIKE PUSHUPS', 'https://www.youtube.com/watch?v=x7_I5SUAd00', 'Start with your hands and feet on the floor. \r\n\r\nPut your hands shoulder width apart. Bend your body, and lift your hips up in an upside down `V` shape. \r\n\r\nBend your elbows, and bring your head close to the floor. \r\n\r\nPush your body back, and repeat the exercise.', 'step', 12, '12', '12', 27, 4, 1, 0, 'img_exercise/PIKEPUSHUPS', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (432, 'REVERSE PUSHUPS', 'https://www.youtube.com/watch?v=a00N2M7I1_o', 'Start in the regular push-up position.\r\n \r\nLower your body down, then bend your knees and move your hips backward with your arms straight. \r\n\r\nGo back to the push-up position and repeat.', 'step', 10, '10', '10', 27, 4, 1, 0, 'img_exercise/REVERSEPUSHUPS', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (433, 'CAT COW POSE', 'https://www.youtube.com/watch?v=y39PrKY_4JM&list=RDQMVCd2F3GXNEQ&start_radio=1', 'Start on all fours with your knees under your butt and your hands directly under your shoulders.\r\n\r\nThen take a breath and make your belly fall down, shoulders roll back and head come up towards the ceiling. \r\n\r\nAs you exhale, curve your back upward and left your head come down. \r\n\r\nRepeat the exercise. \r\n\r\nDo it slowly with each step of this exercise.', 'time', 30, '00:30', '00:30', 27, 4, 1, 0, 'img_exercise/CATCOWPOSE', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (434, 'SUPINE PUSHUPS', 'https://www.youtube.com/watch?v=8H-TSjVRCUA', 'Lie on your back with your feet flat on the floor and your arms bent on two sides. \r\n\r\nPush your chest up as far as you can, and then slowly go back  to the start position. \r\n\r\nRepeat the exercise.', 'step', 16, '16', '16', 27, 4, 1, 0, 'img_exercise/SUPINEPUSHUP', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (435, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 'step', 16, '16', '16', 27, 4, 1, 0, 'img_exercise/HYPEREXTENSION', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (436, 'HOVER PUSHUPS', 'https://www.youtube.com/watch?v=9f6tdzkA7Tg', 'Start in a push-up position. Lower yourself, shift your body to the left and then to the right. \r\n\r\nPush your body up and repeat the exercise.', 'step', 16, '16', '16', 27, 4, 1, 0, 'img_exercise/HOVERPUSHUP', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (437, 'REVERSE SNOW ANGELS', 'https://www.youtube.com/watch?v=ijr9vR9QLIM', 'Lie on your stomach with your arms to your sides. \r\n\r\nLift your arms up and extend them over your head to touch your thumbs. \r\n\r\nThen slowly bring them back. \r\n\r\nRepeat the exercise.', 'step', 14, '14', '14', 27, 4, 1, 0, 'img_exercise/REVERSESNOWANGELS', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (438, 'SUPINE PUSHUPS', 'https://www.youtube.com/watch?v=8H-TSjVRCUA', 'Lie on your back with your feet flat on the floor and your arms bent on two sides. \r\n\r\nPush your chest up as far as you can, and then slowly go back  to the start position. \r\n\r\nRepeat the exercise.', 'step', 16, '16', '16', 27, 4, 1, 0, 'img_exercise/SUPINEPUSHUP', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (439, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'Lie down on your stomach with your toes touching the floor, and your chin on your hand. \r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the strat position. \r\n\r\nRepeat this exercise.', 'step', 16, '16', '16', 27, 4, 1, 0, 'img_exercise/HYPEREXTENSION', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (440, 'HOVER PUSHUPS', 'https://www.youtube.com/watch?v=9f6tdzkA7Tg', 'Start in a push-up position. Lower yourself; shift your body to the left and then to the right. \r\n\r\nPush your body up and repeat the exercise.', 'step', 16, '16', '16', 27, 4, 1, 0, 'img_exercise/HOVERPUSHUP', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (441, 'REVERSE SNOW ANGELS', 'https://www.youtube.com/watch?v=ijr9vR9QLIM', 'Lie on your stomach with your arms to your sides. \r\n\r\nLift your arms up and extend them over your head to touch your thumbs. \r\n\r\nThen slowly bring them back. \r\n\r\nRepeat the exercise.', 'step', 14, '14', '14', 27, 4, 1, 0, 'img_exercise/REVERSESNOWANGELS', 17, 17);
INSERT INTO `tbl_full_body_workouts_list` VALUES (442, 'CHILD\'S POSE', 'https://www.youtube.com/watch?v=2MJGg-dUKh0', 'Start with your knees and hands on the floor. \r\n\r\nPut your hands a little forward, widen your knees and put your toes together.\r\n \r\nTake a breath, then exhale and sit back. \r\n\r\nTry to make your butt touch your heels. \r\n\r\nRelax your elbows, make your forehead touch the floor and try to lower your chest close to the floor. Hold thid position. \r\n\r\nKeep your arms stretched forward as you sit back. \r\n\r\nMake sure there is enough space between your shoulders and ears during the exercise.', 'time', 30, '00:30', '00:30', 27, 4, 1, 0, 'img_exercise/CHILDSPOSE', 18, 18);
INSERT INTO `tbl_full_body_workouts_list` VALUES (443, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups.', 'time', 30, '00:30', '00:30', 28, 4, 1, 0, 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_full_body_workouts_list` VALUES (444, 'ARM CIRCLES', 'https://www.youtube.com/watch?v=140RTNMciH8', 'Stand on the floor with your arms extended straight out to the sides at shoulder height. \r\n\r\nMove your arms forward in circles, and then move backwards.', 'step', 20, '20', '20', 28, 4, 1, 0, 'img_exercise/ARMCIRCLESCLOCKWISE', 2, 2);
INSERT INTO `tbl_full_body_workouts_list` VALUES (445, 'SHOULDER STRETCH', 'https://www.youtube.com/watch?v=K8sr1CGmKRw', 'Place one arm across your body, parallel to the ground, then use the other arm to pull the parallel arm toward your chest. \r\n\r\nHold for a while, switch arms and repeat the exercise. \r\n\r\nKeep the inside arm straight during the exercise.', 'time', 30, '00:30', '00:30', 28, 4, 1, 0, 'img_exercise/SHOULDERSTRETCH', 3, 3);
INSERT INTO `tbl_full_body_workouts_list` VALUES (446, 'BURPEES', 'https://www.youtube.com/watch?v=wS4OsJ4yzx4', 'Stand with your feet shoulder width apart, then put your hands on the ground and kick your feet backwards. \r\n\r\nDo a quick push-up and then jump up.', 'step', 6, '6', '6', 28, 4, 1, 0, 'img_exercise/BURPEES', 4, 4);
INSERT INTO `tbl_full_body_workouts_list` VALUES (447, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 'step', 12, '16', '20', 28, 4, 1, 0, 'img_exercise/PUSHUPS', 5, 5);
INSERT INTO `tbl_full_body_workouts_list` VALUES (448, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt\'s a great exercise for the chest, shoulders, arms and core.', 'step', 10, '12', '14', 28, 4, 1, 0, 'img_exercise/PUSHUPROTATION', 6, 6);
INSERT INTO `tbl_full_body_workouts_list` VALUES (449, 'DIAMOND PUSHUPS', 'https://www.youtube.com/watch?v=jaxbEHLC4qU', 'Start in the push-up position. \r\n\r\nMake a diamond shape with your forefingers and thumbs together under your chest. \r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 10, '14', '18', 28, 4, 1, 0, 'img_exercise/DIAMONDPUSHUPS', 7, 7);
INSERT INTO `tbl_full_body_workouts_list` VALUES (450, 'SPIDERMAN PUSHUPS', 'https://www.youtube.com/watch?v=DYONORexgpY', 'Start in the regular push-up position. \r\n\r\nWhen lowering your torso downward, bend and lift one leg to the side. \r\n\r\nThen return to the start position and switch to the other leg. \r\n\r\nRemember to keep your body straight.', 'step', 10, '14', '18', 28, 4, 1, 0, 'img_exercise/SPIDERMANPUSHUPS', 8, 8);
INSERT INTO `tbl_full_body_workouts_list` VALUES (451, 'PUSHUPS', 'https://www.youtube.com/watch?v=FaIpD_zfrJI', 'Lay prone on the ground with arms supporting your body.\r\n\r\nKeep your body straight while raising and lowering your body with your arms.\r\n\r\nThis exercise works the chest, shoulders, triceps, back and legs.', 'step', 12, '18', '22', 28, 4, 1, 0, 'img_exercise/PUSHUPS', 9, 9);
INSERT INTO `tbl_full_body_workouts_list` VALUES (452, 'PUSH-UP & ROTATION', 'https://www.youtube.com/watch?v=YU0gWh72a3k', 'Start in the push-up position. \r\n\r\nThen go down for a push-up and as you come up, rotate your upper body and extend your right arm upwards. \r\n\r\nRepeat the exercise with the other arm. \r\n\r\nIt\'s a great exercise for the chest, shoulders, arms and core.', 'step', 8, '10', '12', 28, 4, 1, 0, 'img_exercise/PUSHUPROTATION', 10, 10);
INSERT INTO `tbl_full_body_workouts_list` VALUES (453, 'DECLINE PUSHUPS', 'https://www.youtube.com/watch?v=PXIpw1JD4qw', 'Start on all fours with your knees under your butt and your hands under your sholders. \r\n\r\nThen elevate your feet on a chair or bench, and push your body up and down mainly using your arm strength. \r\n\r\nRemember to keep your body straight.', 'step', 8, '12', '16', 28, 4, 1, 0, 'img_exercise/DECLINEPUSHUPS', 11, 11);
INSERT INTO `tbl_full_body_workouts_list` VALUES (454, 'HINDU PUSHUPS', 'https://www.youtube.com/watch?v=nBLy1IGtSJ8', 'Start with your hands and feet touching the floor, body bent and butt up in an upside down \'V\' shape. \r\n\r\nThen bend your elbows to bring your body towardds the floor. \r\n\r\nWhen your body is close to the floor, raise your upper body up as far as possible. \r\n\r\nThen return to the original position and repeat.', 'step', 8, '10', '16', 28, 4, 1, 0, 'img_exercise/HINDUPUSHUPS', 12, 12);
INSERT INTO `tbl_full_body_workouts_list` VALUES (455, 'DIAMOND PUSHUPS', 'https://www.youtube.com/watch?v=jaxbEHLC4qU', 'Start in the push-up position. \r\n\r\nMake a diamond shape with your forefingers and thumbs together under your chest. \r\n\r\nThen push your body up and down. \r\n\r\nRemember to keep your body straight.', 'step', 8, '12', '14', 28, 4, 1, 0, 'img_exercise/DIAMONDPUSHUPS', 13, 13);
INSERT INTO `tbl_full_body_workouts_list` VALUES (456, 'SPIDERMAN PUSHUPS', 'https://www.youtube.com/watch?v=DYONORexgpY', 'Start in the regular push-up position. \r\n\r\nWhen lowering your torso downward, bend and lift one leg to the side. \r\n\r\nThen return to the start position and switch to the other leg. \r\n\r\nRemember to keep your body straight.', 'step', 8, '10', '12', 28, 4, 1, 0, 'img_exercise/SPIDERMANPUSHUPS', 14, 14);
INSERT INTO `tbl_full_body_workouts_list` VALUES (457, 'SHOULDER STRETCH', 'https://www.youtube.com/watch?v=K8sr1CGmKRw', 'Place one arm across your body, parallel to the ground, then use the other arm to pull the parallel arm toward your chest. \r\n\r\nHold for a while, switch arms and repeat the exercise. \r\n\r\nKeep the inside arm straight during the exercise.', 'time', 30, '00:30', '00:30', 28, 4, 1, 0, 'img_exercise/SHOULDERSTRETCH', 15, 15);
INSERT INTO `tbl_full_body_workouts_list` VALUES (458, 'COBRA STRETCH', 'https://www.youtube.com/watch?v=JDcdhTuycOI', 'Lie down on your stomach and bend your elbows with your hands beneath your shoulders.\r\n\r\nThen push your chest up off the ground as far as possible. \r\n\r\nHold this position for seconds.', 'time', 30, '00:30', '00:30', 28, 4, 1, 0, 'img_exercise/COBRASTRETCH', 16, 16);
INSERT INTO `tbl_full_body_workouts_list` VALUES (459, 'CHEST STRETCH', 'https://www.youtube.com/watch?v=Kvo7054R3fQ', 'Find a doorway, take a lunge position in the doorway with your arms on the doorframe and your elbows a little lower than your shoulders, then slowly bring your chest forward.\r\n\r\nHold this position for 30-40 seconds. \r\n\r\nThe slowly come out of it, bring your arms down and do a couple of shoulder rolls.\r\n\r\nDon\'t pull your head forward, and keep your neck relaxed.', 'time', 30, '00:30', '00:30', 28, 4, 1, 0, 'img_exercise/CHESTSTRETCH', 17, 17);
INSERT INTO `tbl_leg_advanced` VALUES (1, 'BURPEES', 'https://www.youtube.com/watch?v=wS4OsJ4yzx4', 'Stand with your feet shoulder width apart, then put your hands on the ground and kick your feet backward. \r\n\r\nDo a quick push-up and then jump up.', 10, 'step', 'img_exercise/BURPEES', 1, 1);
INSERT INTO `tbl_leg_advanced` VALUES (2, 'SQUATS', 'https://www.youtube.com/watch?v=aclHkVaku9U', 'Stand with your feet shoulder width apart and your arms stretched forward, then lower your body until your things are parallel with the floor.\r\n\r\nYour knees should be extended in the same direction as your toes. \r\n\r\nreturn to the start position and do the next rep.\r\n\r\nThis works the thighs, hips buttocks, quads, hamstrings and lower body.', 14, 'step', 'img_exercise/SQUATS', 2, 2);
INSERT INTO `tbl_leg_advanced` VALUES (3, 'SQUATS', 'https://www.youtube.com/watch?v=aclHkVaku9U', 'Stand with your feet shoulder width apart and your arms stretched forward, then lower your body until your things are parallel with the floor.\r\n\r\nYour knees should be extended in the same direction as your toes. \r\n\r\nreturn to the start position and do the next rep.\r\n\r\nThis works the thighs, hips buttocks, quads, hamstrings and lower body.', 14, 'step', 'img_exercise/SQUATS', 3, 3);
INSERT INTO `tbl_leg_advanced` VALUES (4, 'SQUATS', 'https://www.youtube.com/watch?v=aclHkVaku9U', 'Stand with your feet shoulder width apart and your arms stretched forward, then lower your body until your things are parallel with the floor.\r\n\r\nYour knees should be extended in the same direction as your toes. \r\n\r\nreturn to the start position and do the next rep.\r\n\r\nThis works the thighs, hips buttocks, quads, hamstrings and lower body.', 14, 'step', 'img_exercise/SQUATS', 4, 4);
INSERT INTO `tbl_leg_advanced` VALUES (5, 'BOTTOM LEG LIFT LEFT', 'https://www.youtube.com/watch?v=9a8r12qqFHs', 'Lie on your left side with your head resting on your left hand.\r\n\r\nThen put your right foot forward on the floor. \r\n\r\nLift your left leg up and down.', 12, 'step', 'img_exercise/BOTTOMLEGLIFTLEFT', 5, 5);
