INSERT INTO `tbl_leg_advanced` VALUES (23, 'GLUTE KICK BACK LEFT', 'https://www.youtube.com/watch?v=26qmCoP8IyA', 'Start on all fours with your kneed under your butt and your hands directly under your shoulders.\r\n\r\nThen kick one leg back until it is parallel with the ground. \r\n\r\nSwitch to the other side after several sets.', 12, 'step', 'img_exercise/GLUTEKICKBACKLEFT', 23, 23);
