INSERT INTO `tbl_leg_advanced` VALUES (29, 'WALL SIT', 'https://www.youtube.com/watch?v=-cdph8hv0O0', 'Start with your back against the wall, then slide down until your knees are at 90 degree angle.\r\n\r\nkeep your back against the wall with your hands and arms away from your legs. Hold the position.\r\n\r\nThe exercise is to strengthen the quadriceps muscles.', 40, 'time', 'img_exercise/WALLSIT', 29, 29);
INSERT INTO `tbl_leg_advanced` VALUES (30, 'LEFT QUAD STRETCH WITH WALL', 'https://www.youtube.com/watch?v=lZuwJrWnizI', 'Stand with your right hand on the wall. \r\n\r\nBend your left leg and grasp your ankle or toes to bring your left calf close to your left thigh. \r\n\r\nHold this position.', 30, 'time', 'img_exercise/LEFTQUADSTRETCHWITHWALL', 30, 30);
INSERT INTO `tbl_leg_advanced` VALUES (31, 'RIGHT QUAD STRETCH WITH WALL', 'https://www.youtube.com/watch?v=0d-3Qxd8OPg', 'Stand with your left hand on the wall. \r\n\r\nBend your right leg and grasp your ankle or toes to bring your left calf close to your right thigh. \r\n\r\nHold this position.', 30, 'time', 'img_exercise/RIGHTQUADSTRETCHWITHWALL', 31, 31);
INSERT INTO `tbl_leg_advanced` VALUES (32, 'LYING BUTTERFLY STRETCH', 'https://www.youtube.com/watch?v=TRNqVxDerPE', 'Lie on the floor with your feet together. \r\n\r\nOpen your knees to the sides. \r\n\r\nHold this position.', 30, 'time', 'img_exercise/LYINGBUTTERFLYSTRETCH', 32, 32);
INSERT INTO `tbl_leg_advanced` VALUES (33, 'LEARNING STRETCHER RAISES', 'https://www.youtube.com/watch?v=GVHrMnhp4kE', 'Stand a big step away from the wall, put your hands on the wall and lean on it.\r\n\r\nLift your heels as high as you can and then lower them down. \r\n\r\nRepeat the exercise.', 16, 'step', 'img_exercise/LEANINGSTRETCHERRAISES', 33, 33);
