INSERT INTO `tbl_leg_advanced` VALUES (39, 'WALL RESISTING SINGLE LEG CALF RAISE LEFT', 'https://www.youtube.com/watch?v=TjdPy2V9v2A', 'Stand a big step away from the wall. \r\n\r\nPut your right foot on your left ankle. \r\n\r\nPut your hands on the wall and lean on it.\r\n\r\nLift your left heel as high as you can and then lower it. \r\n\r\nRepeat the exercise.', 16, 'step', 'img_exercise/WALLRESISTINGSINGLELEGCALFRAISELEFT', 39, 39);
