INSERT INTO `tbl_leg_advanced` VALUES (45, 'CALF STRETCH LEFT', 'https://www.youtube.com/watch?v=yQSfFpOWX4k', 'Stand one big step away in front of a wall. \r\n\r\nStep forward with your right foot and push the wall with your hands.\r\n\r\nPlease make sure your left leg is full extended and you can feel your left calf stretching. \r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/CALFSTRETCHLEFT', 45, 45);
