INSERT INTO `tbl_leg_beginner` VALUES (1, 'SIDE HOP', 'https://www.youtube.com/watch?v=wcQqb9hVS_Y', 'Stand on the floor, put your hands in front of your and hop from side to side.', 30, 'time', 'img_exercise/SIDEHOP', 1, 1);
INSERT INTO `tbl_leg_beginner` VALUES (2, 'SQUATS', 'https://www.youtube.com/watch?v=aclHkVaku9U', 'Stand with your feet shoulder width apart and your arms stretched forward, then lower your body until your things are parallel with the floor.\r\n\r\nYour knees should be extended in the same direction as your toes. \r\n\r\nReturn to the start position and do the next rep.\r\n\r\nThis works the thighs, hips buttocks, quads, hamstrings and lower body.', 12, 'step', 'img_exercise/SQUATS', 2, 2);
INSERT INTO `tbl_leg_beginner` VALUES (3, 'SIDE LYING LEG LIFT LEFT', 'https://www.youtube.com/watch?v=Dha6wZbFLbY', 'Lie down on your side with your head rested on your right arm.\r\n\r\nList your upper leg up and return to the start position.\r\n\r\nMake sure your left leg goes straight up and down during the exercise.\r\n\r\nIt`s a great exercise for the gluteus.', 12, 'step', 'img_exercise/SIDELYINGLEGLIFTLEFT', 3, 3);
