INSERT INTO `tbl_leg_beginner` VALUES (5, 'SIDE LYING LEG LIFT RIGHT', 'https://www.youtube.com/watch?v=fPUvZV1EE5U', 'Lie down on your side with your head rested on your left arm. \r\n\r\nList your upper leg up and return to the start position.\r\n\r\nMake sure your right leg goes straight up and down during the exercise.\r\n\r\nIt\'s a great exercise for the gluteus.', 12, 'step', 'img_exercise/SIDELYINGLEGLIFTRIGHT', 5, 5);
