INSERT INTO `tbl_leg_beginner` VALUES (8, 'BACKWARD LUNGE', 'https://www.youtube.com/watch?v=6RVu-R9bS7w', 'Stand with your feet shoulder width apart and your hands on your hips.\r\n\r\nStep a big step backward with your right leg and lower your body until your left thigh is parallel to the floor. \r\n\r\nReturn and repeat with the other side.', 14, 'step', 'img_exercise/BACKWARDLUNGE', 8, 8);
