INSERT INTO `tbl_leg_beginner` VALUES (10, 'DONKEY KICKS LEFT', 'https://www.youtube.com/watch?v=l0UJ5v9V6wc', 'Start on all fours with your knees under your butt and your hands under your shoulders.\r\n\r\nThen lift your left leg and squeeze your butt and much as you can. \r\n\r\nGo back to the start position and repeat the exercise.', 16, 'step', 'img_exercise/DONKEYKICKSLEFT', 10, 10);
