INSERT INTO `tbl_leg_beginner` VALUES (16, 'KNEE TO CHEST STRETCH LEFT', 'https://www.youtube.com/watch?v=9hVZ4rc2_3Y', 'Lie on the floor with your legs extended. \r\n\r\nLift your left knee up and grab it with both hands.\r\n\r\nPull your left knee towards your chest as much as you can while keeping your right leg straight on the ground.\r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/KNEETOCHESTSTRETCHLEFT', 16, 16);
