INSERT INTO `tbl_leg_beginner` VALUES (18, 'WALL CALF RAISES', 'https://www.youtube.com/watch?v=_h0v0Jt3ews', 'Stand straight with your hands on the wall and feet shoulder width apart.\r\n\r\nLift tour heels ans stand on your toes. \r\n\r\nThen drop your heels down. Repeat the exercise.', 12, 'step', 'img_exercise/WALLCALFRAISES', 18, 18);
