INSERT INTO `tbl_leg_beginner` VALUES (21, 'SUMO SQUAT CALF RAISES WITH WALL', 'https://www.youtube.com/watch?v=1uVAOiZnWOk', 'Stand with your hands on the wall and your feet a little wider than shoulder width apart.\r\n\r\nLower your body until your thighs are parallel to the floor. \r\n\r\nLift your heels up and down.', 12, 'step', 'img_exercise/SUMOSQUATCALFRAISESWITHWALL', 21, 21);
INSERT INTO `tbl_leg_beginner` VALUES (22, 'CALF STRETCH LEFT', 'https://www.youtube.com/watch?v=yQSfFpOWX4k', 'Stand one big step away in front of a wall. \r\n\r\nStep forward with your right foot and push the wall with your hands.\r\n\r\nPlease make sure your left leg is full extended and you can feel your left calf stretching. \r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/CALFSTRETCHLEFT', 22, 22);
INSERT INTO `tbl_leg_beginner` VALUES (23, 'CALF STRETCH RIGHT', 'https://www.youtube.com/watch?v=f1HzSAuB-Vw', 'Stand one big step away in front of a wall. \r\n\r\nStep forward with your left foot and push the wall with your hands.\r\n\r\nPlease make sure your right leg is full extended and you can feel your right calf stretching. \r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/CALFSTRETCHRIGHT', 23, 23);
INSERT INTO `tbl_leg_intermediate` VALUES (1, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups', 30, 'time', 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_leg_intermediate` VALUES (2, 'SQUATS', 'https://www.youtube.com/watch?v=aclHkVaku9U', 'Stand with your feet shoulder width apart and your arms stretched forward, then lower your body until your things are parallel with the floor.\r\n\r\nYour knees should be extended in the same direction as your toes. \r\n\r\nreturn to the start position and do the next rep.\r\n\r\nThis works the thighs, hips buttocks, quads, hamstrings and lower body.', 12, 'step', 'img_exercise/SQUATS', 2, 2);
