INSERT INTO `tbl_leg_intermediate` VALUES (5, 'FIRE HYDRANT LEFT', 'https://www.youtube.com/watch?v=wrhrEkhEF_Y', 'Start on all fours with your knees under your butt and your hands under your shoulders.\r\n\r\nthen lift your left leg to the side at a 90 degree angle.', 12, 'step', 'img_exercise/FIREHYDRANTLEFT', 5, 5);
