INSERT INTO `tbl_leg_intermediate` VALUES (11, 'LUNGES', 'https://www.youtube.com/watch?v=QOVaHwm-Q6U', 'Stand with your feet shoulder width apart and your hands on your hips.\r\n\r\nTake a step forward with your right leg and lower your body until your right thigh is parallel with the floor.\r\n\r\nThen return and switch to the other leg. \r\n\r\nThis exercise strengthens the quadriceps, gluteus maximus and hamstrings.', 14, 'step', 'img_exercise/LUNGES', 11, 11);
INSERT INTO `tbl_leg_intermediate` VALUES (12, 'LUNGES', 'https://www.youtube.com/watch?v=QOVaHwm-Q6U', 'Stand with your feet shoulder width apart and your hands on your hips.\r\n\r\nTake a step forward with your right leg and lower your body until your right thigh is parallel with the floor.\r\n\r\nThen return and switch to the other leg. \r\n\r\nThis exercise strengthens the quadriceps, gluteus maximus and hamstrings.', 14, 'step', 'img_exercise/LUNGES', 12, 12);
INSERT INTO `tbl_leg_intermediate` VALUES (13, 'SIDE LEG CIRCLES LEFT', 'https://www.youtube.com/watch?v=WpEcGJ0sDjw', 'Lie on your right side with your head resting on your right hand.\r\n\r\nThen lift your left leg and rotate your foot in circles.', 12, 'step', 'img_exercise/SIDELEGCIRCLESLEFT', 13, 13);
