INSERT INTO `tbl_leg_intermediate` VALUES (17, 'SUMO SQUAT', 'https://www.youtube.com/watch?v=9ZuXKqRbT9k', 'Stand with your feet 6-12 inches apart. \r\n\r\nStretch your arms in front of you.\r\n\r\nLower your body until your thighs are parallel to the floor. \r\n\r\nReturn to the starting position and repeat the exercise.', 12, 'step', 'img_exercise/SUMOSQUAT', 17, 17);
