INSERT INTO `tbl_leg_intermediate` VALUES (20, 'REVERSE FLUTTER KICKS', 'https://www.youtube.com/watch?v=ckummKuzlUU', 'Lie face down on bench, place your butt on the edge of the bench and hold on to the sides.\r\n\r\nThen lift your legs until they are level with your upper body.\r\n\r\nlift one leg higher than the other, then switch to the other leg and repeat.', 12, 'step', 'img_exercise/REVERSEFLUTTERKICKS', 20, 20);
