INSERT INTO `tbl_leg_intermediate` VALUES (23, 'WALL SIT', 'https://www.youtube.com/watch?v=-cdph8hv0O0', 'Start with your back against the wall, then slide down until your knees are at 90 degree angle.\r\n\r\nkeep your back against the wall with your hands and arms away from your legs. \r\n\r\nHold the position.\r\n\r\nThe exercise is to strengthen the quadriceps muscles.', 30, 'time', 'img_exercise/WALLSIT', 23, 23);
INSERT INTO `tbl_leg_intermediate` VALUES (24, 'LEFT QUAD STRETCH WITH WALL', 'https://www.youtube.com/watch?v=lZuwJrWnizI', 'Stand with your right hand on the wall. \r\n\r\nBend your left leg and grasp your ankle or toes to bring your left calf close yo your left thigh. Hold this position.', 30, 'time', 'img_exercise/LEFTQUADSTRETCHWITHWALL', 24, 24);
INSERT INTO `tbl_leg_intermediate` VALUES (25, 'RIGHT QUAD STRETCH WITH WALL', 'https://www.youtube.com/watch?v=0d-3Qxd8OPg', 'Stand with your left hand on the wall. \r\n\r\nBend your left leg and grasp your ankle or toes to bring your left calf close yo your right thigh. \r\n\r\nHold this position.', 30, 'time', 'img_exercise/RIGHTQUADSTRETCHWITHWALL', 25, 25);
INSERT INTO `tbl_leg_intermediate` VALUES (26, 'KNEE TO CHEST STRETCH LEFT', 'https://www.youtube.com/watch?v=9hVZ4rc2_3Y', 'Lie on the floor with your legs extended. Lift your left knee up and grab it with both hands.\r\n\r\nPull your left knee towards your chest as much as you can while keeping your right leg straight on the ground.\r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/KNEETOCHESTSTRETCHLEFT', 26, 26);
INSERT INTO `tbl_leg_intermediate` VALUES (27, 'KNEE TO CHEST STRETCH RIGHT', 'https://www.youtube.com/watch?v=7ZQqU0QFB5w', 'Lie on the floor with your legs extended. \r\n\r\nLift your right knee up and grab it with both hands.\r\n\r\nPull your left knee towards your chest as much as you can while keeping your right leg straight on the ground.\r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/KNEETOCHESTSTRETCHRIGHT', 27, 27);
INSERT INTO `tbl_leg_intermediate` VALUES (28, 'CALF RAISE WITH SPLAYED FOOT', 'https://www.youtube.com/watch?v=7ti1VEuyyBQ', 'Stand with your feet shoulder width apart. \r\n\r\nPut your hands on the wall to maintain balance.\r\n\r\nTwist your ankles to make your toes point outwards, then lift your heels up and down.', 12, 'step', 'img_exercise/CALFRAISEWITHSPLAYEDFOOT', 28, 28);
