INSERT INTO `tbl_lower_body_list` VALUES (21, 'PLIE SQUATS', 'https://www.youtube.com/watch?v=lxl533cq5mQ', 'Stand with your hands on your hips and feet a little wider than shoulder width apart. \r\n\r\nThen lower your body until your thighs are parallel to the floor. \r\n\r\nYour knees should be extended in the same direction as your tiptoes.', 'step', 16, '', '', 2, 1, '', 0, 'img_exercise/PLIESQUATS', 4, 4);
INSERT INTO `tbl_lower_body_list` VALUES (22, 'MOUNTAIN CLIMBER', 'https://www.youtube.com/watch?v=nmwgirgXLYM', 'Start in the push-up position. \r\n\r\nBend your right knee towards your chest and keep your left leg straight, then quickly switch from one leg to the other. \r\n\r\nThis exercise strengthens multiple muscle groups.', 'step', 14, '', '', 2, 1, '', 0, 'img_exercise/MOUNTAINCLIMBER', 5, 5);
INSERT INTO `tbl_lower_body_list` VALUES (23, 'DUMBBELL BULGARIAN SPLIT SQUAT LEFT', 'https://www.youtube.com/watch?v=ICfjgXUWeDA', 'Hold a dumbbell in each hand at your sides. Stand several feet away from a bench. Rest your left foot on the bench behind you.\r\n \r\nLower your body until your back knee nearly touches the floor and your front thigh is parallel to the floor.\r\n \r\nThen go back to the start position and repeat the exercise.\r\n \r\nThere should be enough space between your front foot and the bench so that your front knee does not go over your toes.Keep Your upper body straight.\r\n \r\nIt\'s a great exercise for the glutes and hamstrings.', 'step', 10, '', '', 2, 1, '', 0, 'img_exercise/DUMBBELLBULGARIANSPLITSQUATLEFT', 6, 6);
INSERT INTO `tbl_lower_body_list` VALUES (24, 'DUMBBELL BULGARIAN SPLIT SQUAT RIGHT', 'https://www.youtube.com/watch?v=ICfjgXUWeDA', 'Hold a dumbbell in each hand at your sides. Stand several feet away from a bench. Rest your right foot on the bench behind you.\r\n \r\nLower your body until your back knee nearly touches the floor and your front thigh is parallel to the floor.\r\n \r\nThen go back to the start position and repeat the exercise.\r\n \r\nThere should be enough space between your front foot and the bench so that your front knee does not go over your toes.Keep Your upper body straight.\r\n \r\nIt\'s a great exercise for the glutes and hamstrings.', 'step', 10, '', '', 2, 1, '', 0, 'img_exercise/DUMBBELLBULGARIANSPLITSQUATRIGHT', 7, 7);
INSERT INTO `tbl_lower_body_list` VALUES (25, 'DONKEY KICKS LEFT', 'https://www.youtube.com/watch?v=l0UJ5v9V6wc', 'Start on all fours with your knees under your butt and your hands under your shoulders.\r\n\r\nThen lift your left leg and squeeze your butt as much as you can. \r\n\r\nGo back to the start position and repeat the exercise.', 'step', 12, '', '', 2, 1, '', 0, 'img_exercise/DONKEYKICKSLEFT', 8, 8);
INSERT INTO `tbl_lower_body_list` VALUES (26, 'DONKEY KICKS RIGHT', 'https://www.youtube.com/watch?v=BsziOelGh_8', 'Start on all fours with your knees under your butt and your hands under your shoulders.\r\n\r\nThen lift your right leg and squeeze your butt as much as you can. \r\n\r\nGo back to the start position and repeat the exercise.', 'step', 12, '', '', 2, 1, '', 0, 'img_exercise/DONKEYKICKSRIGHT', 9, 9);
INSERT INTO `tbl_lower_body_list` VALUES (27, 'BUTT BRIDGE', 'https://www.youtube.com/watch?v=rWzV67w5-vU', 'Lie on your back with knees bent and feet flat on the floor. \r\n\r\nPut your arms flat at your sides. \r\n\r\nThen lift your butt up and down.', 'step', 14, '', '', 2, 1, '', 0, 'img_exercise/BUTTBRIDGE', 10, 10);
