INSERT INTO `tbl_lower_body_list` VALUES (32, 'ADDUCTOR STRETCH IN STANDING', 'https://www.youtube.com/watch?v=56YqJqFU_qw', 'Stand with your feet wide distance apart and your hands rested on your hips. \r\n\r\nThen bend your left leg and lean your body to the left side. \r\n\r\nHold the position for a few seconds, then return and repeat with the other side.', 'step', 10, '', '', 2, 1, '', 0, 'img_exercise/ADDUCTORSTRETCHINSTANDING', 15, 15);
INSERT INTO `tbl_lower_body_list` VALUES (33, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=Im5nE3J558k', 'Lie on your back with your legs extended. \r\n\r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 'time', 30, '', '', 2, 1, '', 0, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 16, 16);
INSERT INTO `tbl_lower_body_list` VALUES (34, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 2, 1, '', 0, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 17, 17);
INSERT INTO `tbl_lower_body_list` VALUES (35, 'WALL CALF RAISES', 'https://www.youtube.com/watch?v=_h0v0Jt3ews', 'Stand straight with your hands on the wall and feet shoulder width apart.\r\n \r\nLift your heels and stand on your toes. \r\n\r\nThen drop your heels down. \r\n\r\nRepeat the exercise.', 'step', 14, '', '', 3, 1, '', 0, 'img_exercise/WALLCALFRAISES', 1, 1);
