INSERT INTO `tbl_lower_body_list` VALUES (41, 'WALL RESISTING SINGLE LEG CALF RAISE RIGHT', 'https://www.youtube.com/watch?v=ujxxw-rqYhc', 'Stand a big step away from the wall. \r\n\r\nPut your left foot on your right ankle. \r\n\r\nPut your hands on the wall and lean on it. \r\n\r\nLift your right heel as high as you can and then lower it. \r\n\r\nRepeat the exercise.', 'step', 14, '', '', 3, 1, '', 0, 'img_exercise/WALLRESISTINGSINGLELEGCALFRAISERIGHT', 7, 7);
