INSERT INTO `tbl_lower_body_list` VALUES (49, 'HIGH STEPPING', 'https://www.youtube.com/watch?v=sR6hJa7ku1g', 'Run in place while pulling your knees as high as possible with each step. \r\n\r\nKeep your upper body upright during this exercise.', 'time', 30, '', '', 4, 1, '', 0, 'img_exercise/HIGHSTEPPING', 1, 1);
INSERT INTO `tbl_lower_body_list` VALUES (50, 'LUNGES', 'https://www.youtube.com/watch?v=QOVaHwm-Q6U', 'Stand with your feet shoulder width apart and your hands on your hips. \r\n\r\nTake a step foraward with your right leg and lower your body until your right thigh is parallel with the floor. \r\n\r\nThen return and switch to the other leg. \r\n\r\nThis exercise strengthens the quadriceps, gluteus maximus and hamstrings.', 'step', 12, '', '', 4, 1, '', 0, 'img_exercise/LUNGES', 2, 2);
