INSERT INTO `tbl_lower_body_list` VALUES (64, 'LEFT QUAD STRETCH WITH WALL', 'https://www.youtube.com/watch?v=lZuwJrWnizI', 'Stand with your right hand on the wall. \r\n\r\nBend your left leg and grasp your ankle or toes to bring your left calf close yo your left thigh. \r\n\r\nHold this position.', 'time', 30, '', '', 4, 1, '', 0, 'img_exercise/LEFTQUADSTRETCHWITHWALL', 16, 16);
