INSERT INTO `tbl_lower_body_list` VALUES (66, 'KNEE TO CHEST STRETCH LEFT', 'https://www.youtube.com/watch?v=9hVZ4rc2_3Y', 'Lie on the floor with your legs extended. \r\n\r\nLift your left knee up and grab it with both hands.\r\n\r\nPull your left knee towards your chest as much as you can while keeping your right leg straight on the ground.\r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 4, 1, '', 0, 'img_exercise/KNEETOCHESTSTRETCHLEFT', 18, 18);
