INSERT INTO `tbl_lower_body_list` VALUES (72, 'DUMBBELL BULGARIAN SPLIT SQUAT RIGHT', 'https://www.youtube.com/watch?v=ICfjgXUWeDA', 'Hold a dumbbell in each hand at your sides. Stand several feet away from a bench. Rest your right foot on the bench behind you.\r\n \r\nLower your body until your back knee nearly touches the floor and your front thigh is parallel to the floor.\r\n \r\nThen go back to the start position and repeat the exercise.\r\n \r\nThere should be enough space between your front foot and the bench so that your front knee does not go over your toes.Keep Your upper body straight.\r\n \r\nIt\'s a great exercise for the glutes and hamstrings.', 'step', 12, '', '', 5, 1, '', 0, 'img_exercise/DUMBBELLBULGARIANSPLITSQUATRIGHT', 5, 5);
INSERT INTO `tbl_lower_body_list` VALUES (73, 'FIRE HYDRANT LEFT', 'https://www.youtube.com/watch?v=wrhrEkhEF_Y', 'Start on all fours with your knees under your butt and your hands your shoulders. \r\n\r\nThen lift your left leg to the side at a 90 degree angle.', 'step', 12, '', '', 5, 1, '', 0, 'img_exercise/FIREHYDRANTLEFT', 6, 6);
INSERT INTO `tbl_lower_body_list` VALUES (74, 'FIRE HYDRANT RIGHT', 'https://www.youtube.com/watch?v=aUZoWSjevWs', 'Start on all fours with your knees under your butt and your hands your shoulders. \r\n\r\nThen lift your right leg to the side at a 90 degree angle.', 'step', 12, '', '', 5, 1, '', 0, 'img_exercise/FIREHYDRANTRIGHT', 7, 7);
INSERT INTO `tbl_lower_body_list` VALUES (75, 'LUNGES', 'https://www.youtube.com/watch?v=QOVaHwm-Q6U', 'Stand with your feet shoulder width apart and your hands on your hips. \r\n\r\nTake a step foraward with your right leg and lower your body until your right thigh is parallel with the floor. \r\n\r\nThen return and switch to the other leg. \r\n\r\nThis exercise strengthens the quadriceps, gluteus maximus and hamstrings.', 'step', 14, '', '', 5, 1, '', 0, 'img_exercise/LUNGES', 8, 8);
INSERT INTO `tbl_lower_body_list` VALUES (76, 'BENCH GLUTE KICK BACK LEFT', 'https://www.youtube.com/watch?v=MI-jYzIv6JM', 'Start with your right knee and your hands on a bench, put your hands directly under your shoulders.\r\n\r\nThen kick your left leg back until it is parallel with the ground. Return to the starting position and repeat the exercise.', 'step', 12, '', '', 5, 1, '', 0, 'img_exercise/BENCHGLUTEKICKBACKLEFT', 9, 9);
INSERT INTO `tbl_lower_body_list` VALUES (77, 'BENCH GLUTE KICK BACK RIGHT', 'https://www.youtube.com/watch?v=MI-jYzIv6JM', 'Start with your left knee and your hands on a bench, put your hands directly under your shoulders.\r\n\r\nThen kick your right leg back until it is parallel with the ground. Return to the starting position and repeat the exercise.', 'step', 12, '', '', 5, 1, '', 0, 'img_exercise/BENCHGLUTEKICKBACKRIGHT', 10, 10);
