INSERT INTO `tbl_lower_body_list` VALUES (82, 'ADDUCTOR STRETCH IN STANDING', 'https://www.youtube.com/watch?v=56YqJqFU_qw', 'Stand with your feet wide distance apart and your hands rested on your hips. \r\n\r\nThen bend your left leg and lean your body to the left side. \r\n\r\nHold the position for a few seconds, then return and repeat with the other side.', 'step', 10, '', '', 5, 1, '', 0, 'img_exercise/ADDUCTORSTRETCHINSTANDING', 15, 15);
INSERT INTO `tbl_lower_body_list` VALUES (83, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=Im5nE3J558k', 'Lie on your back with your legs extended. \r\n\r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 'time', 30, '', '', 5, 1, '', 0, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 16, 16);
INSERT INTO `tbl_lower_body_list` VALUES (84, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 5, 1, '', 0, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 17, 17);
INSERT INTO `tbl_lower_body_list` VALUES (85, 'SUMO SQUAT CALF RAISES WITH WALL', 'https://www.youtube.com/watch?v=1uVAOiZnWOk', 'Stand with your hands on the wall and your feet a little wider than shoulder width apart. \r\n\r\nLower your body until your thighs are parallel to the floor. \r\n\r\nLift your heels up and down.', 'step', 16, '', '', 6, 1, '', 0, 'img_exercise/SUMOSQUATCALFRAISESWITHWALL', 1, 1);
