INSERT INTO `tbl_lower_body_list` VALUES (99, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups.', 'time', 30, '', '', 7, 1, '', 0, 'img_exercise/JUMPINGJACKS', 1, 1);
