INSERT INTO `tbl_lower_body_list` VALUES (130, 'FIRE HYDRANT LEFT', 'https://www.youtube.com/watch?v=wrhrEkhEF_Y', 'Start on all fours with your knees under your butt and your hands your shoulders. \r\n\r\nThen lift your left leg to the side at a 90 degree angle.', 'step', 10, '', '', 8, 2, '', 0, 'img_exercise/FIREHYDRANTLEFT', 12, 12);
INSERT INTO `tbl_lower_body_list` VALUES (131, 'FIRE HYDRANT RIGHT', 'https://www.youtube.com/watch?v=aUZoWSjevWs', 'Start on all fours with your knees under your butt and your hands your shoulders. \r\n\r\nThen lift your right leg to the side at a 90 degree angle.', 'step', 10, '', '', 8, 2, '', 0, 'img_exercise/FIREHYDRANTRIGHT', 13, 13);
INSERT INTO `tbl_lower_body_list` VALUES (132, 'FROGGY GLUTE LIFTS', 'https://www.youtube.com/watch?v=oEGFkjrJ7ag', 'Lie on your stomach with your knees bent and heels squeezed together.\r\n\r\nThen lift your feet up and down. \r\n\r\nThe exercise is very effective at squeezing your butt.', 'step', 10, '', '', 8, 2, '', 0, 'img_exercise/FROGGYGLUTELIFTS', 14, 14);
INSERT INTO `tbl_lower_body_list` VALUES (133, 'BACKWARD LUNGE WITH FRONT KICK LEFT', 'https://www.youtube.com/watch?v=FfOlFzHyCbs', 'Stand straight up. \r\n\r\nThen step back with your left leg and lower your body. \r\n\r\nWhen you come up, kick your left leg upward. \r\n\r\nGo back to the start position, and repeat the exercise.', 'step', 10, '', '', 8, 2, '', 0, 'img_exercise/BACKWARDLUNGEWITHFRONTKICKLEFT', 15, 15);
INSERT INTO `tbl_lower_body_list` VALUES (134, 'BACKWARD LUNGE WITH FRONT KICK RIGHT', 'https://www.youtube.com/watch?v=wMjJBM6of5M', 'Stand straight up. \r\n\r\nThen step back with your right leg and lower your body. \r\n\r\nWhen you come up, kick your right leg upward. \r\n\r\nGo back to the start position, and repeat the exercise.', 'step', 10, '', '', 8, 2, '', 0, 'img_exercise/BACKWARDLUNGEWITHFRONTKICKRIGHT', 16, 16);
INSERT INTO `tbl_lower_body_list` VALUES (135, 'ADDUCTOR STRETCH IN STANDING', 'https://www.youtube.com/watch?v=56YqJqFU_qw', 'Stand with your feet wide distance apart and your hands rested on your hips. \r\n\r\nThen bend your left leg and lean your body to the left side. \r\n\r\nHold the position for a few seconds, then return and repeat with the other side.', 'step', 10, '', '', 8, 2, '', 0, 'img_exercise/ADDUCTORSTRETCHINSTANDING', 17, 17);
INSERT INTO `tbl_lower_body_list` VALUES (136, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=Im5nE3J558k', 'Lie on your back with your legs extended. \r\n\r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 'time', 30, '', '', 8, 2, '', 0, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 18, 18);
INSERT INTO `tbl_lower_body_list` VALUES (137, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 8, 2, '', 0, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 19, 19);
INSERT INTO `tbl_lower_body_list` VALUES (138, 'CALF RAISE WITH SPLAYED FOOT', 'https://www.youtube.com/watch?v=7ti1VEuyyBQ', 'Stand with your feet shoulder width apart. \r\n\r\nPut your hands on the wall to maintain balance. \r\n\r\nTwist your ankles to make your toes point outwords, then lift your heels up and down.', 'step', 16, '', '', 9, 2, '', 0, 'img_exercise/CALFRAISEWITHSPLAYEDFOOT', 1, 1);
INSERT INTO `tbl_lower_body_list` VALUES (139, 'CALF RAISE WITH SPLAYED FOOT', 'https://www.youtube.com/watch?v=7ti1VEuyyBQ', 'Stand with your feet shoulder width apart. \r\n\r\nPut your hands on the wall to maintain balance. \r\n\r\nTwist your ankles to make your toes point outwords, then lift your heels up and down.', 'step', 14, '', '', 9, 2, '', 0, 'img_exercise/CALFRAISEWITHSPLAYEDFOOT', 2, 2);
