INSERT INTO `tbl_lower_body_list` VALUES (141, 'SINGLE LEG CALF HOP LEFT', 'https://www.youtube.com/watch?v=L3v9Z6xPZXE', 'Stand straight with your right leg lifted. \r\n\r\nThen hop up and down on your left foot.', 'step', 16, '', '', 9, 2, '', 0, 'img_exercise/SINGLELEGCALFHOPLEFT', 4, 4);
