INSERT INTO `tbl_lower_body_list` VALUES (147, 'LEANING STRETCHER RAISES', 'https://www.youtube.com/watch?v=GVHrMnhp4kE', 'Stand a big step away from the wall, put your hands on the wall and lean on it.\r\n \r\nLift your heels as high as you can and then lower them down. \r\n\r\nRepeat the exercise.', 'step', 14, '', '', 9, 2, '', 0, 'img_exercise/LEANINGSTRETCHERRAISES', 10, 10);
INSERT INTO `tbl_lower_body_list` VALUES (148, 'LEANING STRETCHER RAISES', 'https://www.youtube.com/watch?v=GVHrMnhp4kE', 'Stand a big step away from the wall, put your hands on the wall and lean on it.\r\n \r\nLift your heels as high as you can and then lower them down. \r\n\r\nRepeat the exercise.', 'step', 12, '', '', 9, 2, '', 0, 'img_exercise/LEANINGSTRETCHERRAISES', 11, 11);
