INSERT INTO `tbl_lower_body_list` VALUES (150, 'CALF STRETCH LEFT', 'https://www.youtube.com/watch?v=yQSfFpOWX4k', 'Stand one big step away in front of a wall. \r\n\r\nStep forward with your right foot and push the wall with your hands. \r\n\r\nPlease make sure your left leg is fully extended and you can feel your left calf stretching. \r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 9, 2, '', 0, 'img_exercise/CALFSTRETCHLEFT', 13, 13);
INSERT INTO `tbl_lower_body_list` VALUES (151, 'CALF STRETCH RIGHT', 'https://www.youtube.com/watch?v=f1HzSAuB-Vw', 'Stand one big step away in front of a wall. \r\n\r\nStep forward with your left foot and push the wall with your hands.\r\n \r\nPlease make sure your right leg is fully extended and you can feel your right calf stretching. \r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 9, 2, '', 0, 'img_exercise/CALFSTRETCHRIGHT', 14, 14);
INSERT INTO `tbl_lower_body_list` VALUES (152, 'HIGH STEPPING', 'https://www.youtube.com/watch?v=sR6hJa7ku1g', 'Run in place while pulling your knees as high as possible with each step. \r\n\r\nKeep your upper body upright during this exercise.', 'time', 30, '', '', 10, 2, '', 0, 'img_exercise/HIGHSTEPPING', 1, 1);
INSERT INTO `tbl_lower_body_list` VALUES (153, 'SQUATS', 'https://www.youtube.com/watch?v=aclHkVaku9U', 'Stand with your feet shoulder width apart and your arms stretched forward, then lower your body until your thighs are parallel with the floor.\r\n\r\nYour knees should be extended in the same direction as your toes. \r\n\r\nReturn to the start position and do the next rep.\r\n\r\nThis works the thighs, hips buttocks, quads, hamstrings and lower body.', 'step', 12, '', '', 10, 2, '', 0, 'img_exercise/SQUATS', 2, 2);
