INSERT INTO `tbl_lower_body_list` VALUES (164, 'SIDE LEG CIRCLES LEFT', 'https://www.youtube.com/watch?v=WpEcGJ0sDjw', 'Lie on your right side with your head resting on your right hand.\r\n\r\nThen lift your left leg and rotate your foot in circles.', 'step', 12, '', '', 10, 2, '', 0, 'img_exercise/SIDELEGCIRCLESLEFT', 13, 13);
