INSERT INTO `tbl_lower_body_list` VALUES (168, 'LEFT QUAD STRETCH WITH WALL', 'https://www.youtube.com/watch?v=lZuwJrWnizI', 'Stand with your right hand on the wall. \r\n\r\nBend your left leg and grasp your ankle or toes to bring your left calf close yo your left thigh. \r\n\r\nHold this position.', 'time', 30, '', '', 10, 2, '', 0, 'img_exercise/LEFTQUADSTRETCHWITHWALL', 17, 17);
INSERT INTO `tbl_lower_body_list` VALUES (169, 'RIGHT QUAD STRETCH WITH WALL', 'https://www.youtube.com/watch?v=0d-3Qxd8OPg', 'Stand with your left hand on the wall. \r\n\r\nBend your left leg and grasp your ankle or toes to bring your left calf close yo your right thigh. \r\n\r\nHold this position.', 'time', 30, '', '', 10, 2, '', 0, 'img_exercise/RIGHTQUADSTRETCHWITHWALL', 18, 18);
INSERT INTO `tbl_lower_body_list` VALUES (170, 'KNEE TO CHEST STRETCH LEFT', 'https://www.youtube.com/watch?v=9hVZ4rc2_3Y', 'Lie on the floor with your legs extended. \r\n\r\nLift your left knee up and grab it with both hands.\r\n\r\nPull your left knee towards your chest as much as you can while keeping your right leg straight on the ground.\r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 10, 2, '', 0, 'img_exercise/KNEETOCHESTSTRETCHLEFT', 19, 19);
INSERT INTO `tbl_lower_body_list` VALUES (171, 'KNEE TO CHEST STRETCH RIGHT', 'https://www.youtube.com/watch?v=7ZQqU0QFB5w', 'Lie on the floor with your legs extended. \r\n\r\nLift your right knee up and grab it with both hands.\r\n\r\nPull your right knee towards your chest as much as you can while keeping your left leg straight on the ground.\r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 10, 2, '', 0, 'img_exercise/KNEETOCHESTSTRETCHRIGHT', 20, 20);
INSERT INTO `tbl_lower_body_list` VALUES (172, 'SQUATS', 'https://www.youtube.com/watch?v=aclHkVaku9U', 'Stand with your feet shoulder width apart and your arms stretched forward, then lower your body until your thighs are parallel with the floor.\r\n\r\nYour knees should be extended in the same direction as your toes. \r\n\r\nReturn to the start position and do the next rep.\r\n\r\nThis works the thighs, hips buttocks, quads, hamstrings and lower body.', 'step', 16, '', '', 11, 2, '', 0, 'img_exercise/SQUATS', 1, 1);
INSERT INTO `tbl_lower_body_list` VALUES (173, 'MOUNTAIN CLIMBER', 'https://www.youtube.com/watch?v=nmwgirgXLYM', 'Start in the push-up position. \r\n\r\nBend your right knee towards your chest and keep your left leg straight, then quickly switch from one leg to the other. \r\n\r\nThis exercise strengthens multiple muscle groups.', 'step', 18, '', '', 11, 2, '', 0, 'img_exercise/MOUNTAINCLIMBER', 2, 2);
INSERT INTO `tbl_lower_body_list` VALUES (174, 'FLUTTER KICKS', 'https://www.youtube.com/watch?v=ocRe4ccKeK4', 'Lie on your back with your arms at your sides. \r\n\r\nLift your legs and keep them as straight as you can. \r\n\r\nThen quickly raise your right leg up, and simultaneously lower your left leg. \r\n\r\nSwitch legs and repeat.', 'step', 16, '', '', 11, 2, '', 0, 'img_exercise/FLUTTERKICKS', 3, 3);
INSERT INTO `tbl_lower_body_list` VALUES (175, 'PLANK LEG UP', 'https://www.youtube.com/watch?v=cnALCnKaJ1w', 'Start in the straight arm plank position. \r\n\r\nThen alternately lift and lower both legs up and down.', 'step', 16, '', '', 11, 2, '', 0, 'img_exercise/PLANKLEGUP', 4, 4);
INSERT INTO `tbl_lower_body_list` VALUES (176, 'DUMBBELL BULGARIAN SPLIT SQUAT LEFT', 'https://www.youtube.com/watch?v=ICfjgXUWeDA', 'Hold a dumbbell in each hand at your sides. Stand several feet away from a bench. Rest your left foot on the bench behind you.\r\n\r\nLower your body until your back knee nearly touches the floor and your front thigh is parallel to the floor.\r\n \r\nThen go back to the start position and repeat the exercise.\r\n \r\nThere should be enough space between your front foot and the bench so that your front knee does not go over your toes.Keep Your upper body straight.\r\n \r\nIt\'s a great exercise for the glutes and hamstrings.', 'step', 16, '', '', 11, 2, '', 0, 'img_exercise/DUMBBELLBULGARIANSPLITSQUATLEFT', 5, 5);
INSERT INTO `tbl_lower_body_list` VALUES (177, 'DUMBBELL BULGARIAN SPLIT SQUAT RIGHT', 'https://www.youtube.com/watch?v=ICfjgXUWeDA', 'Hold a dumbbell in each hand at your sides. Stand several feet away from a bench. Rest your right foot on the bench behind you.\r\n \r\nLower your body until your back knee nearly touches the floor and your front thigh is parallel to the floor.\r\n \r\nThen go back to the start position and repeat the exercise.\r\n \r\nThere should be enough space between your front foot and the bench so that your front knee does not go over your toes.Keep Your upper body straight.\r\n \r\nIt\'s a great exercise for the glutes and hamstrings.', 'step', 16, '', '', 11, 2, '', 0, 'img_exercise/DUMBBELLBULGARIANSPLITSQUATRIGHT', 6, 6);
