INSERT INTO `tbl_lower_body_list` VALUES (183, 'DUMBBELL BULGARIAN SPLIT SQUAT RIGHT', 'https://www.youtube.com/watch?v=ICfjgXUWeDA', 'Hold a dumbbell in each hand at your sides. Stand several feet away from a bench. Rest your right foot on the bench behind you.\r\n \r\nLower your body until your back knee nearly touches the floor and your front thigh is parallel to the floor.\r\n \r\nThen go back to the start position and repeat the exercise.\r\n \r\nThere should be enough space between your front foot and the bench so that your front knee does not go over your toes.Keep Your upper body straight.\r\n \r\nIt\'s a great exercise for the glutes and hamstrings.', 'step', 12, '', '', 11, 2, '', 0, 'img_exercise/DUMBBELLBULGARIANSPLITSQUATRIGHT', 12, 12);
INSERT INTO `tbl_lower_body_list` VALUES (184, 'ADDUCTOR STRETCH IN STANDING', 'https://www.youtube.com/watch?v=56YqJqFU_qw', 'Stand with your feet wide distance apart and your hands rested on your hips. \r\n\r\nThen bend your left leg and lean your body to the left side. \r\n\r\nHold the position for a few seconds, then return and repeat with the other side.', 'step', 10, '', '', 11, 2, '', 0, 'img_exercise/ADDUCTORSTRETCHINSTANDING', 13, 13);
INSERT INTO `tbl_lower_body_list` VALUES (185, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=Im5nE3J558k', 'Lie on your back with your legs extended. \r\n\r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 'time', 30, '', '', 11, 2, '', 0, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 14, 14);
INSERT INTO `tbl_lower_body_list` VALUES (186, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 11, 2, '', 0, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 15, 15);
INSERT INTO `tbl_lower_body_list` VALUES (187, 'CALF RAISE WITH SPLAYED FOOT', 'https://www.youtube.com/watch?v=7ti1VEuyyBQ', 'Stand with your feet shoulder width apart. \r\n\r\nPut your hands on the wall to maintain balance. \r\n\r\nTwist your ankles to make your toes point outwords, then lift your heels up and down.', 'step', 16, '', '', 12, 2, '', 0, 'img_exercise/CALFRAISEWITHSPLAYEDFOOT', 1, 1);
