INSERT INTO `tbl_lower_body_list` VALUES (199, 'CALF STRETCH LEFT', 'https://www.youtube.com/watch?v=yQSfFpOWX4k', 'Stand one big step away in front of a wall. \r\n\r\nStep forward with your right foot and push the wall with your hands. \r\n\r\nPlease make sure your left leg is fully extended and you can feel your left calf stretching. \r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 12, 2, '', 0, 'img_exercise/CALFSTRETCHLEFT', 13, 13);
INSERT INTO `tbl_lower_body_list` VALUES (200, 'CALF STRETCH RIGHT', 'https://www.youtube.com/watch?v=f1HzSAuB-Vw', 'Stand one big step away in front of a wall. \r\n\r\nStep forward with your left foot and push the wall with your hands.\r\n \r\nPlease make sure your right leg is fully extended and you can feel your right calf stretching. \r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 12, 2, '', 0, 'img_exercise/CALFSTRETCHRIGHT', 14, 14);
INSERT INTO `tbl_lower_body_list` VALUES (201, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups.', 'time', 30, '', '', 13, 2, '', 0, 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_lower_body_list` VALUES (202, 'LUNGES', 'https://www.youtube.com/watch?v=QOVaHwm-Q6U', 'Stand with your feet shoulder width apart and your hands on your hips. \r\n\r\nTake a step foraward with your right leg and lower your body until your right thigh is parallel with the floor. \r\n\r\nThen return and switch to the other leg. \r\n\r\nThis exercise strengthens the quadriceps, gluteus maximus and hamstrings.', 'step', 12, '', '', 13, 2, '', 0, 'img_exercise/LUNGES', 2, 2);
INSERT INTO `tbl_lower_body_list` VALUES (203, 'LUNGES', 'https://www.youtube.com/watch?v=QOVaHwm-Q6U', 'Stand with your feet shoulder width apart and your hands on your hips. \r\n\r\nTake a step foraward with your right leg and lower your body until your right thigh is parallel with the floor. \r\n\r\nThen return and switch to the other leg. \r\n\r\nThis exercise strengthens the quadriceps, gluteus maximus and hamstrings.', 'step', 10, '', '', 13, 2, '', 0, 'img_exercise/LUNGES', 3, 3);
INSERT INTO `tbl_lower_body_list` VALUES (204, 'CURTSY LUNGES', 'https://www.youtube.com/watch?v=xga567iH6-w', 'Stand straight up. \r\n\r\nThen step back with your left leg to the right, and bend your knees at the same time. \r\n\r\nGo back to the start position and switch to the other side.', 'step', 12, '', '', 13, 2, '', 0, 'img_exercise/CURTSYLUNGES', 4, 4);
