INSERT INTO `tbl_lower_body_list` VALUES (206, 'BOTTOM LEG LIFT LEFT', 'https://www.youtube.com/watch?v=9a8r12qqFHs', 'Lie on your left side with your head resting on your left hand. \r\n\r\nThen put your right foot forward on the floor. \r\n\r\nLift your left leg up and down. ', 'step', 12, '', '', 13, 2, '', 0, 'img_exercise/BOTTOMLEGLIFTLEFT', 6, 6);
