INSERT INTO `tbl_lower_body_list` VALUES (218, 'LEFT QUAD STRETCH WITH WALL', 'https://www.youtube.com/watch?v=lZuwJrWnizI', 'Stand with your right hand on the wall. \r\n\r\nBend your left leg and grasp your ankle or toes to bring your left calf close yo your left thigh. \r\n\r\nHold this position.', 'time', 30, '', '', 13, 2, '', 0, 'img_exercise/LEFTQUADSTRETCHWITHWALL', 18, 18);
INSERT INTO `tbl_lower_body_list` VALUES (219, 'RIGHT QUAD STRETCH WITH WALL', 'https://www.youtube.com/watch?v=0d-3Qxd8OPg', 'Stand with your left hand on the wall. \r\n\r\nBend your left leg and grasp your ankle or toes to bring your left calf close yo your right thigh. \r\n\r\nHold this position.', 'time', 30, '', '', 13, 2, '', 0, 'img_exercise/RIGHTQUADSTRETCHWITHWALL', 19, 19);
INSERT INTO `tbl_lower_body_list` VALUES (220, 'KNEE TO CHEST STRETCH LEFT', 'https://www.youtube.com/watch?v=9hVZ4rc2_3Y', 'Lie on the floor with your legs extended. \r\n\r\nLift your left knee up and grab it with both hands.\r\n\r\nPull your left knee towards your chest as much as you can while keeping your right leg straight on the ground.\r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 13, 2, '', 0, 'img_exercise/KNEETOCHESTSTRETCHLEFT', 20, 20);
INSERT INTO `tbl_lower_body_list` VALUES (221, 'KNEE TO CHEST STRETCH RIGHT', 'https://www.youtube.com/watch?v=7ZQqU0QFB5w', 'Lie on the floor with your legs extended. \r\n\r\nLift your right knee up and grab it with both hands.\r\n\r\nPull your right knee towards your chest as much as you can while keeping your left leg straight on the ground.\r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 13, 2, '', 0, 'img_exercise/KNEETOCHESTSTRETCHRIGHT', 21, 21);
INSERT INTO `tbl_lower_body_list` VALUES (222, 'CURTSY LUNGES', 'https://www.youtube.com/watch?v=xga567iH6-w', 'Stand straight up. \r\n\r\nThen step back with your left leg to the right, and bend your knees at the same time. \r\n\r\nGo back to the start position and switch to the other side.', 'step', 16, '', '', 14, 2, '', 0, 'img_exercise/CURTSYLUNGES', 1, 1);
INSERT INTO `tbl_lower_body_list` VALUES (223, 'DONKEY KICKS LEFT', 'https://www.youtube.com/watch?v=l0UJ5v9V6wc', 'Start on all fours with your knees under your butt and your hands under your shoulders.\r\n\r\nThen lift your left leg and squeeze your butt as much as you can. \r\n\r\nGo back to the start position and repeat the exercise.', 'step', 16, '', '', 14, 2, '', 0, 'img_exercise/DONKEYKICKSLEFT', 2, 2);
INSERT INTO `tbl_lower_body_list` VALUES (224, 'DONKEY KICKS RIGHT', 'https://www.youtube.com/watch?v=BsziOelGh_8', 'Start on all fours with your knees under your butt and your hands under your shoulders.\r\n\r\nThen lift your right leg and squeeze your butt as much as you can. \r\n\r\nGo back to the start position and repeat the exercise.', 'step', 16, '', '', 14, 2, '', 0, 'img_exercise/DONKEYKICKSRIGHT', 3, 3);
INSERT INTO `tbl_lower_body_list` VALUES (225, 'FLUTTER KICKS', 'https://www.youtube.com/watch?v=ocRe4ccKeK4', 'Lie on your back with your arms at your sides. \r\n\r\nLift your legs and keep them as straight as you can. \r\n\r\nThen quickly raise your right leg up, and simultaneously lower your left leg. \r\n\r\nSwitch legs and repeat.', 'step', 18, '', '', 14, 2, '', 0, 'img_exercise/FLUTTERKICKS', 4, 4);
INSERT INTO `tbl_lower_body_list` VALUES (226, 'DUMBBELL BULGARIAN SPLIT SQUAT LEFT', 'https://www.youtube.com/watch?v=ICfjgXUWeDA', 'Hold a dumbbell in each hand at your sides. Stand several feet away from a bench. Rest your left foot on the bench behind you.\r\n \r\nLower your body until your back knee nearly touches the floor and your front thigh is parallel to the floor.\r\n \r\nThen go back to the start position and repeat the exercise.\r\n \r\nThere should be enough space between your front foot and the bench so that your front knee does not go over your toes.Keep Your upper body straight.\r\n \r\nIt\'s a great exercise for the glutes and hamstrings.', 'step', 12, '', '', 14, 2, '', 0, 'img_exercise/DUMBBELLBULGARIANSPLITSQUATLEFT', 5, 5);
INSERT INTO `tbl_lower_body_list` VALUES (227, 'DUMBBELL BULGARIAN SPLIT SQUAT RIGHT', 'https://www.youtube.com/watch?v=ICfjgXUWeDA', 'Hold a dumbbell in each hand at your sides. Stand several feet away from a bench. Rest your right foot on the bench behind you.\r\n \r\nLower your body until your back knee nearly touches the floor and your front thigh is parallel to the floor.\r\n \r\nThen go back to the start position and repeat the exercise.\r\n \r\nThere should be enough space between your front foot and the bench so that your front knee does not go over your toes.Keep Your upper body straight.\r\n \r\nIt\'s a great exercise for the glutes and hamstrings.', 'step', 12, '', '', 14, 2, '', 0, 'img_exercise/DUMBBELLBULGARIANSPLITSQUATRIGHT', 6, 6);
INSERT INTO `tbl_lower_body_list` VALUES (228, 'BACKWARD LUNGE WITH FRONT KICK LEFT', 'https://www.youtube.com/watch?v=FfOlFzHyCbs', 'Stand straight up. \r\n\r\nThen step back with your left leg and lower your body. \r\n\r\nWhen you come up, kick your left leg upward. \r\n\r\nGo back to the start position, and repeat the exercise.', 'step', 14, '', '', 14, 2, '', 0, 'img_exercise/BACKWARDLUNGEWITHFRONTKICKLEFT', 7, 7);
