INSERT INTO `tbl_lower_body_list` VALUES (234, 'DUMBBELL BULGARIAN SPLIT SQUAT LEFT', 'https://www.youtube.com/watch?v=ICfjgXUWeDA', 'Hold a dumbbell in each hand at your sides. Stand several feet away from a bench. Rest your left foot on the bench behind you.\r\n \r\nLower your body until your back knee nearly touches the floor and your front thigh is parallel to the floor.\r\n \r\nThen go back to the start position and repeat the exercise.\r\n \r\nThere should be enough space between your front foot and the bench so that your front knee does not go over your toes.Keep Your upper body straight.\r\n \r\nIt\'s a great exercise for the glutes and hamstrings.', 'step', 10, '', '', 14, 2, '', 0, 'img_exercise/DUMBBELLBULGARIANSPLITSQUATLEFT', 13, 13);
INSERT INTO `tbl_lower_body_list` VALUES (235, 'DUMBBELL BULGARIAN SPLIT SQUAT RIGHT', 'https://www.youtube.com/watch?v=ICfjgXUWeDA', 'Hold a dumbbell in each hand at your sides. Stand several feet away from a bench. Rest your right foot on the bench behind you.\r\n \r\nLower your body until your back knee nearly touches the floor and your front thigh is parallel to the floor.\r\n \r\nThen go back to the start position and repeat the exercise.\r\n \r\nThere should be enough space between your front foot and the bench so that your front knee does not go over your toes.Keep Your upper body straight.\r\n \r\nIt\'s a great exercise for the glutes and hamstrings.', 'step', 10, '', '', 14, 2, '', 0, 'img_exercise/DUMBBELLBULGARIANSPLITSQUATRIGHT', 14, 14);
INSERT INTO `tbl_lower_body_list` VALUES (236, 'BACKWARD LUNGE WITH FRONT KICK LEFT', 'https://www.youtube.com/watch?v=FfOlFzHyCbs', 'Stand straight up. \r\n\r\nThen step back with your left leg and lower your body. \r\n\r\nWhen you come up, kick your left leg upward. \r\n\r\nGo back to the start position, and repeat the exercise.', 'step', 12, '', '', 14, 2, '', 0, 'img_exercise/BACKWARDLUNGEWITHFRONTKICKLEFT', 15, 15);
INSERT INTO `tbl_lower_body_list` VALUES (237, 'BACKWARD LUNGE WITH FRONT KICK RIGHT', 'https://www.youtube.com/watch?v=wMjJBM6of5M', 'Stand straight up. \r\n\r\nThen step back with your right leg and lower your body. \r\n\r\nWhen you come up, kick your right leg upward. \r\n\r\nGo back to the start position, and repeat the exercise.', 'step', 12, '', '', 14, 2, '', 0, 'img_exercise/BACKWARDLUNGEWITHFRONTKICKRIGHT', 16, 16);
INSERT INTO `tbl_lower_body_list` VALUES (238, 'ADDUCTOR STRETCH IN STANDING', 'https://www.youtube.com/watch?v=56YqJqFU_qw', 'Stand with your feet wide distance apart and your hands rested on your hips. \r\n\r\nThen bend your left leg and lean your body to the left side. \r\n\r\nHold the position for a few seconds, then return and repeat with the other side.', 'step', 10, '', '', 14, 2, '', 0, 'img_exercise/ADDUCTORSTRETCHINSTANDING', 17, 17);
INSERT INTO `tbl_lower_body_list` VALUES (239, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=Im5nE3J558k', 'Lie on your back with your legs extended. \r\n\r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 'time', 30, '', '', 14, 2, '', 0, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 18, 18);
INSERT INTO `tbl_lower_body_list` VALUES (240, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 14, 2, '', 0, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 19, 19);
INSERT INTO `tbl_lower_body_list` VALUES (241, 'WALL CALF RAISES', 'https://www.youtube.com/watch?v=_h0v0Jt3ews', 'Stand straight with your hands on the wall and feet shoulder width apart.\r\n \r\nLift your heels and stand on your toes. \r\n\r\nThen drop your heels down. \r\n\r\nRepeat the exercise.', 'step', 16, '', '', 15, 3, '', 0, 'img_exercise/WALLCALFRAISES', 1, 1);
