INSERT INTO `tbl_lower_body_list` VALUES (250, 'LEANING STRETCHER RAISES', 'https://www.youtube.com/watch?v=GVHrMnhp4kE', 'Stand a big step away from the wall, put your hands on the wall and lean on it.\r\n \r\nLift your heels as high as you can and then lower them down. \r\n\r\nRepeat the exercise.', 'step', 16, '', '', 15, 3, '', 0, 'img_exercise/LEANINGSTRETCHERRAISES', 10, 10);
