INSERT INTO `tbl_lower_body_list` VALUES (255, 'HIGH STEPPING', 'https://www.youtube.com/watch?v=sR6hJa7ku1g', 'Run in place while pulling your knees as high as possible with each step. \r\n\r\nKeep your upper body upright during this exercise.', 'time', 30, '', '', 16, 3, '', 0, 'img_exercise/HIGHSTEPPING', 1, 1);
