INSERT INTO `tbl_lower_body_list` VALUES (258, 'SIDE LYING LEG LIFT LEFT', 'https://www.youtube.com/watch?v=Dha6wZbFLbY', 'Lie down on your side with your head rested on your right arm. \r\n\r\nList your upper leg up and return to the start position.\r\n\r\nMake sure your left leg goes straight up and down during the exercise.\r\n\r\nIt\'s a great exercise for the gluteus.', 'step', 14, '', '', 16, 3, '', 0, 'img_exercise/SIDELYINGLEGLIFTLEFT', 4, 4);
