INSERT INTO `tbl_lower_body_list` VALUES (274, 'BENCH GLUTE KICK BACK LEFT', 'https://www.youtube.com/watch?v=MI-jYzIv6JM', 'Start with your right knee and your hands on a bench, put your hands directly under your shoulders.\r\n\r\nThen kick your left leg back until it is parallel with the ground. \r\n\r\nReturn to the starting position and repeat the exercise.', 'step', 16, '', '', 17, 3, '', 0, 'img_exercise/BENCHGLUTEKICKBACKLEFT', 1, 1);
