INSERT INTO `tbl_lower_body_list` VALUES (276, 'DONKEY KICKS LEFT', 'https://www.youtube.com/watch?v=l0UJ5v9V6wc', 'Start on all fours with your knees under your butt and your hands under your shoulders.\r\n\r\nThen lift your left leg and squeeze your butt as much as you can. \r\n\r\nGo back to the start position and repeat the exercise.', 'step', 18, '', '', 17, 3, '', 0, 'img_exercise/DONKEYKICKSLEFT', 3, 3);
