INSERT INTO `tbl_lower_body_list` VALUES (278, 'BUTT BRIDGE', 'https://www.youtube.com/watch?v=rWzV67w5-vU', 'Lie on your back with knees bent and feet flat on the floor. \r\n\r\nPut your arms flat at your sides. \r\n\r\nThen lift your butt up and down.', 'step', 18, '', '', 17, 3, '', 0, 'img_exercise/BUTTBRIDGE', 5, 5);
INSERT INTO `tbl_lower_body_list` VALUES (279, 'CURTSY LUNGES', 'https://www.youtube.com/watch?v=xga567iH6-w', 'Stand straight up. \r\n\r\nThen step back with your left leg to the right, and bend your knees at the same time. \r\n\r\nGo back to the start position and switch to the other side.', 'step', 18, '', '', 17, 3, '', 0, 'img_exercise/CURTSYLUNGES', 6, 6);
