INSERT INTO `tbl_lower_body_list` VALUES (308, 'CALF STRETCH LEFT', 'https://www.youtube.com/watch?v=yQSfFpOWX4k', 'Stand one big step away in front of a wall. \r\n\r\nStep forward with your right foot and push the wall with your hands. \r\n\r\nPlease make sure your left leg is fully extended and you can feel your left calf stretching. \r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 18, 3, '', 0, 'img_exercise/CALFSTRETCHLEFT', 16, 16);
INSERT INTO `tbl_lower_body_list` VALUES (309, 'CALF STRETCH RIGHT', 'https://www.youtube.com/watch?v=f1HzSAuB-Vw', 'Stand one big step away in front of a wall. \r\n\r\nStep forward with your left foot and push the wall with your hands.\r\n \r\nPlease make sure your right leg is fully extended and you can feel your right calf stretching. \r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 18, 3, '', 0, 'img_exercise/CALFSTRETCHRIGHT', 17, 17);
INSERT INTO `tbl_lower_body_list` VALUES (310, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups.', 'time', 30, '', '', 19, 3, '', 0, 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_lower_body_list` VALUES (311, 'SQUATS', 'https://www.youtube.com/watch?v=aclHkVaku9U', 'Stand with your feet shoulder width apart and your arms stretched forward, then lower your body until your thighs are parallel with the floor.\r\n\r\nYour knees should be extended in the same direction as your toes. \r\n\r\nReturn to the start position and do the next rep.\r\n\r\nThis works the thighs, hips buttocks, quads, hamstrings and lower body.', 'step', 12, '', '', 19, 3, '', 0, 'img_exercise/SQUATS', 2, 2);
INSERT INTO `tbl_lower_body_list` VALUES (312, 'SQUATS', 'https://www.youtube.com/watch?v=aclHkVaku9U', 'Stand with your feet shoulder width apart and your arms stretched forward, then lower your body until your thighs are parallel with the floor.\r\n\r\nYour knees should be extended in the same direction as your toes. \r\n\r\nReturn to the start position and do the next rep.\r\n\r\nThis works the thighs, hips buttocks, quads, hamstrings and lower body.', 'step', 10, '', '', 19, 3, '', 0, 'img_exercise/SQUATS', 3, 3);
INSERT INTO `tbl_lower_body_list` VALUES (313, 'SIDE LYING LEG LIFT LEFT', 'https://www.youtube.com/watch?v=Dha6wZbFLbY', 'Lie down on your side with your head rested on your right arm. \r\n\r\nList your upper leg up and return to the start position.\r\n\r\nMake sure your left leg goes straight up and down during the exercise.\r\n\r\nIt\'s a great exercise for the gluteus.', 'step', 16, '', '', 19, 3, '', 0, 'img_exercise/SIDELYINGLEGLIFTLEFT', 4, 4);
