INSERT INTO `tbl_lower_body_list` VALUES (317, 'BUTT BRIDGE', 'https://www.youtube.com/watch?v=rWzV67w5-vU', 'Lie on your back with knees bent and feet flat on the floor. \r\n\r\nPut your arms flat at your sides. \r\n\r\nThen lift your butt up and down.', 'step', 12, '', '', 19, 3, '', 0, 'img_exercise/BUTTBRIDGE', 8, 8);
