INSERT INTO `tbl_lower_body_list` VALUES (319, 'SUMO SQUAT', 'https://www.youtube.com/watch?v=9ZuXKqRbT9k', 'Stand with your feet 6-12 inches apart. \r\n\r\nStretch your arms in front of you. \r\n\r\nLower your body until thighs are parallel to the floor. \r\n\r\nReturn to the starting position and repeat the exercise.', 'step', 16, '', '', 19, 3, '', 0, 'img_exercise/SUMOSQUAT', 10, 10);
