INSERT INTO `tbl_lower_body_list` VALUES (322, 'FIRE HYDRANT LEFT', 'https://www.youtube.com/watch?v=wrhrEkhEF_Y', 'Start on all fours with your knees under your butt and your hands your shoulders. \r\n\r\nThen lift your left leg to the side at a 90 degree angle.', 'step', 12, '', '', 19, 3, '', 0, 'img_exercise/FIREHYDRANTLEFT', 13, 13);
