INSERT INTO `tbl_lower_body_list` VALUES (326, 'WALL SIT', 'https://www.youtube.com/watch?v=-cdph8hv0O0', 'Start with your back against the wall, then slide down until your knees are at a 90 degree angle. \r\n\r\nKeep your back against the wall with your hands and arms away from your legs. \r\n\r\nHold the position. \r\n\r\nThe exercise is to strengthen the quadriceps muscles.', 'time', 30, '', '', 19, 3, '', 0, 'img_exercise/WALLSIT', 17, 17);
INSERT INTO `tbl_lower_body_list` VALUES (327, 'LEFT QUAD STRETCH WITH WALL', 'https://www.youtube.com/watch?v=lZuwJrWnizI', 'Stand with your right hand on the wall. \r\n\r\nBend your left leg and grasp your ankle or toes to bring your left calf close yo your left thigh. \r\n\r\nHold this position.', 'time', 30, '', '', 19, 3, '', 0, 'img_exercise/LEFTQUADSTRETCHWITHWALL', 18, 18);
INSERT INTO `tbl_lower_body_list` VALUES (328, 'RIGHT QUAD STRETCH WITH WALL', 'https://www.youtube.com/watch?v=0d-3Qxd8OPg', 'Stand with your left hand on the wall. \r\n\r\nBend your left leg and grasp your ankle or toes to bring your left calf close yo your right thigh. \r\n\r\nHold this position.', 'time', 30, '', '', 19, 3, '', 0, 'img_exercise/RIGHTQUADSTRETCHWITHWALL', 19, 19);
INSERT INTO `tbl_lower_body_list` VALUES (329, 'LYING BUTTERFLY STRETCH', 'https://www.youtube.com/watch?v=TRNqVxDerPE', 'Lie on the floor with your feet together. \r\n\r\nOpen your knees to the sides. \r\n\r\nHold this position.', 'time', 30, '', '', 19, 3, '', 0, 'img_exercise/LYINGBUTTERFLYSTRETCH', 20, 20);
INSERT INTO `tbl_lower_body_list` VALUES (330, 'LUNGES', 'https://www.youtube.com/watch?v=QOVaHwm-Q6U', 'Stand with your feet shoulder width apart and your hands on your hips. \r\n\r\nTake a step foraward with your right leg and lower your body until your right thigh is parallel with the floor. \r\n\r\nThen return and switch to the other leg. \r\n\r\nThis exercise strengthens the quadriceps, gluteus maximus and hamstrings.', 'step', 18, '', '', 20, 3, '', 0, 'img_exercise/LUNGES', 1, 1);
INSERT INTO `tbl_lower_body_list` VALUES (331, 'BUTT BRIDGE', 'https://www.youtube.com/watch?v=rWzV67w5-vU', 'Lie on your back with knees bent and feet flat on the floor. \r\n\r\nPut your arms flat at your sides. \r\n\r\nThen lift your butt up and down.', 'step', 20, '', '', 20, 3, '', 0, 'img_exercise/BUTTBRIDGE', 2, 2);
INSERT INTO `tbl_lower_body_list` VALUES (332, 'PLIE SQUATS', 'https://www.youtube.com/watch?v=lxl533cq5mQ', 'Stand with your hands on your hips and feet a little wider than shoulder width apart. \r\n\r\nThen lower your body until your thighs are parallel to the floor. \r\n\r\nYour knees should be extended in the same direction as your tiptoes.', 'step', 18, '', '', 20, 3, '', 0, 'img_exercise/PLIESQUATS', 3, 3);
INSERT INTO `tbl_lower_body_list` VALUES (333, 'SIDE LYING LEG LIFT RIGHT', 'https://www.youtube.com/watch?v=fPUvZV1EE5U', 'Lie down on your side with your head rested on your left arm. \r\n\r\nList your upper leg up and return to the start position.\r\n\r\nMake sure your right leg goes straight up and down during the exercise.\r\n\r\nIt\'s a great exercise for the gluteus.', 'step', 14, '', '', 20, 3, '', 0, 'img_exercise/SIDELYINGLEGLIFTRIGHT', 4, 4);
