INSERT INTO `tbl_lower_body_list` VALUES (358, 'WALL RESISTING SINGLE LEG CALF RAISE LEFT', 'https://www.youtube.com/watch?v=TjdPy2V9v2A', 'Stand a big step away from the wall. \r\n\r\nPut your right foot on your left ankle.\r\n\r\nPut your hands on the wall and lean on it. \r\n\r\nLift your left heel as high as you can and then lower it. \r\n\r\nRepeat the exercise.', 'step', 16, '', '', 21, 3, '', 0, 'img_exercise/WALLRESISTINGSINGLELEGCALFRAISELEFT', 10, 10);
