INSERT INTO `tbl_lower_body_list` VALUES (384, 'WALL SIT', 'https://www.youtube.com/watch?v=-cdph8hv0O0', 'Start with your back against the wall, then slide down until your knees are at a 90 degree angle. \r\n\r\nKeep your back against the wall with your hands and arms away from your legs. \r\n\r\nHold the position. \r\n\r\nThe exercise is to strengthen the quadriceps muscles.', 'time', 30, '', '', 22, 4, '', 0, 'img_exercise/WALLSIT', 19, 19);
INSERT INTO `tbl_lower_body_list` VALUES (385, 'LEFT QUAD STRETCH WITH WALL', 'https://www.youtube.com/watch?v=lZuwJrWnizI', 'Stand with your right hand on the wall. \r\n\r\nBend your left leg and grasp your ankle or toes to bring your left calf close yo your left thigh. \r\n\r\nHold this position.', 'time', 30, '', '', 22, 4, '', 0, 'img_exercise/LEFTQUADSTRETCHWITHWALL', 20, 20);
INSERT INTO `tbl_lower_body_list` VALUES (386, 'RIGHT QUAD STRETCH WITH WALL', 'https://www.youtube.com/watch?v=0d-3Qxd8OPg', 'Stand with your left hand on the wall. \r\n\r\nBend your left leg and grasp your ankle or toes to bring your left calf close yo your right thigh. \r\n\r\nHold this position.', 'time', 30, '', '', 22, 4, '', 0, 'img_exercise/RIGHTQUADSTRETCHWITHWALL', 21, 21);
INSERT INTO `tbl_lower_body_list` VALUES (387, 'LYING BUTTERFLY STRETCH', 'https://www.youtube.com/watch?v=TRNqVxDerPE', 'Lie on the floor with your feet together. \r\n\r\nOpen your knees to the sides. \r\n\r\nHold this position.', 'time', 30, '', '', 22, 4, '', 0, 'img_exercise/LYINGBUTTERFLYSTRETCH', 22, 22);
INSERT INTO `tbl_lower_body_list` VALUES (388, 'BENCH GLUTE KICK BACK LEFT', 'https://www.youtube.com/watch?v=MI-jYzIv6JM', 'Start with your right knee and your hands on a bench, put your hands directly under your shoulders.\r\n\r\nThen kick your left leg back until it is parallel with the ground. Return to the starting position and repeat the exercise.', 'step', 16, '', '', 23, 4, '', 0, 'img_exercise/BENCHGLUTEKICKBACKLEFT', 1, 1);
INSERT INTO `tbl_lower_body_list` VALUES (389, 'BENCH GLUTE KICK BACK RIGHT', 'https://www.youtube.com/watch?v=MI-jYzIv6JM', 'Start with your left knee and your hands on a bench, put your hands directly under your shoulders.\r\n\r\nThen kick your right leg back until it is parallel with the ground. Return to the starting position and repeat the exercise.', 'step', 16, '', '', 23, 4, '', 0, 'img_exercise/BENCHGLUTEKICKBACKRIGHT', 2, 2);
INSERT INTO `tbl_lower_body_list` VALUES (390, 'SQUATS', 'https://www.youtube.com/watch?v=aclHkVaku9U', 'Stand with your feet shoulder width apart and your arms stretched forward, then lower your body until your thighs are parallel with the floor.\r\n\r\nYour knees should be extended in the same direction as your toes. \r\n\r\nReturn to the start position and do the next rep.\r\n\r\nThis works the thighs, hips buttocks, quads, hamstrings and lower body.', 'step', 16, '', '', 23, 4, '', 0, 'img_exercise/SQUATS', 3, 3);
INSERT INTO `tbl_lower_body_list` VALUES (391, 'BUTT BRIDGE', 'https://www.youtube.com/watch?v=rWzV67w5-vU', 'Lie on your back with knees bent and feet flat on the floor. \r\n\r\nPut your arms flat at your sides. \r\n\r\nThen lift your butt up and down.', 'step', 20, '', '', 23, 4, '', 0, 'img_exercise/BUTTBRIDGE', 4, 4);
INSERT INTO `tbl_lower_body_list` VALUES (392, 'SIDE LYING LEG LIFT RIGHT', 'https://www.youtube.com/watch?v=fPUvZV1EE5U', 'Lie down on your side with your head rested on your left arm. \r\n\r\nList your upper leg up and return to the start position.\r\n\r\nMake sure your right leg goes straight up and down during the exercise.\r\n\r\nIt\'s a great exercise for the gluteus.', 'step', 14, '', '', 23, 4, '', 0, 'img_exercise/SIDELYINGLEGLIFTRIGHT', 5, 5);
INSERT INTO `tbl_lower_body_list` VALUES (393, 'SIDE LYING LEG LIFT LEFT', 'https://www.youtube.com/watch?v=Dha6wZbFLbY', 'Lie down on your side with your head rested on your right arm. \r\n\r\nList your upper leg up and return to the start position.\r\n\r\nMake sure your left leg goes straight up and down during the exercise.\r\n\r\nIt\'s a great exercise for the gluteus.', 'step', 14, '', '', 23, 4, '', 0, 'img_exercise/SIDELYINGLEGLIFTLEFT', 6, 6);
INSERT INTO `tbl_lower_body_list` VALUES (394, 'FROGGY GLUTE LIFTS', 'https://www.youtube.com/watch?v=oEGFkjrJ7ag', 'Lie on your stomach with your knees bent and heels squeezed together.\r\n\r\nThen lift your feet up and down. \r\n\r\nThe exercise is very effective at squeezing your butt.', 'step', 16, '', '', 23, 4, '', 0, 'img_exercise/FROGGYGLUTELIFTS', 7, 7);
INSERT INTO `tbl_lower_body_list` VALUES (395, 'DUMBBELL BULGARIAN SPLIT SQUAT LEFT', 'https://www.youtube.com/watch?v=ICfjgXUWeDA', 'Hold a dumbbell in each hand at your sides. Stand several feet away from a bench. Rest your left foot on the bench behind you.\r\n \r\nLower your body until your back knee nearly touches the floor and your front thigh is parallel to the floor.\r\n \r\nThen go back to the start position and repeat the exercise.\r\n \r\nThere should be enough space between your front foot and the bench so that your front knee does not go over your toes.Keep Your upper body straight.\r\n \r\nIt\'s a great exercise for the glutes and hamstrings.', 'step', 16, '', '', 23, 4, '', 0, 'img_exercise/DUMBBELLBULGARIANSPLITSQUATLEFT', 8, 8);
INSERT INTO `tbl_lower_body_list` VALUES (396, 'DUMBBELL BULGARIAN SPLIT SQUAT RIGHT', 'https://www.youtube.com/watch?v=ICfjgXUWeDA', 'Hold a dumbbell in each hand at your sides. Stand several feet away from a bench. Rest your right foot on the bench behind you.\r\n \r\nLower your body until your back knee nearly touches the floor and your front thigh is parallel to the floor.\r\n \r\nThen go back to the start position and repeat the exercise.\r\n\r\nThere should be enough space between your front foot and the bench so that your front knee does not go over your toes.Keep Your upper body straight.\r\n \r\nIt\'s a great exercise for the glutes and hamstrings.', 'step', 16, '', '', 23, 4, '', 0, 'img_exercise/DUMBBELLBULGARIANSPLITSQUATRIGHT', 9, 9);
