INSERT INTO `tbl_lower_body_list` VALUES (401, 'SIDE LYING LEG LIFT RIGHT', 'https://www.youtube.com/watch?v=fPUvZV1EE5U', 'Lie down on your side with your head rested on your left arm. \r\n\r\nList your upper leg up and return to the start position.\r\n\r\nMake sure your right leg goes straight up and down during the exercise.\r\n\r\nIt\'s a great exercise for the gluteus.', 'step', 12, '', '', 23, 4, '', 0, 'img_exercise/SIDELYINGLEGLIFTRIGHT', 14, 14);
INSERT INTO `tbl_lower_body_list` VALUES (402, 'SIDE LYING LEG LIFT LEFT', 'https://www.youtube.com/watch?v=Dha6wZbFLbY', 'Lie down on your side with your head rested on your right arm. \r\n\r\nList your upper leg up and return to the start position.\r\n\r\nMake sure your left leg goes straight up and down during the exercise.\r\n\r\nIt\'s a great exercise for the gluteus.', 'step', 12, '', '', 23, 4, '', 0, 'img_exercise/SIDELYINGLEGLIFTLEFT', 15, 15);
INSERT INTO `tbl_lower_body_list` VALUES (403, 'FROGGY GLUTE LIFTS', 'https://www.youtube.com/watch?v=oEGFkjrJ7ag', 'Lie on your stomach with your knees bent and heels squeezed together.\r\n\r\nThen lift your feet up and down. \r\n\r\nThe exercise is very effective at squeezing your butt.', 'step', 14, '', '', 23, 4, '', 0, 'img_exercise/FROGGYGLUTELIFTS', 16, 16);
INSERT INTO `tbl_lower_body_list` VALUES (404, 'DUMBBELL BULGARIAN SPLIT SQUAT LEFT', 'https://www.youtube.com/watch?v=ICfjgXUWeDA', 'Hold a dumbbell in each hand at your sides. Stand several feet away from a bench. Rest your left foot on the bench behind you.\r\n \r\nLower your body until your back knee nearly touches the floor and your front thigh is parallel to the floor.\r\n \r\nThen go back to the start position and repeat the exercise.\r\n \r\nThere should be enough space between your front foot and the bench so that your front knee does not go over your toes.Keep Your upper body straight.\r\n \r\nIt\'s a great exercise for the glutes and hamstrings.', 'step', 14, '', '', 23, 4, '', 0, 'img_exercise/DUMBBELLBULGARIANSPLITSQUATLEFT', 17, 17);
INSERT INTO `tbl_lower_body_list` VALUES (405, 'DUMBBELL BULGARIAN SPLIT SQUAT RIGHT', 'https://www.youtube.com/watch?v=ICfjgXUWeDA', 'Hold a dumbbell in each hand at your sides. Stand several feet away from a bench. Rest your right foot on the bench behind you.\r\n \r\nLower your body until your back knee nearly touches the floor and your front thigh is parallel to the floor.\r\n \r\nThen go back to the start position and repeat the exercise.\r\n \r\nThere should be enough space between your front foot and the bench so that your front knee does not go over your toes.Keep Your upper body straight.\r\n \r\nIt\'s a great exercise for the glutes and hamstrings.', 'step', 14, '', '', 23, 4, '', 0, 'img_exercise/DUMBBELLBULGARIANSPLITSQUATRIGHT', 18, 18);
INSERT INTO `tbl_lower_body_list` VALUES (406, 'ADDUCTOR STRETCH IN STANDING', 'https://www.youtube.com/watch?v=56YqJqFU_qw', 'Stand with your feet wide distance apart and your hands rested on your hips. \r\n\r\nThen bend your left leg and lean your body to the left side. \r\n\r\nHold the position for a few seconds, then return and repeat with the other side.', 'step', 10, '', '', 23, 4, '', 0, 'img_exercise/ADDUCTORSTRETCHINSTANDING', 19, 19);
INSERT INTO `tbl_lower_body_list` VALUES (407, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=Im5nE3J558k', 'Lie on your back with your legs extended. \r\n\r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 'time', 30, '', '', 23, 4, '', 0, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 20, 20);
INSERT INTO `tbl_lower_body_list` VALUES (408, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 23, 4, '', 0, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 21, 21);
INSERT INTO `tbl_lower_body_list` VALUES (409, 'WALL CALF RAISES', 'https://www.youtube.com/watch?v=_h0v0Jt3ews', 'Stand straight with your hands on the wall and feet shoulder width apart.\r\n \r\nLift your heels and stand on your toes. \r\n\r\nThen drop your heels down. \r\n\r\nRepeat the exercise.', 'step', 16, '', '', 24, 4, '', 0, 'img_exercise/WALLCALFRAISES', 1, 1);
