INSERT INTO `tbl_lower_body_list` VALUES (412, 'SUMO SQUAT CALF RAISES WITH WALL', 'https://www.youtube.com/watch?v=1uVAOiZnWOk', 'Stand with your hands on the wall and your feet a little wider than shoulder width apart. \r\n\r\nLower your body until your thighs are parallel to the floor. \r\n\r\nLift your heels up and down.', 'step', 16, '', '', 24, 4, '', 0, 'img_exercise/SUMOSQUATCALFRAISESWITHWALL', 4, 4);
