INSERT INTO `tbl_lower_body_list` VALUES (426, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups.', 'time', 30, '', '', 25, 4, '', 0, 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_lower_body_list` VALUES (427, 'BACKWARD LUNGE', 'https://www.youtube.com/watch?v=6RVu-R9bS7w', 'Stand with your feet shoulder width apart and your hands on your hips.\r\n\r\nStep a big step backward with your right leg and lower your body until your left thigh is parallel to the floor. \r\n\r\nReturn and repeat with the other side.', 'step', 18, '', '', 25, 4, '', 0, 'img_exercise/BACKWARDLUNGE', 2, 2);
