INSERT INTO `tbl_lower_body_list` VALUES (436, 'PLIE SQUATS', 'https://www.youtube.com/watch?v=lxl533cq5mQ', 'Stand with your hands on your hips and feet a little wider than shoulder width apart. \r\n\r\nThen lower your body until your thighs are parallel to the floor. \r\n\r\nYour knees should be extended in the same direction as your tiptoes.', 'step', 14, '', '', 25, 4, '', 0, 'img_exercise/PLIESQUATS', 11, 11);
