INSERT INTO `tbl_lower_body_list` VALUES (443, 'WALL SIT', 'https://www.youtube.com/watch?v=-cdph8hv0O0', 'Start with your back against the wall, then slide down until your knees are at a 90 degree angle. \r\n\r\nKeep your back against the wall with your hands and arms away from your legs. \r\n\r\nHold the position. \r\n\r\nThe exercise is to strengthen the quadriceps muscles.', 'time', 30, '', '', 25, 4, '', 0, 'img_exercise/WALLSIT', 18, 18);
INSERT INTO `tbl_lower_body_list` VALUES (444, 'LEFT QUAD STRETCH WITH WALL', 'https://www.youtube.com/watch?v=lZuwJrWnizI', 'Stand with your right hand on the wall. \r\n\r\nBend your left leg and grasp your ankle or toes to bring your left calf close yo your left thigh. \r\n\r\nHold this position.', 'time', 30, '', '', 25, 4, '', 0, 'img_exercise/LEFTQUADSTRETCHWITHWALL', 19, 19);
