INSERT INTO `tbl_lower_body_list` VALUES (447, 'LUNGES', 'https://www.youtube.com/watch?v=QOVaHwm-Q6U', 'Stand with your feet shoulder width apart and your hands on your hips. \r\n\r\nTake a step foraward with your right leg and lower your body until your right thigh is parallel with the floor. \r\n\r\nThen return and switch to the other leg. \r\n\r\nThis exercise strengthens the quadriceps, gluteus maximus and hamstrings.', 'step', 20, '', '', 26, 4, '', 0, 'img_exercise/LUNGES', 1, 1);
