INSERT INTO `tbl_lower_body_list` VALUES (455, 'LUNGES', 'https://www.youtube.com/watch?v=QOVaHwm-Q6U', 'Stand with your feet shoulder width apart and your hands on your hips. \r\n\r\nTake a step foraward with your right leg and lower your body until your right thigh is parallel with the floor. \r\n\r\nThen return and switch to the other leg. \r\n\r\nThis exercise strengthens the quadriceps, gluteus maximus and hamstrings.', 'step', 18, '', '', 26, 4, '', 0, 'img_exercise/LUNGES', 9, 9);
INSERT INTO `tbl_lower_body_list` VALUES (456, 'BUTT BRIDGE', 'https://www.youtube.com/watch?v=rWzV67w5-vU', 'Lie on your back with knees bent and feet flat on the floor. \r\n\r\nPut your arms flat at your sides. \r\n\r\nThen lift your butt up and down.', 'step', 18, '', '', 26, 4, '', 0, 'img_exercise/BUTTBRIDGE', 10, 10);
INSERT INTO `tbl_lower_body_list` VALUES (457, 'PLIE SQUATS', 'https://www.youtube.com/watch?v=lxl533cq5mQ', 'Stand with your hands on your hips and feet a little wider than shoulder width apart. \r\n\r\nThen lower your body until your thighs are parallel to the floor. \r\n\r\nYour knees should be extended in the same direction as your tiptoes.', 'step', 16, '', '', 26, 4, '', 0, 'img_exercise/PLIESQUATS', 11, 11);
INSERT INTO `tbl_lower_body_list` VALUES (458, 'SIDE LYING LEG LIFT RIGHT', 'https://www.youtube.com/watch?v=fPUvZV1EE5U', 'Lie down on your side with your head rested on your left arm. \r\n\r\nList your upper leg up and return to the start position.\r\n\r\nMake sure your right leg goes straight up and down during the exercise.\r\n\r\nIt\'s a great exercise for the gluteus.', 'step', 14, '', '', 26, 4, '', 0, 'img_exercise/SIDELYINGLEGLIFTRIGHT', 12, 12);
INSERT INTO `tbl_lower_body_list` VALUES (459, 'SIDE LYING LEG LIFT LEFT', 'https://www.youtube.com/watch?v=Dha6wZbFLbY', 'Lie down on your side with your head rested on your right arm. \r\n\r\nList your upper leg up and return to the start position.\r\n\r\nMake sure your left leg goes straight up and down during the exercise.\r\n\r\nIt\'s a great exercise for the gluteus.', 'step', 14, '', '', 26, 4, '', 0, 'img_exercise/SIDELYINGLEGLIFTLEFT', 13, 13);
INSERT INTO `tbl_lower_body_list` VALUES (460, 'FIRE HYDRANT LEFT', 'https://www.youtube.com/watch?v=wrhrEkhEF_Y', 'Start on all fours with your knees under your butt and your hands your shoulders. \r\n\r\nThen lift your left leg to the side at a 90 degree angle.', 'step', 12, '', '', 26, 4, '', 0, 'img_exercise/FIREHYDRANTLEFT', 14, 14);
