INSERT INTO `tbl_lower_body_list` VALUES (463, 'ADDUCTOR STRETCH IN STANDING', 'https://www.youtube.com/watch?v=56YqJqFU_qw', 'Stand with your feet wide distance apart and your hands rested on your hips. \r\n\r\nThen bend your left leg and lean your body to the left side. \r\n\r\nHold the position for a few seconds, then return and repeat with the other side.', 'step', 10, '', '', 26, 4, '', 0, 'img_exercise/ADDUCTORSTRETCHINSTANDING', 17, 17);
INSERT INTO `tbl_lower_body_list` VALUES (464, 'SPINE LUMBAR TWIST STRETCH LEFT', 'https://www.youtube.com/watch?v=Im5nE3J558k', 'Lie on your back with your legs extended. \r\n\r\nLift your left leg up and use your right hand to pull your left knee to the right, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few second.', 'time', 30, '', '', 26, 4, '', 0, 'img_exercise/SPINELUMBARTWISTSTRETCHLEFT', 18, 18);
INSERT INTO `tbl_lower_body_list` VALUES (465, 'SPINE LUMBAR TWIST STRETCH RIGHT', 'https://www.youtube.com/watch?v=prnotYq5dhM', 'Lie on your back with your legs extended. \r\n\r\nLift your right leg up and use your left hand to pull your right knee to the left, but keep your other arm extended to the side on the floor.\r\n\r\nHold this position for a few seconds.', 'time', 30, '', '', 26, 4, '', 0, 'img_exercise/SPINELUMBARTWISTSTRETCHRIGHT', 19, 19);
INSERT INTO `tbl_lower_body_list` VALUES (466, 'WALL RESISTING SINGLE LEG CALF RAISE RIGHT', 'https://www.youtube.com/watch?v=ujxxw-rqYhc', 'Stand a big step away from the wall. \r\n\r\nPut your left foot on your right ankle. \r\n\r\nPut your hands on the wall and lean on it. \r\n\r\nLift your right heel as high as you can and then lower it. \r\n\r\nRepeat the exercise.', 'step', 16, '', '', 27, 4, '', 0, 'img_exercise/WALLRESISTINGSINGLELEGCALFRAISERIGHT', 1, 1);
