INSERT INTO `tbl_shoulder_back_advanced` VALUES (1, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups', 30, 'time', 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_shoulder_back_advanced` VALUES (2, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'lie down on your stomach with your toes touching the floor, and your chin on your hand.\r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the start position.\r\n\r\nRepeat this exercise.', 14, 'step', 'img_exercise/HYPEREXTENSION', 2, 2);
INSERT INTO `tbl_shoulder_back_advanced` VALUES (3, 'PIKE PUSHUPS', 'https://www.youtube.com/watch?v=x7_I5SUAd00', 'Start with your hands and feet on the floor. \r\n\r\nPut your hands shoulder with apart. \r\n\r\nBend your body, and lift your hips up in an upside down `V` shape.\r\n\r\nBend your elbows, and bring your head close to the floor. \r\n\r\nPush your body back, and repeat the exercise.', 14, 'step', 'img_exercise/PIKEPUSHUPS', 3, 3);
INSERT INTO `tbl_shoulder_back_advanced` VALUES (4, 'REVERSE PUSHUPS', 'https://www.youtube.com/watch?v=a00N2M7I1_o', 'Start in the regular push-up position.\r\n\r\nLower your body down, then bend your knees and move your hips backward with your arms straight.\r\n\r\nGo back to the push-up position and repeat.', 12, 'step', 'img_exercise/REVERSEPUSHUPS', 4, 4);
INSERT INTO `tbl_shoulder_back_advanced` VALUES (5, 'INCHWORMS', 'https://www.youtube.com/watch?v=VSp0z7Mp5IU', 'Start with your feet shoulder width apart.\r\n\r\nBend your body and walk your hands in front of you as far as you can, then walk your hands back. \r\n\r\nRepeat the exercise.', 16, 'step', 'img_exercise/INCHWORMS', 5, 5);
INSERT INTO `tbl_shoulder_back_advanced` VALUES (6, 'SIDE LYING FLOOR STRETCH LEFT', 'https://www.youtube.com/watch?v=pdgohzanlco', 'Lie on your right side with your right knee slightly bent in front of you and your left leg stretched behind the right leg.\r\n\r\nStraighten your left arm over your head and gently pull on your left wrist to stretch the left side of your body.\r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/SIDELYINGFLOORSTRETCHLEFT', 6, 6);
INSERT INTO `tbl_shoulder_back_advanced` VALUES (7, 'SIDE LYING FLOOR STRETCH RIGHT', 'https://www.youtube.com/watch?v=lBdM0Zurwyo', 'Lie on your left side with your left knee slightly bent in front of you and your right leg stretched behind the left leg.\r\n\r\nStraighten your right arm over your head and gently pull on your right wrist to stretch the right side of your body.\r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/SIDELYINGFLOORSTRETCHRIGHT', 7, 7);
INSERT INTO `tbl_shoulder_back_advanced` VALUES (8, 'HYPEREXTENSION', 'https://www.youtube.com/watch?v=X5WPkTCo3AM', 'lie down on your stomach with your toes touching the floor, and your chin on your hand.\r\n\r\nRaise your chest up as high as possible off the floor. \r\n\r\nHold this position for a few seconds and then go back to the start position.\r\n\r\nRepeat this exercise.', 12, 'step', 'img_exercise/HYPEREXTENSION', 8, 8);
INSERT INTO `tbl_shoulder_back_advanced` VALUES (9, 'PIKE PUSHUPS', 'https://www.youtube.com/watch?v=x7_I5SUAd00', 'Start with your hands and feet on the floor. \r\n\r\nPut your hands shoulder with apart. \r\n\r\nBend your body, and lift your hips up in an upside down `V` shape.\r\n\r\nBend your elbows, and bring your head close to the floor. \r\n\r\nPush your body back, and repeat the exercise.', 12, 'step', 'img_exercise/PIKEPUSHUPS', 9, 9);
INSERT INTO `tbl_shoulder_back_advanced` VALUES (10, 'REVERSE PUSHUPS', 'https://www.youtube.com/watch?v=a00N2M7I1_o', 'Start in the regular push-up position.\r\n\r\nLower your body down, then bend your knees and move your hips backward with your arms straight.\r\n\r\nGo back to the push-up position and repeat.', 10, 'step', 'img_exercise/REVERSEPUSHUPS', 10, 10);
INSERT INTO `tbl_shoulder_back_advanced` VALUES (11, 'INCHWORMS', 'https://www.youtube.com/watch?v=VSp0z7Mp5IU', 'Start with your feet shoulder width apart.\r\n\r\nBend your body and walk your hands in front of you as far as you can, then walk your hands back. \r\n\r\nRepeat the exercise.', 14, 'step', 'img_exercise/INCHWORMS', 11, 11);
INSERT INTO `tbl_shoulder_back_advanced` VALUES (12, 'CAT COW POSE', 'https://www.youtube.com/watch?v=y39PrKY_4JM&list=RDQMVCd2F3GXNEQ&start_radio=1', 'Start on all fours with your knees under your butt and your hands directly under your shoulders.\r\n\r\nThen take a breath and make your belly fall down, shoulders roll back and head come up towards the ceiling.\r\n\r\nAs you exhale, curve your back upward and let your head come down. \r\n\r\nRepeat the exercise.\r\n\r\nDo it slowly with each step of this exercise.', 30, 'time', 'img_exercise/CATCOWPOSE', 12, 12);
INSERT INTO `tbl_shoulder_back_advanced` VALUES (13, 'SUPINE PUSHUPS', 'https://www.youtube.com/watch?v=8H-TSjVRCUA', 'Lie on your back with your feet flat on the floor and your arms bent on two sides.\r\n\r\nPush your chest up as far as you can, and then slowly go back to the start position.\r\n\r\nRepeat the exercise.', 14, 'step', 'img_exercise/SUPINEPUSHUP', 13, 13);
INSERT INTO `tbl_shoulder_back_advanced` VALUES (14, 'FLOOR Y RAISES', 'https://www.youtube.com/watch?v=rSV-cyaqdFg', 'Lie face down on the floor with your arms fully extended and your thumbs pointing up, your body should be in the shape of  the letter \"Y\".\r\n\r\nRaise your arms off the ground as fas as you can and pause them at the top for 2 seconds. \r\n\r\nSlowly go back the the start position, and repeat the exercise.', 14, 'step', 'img_exercise/FLOORYRAISES', 14, 14);
INSERT INTO `tbl_shoulder_back_advanced` VALUES (15, 'SUPINE PUSHUPS', 'https://www.youtube.com/watch?v=8H-TSjVRCUA', 'Lie on your back with your feet flat on the floor and your arms bent on two sides.\r\n\r\nPush your chest up as far as you can, and then slowly go back to the start position.\r\n\r\nRepeat the exercise.', 12, 'step', 'img_exercise/SUPINEPUSHUP', 15, 15);
INSERT INTO `tbl_shoulder_back_advanced` VALUES (16, 'REVERSE SNOW ANGELS', 'https://www.youtube.com/watch?v=ijr9vR9QLIM', 'lie on tour stomach with your arms to your sides.\r\n\r\nLift your arms up and extend them over your head to touch your thumbs. \r\n\r\nThen slowly bring them back.\r\n\r\nRepeat the exercise.', 12, 'step', 'img_exercise/REVERSESNOWANGELS', 16, 16);
INSERT INTO `tbl_shoulder_back_advanced` VALUES (17, 'CHILD\'S POSE', 'https://www.youtube.com/watch?v=2MJGg-dUKh0', 'Start with your knees and hand on the floor. \r\n\r\nPut your hands a little forward, widen your knees and put your toes together.\r\n\r\nTake a breath, then exhale and sit back. \r\n\r\nTry to make your butt touch your heels. \r\n\r\nRelax your elbows, make tour forehead touch the floor and try to lower your chest close to the floor. \r\n\r\nHold this position.\r\n\r\nKeep your arms stretched forward as you sit back. \r\n\r\nMake sure there is enough space between your shoulders and ears during the exercise.', 30, 'time', 'img_exercise/CHILDSPOSE', 17, 17);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (1, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups', 30, 'time', 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (2, 'ARM RAISES', 'https://www.youtube.com/watch?v=D-3JnFrFUOw', 'Stand on the floor with your arms extended straight forward at shoulder height.\r\n\r\nRaise your arms above tour head. \r\n\r\nReturn to the start position and repeat.', 16, 'time', 'img_exercise/ARMRAISES', 2, 2);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (3, 'RHOMBOID PULLS', 'https://www.youtube.com/watch?v=XOs0waYd6hk', 'Stand with your feet shoulder width apart.\r\n\r\nRaise your arms parallel to the ground, and bend your elbows. \r\n\r\nPull your elbows back and squeeze your shoulder blades.\r\n\r\nRepeat this exercise.', 14, 'step', 'img_exercise/RHOMBOIDPULLS', 3, 3);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (4, 'SIDE ARM RAISE', 'https://www.youtube.com/watch?v=ww0r9xZunDM', 'Stand with your feet shoulder width apart.\r\n\r\nRaise your arms to the side at shoulder height, then put them down.\r\n\r\nRepeat the exercise. \r\n\r\nKeep your arms straight during the exercise.', 16, 'time', 'img_exercise/SIDEARMRAISE', 4, 4);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (5, 'KNEE PUSHUPS', 'https://www.youtube.com/watch?v=EgIMk-PZwo0', 'Start in the regular push-up position, then let your feet up off the floor.\r\n\r\nNext push your body up and down.', 14, 'step', 'img_exercise/KNEEPUSHUPS', 5, 5);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (6, 'SIDE LYING FLOOR STRETCH LEFT', 'https://www.youtube.com/watch?v=pdgohzanlco', 'Lie on your right side with your right knee slightly bent in front of you and your left leg stretched behind the right leg.\r\n\r\nStraighten your left arm over your head and gently pull on your left wrist to stretch the left side of your body.\r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/SIDELYINGFLOORSTRETCHLEFT', 6, 6);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (7, 'SIDE LYING FLOOR STRETCH RIGHT', 'https://www.youtube.com/watch?v=lBdM0Zurwyo', 'Lie on your left side with your left knee slightly bent in front of you and your right leg stretched behind the left leg.\r\n\r\nStraighten your right arm over your head and gently pull on your right wrist to stretch the right side of your body.\r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/SIDELYINGFLOORSTRETCHRIGHT', 7, 7);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (8, 'ARM SCISSORS', 'https://www.youtube.com/watch?v=Cilm0WNRdCo', 'Stand upright with your feet shoulder width apart.\r\n\r\nStretch your arms in front of your at shoulder height with one arm overlap the other in the shape of the letter `X`, and spread them apart.\r\n\r\nSwitch arms, and repeat the exercise.', 30, 'time', 'img_exercise/ARMSCISSORS', 8, 8);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (9, 'RHOMBOID PULLS', 'https://www.youtube.com/watch?v=XOs0waYd6hk', 'Stand with your feet shoulder width apart.\r\n\r\nRaise your arms parallel to the ground, and bend your elbows. \r\n\r\nPull your elbows back and squeeze your shoulder blades.\r\n\r\nRepeat this exercise.', 12, 'step', 'img_exercise/RHOMBOIDPULLS', 9, 9);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (10, 'SIDE ARM RAISE', 'https://www.youtube.com/watch?v=ww0r9xZunDM', 'Stand with your feet shoulder width apart.\r\n\r\nRaise your arms to the side at shoulder height, then put them down.\r\n\r\nRepeat the exercise. \r\n\r\nKeep your arms straight during the exercise.', 14, 'time', 'img_exercise/SIDEARMRAISE', 10, 10);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (11, 'KNEE PUSHUPS', 'https://www.youtube.com/watch?v=dmoHFWt-Mms', 'Start in the regular push-up position, then let your knees touch the floor and raise your feet up off the floor.\r\n\r\nNext push your body up and down.', 12, 'step', 'img_exercise/KNEEPUSHUPS', 11, 11);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (12, 'CAT COW POSE', 'https://www.youtube.com/watch?v=y39PrKY_4JM&list=RDQMVCd2F3GXNEQ&start_radio=1', 'Start on all fours with your knees under your butt and your hands directly under your shoulders.\r\n\r\nThen take a breath and make your belly fall down, shoulders roll back and head come up towards the ceiling.\r\n\r\nAs you exhale, curve your back upward and let your head come down. \r\n\r\nRepeat the exercise.\r\n\r\nDo it slowly with each step of this exercise.', 30, 'time', 'img_exercise/CATCOWPOSE', 12, 12);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (13, 'PRONE TRICEPS PUSHUPS', 'https://www.youtube.com/watch?v=JjUBO22JaMI', 'Lie on tour stomach with your hands underneath your shoulders and your elbows bent.\r\n\r\nSlightly raise your chest up, and then go back to the start position.\r\n\r\nRepeat this exercise.', 14, 'step', 'img_exercise/PRONETRICEPSPUSHUPS', 13, 13);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (14, 'RECLINED RHOMBOID SQUEEZES', 'https://www.youtube.com/watch?v=RqRwRE0CEoA', 'Sit with your knees bent. Slightly lean your upper body back.\r\n\r\nStretch your arms in front of you, then pull your elbows back to make then pull your elbows back to make your elbows at a 90 degree angle and squeeze our shoulder blades.\r\n\r\nRepeat this exercise.', 12, 'step', 'img_exercise/RECLINEDRHOMBOIDSQUEEZES', 14, 14);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (15, 'PRONE TRICEPS PUSHUPS', 'https://www.youtube.com/watch?v=JjUBO22JaMI', 'Lie on tour stomach with your hands underneath your shoulders and your elbows bent.\r\n\r\nSlightly raise your chest up, and then go back to the start position.\r\n\r\nRepeat this exercise.', 14, 'step', 'img_exercise/PRONETRICEPSPUSHUPS', 15, 15);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (16, 'RECLINED RHOMBOID SQUEEZES', 'https://www.youtube.com/watch?v=RqRwRE0CEoA', 'Sit with your knees bent. \r\n\r\nSlightly lean your upper body back.\r\n\r\nStretch your arms in front of you, then pull your elbows back to make then pull your elbows back to make your elbows at a 90 degree angle and squeeze our shoulder blades.\r\n\r\nRepeat this exercise.', 12, 'step', 'img_exercise/RECLINEDRHOMBOIDSQUEEZES', 16, 16);
INSERT INTO `tbl_shoulder_back_beginner` VALUES (17, 'CHILD\'S POSE', 'https://www.youtube.com/watch?v=2MJGg-dUKh0', 'Start with your knees and hand on the floor. \r\n\r\nPut your hands a little forward, widen your knees and put your toes together.\r\n\r\nTake a breath, then exhale and sit back. \r\n\r\nTry to make your butt touch your heels. \r\n\r\nRelax your elbows, make tour forehead touch the floor and try to lower your chest close to the floor. \r\n\r\nHold this position.\r\n\r\nKeep your arms stretched forward as you sit back. \r\n\r\nMake sure there is enough space between your shoulders and ears during the exercise.', 30, 'time', 'img_exercise/CHILDSPOSE', 17, 17);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (1, 'JUMPING JACKS', 'https://www.youtube.com/watch?v=UpH7rm0cYbM', 'Start with your feet together and your arms by your sides, then jump up with your feet apart and your hands overhead.\r\n\r\nReturn to the start position then do the next rep. \r\n\r\nThis exercise provides a full-body workout and works all your large muscle groups', 30, 'time', 'img_exercise/JUMPINGJACKS', 1, 1);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (2, 'TRICEPS KICKBACKS', 'https://www.youtube.com/watch?v=ZO81bExngMI', 'Learn forward bend your knees and your elbows.\r\n\r\nExtend your arms behind you and squeeze your triceps. \r\n\r\nPlease make your arms parallel to the ground when extending them.\r\n\r\nGo back to the start position, and repeat this exercise.', 14, 'step', 'img_exercise/TRICEPSKICKBACKS', 2, 2);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (3, 'INCLINE PUSHUPS', 'https://www.youtube.com/watch?v=3WGP7sn2_OI', 'Start in  the regular push-up position but with your hands elevated on a chair or bench.\r\n\r\nthen push your body up down using your arm strength. \r\n\r\nRemember to keep your body straight.', 14, 'step', 'img_exercise/INCLINEPUSHUPS', 3, 3);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (4, 'RHOMBOID PULLS', 'https://www.youtube.com/watch?v=XOs0waYd6hk', 'Stand with your feet shoulder width apart.\r\n\r\nRaise your arms parallel to the ground, and bend your elbows. \r\n\r\nPull your elbows back and squeeze your shoulder blades.\r\n\r\nRepeat this exercise.', 12, 'step', 'img_exercise/RHOMBOIDPULLS', 4, 4);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (5, 'FLOOR TRICEP DIPS', 'https://www.youtube.com/watch?v=Nl578wCij6E', 'Sit on the floor with your knees bent and feet flat on the floor. \r\n\r\nPut your hands beneath your shoulders with your finders pointing toward your hips.\r\n\r\nLift your hips off the floor. \r\n\r\nThen bend and extend your elbows to lower and lift your hips.\r\n\r\nRepeat the exercise to strengthen your upper arms.', 16, 'step', 'img_exercise/FLOORTRICEPDIPS', 5, 5);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (6, 'CAT COW POSE', 'https://www.youtube.com/watch?v=y39PrKY_4JM&list=RDQMVCd2F3GXNEQ&start_radio=1', 'Start on all fours with your knees under your butt and your hands directly under your shoulders.\r\n\r\nThen take a breath and make your belly fall down, shoulders roll back and head come up towards the ceiling.\r\n\r\nAs you exhale, curve your back upward and let your head come down. \r\n\r\nRepeat the exercise.\r\n\r\nDo it slowly with each step of this exercise.', 30, 'time', 'img_exercise/CATCOWPOSE', 6, 6);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (7, 'TRICEPS KICKBACKS', 'https://www.youtube.com/watch?v=ZO81bExngMI', 'Learn forward bend your knees and your elbows.\r\n\r\nExtend your arms behind you and squeeze your triceps. \r\n\r\nPlease make your arms parallel to the ground when extending them.\r\n\r\nGo back to the start position, and repeat this exercise.', 12, 'step', 'img_exercise/TRICEPSKICKBACKS', 7, 7);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (8, 'INCLINE PUSHUPS', 'https://www.youtube.com/watch?v=3WGP7sn2_OI', 'Start in  the regular push-up position but with your hands elevated on a chair or bench.\r\n\r\nthen push your body up down using your arm strength. \r\n\r\nRemember to keep your body straight.', 12, 'step', 'img_exercise/INCLINEPUSHUPS', 8, 8);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (9, 'HIP HINGE', 'https://www.youtube.com/watch?v=NLY_m5Jx_tE', 'Stand upright with your feet shoulder width apart.\r\n\r\nSit your hips back and bend your upper body while keeping your upper body straight, then slowly go back to the start position and repeat the exercise.', 10, 'step', 'img_exercise/HIPHINGE', 9, 9);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (10, 'FLOOR TRICEP DIPS', 'https://www.youtube.com/watch?v=Nl578wCij6E', 'Sit on the floor with your knees bent and feet flat on the floor. \r\n\r\nPut your hands beneath your shoulders with your finders pointing toward your hips.\r\n\r\nLift your hips off the floor. \r\n\r\nThen bend and extend your elbows to lower and lift your hips.\r\n\r\nRepeat the exercise to strengthen your upper arms.', 14, 'step', 'img_exercise/FLOORTRICEPDIPS', 10, 10);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (11, 'SIDE LYING FLOOR STRETCH LEFT', 'https://www.youtube.com/watch?v=pdgohzanlco', 'Lie on your right side with your right knee slightly bent in front of you and your left leg stretched behind the right leg.\r\n\r\nStraighten your left arm over your head and gently pull on your left wrist to stretch the left side of your body.\r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/SIDELYINGFLOORSTRETCHLEFT', 11, 11);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (12, 'SIDE LYING FLOOR STRETCH RIGHT', 'https://www.youtube.com/watch?v=lBdM0Zurwyo', 'Lie on your left side with your left knee slightly bent in front of you and your right leg stretched behind the left leg.\r\n\r\nStraighten your right arm over your head and gently pull on your right wrist to stretch the right side of your body.\r\n\r\nHold this position for a few seconds.', 30, 'time', 'img_exercise/SIDELYINGFLOORSTRETCHRIGHT', 12, 12);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (13, 'HOVER PUSHUPS', 'https://www.youtube.com/watch?v=9f6tdzkA7Tg', 'Start in push-up position. Lower yourself; shift your body to the left and then to the right.\r\n\r\nPush your body up and repeat the exercise.', 14, 'step', 'img_exercise/HOVERPUSHUP', 13, 13);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (14, 'SWIMMER AND SUPERMAN', 'https://www.youtube.com/watch?v=5soxSMFTyBw', 'Lie on your stomach with your arms extended straight overhead. \r\n\r\nAlternately lift your opposite arm and leg.', 14, 'step', 'img_exercise/SWIMMERANDSUPERMAN', 14, 14);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (15, 'HOVER PUSHUPS', 'https://www.youtube.com/watch?v=9f6tdzkA7Tg', 'Start in push-up position. Lower yourself; shift your body to the left and then to the right.\r\n\r\nPush your body up and repeat the exercise.', 12, 'step', 'img_exercise/HOVERPUSHUP', 15, 15);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (16, 'SWIMMER AND SUPERMAN', 'https://www.youtube.com/watch?v=5soxSMFTyBw', 'Lie on your stomach with your arms extended straight overhead. \r\n\r\nAlternately lift your opposite arm and leg.', 12, 'step', 'img_exercise/SWIMMERANDSUPERMAN', 16, 16);
INSERT INTO `tbl_shoulder_back_intermediate` VALUES (17, 'CHILD\'S POSE', 'https://www.youtube.com/watch?v=2MJGg-dUKh0', 'Start with your knees and hand on the floor. \r\n\r\nPut your hands a little forward, widen your knees and put your toes together.\r\n\r\nTake a breath, then exhale and sit back. \r\n\r\nTry to make your butt touch your heels. Relax your elbows, make tour forehead touch the floor and try to lower your chest close to the floor. \r\n\r\nHold this position.\r\n\r\nKeep your arms stretched forward as you sit back. \r\n\r\nMake sure there is enough space between your shoulders and ears during the exercise.', 30, 'time', 'img_exercise/CHILDSPOSE', 17, 17);
